INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ここに困ってる人は\nいないよね…？\nよかった♪", 1, 0, 1, 1, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "冒険の準備準備…\nうん、忘れ物はなし！\n…あっ！", 2, 0, 1, 1, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 3, 0, 1, 1, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ここで特訓していい？\n物は壊さないように\n気をつけるね！", 4, 0, 1, 1, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "なんか落ち着かないや\nもしかして、\n困ってる人が\n近くにいるのかな…？", 5, 0, 1, 1, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "えへへ…いつも\n一緒にいてくれて\nありがとねっ！", 6, 0, 4, 1, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 7, 0, 8, 1, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あははっ！\nやったなー！\nお返しだー！\nこちょこちょこちょ…", 8, 0, 1, 2, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どうしたの？\nもしかして困ってる？\nあたしにまかせて！", 9, 0, 1, 2, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "えっとね…しっぽは\n触っちゃダメだよ？", 10, 0, 1, 2, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 11, 0, 1, 2, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふぁふぃ？\nやられた～！　ほっぺ\nぷにぷにしないでぇ～", 12, 0, 4, 2, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 13, 0, 8, 2, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよー！\n今日も元気に\nいっちゃうよー！", 14, 1, 1, 2, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 15, 2, 1, 2, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 16, 3, 1, 2, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちゃんとケアして\n傷が残らないように\nしないと…", 17, 0, 1, 3, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一回休むと\nこのままずるずる\nいきそう…", 18, 0, 1, 3, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 19, 0, 1, 3, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "落ち着くなぁ～\n心だけじゃなくて\n体もほぐれそう♪", 20, 0, 1, 3, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかい所に\nいると体が丸く\nなっちゃう…", 21, 0, 1, 3, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "いつ何が起きるか\n分からないし、\nもっと力をつけないと", 22, 0, 1, 3, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "美味しいけど、\n食べ過ぎないように\nしないと…！！", 23, 0, 1, 3, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "文字が多いと\n眠くなっちゃう…\n危ない危ない！", 24, 0, 1, 3, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 26, 0, 1, 1, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "のんびりするのって\n退屈かも…\n何かして遊ばない？", 27, 0, 1, 1, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "留守番はちょっと\n苦手かも…\nなんか寂しいんだもん", 28, 0, 1, 1, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あたしのお友達も\n呼んできていい？\nきっと楽しいよ！", 29, 0, 1, 1, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "誰も困ってないよね？\n…何をすれば\nいいのか分かんないや", 30, 0, 1, 1, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 31, 0, 8, 1, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…なんであたし\n騎士くんばっかり\n見てるんだろ…", 32, 0, 8, 1, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 33, 0, 1, 2, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "触るのって楽しい？\n…そっか\n少しだけだよ…？", 34, 0, 1, 2, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あたしの元気を\nわけてあげるね！\nフレー！　フレー！", 35, 0, 1, 2, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "何かムズムズする！？\nって騎士くんかぁー\nどしたの？", 36, 0, 1, 2, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ひゃうっ！　もう…\nしっぽはだめだってば\n次やったらデコピン！", 37, 0, 8, 2, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 38, 0, 8, 2, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝ごはんと運動！\nこれがあたしの\n元気の素だよ！", 39, 1, 1, 2, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 40, 2, 1, 2, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 41, 3, 1, 2, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "これでよし♪\n騎士くん\n気づくかな…？", 42, 0, 1, 3, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一回休むと\nこのままずるずる\nいきそう…", 43, 0, 1, 3, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 44, 0, 1, 3, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こういうの\nなんか気になって\nじーって見ちゃうんだ", 45, 0, 1, 3, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかい所に\nいると体が丸く\nなっちゃう…", 46, 0, 1, 3, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "いつ何が起きるか\n分からないし\nもっと力をつけないと", 47, 0, 1, 3, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お腹が減ると\nなんか力が\n出ないんだよね…", 48, 0, 1, 3, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "色んなことを\n知っておくのは\n大事だよね！", 49, 0, 1, 3, 100102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お片付けも済んだし\n今度は洗濯ものを\nたたもうかな", 51, 0, 1, 1, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 52, 0, 1, 1, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 53, 0, 1, 1, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "戦いは\n得意じゃないけど\nお料理なら…！", 54, 0, 1, 1, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "こういう平和な\n時間が、もっと\n続くといいな", 55, 0, 1, 1, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "わたし…\nもうちょっとだけ勇気\n出してみようかな", 56, 0, 4, 1, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "みんなのことが大好き\nも、もちろん、\n騎士クンのことも…\nな、仲間として！", 57, 0, 8, 1, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ひゃうっ！\nな、なに？\nびっくりしたぁ…", 58, 0, 1, 2, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "男の子って、\nやっぱりおっきいね。\nその…手とか\n他にもいろいろ…", 59, 0, 1, 2, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "困ったことが\nあったら\nいつでも話してね", 60, 0, 1, 2, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "え！　む、虫っ！？\n取って取って！\nはやく～！", 61, 0, 1, 2, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あのね…\n一緒におでかけ\nしたいんだけど…\nダメかな？", 62, 0, 4, 2, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 63, 0, 8, 2, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お、おはよう！\nあの…朝ごはんは\nもう食べちゃった？", 64, 1, 1, 2, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼休みだね\nあの…良かったら\nお弁当…食べない？", 65, 2, 1, 2, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "遅くまでお疲れ様\n明日も頑張ろうね\nふわぁ…", 66, 3, 1, 2, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "よし…\nこれなら\n褒めてもらえるかな？", 67, 0, 1, 3, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "がんばることも\n必要だけど、\nお休みも大切だよね", 68, 0, 1, 3, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいなぁ…\nわたしも今度\n作ってみよう。\nえっと、材料は…", 69, 0, 1, 3, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "戦う前にもこうやって\n落ち着けたら\nいいのに", 70, 0, 1, 3, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "…はへっ？\nも、もしかして今\n寝ちゃってた…？", 71, 0, 1, 3, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 72, 0, 1, 3, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしいものって\n食べ過ぎちゃうけど…\nしょうがない…よね？", 73, 0, 1, 3, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "…そっか\nこうすれば魔法が\nもっと強くなるんだ", 74, 0, 1, 3, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "洗濯と掃除\nどっちから\nはじめよう？", 76, 0, 1, 1, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "新しい魔道書を\n買いに行かなくちゃ\nもっとたくさん\n魔法を覚えたいな", 77, 0, 1, 1, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 78, 0, 1, 1, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今日はどんな料理に\n挑戦しよう…♪", 79, 0, 1, 1, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 80, 0, 1, 1, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "みんなのことが大好き\nも、もちろん\n騎士クンのことも…\nな、仲間として！", 81, 0, 8, 1, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士クンのそばに\nいられるだけで\n幸せだよ", 82, 0, 8, 1, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "えっと、その…\nこんな所で\nこういうことされると\n恥ずかしいよ…", 83, 0, 1, 2, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "え！　む、虫っ！？\n取って取って！\nはやく～！", 84, 0, 1, 2, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ、あの…実は\n騎士クンのこと…\nううん、やっぱり\nなんでもない", 85, 0, 1, 2, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "男の子って\nやっぱりおっきいね\nその…手とか\n他にもいろいろ…", 86, 0, 1, 2, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 87, 0, 8, 2, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ふふふっ…そんなとこ\nツンツンしないで\nくすぐったいよ～", 88, 0, 8, 2, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう\nよく眠れた？　今日も\n一日、頑張ろうね♪", 89, 1, 1, 2, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹空いちゃった…\nそうだ。騎士クンも\n一緒にお昼食べない？", 90, 2, 1, 2, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間…\nそろそろ寝なくちゃ\nおやすみなさい", 91, 3, 1, 2, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "よし…\nこれなら\n褒めてもらえるかな？", 92, 0, 1, 3, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "がんばることも\n必要だけど\nお休みも大切だよね", 93, 0, 1, 3, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい～♪\n騎士クンは\nこういうのって好き？", 94, 0, 1, 3, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "戦う前にもこうやって\n落ち着けたら\nいいのに", 95, 0, 1, 3, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あの…！\nよ、良かったら\n一緒に…！", 96, 0, 1, 3, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 97, 0, 1, 3, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "最近服のサイズが\n合わないんだけど…\n食べ過ぎなのかな？", 98, 0, 1, 3, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "…やっぱり\n月刊恋愛指南は\nためになる…", 99, 0, 1, 3, 100202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "装備の手入れでも\nしようかな…", 101, 0, 1, 1, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "次に鍛えるべきは\n肉体面か精神面か\nどちらにしよう…？", 102, 0, 1, 1, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 103, 0, 1, 1, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "仲間なんていらない\nそう思ってた頃も\nあったな…", 104, 0, 1, 1, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "考えごとをしていると\nつい部屋中を\n歩いてしまうな", 105, 0, 1, 1, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "彼は\nどこまで強くなるのか\n私も負けられないな", 106, 0, 4, 1, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 107, 0, 8, 1, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ああ、キミだったのか\n人の気配がしたから\n誰かと思ったよ", 108, 0, 1, 2, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "斬りかかるつもりなら\nちゃんとかかってきて\n…呼んだだけ？", 109, 0, 1, 2, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なに？　私に相談？\n戦いについてなら\n喜んで", 110, 0, 1, 2, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今のが突き？\n軽い！　もっと鋭く！\nさあ、もう一回！", 111, 0, 1, 2, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ひゃっ！　ど、どこを\n触ってるの！？\n…油断した", 112, 0, 4, 2, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 113, 0, 8, 2, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう\n今日も充実した\n一日にしていこう", 114, 1, 1, 2, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろ\nお茶の時間か\nキミも一緒にどう？", 115, 2, 1, 2, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 116, 3, 1, 2, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "戦いを経てもなお\n美しくあるように…\nこれでよし♪", 117, 0, 1, 3, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "戦ってばかりで\n休まないと、また\nユイに怒られるな", 118, 0, 1, 3, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 119, 0, 1, 3, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これはいい…\n戦いの前の精神統一に\nもってこいじゃないか", 120, 0, 1, 3, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "時々は落ち着いた\n時間を過ごすのも\n悪くない…", 121, 0, 1, 3, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 122, 0, 1, 3, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食事は大切だけど\n食べ過ぎには\n注意しておこう…", 123, 0, 1, 3, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 124, 0, 1, 3, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "海だけじゃなくて\n川でも釣りがしたいな\n道具も新調しよう", 126, 0, 1, 1, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 127, 0, 1, 1, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "彼は\nどこまで強くなるのか\n私も負けられないな", 128, 0, 1, 1, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そろそろ修行の\n内容を新しくしよう\nより厳しいものにね", 129, 0, 1, 1, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "強くなって…誰にも\n妨げられない自由な\n生き方がしたい", 130, 0, 1, 1, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "まさか風邪を引くとは\n彼の看病のおかげで\nすっかり良く\nなったけど", 131, 0, 8, 1, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 132, 0, 8, 1, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうしたの？\nなんでもない？\nそれなら良かった", 133, 0, 1, 2, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あんまり突っつくと\nお返しするよ？\n覚悟は出来てる？", 134, 0, 1, 2, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ねぇ、今度また\n釣りに行かない？\n大きいのを狙おう", 135, 0, 1, 2, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "修行がしたいの？\nそれを早く言ってよ\nすぐに出発しよう！", 136, 0, 1, 2, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ひょっとして\n今のも一本だなんて\n言わないよね？", 137, 0, 8, 2, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 138, 0, 8, 2, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日は仕事？\nそれとも修行？\n良ければ付き合うよ", 139, 1, 1, 2, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休息も時には\n必要だと、仲間から\n教わったよ", 140, 2, 1, 2, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 141, 3, 1, 2, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "髪の長さを少し\n変えてみようかな…\nわ、私は何を…！", 142, 0, 1, 3, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休息があってこそ\n万全な状態で\n戦えるんだ", 143, 0, 1, 3, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 144, 0, 1, 3, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "体と同様に\n心もほぐれるね…\nはぁ…", 145, 0, 1, 3, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "休む時は休む\nヒヨリもそろそろ\n覚えて欲しいな…", 146, 0, 1, 3, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 147, 0, 1, 3, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "修行のせいか\n最近食べる量が\n増えてきたような…", 148, 0, 1, 3, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 149, 0, 1, 3, 100302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 151, 0, 1, 1, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "落とし穴…どこに\n作ったんだっけ？", 152, 0, 1, 1, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 153, 0, 1, 1, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 154, 0, 1, 1, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "かくれんぼする人\nこの指、と～まれ！", 155, 0, 1, 1, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ミソギ以外の人に\nイタズラされちゃ\nダメだよ！", 156, 0, 4, 1, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ミソギと遊ぶ？\nミソギに遊ばれる？", 157, 0, 8, 1, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いいこと思いついた！\nい、イタズラとかじゃ\nないよ～", 158, 0, 1, 2, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うわっ！？\n　にいちゃんが、\nミソギにイタズラ？", 159, 0, 1, 2, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "にいちゃんの\n通りそうなところに\nバナナの皮を…", 160, 0, 1, 2, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 161, 0, 1, 2, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ここ、ミソギ探検隊の\n基地にしようよ！", 162, 0, 4, 2, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 163, 0, 8, 2, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "にいちゃん、おはよ！\n目覚まし時計を\n止めておいたのに、\nよく起きられたね～♪", 164, 1, 1, 2, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "にいちゃんが\n昼寝したら、\nイタズラし放題♪", 165, 2, 1, 2, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 166, 3, 1, 2, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "イタズラには\nお色気も必要…\nうん、完璧！", 167, 0, 1, 3, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "座ったら、ブーッって\nいう音が出たら、\nおもしろいな～♪", 168, 0, 1, 3, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 169, 0, 1, 3, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 170, 0, 1, 3, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 171, 0, 1, 3, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "探検家は\n体力勝負だよー！", 172, 0, 1, 3, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "みんなに分けて\nあげようかな～\n激辛ソースも\n入れちゃうけどね！", 173, 0, 1, 3, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "こういう所に\n宝の地図が\n隠れてるんだよね～", 174, 0, 1, 3, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 176, 0, 1, 1, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うぅ、探検に出たい！\nじっとしてなんか\nいられないよ～！", 177, 0, 1, 1, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 178, 0, 1, 1, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 179, 0, 1, 1, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "かくれんぼする人\nこの指、と～まれ！", 180, 0, 1, 1, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 181, 0, 8, 1, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "にいちゃんが喜ぶ\nイタズラ、何かない\nかな～？", 182, 0, 8, 1, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ミソギがしかけた\nイタズラ\n見つけられるかな？", 183, 0, 1, 2, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "探検する？\n冒険する？\nそれとも…\nイタズラされる？", 184, 0, 1, 2, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "将来の夢は探検家！\n探したい物はないけど", 185, 0, 1, 2, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "にいちゃんに宿題！\n落とし穴を10個\n掘ること！", 186, 0, 1, 2, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 187, 0, 8, 2, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ここ、ミソギ探検隊の\n基地にしようよ！", 188, 0, 8, 2, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "にいちゃん\n探検に行こうよ！\n今からなら遭難しても\n夜には帰れるよ！", 189, 1, 1, 2, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "にいちゃんが昼寝したら\nイタズラし放題♪", 190, 2, 1, 2, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 191, 3, 1, 2, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "イタズラには\nお色気も必要…\nうん、完璧！", 192, 0, 1, 3, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ゆっくりまったりして\n次のイタズラを\n考えよ～！", 193, 0, 1, 3, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 194, 0, 1, 3, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 195, 0, 1, 3, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 196, 0, 1, 3, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "探検家は\n体力勝負だよー！", 197, 0, 1, 3, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "探検のおやつに\nぴったりかも～！", 198, 0, 1, 3, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "こういう所に\n宝の地図が\n隠れてるんだよね～", 199, 0, 1, 3, 100402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "音楽は全部好きだけど\n一番好きなのは\nやっぱりジャズかな", 201, 0, 1, 1, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ、はぁ…\n一人でもいっぱい\nしないと…\n特訓…", 202, 0, 1, 1, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お姉ちゃんには\nもっと自信を\n持ってほしいなぁ", 203, 0, 1, 1, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お姉ちゃんのマネ\nしちゃおうかな？", 204, 0, 1, 1, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "双子って、\n好みのタイプも\n似ちゃうのかな？", 205, 0, 1, 1, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんと私は\n相性抜群です♪", 206, 0, 4, 1, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 207, 0, 8, 1, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 208, 0, 1, 2, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うふふ、お兄ちゃん！\n今日は何を\nするんですか？", 209, 0, 1, 2, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そんなところ\n触っちゃダメ♪", 210, 0, 1, 2, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お兄ちゃん、イジワル\nしないでください…", 211, 0, 1, 2, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃん、もっと\n上級編のテクニック、\n教えてくださいね！", 212, 0, 4, 2, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "コーチ、\n今日も特訓\nお願いします！", 213, 0, 8, 2, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 214, 1, 1, 2, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こんな明るい時間から\nす、するんですか…\n二人っきりの特訓…", 215, 2, 1, 2, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜はこれからですよ\nお兄ちゃん♪", 216, 3, 1, 2, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "世界一、かわいく\nなるんだから♪", 217, 0, 1, 3, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "気持ちいい♪\nもう立てないよ～", 218, 0, 1, 3, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\nアカリのライバル\nだね", 219, 0, 1, 3, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 220, 0, 1, 3, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はぁ…アカリ、\nとろけちゃう…", 221, 0, 1, 3, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "はぁ…はぁはぁ、\n私…もう…ダメ\n限界です…！", 222, 0, 1, 3, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "わぁ、おいしい～\nけど食べ過ぎは美容に\nよくないですよね", 223, 0, 1, 3, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この楽譜、\nサックスで吹いて\nみたいなぁ♪", 224, 0, 1, 3, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "このごろ一人でいると\nお兄ちゃんのこと\nばかり考えちゃう…", 226, 0, 1, 1, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ、はぁ…もっと\nいっぱいしなくちゃ\n…練習", 227, 0, 1, 1, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "このお部屋、なんだか\n落ち着きます…\nお兄ちゃんが\nいるから？", 228, 0, 1, 1, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "みんなかわいいな～\n世界一かわいくなる\nのは、難しいな…", 229, 0, 1, 1, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "双子って、\n好みのタイプも\n似ちゃうのかな？", 230, 0, 1, 1, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "いつか世界でいちばん\nかわいくなって\nお兄ちゃんと…", 231, 0, 8, 1, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 232, 0, 8, 1, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 233, 0, 1, 2, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "二人きりの秘密の特訓\n今度はいつですか？\n待ち遠しいです…", 234, 0, 1, 2, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "え？　ここでするの？\nみんなの前で恥ずか\nしいな…筋トレ", 235, 0, 1, 2, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お兄ちゃん、イジワル\nしないでください…", 236, 0, 1, 2, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんといると\nわ、私…ドキドキ\nしてきちゃう…", 237, 0, 8, 2, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "コーチ、\n今日も特訓\nお願いします！", 238, 0, 8, 2, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 239, 1, 1, 2, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お兄ちゃんに\n食べてもらいたいなぁ\n手作りのお昼ごはん", 240, 2, 1, 2, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お風呂入ってきますね\nそのあとは…\n二人でい～っぱい\n遊びましょうね", 241, 3, 1, 2, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お姉ちゃんのマネ\nしちゃおうかな？", 242, 0, 1, 3, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "気持ちいい♪\nもう立てないよ～", 243, 0, 1, 3, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\nアカリのライバル\nだね", 244, 0, 1, 3, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 245, 0, 1, 3, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったか～い…\nまるでお兄ちゃんが\n隣にいる時みたい", 246, 0, 1, 3, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "汗をかくと\n気持ちいいですよね", 247, 0, 1, 3, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お兄ちゃんの特訓に\n付き合うために\nたっぷり\n食べておかないと♪", 248, 0, 1, 3, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この楽譜\nサックスで吹いて\nみたいなぁ♪", 249, 0, 1, 3, 100602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "プリン、プリン、\nプリン、プリン、\nプリン、プリン～♪", 251, 0, 1, 1, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "う～ら～め～し～や～\nなの～♪", 252, 0, 1, 1, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～", 253, 0, 1, 1, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "幽霊の正体見たり、\nミヤコなの～", 254, 0, 1, 1, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ミヤコがいきなり\n消えたら、みんな\n驚くかもなの～♪", 255, 0, 1, 1, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "アイツがいて、\nプリンもある。\nきっとここが天国なの", 256, 0, 4, 1, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 257, 0, 8, 1, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "姿を消して、オマエを\n見張ってやるの～\nむふふ～♪", 258, 0, 1, 2, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 259, 0, 1, 2, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 260, 0, 1, 2, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 261, 0, 1, 2, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "たくさんオマエと\n遊べて、\n成仏しそうなくらい\nうれしいの～！", 262, 0, 4, 2, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "オマエのこと\n気に入ったからずっと\nとり憑いてやるの～", 263, 0, 8, 2, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "う～　眠いの…\n二度目の二度寝を\nするの…", 264, 1, 1, 2, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯はプリンなの\n３時のおやつも、\nプリンなの～", 265, 2, 1, 2, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ディナーは豪華に、\nプリンのフルコース\nなの～♪", 266, 3, 1, 2, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "体が透けちゃうから\nうまく使えないの～", 267, 0, 1, 3, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "まったりなの～\nあとはプリンがあれば\n完璧なの～", 268, 0, 1, 3, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "む～…かわいいけど\nプリンは分けて\nあげないの～", 269, 0, 1, 3, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "は～　いい気分なの…\n成仏しそうなの…", 270, 0, 1, 3, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？", 271, 0, 1, 3, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "幽霊には、体力も\n筋力も関係ないの～！", 272, 0, 1, 3, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ぱくぱくモグモグ…\nミヤコ、幽霊だけど、\nお腹はすくの～", 273, 0, 1, 3, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "プリンの写真集が\nあればいいのに\nなの～", 274, 0, 1, 3, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うらめしや～…\n裏の飯より\nプリンがいいの～", 276, 0, 1, 1, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "プリン♪　プリン♪\nプリン♪　なの～♪　", 277, 0, 1, 1, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "世界中のケーキ屋が\nプリンのおいしさを\n競い合えばいいの～！\n審査員はミヤコなの～", 278, 0, 1, 1, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "買ってきたプリンには\n全部ミヤコの名前を\n書いておくの～", 279, 0, 1, 1, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～ ", 280, 0, 1, 1, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "アイツがいて\nプリンもある\nきっとここが天国なの", 281, 0, 8, 1, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 282, 0, 8, 1, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 283, 0, 1, 2, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 284, 0, 1, 2, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日はオマエと\nプリンを買いに行くの\n強制なの～　", 285, 0, 1, 2, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 286, 0, 1, 2, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "たくさんオマエと\n遊べて\n成仏しそうなくらい\nうれしいの～！ ", 287, 0, 8, 2, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ミヤコのプリン\nオマエにだったら\n分けてあげるの～ ", 288, 0, 8, 2, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "う～　眠いの…\n二度目の二度寝を\nするの… ", 289, 1, 1, 2, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "う～ら～め～し～や～\n…明るい時間だと\n驚かせないの～ ", 290, 2, 1, 2, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ひゅ～どろどろ～ん☆\n真っ暗なうちに\nいたずらしまくるの～♪", 291, 3, 1, 2, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "体が透けちゃうから\nうまく使えないの～ ", 292, 0, 1, 3, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "落ち着くの～\nいまプリン食べたら\nきっといつもより\nおいしいの～♪ ", 293, 0, 1, 3, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "む～…かわいいけど\nプリンは分けて\nあげないの～　", 294, 0, 1, 3, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "は～　いい気分なの…\n成仏しそうなの…", 295, 0, 1, 3, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？ ", 296, 0, 1, 3, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "幽霊には、体力も\n筋力も関係ないの～！　", 297, 0, 1, 3, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしいの～\nプリン味だったら\nもっとおいしいの～ ", 298, 0, 1, 3, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "プリンの写真集が\nあればいいのに\nなの～ ", 299, 0, 1, 3, 100702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もし太陽が滅んでも\nボクの美しさで大地を\n照らしてあげる！", 301, 0, 1, 1, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 302, 0, 1, 1, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 303, 0, 1, 1, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 304, 0, 1, 1, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うわっ昨日より可愛く\nなってる。明日は\nどうなっちゃう\nのかな？", 305, 0, 1, 1, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "このボクがいるだけで\nあの人への\nおもてなしだよね", 306, 0, 4, 1, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ボクの可愛さは、\nふふ…あの人の\nためのものさ", 307, 0, 8, 1, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ねぇ～、ボクって\n可愛い？\nふふ、知ってる☆", 308, 0, 1, 2, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 309, 0, 1, 2, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふ、ボクに触ると\nキミも美しく\nなっちゃうかもよ？", 310, 0, 1, 2, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "どうかな、\n今日のボク。\n美しい？　可愛い？\nねえ、どっち？", 311, 0, 1, 2, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人も今、\n可愛いボクのこと\n考えてるかな…", 312, 0, 4, 2, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "美しい…\nキミの瞳に写るボクは\nより一層きれいだ", 313, 0, 8, 2, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "美しいボクの\n美しい一日が\n始まるよ！", 314, 1, 1, 2, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さーて、午後からも\n可愛く美しく\n華麗に優雅に♪", 315, 2, 1, 2, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "バラの花びら\nいっぱい浮かべた\nお風呂に入ってから\n寝ようっと♪", 316, 3, 1, 2, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 317, 0, 1, 3, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 318, 0, 1, 3, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わあ、可愛い！\n…まあ、ボクほど\nじゃないけどさ！", 319, 0, 1, 3, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 320, 0, 1, 3, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "気安く触ったら\n火傷する…\n炎はボクに似ているね", 321, 0, 1, 3, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 322, 0, 1, 3, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ボクが食べると、\n食べ物まで\n可愛いなあ…", 323, 0, 1, 3, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ボクが触った瞬間に、\nこの本は美を\n携えてしまうんだ", 324, 0, 1, 3, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ボクの美しさは\nみんなのために\nあるんだよ！", 326, 0, 1, 1, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 327, 0, 1, 1, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これ以上美しくなると\nボクをめぐって\n大陸中で戦争が\n始まっちゃう！", 328, 0, 1, 1, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 329, 0, 1, 1, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ボクの可愛さについて\nみんな話し合わない\nのかな…？", 330, 0, 1, 1, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "このボクがいるだけで\nあの人への\nおもてなしだよね", 331, 0, 8, 1, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人も今\n可愛いボクのこと\n考えてるかな…", 332, 0, 8, 1, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 333, 0, 1, 2, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ボクの美しさに嫉妬\nしたって意味ないよね\n次元が違うんだから", 334, 0, 1, 2, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ボクの化粧品使う？\n一緒に可愛くなろうよ", 335, 0, 1, 2, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ボクがいるだけで\nこの部屋は美の神殿♪\nランドソルの新たな\n観光名所になるね！", 336, 0, 1, 2, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 337, 0, 8, 2, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "美しい…\nキミの瞳に写るボクは\nより一層綺麗だ", 338, 0, 8, 2, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝日と共に\nボクの美しさも\n周りを照らすよ", 339, 1, 1, 2, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ボクの美しさを\n維持するために\nお昼ご飯食べなくちゃ", 340, 2, 1, 2, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "バラの花びらいっぱい\n浮かべたお風呂に\n入ってから\n寝ようっと♪", 341, 3, 1, 2, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 342, 0, 1, 3, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 343, 0, 1, 3, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "可愛いものを\n可愛いって言える\nボクって可愛いよね！", 344, 0, 1, 3, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 345, 0, 1, 3, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "冷えは美容の大敵\nなんだから！\nここ、ボクの場所ね！", 346, 0, 1, 3, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 347, 0, 1, 3, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ボクが食べると\n食べ物まで\n可愛いなあ…", 348, 0, 1, 3, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ボクが触った瞬間に\nこの本は美を\n携えてしまうんだ", 349, 0, 1, 3, 100802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "「第１０部２０章\n終焉戦争、開幕」\n…これでよし！", 351, 0, 1, 1, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今度シグルドに\n私の魔法を一つ\n伝授してやるか", 352, 0, 1, 1, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ここでは風が\n吹いてこないな…\n換気したい！", 353, 0, 1, 1, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 354, 0, 1, 1, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "まずは包帯をとって\n手から龍の形の\n炎を出して…", 355, 0, 1, 1, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "シグルド…\n今頃何処で何を\nしているのだろう…", 356, 0, 4, 1, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "最近、彼の姿が\nまぶしく見える…\nどうして…？", 357, 0, 8, 1, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "辞書を知らないか？\n…探している\n理由は聞くな", 358, 0, 1, 2, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そうだ！\n貴様の技にも\n名前をつけてやろう！", 359, 0, 1, 2, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私に触れても力を\n奪われないのは\n貴様くらいだぞ？", 360, 0, 1, 2, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "何事だ？\nまさか我が瞳に\n魅入られたのか？", 361, 0, 1, 2, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 362, 0, 4, 2, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 363, 0, 8, 2, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "「覚醒」めたか…\n行くぞ、悪を討つ\n戦いに出発だ！", 364, 1, 1, 2, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼間は「ヤツら」も\n襲ってはこない…\n束の間の休息だ", 365, 2, 1, 2, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうした？　夜はまだ\nこれから…ふぁ…\nね、眠くなどないぞ！", 366, 3, 1, 2, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 367, 0, 1, 3, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "くっ…！\n私を眠りの国へ\n誘うつもりか！", 368, 0, 1, 3, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "このようなものに\n懐柔されるものか！\n…されるものか！", 369, 0, 1, 3, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 370, 0, 1, 3, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これが我らの求めた\n安寧か…\n悪くない…", 371, 0, 1, 3, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "この程度\n前世での激闘に\n比べれば…！", 372, 0, 1, 3, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "最近金欠でな…\nいやぁありがたい…", 373, 0, 1, 3, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ここにも\n前世の記憶が\n眠っていたとは…", 374, 0, 1, 3, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "「第１３部１章\n閃光のシグルド」\n…ついに登場だな", 376, 0, 1, 1, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "何故だ…何故\nこうもあっさり金欠に\n逆戻りするのだ！？", 377, 0, 1, 1, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "やはり転生者という\n設定はカッコイイ…\n天才だな、私！", 378, 0, 1, 1, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 379, 0, 1, 1, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "そろそろ今日の分の\n魔力を溜めないと\nまた魔力切れが…", 380, 0, 1, 1, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "最近奴がそばに\nいるだけで、鼓動が\n早くなるのは何故だ？", 381, 0, 1, 1, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "シ、シグルド…！\nだめだ…妄想でも\n上手く言えない…", 382, 0, 8, 1, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なんだ？　新たな\n賞金の情報を\n持ってきたのか？", 383, 0, 8, 2, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "名乗りやポーズは\nその強度で相手を\n圧倒する技術だ", 384, 0, 1, 2, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いいか、魔法の\n詠唱中は絶対に\n声をかけるなよ？", 385, 0, 1, 2, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おお、ちょうど今\n貴様専用の設定集を\n作成中だぞ！", 386, 0, 1, 2, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 387, 0, 1, 2, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 388, 0, 8, 2, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夜更かしのせいか\nまだ眠気が…いや！\nこれは組織の罠だ！", 389, 1, 8, 2, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "平穏な時に\n出来るだけ魔力を\n溜めておかねば…", 390, 2, 1, 2, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜になると、力が\n増した気分になるな\n…なりませんか？", 391, 3, 1, 2, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 392, 0, 1, 3, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お、おのれ\nヒュプノス…\n私は負けないぞ…", 393, 0, 1, 3, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "くっくっくっ…\n貴様は特別団員に\nしてやろう", 394, 0, 1, 3, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 395, 0, 1, 3, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これが我らの求めた\n安寧か…\n悪くない…", 396, 0, 1, 3, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "新たな戦いに備えて\n魔力だけでなく\n体力も鍛えねば！", 397, 0, 1, 3, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食事は魔力に\n変換する体力の\n元になるのだ！", 398, 0, 1, 3, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "フフフ…\nこれを覚えれば\nもっと強く…！", 399, 0, 1, 3, 100902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "王子はんほんまに\nはんなりしてて、\n王子はんって感じやわ", 401, 0, 1, 1, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この絵本の王子はん、\n王子はんみたいで\nええなぁ♪", 402, 0, 1, 1, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 403, 0, 1, 1, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 404, 0, 1, 1, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "王子はんのために\n糸を紡いで、\n編み物でもしまひょか", 405, 0, 1, 1, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "マホ姫と王子はん、\n絵本の世界より\nベストカップルや", 406, 0, 4, 1, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 407, 0, 8, 1, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 408, 0, 1, 2, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 409, 0, 1, 2, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "王子はんは、\n絵本から出てきた人\nみたいやね～", 410, 0, 1, 2, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うちの話し方\nのんびりしてます\nやろか？", 411, 0, 1, 2, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "マホ姫の手は\nつべたいから、\n王子はんが温めて？", 412, 0, 4, 2, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 413, 0, 8, 2, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 414, 1, 1, 2, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お茶請けはお大福が\nよろしおすけど\nクッキーもええなあ", 415, 2, 1, 2, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うち、普段から\n夢見がちやけど…\nほんに眠い時間やわぁ", 416, 3, 1, 2, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "王子はんに\n会いに行くなら、\nおめかしせな\nあかんなぁ", 417, 0, 1, 3, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はんなりした\nええお椅子やわぁ\nほっこりしますなあ", 418, 0, 1, 3, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かいらしもんが\nいっぱいで、\nマホマホ王国みたい\nやわぁ", 419, 0, 1, 3, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "心地ええどす。まるで\nお花畑にいるようやね", 420, 0, 1, 3, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽかぽかどす。\n心まであったかく\nなりますわぁ", 421, 0, 1, 3, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "はぁはぁ、お姫はんは\n激しい運動は\nしぃひんもんどす～", 422, 0, 1, 3, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…あんまり\n速う食べられへんけど\n美味しいわぁ", 423, 0, 1, 3, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "絵本、絵本～\n幸せやわぁ♪", 424, 0, 1, 3, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "王子はんにとって\n自慢の姫になるえ～", 426, 0, 1, 1, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "カボチャの馬車に\nガラスの靴…\n欲しいなぁ", 427, 0, 1, 1, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 428, 0, 1, 1, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 429, 0, 1, 1, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ほんまなぁ\nこの絵本が面白いんよ\n王子はんに\n読んであげよ", 430, 0, 1, 1, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "マホ姫と王子はん\n絵本の世界より\nベストカップルや", 431, 0, 8, 1, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 432, 0, 8, 1, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "たまには、王子はんの\n好きな絵本も\n知りたいな～", 433, 0, 1, 2, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 434, 0, 1, 2, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そのうち、王子はんの\nお国にも連れてって\nもらえますやろか？", 435, 0, 1, 2, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "絵本読むんも\nええなぁ…", 436, 0, 1, 2, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 437, 0, 8, 2, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 438, 0, 8, 2, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 439, 1, 1, 2, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "マホマホ王国では\nこの時分は\nみんなお昼寝\nしてたんよ", 440, 2, 1, 2, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜に飛んだり鳴いたり\nする鳥はんもおるんよ\n昼は寝てはるんかねぇ", 441, 3, 1, 2, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "王子はんに\n会いに行くなら\nおめかしせな\nあかんなぁ", 442, 0, 1, 3, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "王子はんも一緒に\nゆっくりしていっても\nええんよ？", 443, 0, 1, 3, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かいらしい子やねぇ\nうちとお友だちに\nなってくれるん？", 444, 0, 1, 3, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "癒しアイテムって\nほんま、好っきゃわぁ", 445, 0, 1, 3, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うちのお城にも\nほしいわぁ。帰ったら\nさっそく準備せな\nあかんなぁ", 446, 0, 1, 3, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "部屋の中で運動\nできるのも、なかなか\n面白いもんやわぁ", 447, 0, 1, 3, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいひいわ～\nマホマホ王国には\nない味やわぁ", 448, 0, 1, 3, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "しっかり知識を\n身につけんと\n魔法も使えへん\nからなぁ", 449, 0, 1, 3, 101002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 451, 0, 1, 1, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おやつのケーキは\n苺かチョコ…\nどっちも食べよう！", 452, 0, 1, 1, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "い、いけない！\n縫い針落としちゃった", 453, 0, 1, 1, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ケーキをクレープで\n巻いたら…\n大ヒット商品の予感！", 454, 0, 1, 1, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 455, 0, 1, 1, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 456, 0, 4, 1, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ここがお兄ちゃんの\n部屋…\nドキドキしちゃう～", 457, 0, 8, 1, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ねぇ、おにいちゃん\n一緒に、スイーツでも\n食べにいかない？", 458, 0, 1, 2, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 459, 0, 1, 2, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "勉強、見てくれるん\nですか？　やった～♪", 460, 0, 1, 2, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "服がほつれてますよ？\n直してあげます！", 461, 0, 1, 2, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私をお嫁さんに\nしたいなら、予約は\nお早目に、ですよ♪", 462, 0, 4, 2, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ねぇねぇお兄ちゃん！\n…えへへ、\n呼んでみただけ♪", 463, 0, 8, 2, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 464, 1, 1, 2, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼休憩に\n甘いものが\n食べたいです～", 465, 2, 1, 2, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ねむいです～\nでももうちょっと\n勉強しないと～…", 466, 3, 1, 2, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この服、かわいい♪\n今度作って\nみよっと～！", 467, 0, 1, 3, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "勉強で疲れたから\n休憩しよ～っと", 468, 0, 1, 3, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\n私が服を作って\nあげよっか？", 469, 0, 1, 3, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "リラックスできます～\nお兄ちゃんが隣に\nいるみたい！", 470, 0, 1, 3, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "のんびりしたら、\nまた勉強しよっと！", 471, 0, 1, 3, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "運動すると勉強も\nはかどるよね！", 472, 0, 1, 3, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 473, 0, 1, 3, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "お兄ちゃんの記憶を\n戻す方法、どこかに\n書いてないかな？", 474, 0, 1, 3, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ケーキの食べ過ぎで\nお腹が…うぅ、\n因果横暴だよー…", 476, 0, 1, 1, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 477, 0, 1, 1, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "い、いけない！\n縫い針落としちゃった", 478, 0, 1, 1, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "笑う時には服着ます！", 479, 0, 1, 1, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 480, 0, 1, 1, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 481, 0, 8, 1, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄ちゃんが帰って\nきたら、何して遊ぼう\nかな～？", 482, 0, 8, 1, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "勉強、見てくれるん\nですか？　やった～♪", 483, 0, 1, 2, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 484, 0, 1, 2, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おにいちゃん！\nそろそろ、おやつに\nしませんか？", 485, 0, 1, 2, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "勉強は…\n明日にしようっと", 486, 0, 1, 2, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "妹だけど、大人な\nレディですからね！", 487, 0, 8, 2, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "な、ナデナデとか\n恥ずかしいな～", 488, 0, 8, 2, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 489, 1, 1, 2, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼休憩に\n甘いものが\n食べたいです～", 490, 2, 1, 2, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お兄ちゃんは\n夜強いんですね\n私は眠くて…", 491, 3, 1, 2, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "服装や髪形が変わると\n気分も変わるよね", 492, 0, 1, 3, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここで寝ちゃったら\n受験勉強が～…\nぐーー", 493, 0, 1, 3, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\n私が服を作って\nあげよっか？", 494, 0, 1, 3, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いまならどんな試験も\n合格できそうです！", 495, 0, 1, 3, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "のんびりしたら\nまた勉強しよっと！", 496, 0, 1, 3, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "お兄ちゃんを\n守るためには\n毎日、鍛えなくちゃ！", 497, 0, 1, 3, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 498, 0, 1, 3, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本の服\nかわいいなぁ♪\n私に作れるかな？", 499, 0, 1, 3, 101102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 501, 0, 1, 1, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "たくさん寝すぎて、\n夢の中か現実か\nわかんなく\nなっちゃうんだよね～", 502, 0, 1, 1, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…はっ！？\nね、寝てないよ？\nホントだよっ", 503, 0, 1, 1, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 504, 0, 1, 1, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "もし、超能力のことが\nバレたら…ブルブル", 505, 0, 1, 1, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "テレパシーで\nキミの心を覗けたら\n…なんてね！", 506, 0, 4, 1, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミを抱き枕に…\nじょ、冗談冗談！", 507, 0, 8, 1, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ん～、なになに？\n一緒にお昼寝する？", 508, 0, 1, 2, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "忘れ物しちゃった。\nま、いっか！\nえ、ダメ？", 509, 0, 1, 2, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おおっ、相談ごと？\nなにかな\nなにかな～？", 510, 0, 1, 2, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "う～ん、もしかして\nキミにも仲良しになる\n超能力があるのかも！", 511, 0, 1, 2, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 512, 0, 4, 2, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "えっ？　私とキミとの\n相性？　むむ～…\nうん、バッチリだよ☆", 513, 0, 8, 2, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "まだこんな時間？\nベッドに行って、\n二度寝しなくちゃ～", 514, 1, 1, 2, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 515, 2, 1, 2, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どんなにお昼寝しても\n夜は眠いんだ～", 516, 3, 1, 2, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 517, 0, 1, 3, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 518, 0, 1, 3, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これ…可愛い！\nシオリンに\n届けてあげたい！", 519, 0, 1, 3, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 520, 0, 1, 3, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "気持ちいい…\nはっ！　ダメダメ！\nまた寝るとこだった！", 521, 0, 1, 3, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "眠くならないように、\n運動しよっと！", 522, 0, 1, 3, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お腹いっぱいになると\n眠くなるよね～", 523, 0, 1, 3, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 524, 0, 1, 3, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 526, 0, 1, 1, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もっといっぱい\n超能力使えたら\nいいのにな～", 527, 0, 1, 1, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ねえねえ、\n今から人助け、\n付き合ってほしいなー", 528, 0, 1, 1, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 529, 0, 1, 1, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "人助け、頑張ったら\nなんだか、眠く…\n…はっ、ダメダメ！", 530, 0, 1, 1, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミと一緒なら、\nなんだって出来る！\n間違いない！", 531, 0, 8, 1, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミを抱き枕に…\nじょ、冗談冗談！", 532, 0, 8, 1, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "忘れ物しちゃった\nま、いっか！\nえ、ダメ？", 533, 0, 1, 2, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "なに？　困ってる？\nちょうど良かった！\n今は体力満タンだよ☆", 534, 0, 1, 2, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "一緒に\nお出かけしたいなー\nデートしよっ！", 535, 0, 1, 2, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うんうん、そうだねっ\n困ってる人がいたら\n見過ごせないよねっ！", 536, 0, 1, 2, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 537, 0, 8, 2, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "う～だんだん眠く…\nねぇ一緒に寝よ？", 538, 0, 8, 2, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "キミって早起きだね！\n私は寝ようかな～", 539, 1, 1, 2, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 540, 2, 1, 2, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どんなにお昼寝しても\n夜は眠いんだ～", 541, 3, 1, 2, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 542, 0, 1, 3, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 543, 0, 1, 3, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これ…可愛い！\nシオリンに\n届けてあげたい！", 544, 0, 1, 3, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 545, 0, 1, 3, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うう～ん、なんだか\nいつもより眠ーく\nなってきたよ…", 546, 0, 1, 3, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "よーし\n困ってる人のために\nパワーアップ☆", 547, 0, 1, 3, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食べてすぐ寝ると\n牛になるんだっけ？\nまぁ、いいかぁ～", 548, 0, 1, 3, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 549, 0, 1, 3, 101202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "モデルは楽しいよ！\nファンの子みんな\n応援してくれるしー！", 551, 0, 1, 1, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 552, 0, 1, 1, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "んー、今日のおやつは\n何にしよう？\nやっぱアメ玉かな！", 553, 0, 1, 1, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ここで撮影会、\nしようかな～♪", 554, 0, 1, 1, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 555, 0, 1, 1, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "やば…\nこのままじゃ、うち\nキュン死にかも…", 556, 0, 4, 1, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 557, 0, 8, 1, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うちの写真撮るの？\nどんなポーズ？", 558, 0, 1, 2, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイにしてあげる", 559, 0, 1, 2, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "宿題見てくんない？\nひとりじゃムリ～", 560, 0, 1, 2, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "みてこのネイル♪\n超エモくな～い？\nヒデサイもする～？", 561, 0, 1, 2, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 562, 0, 4, 2, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 563, 0, 8, 2, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "早起きとか\nつらたんだよねー\n昼すぎまで寝てたい", 564, 1, 1, 2, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 565, 2, 1, 2, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 566, 3, 1, 2, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どんなシーンにも合う\nきれいめわがまま\nちゃんとコーデだよ♪", 567, 0, 1, 3, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 568, 0, 1, 3, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "きゃわたーん☆\n君もおしゃれしよっか", 569, 0, 1, 3, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いいにおいじゃん！\nこれと同じにおいの\n香水ないかな？", 570, 0, 1, 3, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 571, 0, 1, 3, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "あはは、なんか\nウォーキングの練習\nしてるみたーい！", 572, 0, 1, 3, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 573, 0, 1, 3, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 574, 0, 1, 3, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "そろそろ\n仕事の時間だ～\n出かける準備\nしよっと！", 576, 0, 1, 1, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 577, 0, 1, 1, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ヒデサイを見習って\nうちも少し勉強して\nみよっかな…　", 578, 0, 1, 1, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "体形維持とか\n気にしてるんだよ～", 579, 0, 1, 1, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 580, 0, 1, 1, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "やば…\nこのままじゃ、うち\nキュン死にかも…　", 581, 0, 8, 1, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 582, 0, 8, 1, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うちの写真撮るの？\nどんなポーズ？", 583, 0, 1, 2, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイに\nしてあげる♪", 584, 0, 1, 2, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この雑誌の服\nガチめにほしぃ～", 585, 0, 1, 2, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うちのコーデで\nヒデサイをオシャンに\nしてあげるね♪", 586, 0, 1, 2, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 587, 0, 8, 2, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 588, 0, 8, 2, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日は早起き\nできたんだー\nメイクもばっち\nきまってるっしょ？", 589, 1, 1, 2, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 590, 2, 1, 2, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 591, 3, 1, 2, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この服ね～\n今年のトレンドなんだ♪\nかわたんでしょ！", 592, 0, 1, 3, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 593, 0, 1, 3, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うわー\nこのぬいぐるみ\nもきゅすぎでしょ～！", 594, 0, 1, 3, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いいにおーい♪\nファンのみんなにも\n教えてあげよー♪", 595, 0, 1, 3, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 596, 0, 1, 3, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "食べた分は\n消費しないとね～", 597, 0, 1, 3, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 598, 0, 1, 3, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 599, 0, 1, 3, 101602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "やっさー\n踊ってると、どんどん\n楽しくなるさー！", 601, 0, 1, 1, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このお菓子、でーじ\nおいしいねー！\nキミも食べる？", 602, 0, 1, 1, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ハイターイ！　元気な\nあいさつが一番さ～！", 603, 0, 1, 1, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 604, 0, 1, 1, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "さぁ、みんなで歌って\n踊るさ～♪", 605, 0, 1, 1, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "毎日、最高に幸せさ～\nキミのおかげだねー", 606, 0, 4, 1, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミへの気持ちを\n踊りで表現\nしてみるさ～", 607, 0, 8, 1, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 608, 0, 1, 2, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あぎひゃっ！\n急に声かけたら、\nビックリするさ～", 609, 0, 1, 2, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "踊りなら、\n私が手とり足とり\n教えてあげるさ～！", 610, 0, 1, 2, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "空手の型の\n練習するさー\nキミもどう？", 611, 0, 1, 2, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "よ～し、手をつないで\n踊るさ～！\n恥ずかしがること\nないさ～", 612, 0, 4, 2, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミと一緒だから、\n毎日楽しいこと\nばっかりさー", 613, 0, 8, 2, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ハイターイ！\n今日も一日、\nがんばるさー！", 614, 1, 1, 2, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！", 615, 2, 1, 2, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "故郷では見えない星が\n見られるんだねえ。\nなんか不思議さぁ", 616, 3, 1, 2, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夢中で踊ってたら、\n髪の毛ぼさぼさに\nなってるさ～！？", 617, 0, 1, 3, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "よく食べてよく踊って\nよく休む。\nそれが元気の秘訣さ～", 618, 0, 1, 3, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？", 619, 0, 1, 3, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆", 620, 0, 1, 3, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "故郷はあんまり暖房を\n使わなかったから、\n新鮮さー！", 621, 0, 1, 3, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "汗をかくのは\n気持ちいいさー！\nどんどん行くよー！", 622, 0, 1, 3, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "うーん、おいしいさ～\nゴーヤっぽいものを\n混ぜたいさ～", 623, 0, 1, 3, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！", 624, 0, 1, 3, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "焦らなくても\nなんくるないさ～\nなるようになるさ～", 626, 0, 1, 1, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さぁ、みんなで歌って\n踊るさ～♪", 627, 0, 1, 1, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "元気がないときは\n私のところに来るさー", 628, 0, 1, 1, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 629, 0, 1, 1, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ノリノリな音楽と\n踊りで、疲れを\n吹き飛ばすさ～！", 630, 0, 1, 1, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "毎日、最高に幸せさ～\nキミのおかげだねー", 631, 0, 8, 1, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "幸せすぎて踊らずには\nいられないさ～", 632, 0, 8, 1, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 633, 0, 1, 2, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ん？　どうしたの～？\nヒマなら一緒に\n踊ろうさ～", 634, 0, 1, 2, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "キミと一緒だから\n毎日楽しいこと\nばっかりさー", 635, 0, 1, 2, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ハイターイ！　元気な\nあいさつが一番さ～！", 636, 0, 1, 2, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミと踊ってる時が\n一番幸せさ～\nキミもそう思ってたら\nうれしいさ～", 637, 0, 8, 2, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "海に沈む夕日は\nとっても綺麗さ～！\n今度一緒に見ようね～ ", 638, 0, 8, 2, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "気持ちのいい朝さー！\nひとっ走り\nしてくるさー！", 639, 1, 1, 2, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！ ", 640, 2, 1, 2, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "故郷では見えない星が\n見られるんだねえ\nなんか不思議さぁ ", 641, 3, 1, 2, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夢中で踊ってたら\n髪の毛ぼさぼさに\nなってるさ～！？", 642, 0, 1, 3, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "よく食べてよく踊って\nよく休む\nそれが元気の秘訣さ～", 643, 0, 1, 3, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？ ", 644, 0, 1, 3, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆ ", 645, 0, 1, 3, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "故郷はあんまり暖房を\n使わなかったから\n新鮮さー！", 646, 0, 1, 3, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "徹夜で踊り続ける\nためにも、まずは\n体を鍛えるさ～", 647, 0, 1, 3, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…もっと\nおかわりがほしいさー", 648, 0, 1, 3, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！ ", 649, 0, 1, 3, 101702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 651, 0, 1, 1, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このお部屋\n女の子ばかりね。\n魔族の女子校を\n思い出しちゃう♪", 652, 0, 1, 1, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "次のテスト\n恋愛小説から\n出題したら\nダメかしら…？", 653, 0, 1, 1, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "キンコンカンコ～ン♪\n授業をはじめま～す", 654, 0, 1, 1, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はー…\nちょっと肩が\nこっちゃった…", 655, 0, 1, 1, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 656, 0, 4, 1, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…", 657, 0, 8, 1, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 658, 0, 1, 2, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 659, 0, 1, 2, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 660, 0, 1, 2, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "学院の外でも\n私は君の先生よ\nなんでも聞いてね♪", 661, 0, 1, 2, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "今読んでるのは\nヒロインが年下の子と\n恋に落ちる話…あ、\n深い意味はないのよ～", 662, 0, 4, 2, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "生徒は全員可愛いけど\n君は少し特別…\nみんなには内緒よ？", 663, 0, 8, 2, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "学校に\n遅刻しないように\n早く準備しないとね", 664, 1, 1, 2, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "男の子といっしょに\nお弁当を食べるの、\n夢なんだ～", 665, 2, 1, 2, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 666, 3, 1, 2, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もしかして…\n少し露出多いかしら？", 667, 0, 1, 3, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "リラックスすると\nα波が出て、勉強が\nはかどるんですって", 668, 0, 1, 3, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪　あなたも\n私の生徒になる？", 669, 0, 1, 3, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "学院にもこういう\n安らぐ設備が\n必要かしらね？", 670, 0, 1, 3, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "まだ寒いわぁ\n誰か隣に\n来てくれたら…", 671, 0, 1, 3, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "運動部の顧問も\nできるかしら？", 672, 0, 1, 3, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "学校の給食でも\n食べたいわぁ～", 673, 0, 1, 3, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "いい参考書を\n見つけちゃった♪", 674, 0, 1, 3, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私の生徒に\n不良なんていないわ\nみーんないい子♪", 676, 0, 1, 1, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このお部屋\n女の子ばかりね\n魔族の女子校を\n思い出しちゃう♪", 677, 0, 1, 1, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あの子、まだかな…\n宿題も見てあげたいし\n早く来ないかしら？", 678, 0, 1, 1, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 679, 0, 1, 1, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "学校の図書室に\n恋愛小説を\n置いて欲しいなあ", 680, 0, 1, 1, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 681, 0, 8, 1, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…　", 682, 0, 8, 1, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 683, 0, 1, 2, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 684, 0, 1, 2, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "宿題はもうやった？\n苦手なところは\n先生が見てあげる♪", 685, 0, 1, 2, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "んん？　なんだか\n元気がないみたい\n先生がぎゅぅ～って\nしてあげる…　", 686, 0, 1, 2, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "君のお勉強も\nだいぶ進んできたね～\n補習卒業も近いかな？\n少し寂しいけど…", 687, 0, 8, 2, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 688, 0, 8, 2, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝の特別授業\nしてあげましょうか？", 689, 1, 1, 2, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "午後の授業って\n眠いでしょう？\n気持ちは分かるけど\nがんばってね♪", 690, 2, 1, 2, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 691, 3, 1, 2, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もしかして…\n少し露出多いかしら？", 692, 0, 1, 3, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私の膝枕と、どっちが\nフカフカかしら？", 693, 0, 1, 3, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "可愛いわね～\n教室に置いたら\n生徒が喜ぶかしら？　", 694, 0, 1, 3, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "は～落ち着くなぁ～\n教師には\nこういうゆとりも\n必要よね♪　", 695, 0, 1, 3, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "まだ寒いわぁ\n誰か隣に\n来てくれたら…　", 696, 0, 1, 3, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "運動部の顧問も\nできるかしら？　", 697, 0, 1, 3, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あん！\nお胸にこぼしちゃった", 698, 0, 1, 3, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "あぁーん♪\nこういう物語みたいな\n恋愛あこがれる～　", 699, 0, 1, 3, 101802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おにいちゃんは、\nにんじん食べられる？", 701, 0, 1, 1, 102001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "えへへ、\nお絵かきしよ～♪", 702, 0, 1, 1, 102001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あのね、ミミと\nあそんでほしいな～", 703, 0, 1, 1, 102001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "さっきね、きれいな\nお花見つけたよ。\nおにいちゃんにも\n見せてあげたいな～", 704, 0, 1, 1, 102001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うさぎさん、\nぴょんぴょん\nぴょーん♪", 705, 0, 1, 1, 102001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おにいちゃんの絵、\nかいてあげるね♪", 706, 0, 4, 1, 102001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おっきくなったら\nおにいちゃんの\nお嫁さんになるんだ♪", 707, 0, 8, 1, 102001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふわぁ！\nおにいちゃんの手、\nおっきいね～", 708, 0, 1, 2, 102001);
