INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "リボンや服に\n染み込ませておこう\nいつでもいい匂い♪", 795, 0, 1, 3, 102102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "えへへ\nぽっかぽかです…", 796, 0, 1, 3, 102102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "え、演劇には\nた、体力も重要\nだから～", 797, 0, 1, 3, 102102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "残さず\n食べますね…！", 798, 0, 1, 3, 102102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "戯曲を読んで\n自分が演じるところを\n想像するの…", 799, 0, 1, 3, 102102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 801, 0, 1, 1, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "アカリみたいに\nかわいくなるには、\nどうすればいいのかな", 802, 0, 1, 1, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "レアカードをゲット！\nねえねえ、\nすごいでしょ！？", 803, 0, 1, 1, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ア、アイツと同じ\n部屋にいるのよね…\nって、だから何よ！？", 804, 0, 1, 1, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "楽しいゲームって\nやめどきが\n見つからないわ", 805, 0, 1, 1, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 806, 0, 4, 1, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "うぅ…最近、\nアイツを見るとなんか\nドキドキするのよね", 807, 0, 8, 1, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ゲームに負けた罰\nだからって、\nくすぐるのは…\nあはは…ダメだって！", 808, 0, 1, 2, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "アンタと話すのは割と\n緊張しないのよね\n…なんでかな", 809, 0, 1, 2, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "待ちきれない…\n新作ゲームの発売日が\n待ちきれない…", 810, 0, 1, 2, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アンタは人見知り\nしないタチよね？\nいいなあ～…", 811, 0, 1, 2, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 812, 0, 4, 2, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アンタと…そ、その\nこうして話してるのも\nわわ、悪くないわね！", 813, 0, 8, 2, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 814, 1, 1, 2, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 815, 2, 1, 2, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜はこれからよ！\n朝まで\nゲームするからね！", 816, 3, 1, 2, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "アカリみたいに\n可愛くなるのは\n難しいかな", 817, 0, 1, 3, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "寝っ転がりながら\nゲームができれば\n気分が良さそう", 818, 0, 1, 3, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "可愛い…けど、\n私には似合わないかな", 819, 0, 1, 3, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はあ、リラックスして\nゲームができるわ", 820, 0, 1, 3, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ん…暖かくて、\n寝落ちしちゃいそう", 821, 0, 1, 3, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "ゲーム感覚でやると、\n体動かすのも\n楽しいわね", 822, 0, 1, 3, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 823, 0, 1, 3, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 824, 0, 1, 3, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さあ、今日は\n何のゲームで\n遊ぼうかな？", 826, 0, 1, 1, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一緒にゲームができる\n人がいるっていうのも\n新鮮だな…", 827, 0, 1, 1, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "レアカードをゲット！\nすごいでしょ！？", 828, 0, 1, 1, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アカリってどうやって\n友達作ってるんだろ？\nコツがあるのかな…", 829, 0, 1, 1, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "楽しいゲームって\nやめどきが\n見つからないわ", 830, 0, 1, 1, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "うぅ…最近\nアイツを見るとなんか\nドキドキするのよね", 831, 0, 8, 1, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ね、ねえ\nもう少しその…\n一緒にゲームしない？", 832, 0, 8, 1, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 833, 0, 1, 2, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "欲しいゲームが\n見つからなくて…\n探すの手伝って！", 834, 0, 1, 2, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ねえ、見て！\n新しいゲームを\n買って来たの！", 835, 0, 1, 2, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ゲームに負けた罰\nだからって、くすぐる\nのは…あ、あはは！\nだ、ダメだって！", 836, 0, 1, 2, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 837, 0, 8, 2, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あ、あのさ…\nもう少し、そこに\nいてくれてもいいわよ", 838, 0, 8, 2, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 839, 1, 1, 2, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 840, 2, 1, 2, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜はこれからよ！\n朝まで\nゲームするからね！", 841, 3, 1, 2, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 842, 0, 1, 3, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふああ…\n徹夜明けには\n辛い誘惑だな…", 843, 0, 1, 3, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "可愛い…けど、\n私には似合わないかな", 844, 0, 1, 3, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こういうのに詳しいと\n女の子っぽく\n見えたりするのかな", 845, 0, 1, 3, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "寒い日は\nここでゲームするのが\n最高のぜいたくよね", 846, 0, 1, 3, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "最近ゲームばかりだし\nたまにはいいかな？", 847, 0, 1, 3, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 848, 0, 1, 3, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 849, 0, 1, 3, 102202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "じゃんけんぽん！\nあっち向いてほい！\nあ～ん、負けたぁ\n　『勝ったぜ！』", 851, 0, 1, 1, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぷうきちがいれば、\nなんでも出来ちゃうよ", 852, 0, 1, 1, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "発声練習しよっと\nぷうきち\nフルスイ～ング！", 853, 0, 1, 1, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ここで、ぷうきち\nフルスイングは、\nまずいかな～？", 854, 0, 1, 1, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この部屋、ぷうきちを\n置く場所はないのかな", 855, 0, 1, 1, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんって…\nちょっとぷうきちに\n似てるかも♪", 856, 0, 4, 1, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄ちゃんにも、\nぷうきちのこと\n好きになって\nもらいたいな～", 857, 0, 8, 1, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おやつは、\n私とぷうきちの\n二人分用意してね♪", 858, 0, 1, 2, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぷうきちが、お腹\nペコペコだって～\n何かちょうだい！", 859, 0, 1, 2, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "『アヤネに手出したら\n…坊ちゃんでも、\n分かってんな？』", 860, 0, 1, 2, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ぷうきちとの\n連携を磨いてるの！\nもっと仲良くなるよ！", 861, 0, 1, 2, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "特別だからね？\nもっと触っていいよ\n…ぷうきちのこと", 862, 0, 4, 2, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄ちゃんのこと、\n「ぷう兄」って\n呼ぼうかな？", 863, 0, 8, 2, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お兄ちゃんって\n朝早いんだね～\n私はまだ眠いよ～", 864, 1, 1, 2, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぁ～…ぷうきちと\nお昼寝してくるね…", 865, 2, 1, 2, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぷうきちと\nおしゃべりしてたら\nもうこんな時間…", 866, 3, 1, 2, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "『座り心地がいいな』\nぷうきちは座れない\nでしょ？", 868, 0, 1, 3, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい～！\nぷうきちのお友達に\nしちゃおうかな？", 869, 0, 1, 3, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いいニオイ～♪\nぷうきちも\n気に入ったみたい！", 870, 0, 1, 3, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽわぽわする～\nぷうきちも\n気持ちいい？", 871, 0, 1, 3, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしい～\nぷうきちも\n食べてみる？", 873, 0, 1, 3, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ぷうきち！\nこの本、読んで～！", 874, 0, 1, 3, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 901, 0, 1, 1, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 902, 0, 1, 1, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうしたら転ばなく\nなるんでしょうか？", 903, 0, 1, 1, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "わわわわ～～っ\nふう…\nきゃ、きゃあっ！", 904, 0, 1, 1, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "私のドジで、\nこのお部屋を\n壊しちゃったら\nどうしましょう～～", 905, 0, 1, 1, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おいしい料理で\nお出迎えしなくちゃ！", 906, 0, 4, 1, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "一生懸命\nご奉仕しますよ～♪", 907, 0, 8, 1, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "耳かきしましょうか？\nえ？　こわい？", 908, 0, 1, 2, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お疲れでしたら、\nお昼寝しませんか？\n膝枕もしますよ？", 909, 0, 1, 2, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おかえりなさいませ\nご主人さま♪", 910, 0, 1, 2, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "すみません\nすみません\nすみません～～", 911, 0, 1, 2, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "メイドの私が、\nこんな気持ちを持って\nいいんでしょうか…", 912, 0, 4, 2, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私のこと、\n専属メイドと思って\n頼ってくださいね", 913, 0, 8, 2, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます♪\n今日も一日がんば…\nきゃ、きゃあ！", 914, 1, 1, 2, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 915, 2, 1, 2, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 916, 3, 1, 2, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 917, 0, 1, 3, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休憩が終わったら\nお洗濯にお料理に\nお掃除もしないと！", 918, 0, 1, 3, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\nあとでお洗濯\nしてあげますね", 919, 0, 1, 3, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 920, 0, 1, 3, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここでお洗濯ものを\n乾かしましょうか", 921, 0, 1, 3, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "あわわわっ…\nこ、転びそうです～！", 922, 0, 1, 3, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これくらい\nおいしいものを\n作ってみたいです～", 923, 0, 1, 3, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 924, 0, 1, 3, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "失敗したら、この\nお部屋追い出され\nちゃうかも～？", 926, 0, 1, 1, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 927, 0, 1, 1, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうやったら、立派な\nメイドになれるのかな", 928, 0, 1, 1, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "塩にはＳマーク\n砂糖にはＳマーク\n…あ、あれ！？", 929, 0, 1, 1, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ご用があれば\nなんでも言って\nくださいね", 930, 0, 1, 1, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "迷惑をかけすぎて…\n嫌われちゃったら\nどうしましょう", 931, 0, 8, 1, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "メイドの私が\nこんな気持ちを持って\nいいんでしょうか…　", 932, 0, 8, 1, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おでかけですか？\nいってらっしゃいませ\nご主人さま♪", 933, 0, 1, 2, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 934, 0, 1, 2, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私、またなにか\nやっちゃいましたか？", 935, 0, 1, 2, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おいしいお茶っ葉が\n手に入りました～♪\n一緒に飲みませんか？", 936, 0, 1, 2, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "転んだふりであの人に\n…って！\nなんでもないですよ！", 937, 0, 8, 2, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私、できることなら\nなんでもやりますよ\nあなたのためですから", 938, 0, 8, 2, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます♪\n今日も一日がんば…\nう、うわあ！", 939, 1, 1, 2, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 940, 2, 1, 2, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 941, 3, 1, 2, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 942, 0, 1, 3, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いい座り心地です～\nこれならお嬢さまも\nゆったりできますね♪", 943, 0, 1, 3, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\nあとでお洗濯\nしてあげますね", 944, 0, 1, 3, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 945, 0, 1, 3, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖かいですけど\n…私が火に近づいて\n大丈夫でしょうか！？", 946, 0, 1, 3, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "運動しようとすると\nいつも怪我するん\nですよね…", 947, 0, 1, 3, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "こんなに美味しいもの\nメイドの私には\nもったいないです～！", 948, 0, 1, 3, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 949, 0, 1, 3, 102502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あの方と私だけの\n部屋にしたいですわ", 951, 0, 1, 1, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あの方は私のもの…\n眼も耳も鼻も口も髪も\n首も胸も腰も手も脚も\nぬくもりも心も…！", 952, 0, 1, 1, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "運命とは決して\n抗えないもの…\nクスクス…クスクス", 953, 0, 1, 1, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "部屋からあの方の\n香りが…\nああ、至福ですわ", 954, 0, 1, 1, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "毒にも薬にもならない\n存在なんて嫌ですわ\nどうせならとびきりの\n毒でありたい…", 955, 0, 1, 1, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 956, 0, 4, 1, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 957, 0, 8, 1, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "運命を信じますか？\nもちろん絶対当然\n信じますわよね？", 958, 0, 1, 2, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この薬は起床時就寝前\n食前食後食間に、毎日\n服用してください。\n惚れ薬ですわ", 959, 0, 1, 2, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お願いがあるのです。\n新しい研究の実験台に\n…", 960, 0, 1, 2, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 961, 0, 1, 2, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 962, 0, 4, 2, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私の身も心も、全てが\nあなた様のもの。\nあなた様の全ても…", 963, 0, 8, 2, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 964, 1, 1, 2, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼を用意しましたの\n何も入れていませんわ\nクスクス…", 965, 2, 1, 2, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなた様が眠るまで\nお傍で見守りますわ。\n…あの、どうして\n眠らないのですか？", 966, 3, 1, 2, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いっそ鏡の中に\n閉じ込めてしまえたら\n私だけのものに…", 967, 0, 1, 3, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はっ！\nリラックスしたら\n閃きましたわ！", 968, 0, 1, 3, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あら、キメラの素体に\nぴったりですわ", 969, 0, 1, 3, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "このお部屋は\n良い香りがしますわ。\nはっ、あなた様の匂い\nなのでは…！？", 970, 0, 1, 3, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あたたかい…\n加熱調合にも\n使えそうですわね", 971, 0, 1, 3, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 972, 0, 1, 3, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 973, 0, 1, 3, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 974, 0, 1, 3, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あの方と私だけの\n部屋にしたいですわ", 976, 0, 1, 1, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 977, 0, 1, 1, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "新しい薬\nどうやってあの方に\n飲ませようかしら", 978, 0, 1, 1, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "部屋からあの方の\n香りが…\nああ、至福ですわ", 979, 0, 1, 1, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 980, 0, 1, 1, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 981, 0, 8, 1, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "魔法も科学も錬金術も\n全て駆使して\nあの方のために…", 982, 0, 8, 1, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この部屋には雌犬…\n失礼、女の方がとても\n沢山いますのね", 983, 0, 1, 2, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あなた様には私の伴侶\nとして高い教養を…\nあ、逃げられてしまい\nましたわ…！", 984, 0, 1, 2, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お願いがあるのです\n新しい研究の\n実験台に…", 985, 0, 1, 2, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あなた様が寝ている時\n私は…クスクス\nこれ以上は言えません", 986, 0, 1, 2, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "想像の中のあなた様は\nすっかり私の虜なのに\n現実は…\nもどかしいですわね", 987, 0, 8, 2, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 988, 0, 8, 2, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 989, 1, 1, 2, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さあ、お食事ですよ\n味は保証しますわ\n特製ソースで少しだけ\n体が痺れますけど…", 990, 2, 1, 2, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなた様が眠るまで\nお傍で見守りますわ\n…あの、どうして\n眠らないのですか？", 991, 3, 1, 2, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私ももう少し\n外見に気を配る\nべきでしょうか…", 992, 0, 1, 3, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はっ！\nリラックスしたら\n閃きましたわ！", 993, 0, 1, 3, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この私を差し置いて\nあなた様に媚びるなど\n言語道断…っ！", 994, 0, 1, 3, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "このお部屋は\n良い香りがしますわ\nはっ、あなた様の匂い\nなのでは…！？", 995, 0, 1, 3, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "素敵なぬくもり…\nまるであの方に\n抱きしめられたような", 996, 0, 1, 3, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 997, 0, 1, 3, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 998, 0, 1, 3, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 999, 0, 1, 3, 102702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1001, 0, 1, 1, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "使えるものは\n再利用しないと\n…あ、これとか\nまだ使えるわね", 1002, 0, 1, 1, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "贅沢は敵！　とはいえ\n気持ちに余裕のない\n暮らしはダメよね", 1003, 0, 1, 1, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お腹空いたわね、\n残り物で\n何か作ろうかしら", 1004, 0, 1, 1, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 1005, 0, 1, 1, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 1006, 0, 4, 1, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "焼きそばパンが\n食べたいな～\nあいつと…", 1007, 0, 8, 1, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ねぇあんた、どこか\n安いお店知らない？", 1008, 0, 1, 2, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あたし、エレガントに\n振る舞えてる？\n…そう？　嬉しい♪", 1009, 0, 1, 2, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いっぱい働いて遊んで\nよく休んでまた働く。\nそれが健全な生活よね", 1010, 0, 1, 2, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "一緒に部屋の\n整頓でもする？\nハマると楽しいわよ♪", 1011, 0, 1, 2, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんたがいると\n子供たちも喜ぶわ♪\nもちろんあたしもね！", 1012, 0, 4, 2, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ね、あんた今、幸せ？\n何びっくりしてるのよ\n大事なことじゃないの", 1013, 0, 8, 2, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "面倒な用事は午前中に\n片づけてしまうのが、\n時間の使い方のコツよ", 1014, 1, 1, 2, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "午後のティータイム\nとかどう？\n良いカフェがあるの♪", 1015, 2, 1, 2, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さ、エレガントな夜を\n楽しみましょ。\nモダンな音楽でも\nかけましょうか？", 1016, 3, 1, 2, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "レディたるもの\n身嗜みはしっかりとね\n見本にならないと♪", 1017, 0, 1, 3, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "これで仕事は一段落ね\nちょっと休憩…", 1018, 0, 1, 3, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うふふ、\nかわいいものを\n見るのは幸せね～", 1019, 0, 1, 3, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 1020, 0, 1, 3, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "風邪を引かないように\n身体を温めなくちゃ", 1021, 0, 1, 3, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 1022, 0, 1, 3, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…はっ、\n口の周り、\n汚れてないわよね？", 1023, 0, 1, 3, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "知識から過去を学んで\n未来に活かすわよ", 1024, 0, 1, 3, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "安売りのお店の情報\n整理しないと…", 1026, 0, 1, 1, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どんなに苦労してても\nそう見せないのが真の\nエレガントなレディよ", 1027, 0, 1, 1, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "安く済んであいつが\n喜ぶ料理とか…\nないかしら", 1028, 0, 1, 1, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1029, 0, 1, 1, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 1030, 0, 1, 1, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "焼きそばパンが\n食べたいな～\nあいつと…", 1031, 0, 8, 1, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あいつと一緒に…\n色々なところに\nいきたいな", 1032, 0, 8, 1, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今度買い物に\n付き合いなさい\nセールがあるのよ", 1033, 0, 1, 2, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あんたがいると子供\nたちも喜ぶわ♪\nもちろんあたしもね♪", 1034, 0, 1, 2, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いっぱい働いて遊んで\nよく休んでまた働く\nそれが健全な生活よね", 1035, 0, 1, 2, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あんたとこうして\nのんびりするのも\nいいものね", 1036, 0, 1, 2, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ねえ、今度遊びに\n行きたいな\nもちろん一緒に、よ", 1037, 0, 8, 2, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 1038, 0, 8, 2, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "面倒な用事は午前中に\n片づけてしまうのが\n時間の使い方のコツよ", 1039, 1, 1, 2, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ランチにして午後の\n仕事に備えましょ！\nやることは一杯よ♪", 1040, 2, 1, 2, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわあ～\nもうこんな時間\n子供たちは\nもう寝たかしら", 1041, 3, 1, 2, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "忙しい時こそ\n身だしなみは隙なく\nぴしっとね！", 1042, 0, 1, 3, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "これで仕事は一段落ね\nちょっと休憩…", 1043, 0, 1, 3, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふふ\nずっと眺めてたく\nなっちゃうわね", 1044, 0, 1, 3, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 1045, 0, 1, 3, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "風邪を引かないように\n身体を温めなくちゃ", 1046, 0, 1, 3, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 1047, 0, 1, 3, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "しっかり食べて\n栄養補給、栄養補給！", 1048, 0, 1, 3, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "知識から過去を学んで\n未来に活かすわよ", 1049, 0, 1, 3, 102802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "可愛い子が\nいっぱいいるなぁ…\n誰か私とユニット\n組んでくれないかな？", 1051, 0, 1, 1, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今度のライブ会場、\nいつもより大きいから\n楽しみなんだ～！", 1052, 0, 1, 1, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 1053, 0, 1, 1, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "彼とデュエット\nしてみたいな～♪", 1054, 0, 1, 1, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "キラキラ無病息災、\nドキドキ一日一善…\n作詞って難しい～", 1055, 0, 1, 1, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 1056, 0, 4, 1, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "写真集見なくても、\n本物がここに\nいるのにな～", 1057, 0, 8, 1, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "握手会の練習、\n付き合ってくれない？", 1058, 0, 1, 2, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "写真集のポーズ\n練習中～！\nど、どうかな？", 1059, 0, 1, 2, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "何て書いてあるか\n読めないって？\nもー！\nこれは私のサイン！", 1060, 0, 1, 2, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ね、次のライブ\n観に来てくれる？\nいい席とっとくから！", 1061, 0, 1, 2, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ねぇ、台本読むの\nつきあってくれる？\n恋人役に\nなってほしいんだ", 1062, 0, 4, 2, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ。\nどこかは秘密だけど♪", 1063, 0, 8, 2, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 1064, 1, 1, 2, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この時間は\nお腹すくけど…\n水着撮影があるから\nお昼抜いてるんだ", 1065, 2, 1, 2, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ。", 1066, 3, 1, 2, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 1067, 0, 1, 3, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 1068, 0, 1, 3, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい～♪\nこれは強力な\nライバル登場かな！", 1069, 0, 1, 3, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ステキな香り～♪\n歌詞のイメージが\n浮かんできそう！", 1070, 0, 1, 3, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 1071, 0, 1, 3, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 1072, 0, 1, 3, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 1073, 0, 1, 3, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ステキなお話…\n新曲の作詞の\n参考になりそう♪", 1074, 0, 1, 3, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "このお部屋すてき！\nファンに追われた時の\n隠れ家にピッタリね！", 1076, 0, 1, 1, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろイメチェン\nしてみようかな…\nそれともこの路線で\nもう少し…？", 1077, 0, 1, 1, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "みんながくれた\nファンレター…\n私の大事な宝物…", 1078, 0, 1, 1, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "彼とデュエット\nしてみたいな～♪", 1079, 0, 1, 1, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "疾風怒濤、威風堂々\n獅子奮迅、唯我独尊…\nラブソングの作詞って\n難しいな～", 1080, 0, 1, 1, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 1081, 0, 8, 1, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "トップアイドルの\nさらに先…\n彼とならその景色も\n見られるかな", 1082, 0, 8, 1, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 1083, 0, 1, 2, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "アイドルノゾミだけ\nじゃなくて、私の事も\nちゃんと見てね？", 1084, 0, 1, 2, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "キミに響かないなら\nファンにも響くわけ\nないよ！　練習練習！", 1085, 0, 1, 2, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "衣装のスカートは\n鉄壁なんだよ！\n残念でした～", 1086, 0, 1, 2, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ\nどこかは秘密だけど♪", 1087, 0, 8, 2, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ねぇ、私がトップ\nアイドルになっても\nちゃんと隣にいてね\n遠くに行かないでね？", 1088, 0, 8, 2, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 1089, 1, 1, 2, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ごはん行かない？\n誰にも知られてない\nお店があるんだけど！", 1090, 2, 1, 2, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ", 1091, 3, 1, 2, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 1092, 0, 1, 3, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 1093, 0, 1, 3, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい～♪\nこれは強力な\nライバル登場かな！", 1094, 0, 1, 3, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "みんなのイメージする\nアイドルの香りは\nこんな感じかな～", 1095, 0, 1, 3, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 1096, 0, 1, 3, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 1097, 0, 1, 3, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 1098, 0, 1, 3, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この恋愛小説ステキ！\n私もアイドルじゃ\nなかったら…", 1099, 0, 1, 3, 102902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "手裏剣の数が\n合わないデス！\nどこかに落とした\nデスか…？", 1101, 0, 1, 1, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 1102, 0, 1, 1, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "金は天下の\nマワリモノ！\nところで、\nどういう意味デス？", 1103, 0, 1, 1, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "むむ、アクダイカンの\n気配がするデース", 1104, 0, 1, 1, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "クニトリ合戦、\n楽しみデース！", 1105, 0, 1, 1, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ショーグンと\n出会えて、\nワタシは果報者デス！", 1106, 0, 4, 1, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 1107, 0, 8, 1, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なんでも\n命令するデス！\nショーグンの命は\n絶対デス！", 1108, 0, 1, 2, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あっ、ショーグン、\n出陣はいつで\nゴザルデス！？", 1109, 0, 1, 2, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さ、さすが\nショーグンデス…\nいつの間に背後を！？", 1110, 0, 1, 2, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "出陣の合図に\n備えるデス！\nほら貝は\nどこデスか！？", 1111, 0, 1, 2, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 1112, 0, 4, 2, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 1113, 0, 8, 2, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようデス！\n今日も一日\n忍法日和デス！", 1114, 1, 1, 2, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろお腹\n空いてきたデス。\n昼ごはんにするデス！", 1115, 2, 1, 2, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日もきっと\nいい日デスよ、\nショーグン！", 1116, 3, 1, 2, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちょんまげに\nしてみるのも\n面白いかもデス！", 1117, 0, 1, 3, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "心地よくて\n眠くなってきマス…\nもしやテキコクの\n罠デスか！？", 1118, 0, 1, 3, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 1119, 0, 1, 3, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ワビサビというもの\nデスね！\n素晴らしいデス！", 1120, 0, 1, 3, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "身体を暖めて\nイクサに向かうデス！", 1121, 0, 1, 3, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "アクロバットな忍法を\n使うには、体を\n鍛えないと危険デス！", 1122, 0, 1, 3, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "うーん、\n美味しいデス…\n幸せデス～", 1123, 0, 1, 3, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "これは…\nＢＵＳＨＩＤＯ…\nデスか？", 1124, 0, 1, 3, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふんふんふ～ん\n武器の手入れは\n念入りにしマスよ～", 1126, 0, 1, 1, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 1127, 0, 1, 1, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "金は天下の\nマワリモノ！\nところで\nどういう意味デス？", 1128, 0, 1, 1, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "むむ、アクダイカンの\n気配がするデース", 1129, 0, 1, 1, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "クニトリ合戦\n楽しみデース！", 1130, 0, 1, 1, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 1131, 0, 8, 1, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ショーグンの身は\n何があってもワタシが\n守るデス！", 1132, 0, 8, 1, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あっ、ショーグン\n出陣はいつで\nゴザルデス！？", 1133, 0, 1, 2, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "イクサの前に\nホネ休めも大事デスよ\nゆっくりするデース！", 1134, 0, 1, 2, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さ、さすがショーグン\nデス…いつの間に\n背後を！？", 1135, 0, 1, 2, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "一緒に忍法考える\nデス！\nショーグン用の\n忍法も必要デスね！", 1136, 0, 1, 2, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 1137, 0, 8, 2, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 1138, 0, 8, 2, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いい朝デス！\nトーゴク風の朝ゴハン\n作るデス！", 1139, 1, 1, 2, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もうお昼デス\nお昼寝するデスか？", 1140, 2, 1, 2, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろおネム\nデース…\n一緒に寝るデス？", 1141, 3, 1, 2, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "服の乱れは心の乱れ\nデス！　きっちり\nしないといけないデス", 1142, 0, 1, 3, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "心地よくて眠く\nなってきマス…\nもしやテキコクの\n罠デスか！？", 1143, 0, 1, 3, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 1144, 0, 1, 3, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ワビサビというもの\nデスね！\n素晴らしいデス！", 1145, 0, 1, 3, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "身体を暖めてイクサに\n向かうデス！", 1146, 0, 1, 3, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "ショーグンのお役に\n立つため、修行\nあるのみデス！", 1147, 0, 1, 3, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "美味しいデス…\n酢昆布を和えて\nみたいデス", 1148, 0, 1, 3, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "物事を知って\n来たるべきイクサに\n活かすデス", 1149, 0, 1, 3, 103002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1151, 0, 1, 1, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "父は、いつも男性に\nきびしいですね", 1152, 0, 1, 1, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "占ってほしい人は、\nいつでも言って\nください", 1153, 0, 1, 1, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 1154, 0, 1, 1, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この部屋、風水的にも\n運気が上がりそうです", 1155, 0, 1, 1, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人とのこと占って\nみようかな…\n好き…嫌い…\n好き♪…き、嫌い", 1156, 0, 4, 1, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 1157, 0, 8, 1, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "女難の相が\n出ていますね…\n気をつけてください", 1158, 0, 1, 2, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日のあなたの運勢は\n大きょ…\n大吉です", 1159, 0, 1, 2, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "父と散歩中です。\n毎日決まったコースを\n散歩させないと、\nストレスが溜まるので", 1160, 0, 1, 2, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "小僧！\nシノブに触るとは\nいい度胸じゃねぇか！", 1161, 0, 1, 2, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたに触られると、\n動悸が早くなります\nもしかして心霊現象？", 1162, 0, 4, 2, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今日もたくさんの幽霊\nに慕われていますね。\n素敵です", 1163, 0, 8, 2, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n今日の運勢を\n占いましょうか？", 1164, 1, 1, 2, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 1165, 2, 1, 2, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日のあなたの運気は\n最高潮でした。\nもうすぐ今日は\n終わりますが", 1166, 3, 1, 2, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お父さん。\nいつも、身だしなみに\n気を使ってるけど、\nあまり変わってないよ", 1167, 0, 1, 3, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一休みしましょう。\n憑かれて疲れました", 1168, 0, 1, 3, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい…\n付喪神が宿らないかな", 1169, 0, 1, 3, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お父さん、\nリラックスし過ぎると\n成仏しちゃうよ？", 1170, 0, 1, 3, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "気持ちいいです…\n極楽浄土みたい…", 1171, 0, 1, 3, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 1172, 0, 1, 3, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お父さんも\n食べたいの？\n死んでるのに？", 1173, 0, 1, 3, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本…\nもしかして予言書？", 1174, 0, 1, 3, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ここにいる幽霊は\nみんな幸せそうです", 1176, 0, 1, 1, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お父さんが\n女の子ばかりに\n声をかけるので\n困っています", 1177, 0, 1, 1, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "成仏はうれしいこと\nです…でも友達が\n減るのは寂しいですね", 1178, 0, 1, 1, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "幽霊に好かれる人は\n素敵な方です\nもちろん、あなたも", 1179, 0, 1, 1, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1180, 0, 1, 1, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "生きている人に\n好かれるには、\nどうすればいい\nのでしょう？", 1181, 0, 8, 1, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お父さん、どうしたら\nあの人のことを\n認めてくれますか？", 1182, 0, 8, 1, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この部屋、風水的にも\n運気が上がりそうです", 1183, 0, 1, 2, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "シノブには指一本\n触れさせん！\nガブッ！！", 1184, 0, 1, 2, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 1185, 0, 1, 2, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ラップ音？\nいえ、父のいびきです", 1186, 0, 1, 2, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 1187, 0, 8, 2, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "前世って信じますか？\n私とあなたは\nもしかすると…", 1188, 0, 8, 2, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 1189, 1, 1, 2, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "明るい時間は\nあまり得意では\nないんです…", 1190, 2, 1, 2, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜のお散歩に\n行きませんか？\n知り合いの幽霊に\n挨拶して回るんです", 1191, 3, 1, 2, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お父さん\nいつも、身だしなみに\n気を使ってるけど\nあまり変わってないよ", 1192, 0, 1, 3, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うとうと…\nあれ…\n走馬灯が見える…", 1193, 0, 1, 3, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい…\nお父さんみたい…", 1194, 0, 1, 3, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お父さん\nリラックスし過ぎると\n成仏しちゃうよ？", 1195, 0, 1, 3, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "快適です…\n幽霊もどんどん\n集まってきますね…", 1196, 0, 1, 3, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 1197, 0, 1, 3, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お父さんの分も、\n私が食べるね", 1198, 0, 1, 3, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本の占い\n私の占いと違う…", 1199, 0, 1, 3, 103102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私だって、一人で\n買い物ぐらい\nできますわ…きっと", 1201, 0, 1, 1, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1202, 0, 1, 1, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "一日も早く、\n一人前の商人に\nなりたいものです", 1203, 0, 1, 1, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "平和を買うのには\nどれほどのお金が\n必要なのかしら？", 1204, 0, 1, 1, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここももう少し広いと\n落ち着くのですけど。\n改築しませんこと？", 1205, 0, 1, 1, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 1206, 0, 4, 1, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 1207, 0, 8, 1, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私と、庶民向けの\nお店へ一緒に\n参りませんか？", 1208, 0, 1, 2, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "資産運用？\nお幾らほど\n増やしたいのです？", 1209, 0, 1, 2, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どんぶり勘定だとよく\n言われるのですが…\n例えが小さすぎます！", 1210, 0, 1, 2, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お金で解決するのは\n悪いことでは\nありませんわよね？", 1211, 0, 1, 2, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "その、よろしければ\n私とお散歩など\nいかがです？", 1212, 0, 4, 2, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もしあなたさまが\n道に迷われるなら、\n私もお供いたします！", 1213, 0, 8, 2, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "早起きは三ルピの徳と\n申しますが…\nもっとお得ですわね", 1214, 1, 1, 2, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 1215, 2, 1, 2, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 1216, 3, 1, 2, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "だらしない身なりでは\n取引相手に信用して\nいただけませんものね", 1217, 0, 1, 3, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この感触と安らぎ…\n素晴らしい\n費用対効果ですわ…", 1218, 0, 1, 3, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 1219, 0, 1, 3, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "目に見えないものに\nお金をかけるのが\n真の贅沢ですわ！", 1220, 0, 1, 3, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 1221, 0, 1, 3, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "健康はお金では\n買えませんが\n運動器具は別ですわ！", 1222, 0, 1, 3, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "なかなか\n美味ですわ\nシェフはどちらに？", 1223, 0, 1, 3, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "経済の仕組みを\nしっかりと\n学ばなくては…", 1224, 0, 1, 3, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1226, 0, 1, 1, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ええと、これは\nおいくらで買ったん\nでしたっけ？", 1227, 0, 1, 1, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お金を見せたら\n態度が変わる人は\n信用できませんわ", 1228, 0, 1, 1, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "地図が読めずとも\n道に迷わない方って\nいらっしゃるのですね", 1229, 0, 1, 1, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この狭さも\n慣れれば\n快適ですわ♪", 1230, 0, 1, 1, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 1231, 0, 8, 1, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 1232, 0, 8, 1, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "一人前の商人に\n相応しい居振る舞いを\nしたいものですわ", 1233, 0, 1, 2, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "幼い頃\nお店屋さんごっこを\nなさいましたか？", 1234, 0, 1, 2, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "資産運用？\nお幾らほど\n増やしたいのです？", 1235, 0, 1, 2, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今度一緒に…\nパーティにでも\n行きませんこと？", 1236, 0, 1, 2, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "その、よろしければ\n私とお散歩など\nいかがです？", 1237, 0, 8, 2, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたさまの優しさは\nお金には\n代えられませんわね", 1238, 0, 8, 2, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なぜだか\n眠り足りないような\n感じがしますわ…", 1239, 1, 1, 2, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 1240, 2, 1, 2, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 1241, 3, 1, 2, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ドレスは汚れていない\nようですが…やだ\n髪がほつれてますわ！", 1242, 0, 1, 3, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こういったものに\n腰を沈めると…\nき、気が緩んで…", 1243, 0, 1, 3, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 1244, 0, 1, 3, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "香りは質のいいものと\nそうでないものが\nはっきり分かりますわ", 1245, 0, 1, 3, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 1246, 0, 1, 3, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "目標は遠くに\n置いた方が励みに\nなりますわ！", 1247, 0, 1, 3, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "なかなか\n美味ですわ\nシェフはどちらに？", 1248, 0, 1, 3, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "商人って、物語では\n悪役にされやすいの\nですね…", 1249, 0, 1, 3, 103202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "家の中のものを使って\n物ボケ、考えるべ！", 1251, 0, 1, 1, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "毎日の日課…それは\n炊事、洗濯、大喜利\nだべ！", 1252, 0, 1, 1, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うちに塀ができたら、\nへー、って言いたい！", 1253, 0, 1, 1, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "オラが作る料理は\nこの後スタッフで\n美味しくいただくべよ", 1254, 0, 1, 1, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "エリザベスも\n連れてきてぇ～", 1255, 0, 1, 1, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんちゃんも、\nエリザベスと同じ位\nめんこいべ♪", 1256, 0, 4, 1, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "オラとあんちゃん、\n息がぴったりに\nなってきたべ…！", 1257, 0, 8, 1, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おぉ！　そんな急に\nツッコまれたら、\nびっくらこくべやー！", 1258, 0, 1, 2, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ネタはオラが書くけど\nあんちゃんが\n書きたかったら\n書いてもいいんだぞ？", 1259, 0, 1, 2, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 1260, 0, 1, 2, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "押すなよ、\n絶対押すなよ\n…なんて\n言ってないべさ？", 1261, 0, 1, 2, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 1262, 0, 4, 2, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "将来的には夫婦漫才\nってのも…あ、ひ、\nひとりごとだべさ～！", 1263, 0, 8, 2, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！　一緒に\n牛の乳しぼりいくべ？", 1264, 1, 1, 2, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼だ～腹が減っては\n笑いはできぬ～！", 1265, 2, 1, 2, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日もよく働いたべ！\nさ、今からは\nお笑いの練習だ～！", 1266, 3, 1, 2, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "舞台に上がる前に\n身なりは整えねぇと\nだめだべ～！", 1267, 0, 1, 3, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ナイスなイスに\n座りたい、\nなんちゃって！", 1268, 0, 1, 3, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "めんこいのは、\nスベっても許される\nからずるいべな～？", 1269, 0, 1, 3, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "必要以上に\n癒されちまうべや～", 1270, 0, 1, 3, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽかぽかだ…\nウケた会場みてぇだ", 1271, 0, 1, 3, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "お笑い芸人は、\n体が資本だべさ～！", 1272, 0, 1, 3, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 1273, 0, 1, 3, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ネタ作りのヒントが\n載ってねぇか探すべ", 1274, 0, 1, 3, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さぁ今日も張り切って\n漫才の練習するべさ！", 1276, 0, 1, 1, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この部屋でも、商品\n売っていいんだべか？", 1277, 0, 1, 1, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "眼鏡を頭の上に乗せて\n「メガネメガネ～」\nって言う練習した方が\nいいべか？", 1278, 0, 1, 1, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "漫才を持ち時間に\n収めるには、何度も\n練習するしかねぇべ", 1279, 0, 1, 1, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "エリザベスも\n連れてきてぇ～", 1280, 0, 1, 1, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 1281, 0, 8, 1, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんちゃんに\n採れたての食材を\n食わしてやりてぇ～", 1282, 0, 8, 1, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "押すなよ\n絶対押すなよ\n…なんて\n言ってないべさ？", 1283, 0, 1, 2, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あんちゃん、百連\nツッコミ特訓だ～！", 1284, 0, 1, 2, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 1285, 0, 1, 2, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "「なんでだべ～！」\nって言いながら\nツッコむといいべ！", 1286, 0, 1, 2, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あはは～あんちゃんの\nツッコミはやっぱり\n気持ちいいなぁ～", 1287, 0, 8, 2, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "将来的には夫婦漫才\nってのも…あ、ひ\nひとりごとだべさ～！", 1288, 0, 8, 2, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！\n今日もいい\nネタ作り日和だ！", 1289, 1, 1, 2, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼だな\nご飯を食べたら、\nネタの練習するべ！", 1290, 2, 1, 2, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間だべ\nネタ作りは\n明日にするべ…", 1291, 3, 1, 2, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うーん…衣装、\nずれてねぇべか？", 1292, 0, 1, 3, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ナイスなイスに\n座りたい\nなんちゃって！", 1293, 0, 1, 3, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "はう～\nなまらめんこいべや～", 1294, 0, 1, 3, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "必要以上に\n癒されちまうべや～", 1295, 0, 1, 3, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "笑いをとることを\n忘れるほど\nあったけぇべ～", 1296, 0, 1, 3, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "たくさん運動して\n動きでも笑いがとれる\nように頑張るべ～！", 1297, 0, 1, 3, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 1298, 0, 1, 3, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "幅広く教養を\n身につけて\nいいネタ作るべ！", 1299, 0, 1, 3, 103302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "通りにいる\nカップル…爆発\nすればいいのに…", 1301, 0, 1, 1, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "う～ん、仕事なんて\nしないで、\n飲んでたいな～", 1302, 0, 1, 1, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日は一日、\n外に出ない！\nもう決めたわ！", 1303, 0, 1, 1, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お腹空いた…\nけど、外に出るのは\n面倒だなぁ", 1304, 0, 1, 1, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うぅ…頭がガンガン\nする…昨日、\n飲み過ぎたかな…", 1305, 0, 1, 1, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "デートとか…\n誘っても嫌がられ\nないかな…？", 1306, 0, 4, 1, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もしかして運命の\n相手だったり…\nするのかな", 1307, 0, 8, 1, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "やっぱり一杯目が\n一番おいしいわ～！\n…え、見てた！？", 1308, 0, 1, 2, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "頼れるお姉さんだって\nところ、もっと見せて\nあげるからね", 1309, 0, 1, 2, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ねえ、一緒に買い物に\n行かない？　その…\nの、飲み物とか…", 1310, 0, 1, 2, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ひっく、うふふ…\nもっとお姉さんと\nお話しようよ～", 1311, 0, 1, 2, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 1312, 0, 4, 2, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつか…\nキミと一緒に飲めたら\n楽しいだろうな", 1313, 0, 8, 2, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう…朝は\nちょっとつらいな…\n低血圧なのよ…", 1314, 1, 1, 2, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おっひるー♪\nなに食べよっかな～♪", 1315, 2, 1, 2, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわあ…\n眠る前にちょっと\n一杯…冗談よ", 1316, 3, 1, 2, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うう…\n髪がボサボサ…\nちゃんとしなきゃ…", 1317, 0, 1, 3, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 1318, 0, 1, 3, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こういうの男の子に\nプレゼントして\nもらいたいな…", 1319, 0, 1, 3, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うわあ、\nこれ、私の好きな\n香りだー！", 1320, 0, 1, 3, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽっかぽか…\nあとは熱い一杯が\nあれば…！", 1321, 0, 1, 3, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "家でゴロゴロして\n付いちゃったお肉を\n落とさないと…！", 1322, 0, 1, 3, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…\nおーいしー！\n…太らないよね？", 1323, 0, 1, 3, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 1324, 0, 1, 3, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "仕事終わりの一杯の\nために、今日も\n頑張らないと", 1326, 0, 1, 1, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日は\nのんびり\n過ごそうかな～", 1327, 0, 1, 1, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ…\nお皿、洗って\nなかった…", 1328, 0, 1, 1, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "もう少し、大人の\n魅力が出せるように\nなりたいな", 1329, 0, 1, 1, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "素敵な彼氏…\n欲しいなぁ…", 1330, 0, 1, 1, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "彼と私\n釣り合うかな…\n大丈夫よね？", 1331, 0, 8, 1, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今後のために\nちょっとは花嫁修業\nしてみようかな…？", 1332, 0, 8, 1, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "何事も\nお姉さんと一緒に\n楽しく頑張りましょ？", 1333, 0, 1, 2, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ね、ねえ！\nキミは年上と年下\nどっちが好きかな？", 1334, 0, 1, 2, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もう…\n構ってくれないと\n泣いちゃうぞ～？", 1335, 0, 1, 2, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お姉さんが～\n可愛がって\nあげようか～？", 1336, 0, 1, 2, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 1337, 0, 8, 2, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お姉さんとチュー\nする？　ふふふ～\n冗談で～す！", 1338, 0, 8, 2, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さーて、今日も\nいっちょやるぞー！", 1339, 1, 1, 2, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "後でのんびり\nストレッチでも\nしようっと♪", 1340, 2, 1, 2, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "一日よく働いた～！\n自分にごほうび\nあげたいなー♪", 1341, 3, 1, 2, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "仕事の前に、髪とか\n整えないと…", 1342, 0, 1, 3, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 1343, 0, 1, 3, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もう大人だし…\nあんまり可愛いのは\n似合わないかな…？", 1344, 0, 1, 3, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うわあ\nこれ、私の好きな\n香りだー！", 1345, 0, 1, 3, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかーい…\nだ、だらけ\nちゃいそう…", 1346, 0, 1, 3, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "地道な努力が\nリア充への\n第一歩！", 1347, 0, 1, 3, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おーいしっ♪\nこのために\n生きてるわねえ", 1348, 0, 1, 3, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 1349, 0, 1, 3, 103402);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1351, 0, 1, 1, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？", 1352, 0, 1, 1, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1353, 0, 1, 1, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ちょっと、休憩…\n本でも読もうかな", 1354, 0, 1, 1, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "もっとたくさんの本に\n囲まれて生活したいな", 1355, 0, 1, 1, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "むかしむかしある所に\nシオリと\nあの人が…", 1356, 0, 4, 1, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この本の主人公、\nあの人に\n似ているかも…\nかっこいいな", 1357, 0, 8, 1, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1358, 0, 1, 2, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ…お姉ちゃんと\n約束があったんだ…", 1359, 0, 1, 2, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 1360, 0, 1, 2, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 1361, 0, 1, 2, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "読みたい本も\nあなたと行きたい所も\n増えるばっかりです", 1362, 0, 4, 2, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私の病気、\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 1363, 0, 8, 2, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1364, 1, 1, 2, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅ…午前中\n動いたので体力が…\nすこし休みますね", 1365, 2, 1, 2, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "早く寝ないと\n体に良くないですよね\nでも気になっている\n本があって…", 1366, 3, 1, 2, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "寝てばかりなので、\n髪が乱れてないかな\n…？", 1367, 0, 1, 3, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "少し休もう\n…やっぱり\nたくさん休もう", 1368, 0, 1, 3, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいものが\n枕元にあると\n安心できるんですよ", 1369, 0, 1, 3, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…\n病は気からと言うので\n雰囲気も大事ですね", 1370, 0, 1, 3, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "こうして温まって\nいると、病気も\n治る気がします", 1371, 0, 1, 3, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "運動…イメージ\nトレーニングだけじゃ\nだめでしょうか…", 1372, 0, 1, 3, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "少食ですけど\nこれならたくさん\n食べられそうです", 1373, 0, 1, 3, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "続きが気になって\n読むのを止める\nタイミングが…", 1374, 0, 1, 3, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "しっかり休まないと\n早く回復するように", 1376, 0, 1, 1, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？　", 1377, 0, 1, 1, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "病室よりも…\nずっとこの部屋に\nいたいですね…　", 1378, 0, 1, 1, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1379, 0, 1, 1, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1380, 0, 1, 1, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "むかしむかしある所に\nシオリと\nあの人が…", 1381, 0, 8, 1, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人の\nためにも早く\n病気を治さないと…", 1382, 0, 8, 1, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1383, 0, 1, 2, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "新記録です！\n一週間連続、\n平熱を保ちました！", 1384, 0, 1, 2, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ…お薬の時間…\n苦いけど我慢しなきゃ　", 1385, 0, 1, 2, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 1386, 0, 1, 2, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 1387, 0, 8, 2, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私の病気\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 1388, 0, 8, 2, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1389, 1, 1, 2, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "…お昼の薬？\nあ、飲み忘れてました\nありがとうございます", 1390, 2, 1, 2, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この薬を飲むと\n眠くなっちゃうんです\nでもまだ、あなたと\nお話したいし～", 1391, 3, 1, 2, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "寝てばかりなので、\n髪が乱れてないかな\n…？　", 1392, 0, 1, 3, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "少し休もう\n…やっぱり\nたくさん休もう", 1393, 0, 1, 3, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この子がいれば\n病室に一人でも\n寂しくないですね", 1394, 0, 1, 3, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いろんな効能が？\n健康になる香りも\nあるのでしょうか？", 1395, 0, 1, 3, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "こうして温まって\nいると、病気も\n治る気がします", 1396, 0, 1, 3, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "私も、少しは\n体力をつけないと\nいけませんよね　", 1397, 0, 1, 3, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いっぱい食べて\n健康な体にならないと", 1398, 0, 1, 3, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "続きが気になって\n読むのを止める\nタイミングが…", 1399, 0, 1, 3, 103802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "友達ができたら、\n山の上でお弁当…\n夢が広がります…", 1401, 0, 1, 1, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ、忘れずに\nお花に水を\nあげなきゃ…", 1402, 0, 1, 1, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お菓子を作って、\nみなさんに振る舞って\n友達作戦！　とか…", 1403, 0, 1, 1, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そろそろ新しい\n草人形を作って\n友達作りの特訓を…", 1404, 0, 1, 1, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "植物のお世話って、\nぼっちにとっては、\n救い…なんです…", 1405, 0, 1, 1, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ＢＢ団の活動日…\nまだかな…\nうふふふっ", 1406, 0, 4, 1, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 1407, 0, 8, 1, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あ、こんにちは！\n今日もＢＢ団で\nお世話になります！", 1408, 0, 1, 2, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あの…私の友達作りの\n練習方法、間違って\nませんよね…？", 1409, 0, 1, 2, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そうだ、今度、\n森に一緒に木の苗を\n植えに行きませんか？", 1410, 0, 1, 2, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "人とお話するのって、\n私、大好きです！\n友達ふやすぞ～！", 1411, 0, 1, 2, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたと話してると、\nまるで私がぼっちじゃ\nないみたいです！", 1412, 0, 4, 2, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 1413, 0, 8, 2, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます！\n今日もＢＢ団、\nがんばるぞー！", 1414, 1, 1, 2, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "なんだか、お腹が\n空いてきました。\nお昼ごはんー♪", 1415, 2, 1, 2, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もう眠いかもです…\n明日は友達、\nできるといいなあ…", 1416, 3, 1, 2, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私がもっと\n可愛ければ、\n友達できるかなあ？", 1417, 0, 1, 3, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふわあ…のんびり\nしすぎないように\n気を付けなきゃです", 1418, 0, 1, 3, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいなあ。\nこの子とも\n友達になりたい…", 1419, 0, 1, 3, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りです…\n精神統一して\n友達のイメトレ…", 1420, 0, 1, 3, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "灯りを見てると、\n心がなごみます～", 1421, 0, 1, 3, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 1422, 0, 1, 3, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしいです…\n私に友達がいたら、\n分けてあげたいな", 1423, 0, 1, 3, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 1424, 0, 1, 3, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "友達作りは、焦らず\n慌てず、じっくりと…", 1426, 0, 1, 1, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ひとつ屋根の下\nって感じ…\nいいですねえ…", 1427, 0, 1, 1, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "煮汁、煮汁が\n噴きこぼれて\nいませんか～", 1428, 0, 1, 1, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今度、みなさんと\nピクニックとか…\nいってみたいな", 1429, 0, 1, 1, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぼっちでもいい\nたくましく育てば\n…なんて", 1430, 0, 1, 1, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "最近、毎日あの人の\nこと考えちゃいます\nどうしてだろう…", 1431, 0, 8, 1, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 1432, 0, 8, 1, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あ！　ＢＢ団の活動\nですか？　嬉しくて\n飛び跳ねちゃいます！", 1433, 0, 1, 2, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あなたとのお話で友達\n作りの練習になるなら\n一石二鳥です！", 1434, 0, 1, 2, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私少しは人と話しても\nテンパらなくなって\nきましたかね…？", 1435, 0, 1, 2, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あの、友達作りの\n新しい作戦\n考えてみたんですっ！", 1436, 0, 1, 2, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたとお話する時の\nこの気持ち、私の宝物\nなんです…えへへ", 1437, 0, 8, 2, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 1438, 0, 8, 2, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝ですね！\nこんないい朝は\n友達作りのチャンス！", 1439, 1, 1, 2, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あの…そろそろお腹\nすきませんか？\nお昼ごはんは…", 1440, 2, 1, 2, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もう眠いかもです…\n明日は友達\nできるといいなあ…", 1441, 3, 1, 2, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私…見た目\nそこまで変じゃ\nないですよね…？", 1442, 0, 1, 3, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ほわあ～…\nふかふかって\nいいものですね～", 1443, 0, 1, 3, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この子みたいな\nあいくるしさを\n目指したいです！", 1444, 0, 1, 3, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "灯りを見てると\n心がなごみます～", 1445, 0, 1, 3, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぬくぬくで、なんだか\n眠くなっちゃいますね", 1446, 0, 1, 3, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "身体を鍛えて\nみなさんを\n守ります！", 1447, 0, 1, 3, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 1448, 0, 1, 3, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 1449, 0, 1, 3, 104002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "唱喚の歌は、みだりに\n歌っていいものでは\nないんです", 1451, 0, 1, 1, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここでアイドルの\n練習は、さすがに\n迷惑ですよね？", 1452, 0, 1, 1, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1453, 0, 1, 1, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "人々の平和を守る旅に\n同行してくれる人を\n探していて…", 1454, 0, 1, 1, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あとで曲を復習して\nおかないと…", 1455, 0, 1, 1, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "踊りを見られるのは\nまだ恥ずかしいけど\nあの人になら…", 1456, 0, 4, 1, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 1457, 0, 8, 1, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1458, 0, 1, 2, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "え、もう練習の時間？\nごめんなさい\nすぐ準備します！", 1459, 0, 1, 2, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1460, 0, 1, 2, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 1461, 0, 1, 2, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 1462, 0, 4, 2, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 1463, 0, 8, 2, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます♪\n少し歌の練習を\nしてきますね", 1464, 1, 1, 2, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もうお昼なんですか？\n練習に夢中で\n気づきませんでした", 1465, 2, 1, 2, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日の予定は…\nアイドルはやることが\n多いみたいで…", 1466, 3, 1, 2, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1467, 0, 1, 3, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "歌の調子をよくする\nためには休息も\n必要ですよね…", 1468, 0, 1, 3, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この子たちを\n相手に練習して\nみようかな…♪", 1469, 0, 1, 3, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 1470, 0, 1, 3, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここにいると\n穏やかな旋律が\n浮かんできます…", 1471, 0, 1, 3, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "歌うためには\n体力づくりは\n欠かせません", 1472, 0, 1, 3, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "歌った後は\nお腹が空いて\nしまうんです", 1473, 0, 1, 3, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "音楽について\n理論も勉強\nしないと…", 1474, 0, 1, 3, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "歌うことの楽しさ\n分かってきました\nもっと歌いたいな…", 1476, 0, 1, 1, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1477, 0, 1, 1, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "精霊も強くなったし\nもっとたくさんの人を\n守りたいです", 1478, 0, 1, 1, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "最近、よく頭の中に\n歌が浮かんできます\n不思議な感覚…", 1479, 0, 1, 1, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "楽譜を買いました\n思いついた歌を\n書き留めておくために", 1480, 0, 1, 1, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 1481, 0, 8, 1, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私の中にある\n私だけの歌…\n作ってみようかな？", 1482, 0, 8, 1, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1483, 0, 1, 2, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 1484, 0, 1, 2, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "魔物退治ですか！？\n…違います？\n良かった…", 1485, 0, 1, 2, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1486, 0, 1, 2, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 1487, 0, 8, 2, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 1488, 0, 8, 2, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "呼吸を深く、大きく…\nこれでちゃんと\n目が覚めますよ", 1489, 1, 1, 2, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "少し休んだら\n午後の練習に\n行ってきますね", 1490, 2, 1, 2, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "曲を作っていたら\nもうこんな時間…\nおやすみなさい", 1491, 3, 1, 2, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1492, 0, 1, 3, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ～…♪\nよく体がほぐれます…\nいい歌が歌えそうです", 1493, 0, 1, 3, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいと思う\n気持ちを、歌にしても\nいいかも知れませんね", 1494, 0, 1, 3, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 1495, 0, 1, 3, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここにいると\n穏やかな旋律が\n浮かんできます…", 1496, 0, 1, 3, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "もっと体力をつけて\n最高のライブを\nファンに届けます！", 1497, 0, 1, 3, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これでも一応\n体形には気をつけて\n食べてるんですよ？", 1498, 0, 1, 3, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "読書は歌に\n新しい風を\n吹き込んでくれます", 1499, 0, 1, 3, 104202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "店の新メニューでも\n考えるかな", 1501, 0, 1, 1, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あたしの店から、\n出前を届けようか？", 1502, 0, 1, 1, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "パトロール、\nパトロール…\nここは異常なしかな？", 1503, 0, 1, 1, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 1504, 0, 1, 1, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "のんびりし過ぎるのも\n…性に合わねぇな", 1505, 0, 1, 1, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "そろそろあいつ、\n腹すかしてるん\nじゃないかな？", 1506, 0, 4, 1, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今日の献立は…\nあいつの好きなものに\nしてやるか", 1507, 0, 8, 1, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "強くなりたいなら、\nあたしがビシバシ\n鍛えてやるよ", 1508, 0, 1, 2, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "天気がいい日は\n外で運動したく\nならねぇか？", 1509, 0, 1, 2, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "腹減ったか？　なんか\n作ってやろうか？", 1510, 0, 1, 2, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん？　なんだよ、\n相談事か？\nなんでも言ってくれ", 1511, 0, 1, 2, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お前が好きな飯って\nなんだ？\n今度、作ってやるよ", 1512, 0, 4, 2, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 1513, 0, 8, 2, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか", 1514, 1, 1, 2, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 1515, 2, 1, 2, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "日中たっぷり動いたら\nそのぶん夜はしっかり\n休んどけよな", 1516, 3, 1, 2, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "た、たまにはその…\nかわいい格好とか\nしても…", 1517, 0, 1, 3, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふわぁ、\n一休みすっかなぁ～", 1518, 0, 1, 3, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うっ！　か、かわいい\nじゃねぇか", 1519, 0, 1, 3, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 1520, 0, 1, 3, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふわぁ〜！\n温かいと、つい\nウトウトしちまうな", 1521, 0, 1, 3, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "オラオラオラーーー！\n燃えるぜーーー！", 1522, 0, 1, 3, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いい味してるぜ！\nうちの店でも\n出してみたいな", 1523, 0, 1, 3, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "文字を読んでると\nどうしても眠く\nなっちまうんだよなぁ", 1524, 0, 1, 3, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "パトロール終了～\n本日も異常なしっと！", 1526, 0, 1, 1, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あたしの店から\n出前を届けようか？", 1527, 0, 1, 1, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あいつ、早く\n帰ってこないかな", 1528, 0, 1, 1, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あいつ\n腹すかせてないと\nいいんだけど…", 1529, 0, 1, 1, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "のんびりし過ぎるのも\n…性に合わねぇな", 1530, 0, 1, 1, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつの事を思うと\n胸があったかくなる？\nなんだコレ…？", 1531, 0, 8, 1, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今日の献立は…\nあいつの好きなものに\nしてやるか", 1532, 0, 8, 1, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ん？　なんだよ\n相談事か？\nなんでも言ってくれ", 1533, 0, 1, 2, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "天気がいい日は\n外で運動したく\nならねぇか？", 1534, 0, 1, 2, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "腹減ったか？　なんか\n作ってやろうか？", 1535, 0, 1, 2, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 1536, 0, 1, 2, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あのさ…できれば\nもっとそばに…いや\nなんでもねぇ忘れろ！", 1537, 0, 8, 2, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 1538, 0, 8, 2, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか？", 1539, 1, 1, 2, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 1540, 2, 1, 2, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あんま夜更しすんなよ\n明日に響いたら\n大変だろ？", 1541, 3, 1, 2, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "た、たまにはその…\nかわいい格好とか\nしても…", 1542, 0, 1, 3, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅ～♪\n疲れがとれるな～", 1543, 0, 1, 3, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うっ！　か、かわいい\nじゃねぇか", 1544, 0, 1, 3, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 1545, 0, 1, 3, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふわぁ～！\n温かいと、つい\nウトウトしちまうな", 1546, 0, 1, 3, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "オラオラオラーーー！\n燃えるぜーーー！", 1547, 0, 1, 3, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いい味してるぜ！\nうちの店でも\n出してみたいな", 1548, 0, 1, 3, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "料理だけじゃなく\n経営術とかも\n学んどかねぇと…", 1549, 0, 1, 3, 104302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "最近なにも\nしてくれません…\n焦らしてるんですね", 1551, 0, 1, 1, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぐふふ、じゅるり…\nい、いけない、また\nいつの間にかよだれが", 1552, 0, 1, 1, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "好きな武器といえば\n剣より槍より\nやっぱり鞭…ぐふふ", 1553, 0, 1, 1, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "「無数の触手が\nクウカの柔肌に\n食い込み」…ぐふふ", 1554, 0, 1, 1, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 1555, 0, 1, 1, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ドＳさんを登場\nさせるだけで、妄想に\n無限の広がりが！", 1556, 0, 4, 1, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 1557, 0, 8, 1, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "視線を感じると\n思ったら…やはり\nドＳさんでしたか", 1558, 0, 1, 2, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日は\nどんなヒドイことを\nしてくれるんですか？\nぐふふふ", 1559, 0, 1, 2, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いつの間にそこに！？\nまさかクウカを監視\nしていたのですか！？", 1560, 0, 1, 2, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "クウカに触るつもり\nですか？　触るつもり\nなのですねっ！？", 1561, 0, 1, 2, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "クウカにナニをする\nつもりですか…\n期待してしまいます！", 1562, 0, 4, 2, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ドＳさんの視界に入る\nだけでドキドキが…\nこれが恋！？", 1563, 0, 8, 2, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます。\n朝からお盛んですね？\nぐふふ…", 1564, 1, 1, 2, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こんなにも日の高い\nうちからドＳさんは…\nじゅるり", 1565, 2, 1, 2, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜はこれから、\nですよ…\nぐふ、ぐふふふ…", 1566, 3, 1, 2, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "キレイにおめかし\nしたのに力ずくで…\nぐふふふ", 1567, 0, 1, 3, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ソファの背にクウカを\n押し付けて…ぐふふ\nいいですね\nソファドン", 1568, 0, 1, 3, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 1569, 0, 1, 3, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "香りを吸ったクウカの\n頬は紅潮し目はうるみ\nもはや抗う力も…！", 1570, 0, 1, 3, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ああ、身体が\n火照って…\nぐふ、ぐふふ…", 1571, 0, 1, 3, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "はぁ、はぁ、こうして\nクウカの体力を\n奪ってから…ぐふふ", 1572, 0, 1, 3, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食欲が満たされたら\nつ、次はやはり…！\nそうなのですね！？", 1573, 0, 1, 3, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本の下に、\nそういう本を\nカムフラージュ？", 1574, 0, 1, 3, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "「ドＳさんと踊り子\n乱舞の一夜」…\n次の日記はこれで…", 1576, 0, 1, 1, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "最近なにも\nしてくれません…\n焦らしてるんですね", 1577, 0, 1, 1, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "も、妄想が\n足りません…\n禁断症状がっ…！", 1578, 0, 1, 1, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 1579, 0, 1, 1, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "次はどんなドＳを\nされるのか、想像する\nだけで…ぐふふふ", 1580, 0, 1, 1, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "じっとしてると\nドＳさんのことばかり\n考えてしまいますね", 1581, 0, 8, 1, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "妄想が止まらなくて\nクウカどうにかなって\nしまいそうです！", 1582, 0, 8, 1, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ドＳさんといると体が\n火照って…クウカは\nいやらしい子です！", 1583, 0, 1, 2, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 1584, 0, 1, 2, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ドＳさんのおかげで\n新しい扉が開けそう\nです…じゅるり", 1585, 0, 1, 2, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いやー！　ドＳさんに\n襲われ…襲って\nくれないんですか？", 1586, 0, 1, 2, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "クウカはドＳさんに\n身も心も堕とされて\nしまったのですね", 1587, 0, 8, 2, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ドＳさんがお望みなら\nクウカは\nどんなことだって！", 1588, 0, 8, 2, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝だからこそ\nできる妄想が\nあります…ぐふふ", 1589, 1, 1, 2, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こんな日の高いうち\nからドＳさんは…\nじゅるり", 1590, 2, 1, 2, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今夜は一晩中…\nなんですね？\nぐふふ…", 1591, 3, 1, 2, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "意外と難しいんですよ\n正しい亀甲縛りと\nいうものは…", 1592, 0, 1, 3, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "くつろいで油断\nしているスキに何を\nされるのでしょう！？", 1593, 0, 1, 3, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 1594, 0, 1, 3, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これは禁断の香り…\nああっ一段階上の\n妄想が開花するうぅ！", 1595, 0, 1, 3, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ああっ、暖気がまるで\nロウソクのように\nクウカを攻めますっ！", 1596, 0, 1, 3, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "激しい攻めを受けきる\nためには、鍛えないと\nいけないのですね", 1597, 0, 1, 3, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "こんなにいっぱい\n入りません…\nお腹にっ！", 1598, 0, 1, 3, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "どんな本も\nよく見ると\nいやらしいです…！", 1599, 0, 1, 3, 104502);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この前遊んだ猫、\nモッフモフ\nだったにゃあ…♪", 1601, 0, 1, 1, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ほっぺやお腹が、\n肉球ぐらいぷにぷに…\nこれはまずいにゃ…", 1602, 0, 1, 1, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "大きな仕事が\n決まったにゃ！\n腕が鳴るにゃ～♪", 1603, 0, 1, 1, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おやつのたい焼き、\nつぶあんとこしあん、\nどっちに\nしようかにゃ？", 1604, 0, 1, 1, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うにゃー…\nもうちょっとお昼寝\nしたかったにゃ…\nむにゃむにゃ…", 1605, 0, 1, 1, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミに呼ばれると、\n猫まっしぐらな気分に\nなっちゃうにゃ♪", 1606, 0, 4, 1, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミのおかげで\nギルドの仕事も\n大成功だにゃ♪\nありがとにゃ♪", 1607, 0, 8, 1, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うずうず…その指、\nじゃれついても\nいいかにゃ？", 1608, 0, 1, 2, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "にゃ？　あたしに何か\nご入り用かにゃ？\nお安くしとくにゃ～♪", 1609, 0, 1, 2, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うーん、なんだか\n退屈にゃ～\n遊んで、遊んで～？", 1610, 0, 1, 2, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "素早い動きのコツ？\nタダじゃ教えて\nあげられないにゃ～♪", 1611, 0, 1, 2, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "そんなにあたしを\nなでたいにゃ？\nキミならなでさせて\nあげてもいいかにゃー", 1612, 0, 4, 2, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ふにゃあ、ねえねえ、\n一緒にゴロゴロ\nしようにゃあ？", 1613, 0, 8, 2, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いい朝にゃ！\n顔を洗ってくるにゃ！", 1614, 1, 1, 2, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "むーん、そろそろ\nお昼…猫たちにも\n猫缶を…", 1615, 2, 1, 2, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわあ…眠いにゃ…\n猫は布団で\n丸くなるにゃ", 1616, 3, 1, 2, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "客商売では、\n外見のチェックも\n欠かせないのにゃ！", 1617, 0, 1, 3, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うにゃ～！\nお昼寝に\nぴったりにゃ", 1618, 0, 1, 3, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これ…量産したら\n子どもにバカ売れ\nしそうだにゃ！", 1619, 0, 1, 3, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この灯り、まるで\n猫みたいな\n癒し効果にゃ！", 1620, 0, 1, 3, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふにゃあ、\nあったかいと猫は丸く\nなっちゃうのにゃあ…", 1621, 0, 1, 3, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "本当は外で\n運動したいん\nだけどにゃ", 1622, 0, 1, 3, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "むーん、\n美味しいにゃー！\nたい焼きに\n匹敵するにゃ！", 1623, 0, 1, 3, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…猫の\nしつけ方は、と…", 1624, 0, 1, 3, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "かわいいネコの置物を\nゲットしたにゃ！\nどこに飾ろうか\nにゃ～♪", 1626, 0, 1, 1, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "仕事の交渉がうまく\n行ったにゃ～♪\nいい気分だにゃ～♪", 1627, 0, 1, 1, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ねこじゃらしには\n食いついちゃうにゃ\nびしっ！　びしっ！", 1628, 0, 1, 1, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ほっぺやお腹が、肉球\nぐらいぷにぷに…\nこれはまずいにゃ…", 1629, 0, 1, 1, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "さっきのたいやき\nおいしかったにゃ♪\nごろごろごろ…", 1630, 0, 1, 1, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "手作りのたい焼き\nあいつは食べて\nくれるかにゃ…？", 1631, 0, 8, 1, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あいつには、いつか\nたっぷり恩返しが\nしたいにゃ…", 1632, 0, 8, 1, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "にゃーに？　あたしの\nことがそんなに気に\nなるのかにゃ？", 1633, 0, 1, 2, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あたしのこと…\nしっかり捕まえ\nといてにゃ？", 1634, 0, 1, 2, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あたしの力が\n必要かにゃ？　猫の手\n貸してあげるにゃ♪", 1635, 0, 1, 2, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "たいやきとクレープを\n合わせれば…\n新しい商売のニオイが\nするにゃ…！", 1636, 0, 1, 2, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふにゃあ、ねえねえ\n一緒にゴロゴロ\nしようにゃあ？", 1637, 0, 8, 2, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミと一緒にいると\n楽しくなってつい\nじゃれちゃうにゃ！", 1638, 0, 8, 2, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いい朝にゃ！\n顔を洗ってくるにゃ！", 1639, 1, 1, 2, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろおっひる～\nにゃーんか\n食べたい…", 1640, 2, 1, 2, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うーん、眠くなって\nきたにゃ。あたしは\n夜行性じゃないのにゃ", 1641, 3, 1, 2, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "にゃにゃ…\n髪が乱れてるにゃ", 1642, 0, 1, 3, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふっかふかにゃ～\n猫がねころん\nじゃうにゃ", 1643, 0, 1, 3, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これ、猫と匹敵する\nぐらいかわいいにゃ！", 1644, 0, 1, 3, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "猫でもこわくない\n優しい灯りにゃ！", 1645, 0, 1, 3, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽっかぽか\nしあわせな気分にゃ～", 1646, 0, 1, 3, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "雨の日でも運動\nできるのは、濡れ\nなくて便利だにゃ！", 1647, 0, 1, 3, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "美味しいにゃ～！\nこれ、朝昼晩\n食べたいにゃ！", 1648, 0, 1, 3, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "本を読んで\n猫の気持ちを\n勉強するのにゃ！", 1649, 0, 1, 3, 104602);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "内職手伝える人\nいないかしら？", 1651, 0, 1, 1, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "次の依頼は、\nこういう計画で…\nうん、完璧ね！", 1652, 0, 1, 1, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "次の特売セールに\n向けて、しっかり\n準備しないと！", 1653, 0, 1, 1, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "配達の後に売り子\n次に採取のバイト…\nうん、効率的ね", 1654, 0, 1, 1, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "一日に受ける\nバイトの数、もう少し\n増やしたいわね", 1655, 0, 1, 1, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "師匠として\n頼りにされたいし\nもっと頑張らなきゃ！", 1656, 0, 4, 1, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 1657, 0, 8, 1, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あら、\nちょうどよかった\n今から一緒に\nバイトでもどう？", 1658, 0, 1, 2, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "相談事かしら？\nそれくらいなら\n無料でいいわよ", 1659, 0, 1, 2, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "背後の気配なら\nすぐ分かるわ\n試してみる？", 1660, 0, 1, 2, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "道具やお金の管理は\n大丈夫？　手伝うから\nいつでも言って", 1661, 0, 1, 2, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 1662, 0, 4, 2, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ねえ、あの…\n私はキミにとって…\nいや、何でもないわ", 1663, 0, 8, 2, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！\n今日も朝から\nバイトよ！", 1664, 1, 1, 2, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼時ね。\n少し休憩したら、\nまた働くわよ！", 1665, 2, 1, 2, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 1666, 3, 1, 2, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "接客業の依頼が\nある時は、外見も\nキレイにしないとね", 1667, 0, 1, 3, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ～バイトで\n疲れたから癒される～", 1668, 0, 1, 3, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これを内職で\n作ったら\n儲かるかしら？", 1669, 0, 1, 3, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "リフレッシュできたわ\nこれでまた、バリバリ\n働けるわね！", 1670, 0, 1, 3, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "風邪を引いたら効率が\n落ちちゃうから、\n暖めないと！", 1671, 0, 1, 3, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "働き続けるには\n健康第一！　それには\n運動が一番よ", 1672, 0, 1, 3, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…\n腹が減っては\n戦ができぬ、よ！", 1673, 0, 1, 3, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "日々絶えず学んで、\n生活に活かすのよ！", 1674, 0, 1, 3, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "家計簿をつけなきゃ！\n覚えている時に\nやっておかないとね", 1676, 0, 1, 1, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "次の依頼は\nこういう計画で…\nうん、完璧ね！", 1677, 0, 1, 1, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ギルドの経費\nあとちょっとだけ\n削れそうね…", 1678, 0, 1, 1, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "少しでも時給のいい\nバイトがしたいけど\nなかなか\n出会えないのよ", 1679, 0, 1, 1, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "今度のバイトも\nなかなか大変そう\nね…腕が鳴るわ", 1680, 0, 1, 1, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 1681, 0, 8, 1, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私、どうしたんだろ？\n仕事中もずっと\n彼のこと考えてる…", 1682, 0, 8, 1, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この間はヘルプに\n来てくれてありがとう\n頼んで正解だったわ", 1683, 0, 1, 2, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "見つけた！　ちょうど\n頼みたいことが\nあるんだけど、いい？", 1684, 0, 1, 2, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今から\n休憩するところなの\n一緒にどう？", 1685, 0, 1, 2, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん？　どうしたの？\n私のことが\n気になるの？", 1686, 0, 1, 2, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…たまには甘えても\nいい？　私だって\n弱る時はあるのよ", 1687, 0, 8, 2, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 1688, 0, 8, 2, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！\nいい朝ね。一緒に\nランニングでもいく？", 1689, 1, 1, 2, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼時ね\n少し休憩したら\nまた働くわよ！", 1690, 2, 1, 2, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 1691, 3, 1, 2, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "女の子らしく…\nどうも忘れちゃう\nのよね", 1692, 0, 1, 3, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここで少し\n休んだら\nまたバイトよ！", 1693, 0, 1, 3, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これを内職で\n作ったら\n儲かるかしら？", 1694, 0, 1, 3, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "仕事から帰ってきて\nこういうのがあると\n素敵ね", 1695, 0, 1, 3, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "しっかり身体を\n温めて、血流を\nよくしなくっちゃ", 1696, 0, 1, 3, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "これで休憩中も\n無駄なく\n鍛えられるわ♪", 1697, 0, 1, 3, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…よく\n食べて、よく働く！\nそれが私のモットーよ", 1698, 0, 1, 3, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "日々絶えず学んで\n生活に活かすのよ！", 1699, 0, 1, 3, 104802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1701, 0, 1, 1, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…", 1702, 0, 1, 1, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！", 1703, 0, 1, 1, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "くんくん、\n弟くんのにおい…\n近くにいるね？", 1704, 0, 1, 1, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪", 1705, 0, 1, 1, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "この部屋を、\n私と弟くんの\n愛の巣に…", 1706, 0, 4, 1, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "はぁ～…弟くん\n禁断症状だよ～", 1707, 0, 8, 1, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～", 1708, 0, 1, 2, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？", 1709, 0, 1, 2, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "姉と弟の外出は\nデートって\nいうのかな？", 1710, 0, 1, 2, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "もう！\nイタズラする子には\nお姉ちゃんチョップ！", 1711, 0, 1, 2, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お姉ちゃんが\nぎゅ～ってして\nあげるね♪", 1712, 0, 4, 2, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？", 1713, 0, 8, 2, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね", 1714, 1, 1, 2, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "出かけるなら\n明るいうちに\n帰ってくるんだよ！", 1715, 2, 1, 2, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "まだ起きてるの？\nそれじゃあ、\nお姉ちゃんも\n夜更かししちゃお☆", 1716, 3, 1, 2, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "きれいなお姉ちゃん\n好きだよね♪", 1717, 0, 1, 3, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪", 1718, 0, 1, 3, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\nお姉ちゃんチョップ！", 1719, 0, 1, 3, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り、\n弟くん好きかな？", 1720, 0, 1, 3, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これ、弟くんみたいに\nあったかいね～", 1721, 0, 1, 3, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "ダイエットダイエット\nきれいなお姉ちゃんに\nならなくちゃ", 1722, 0, 1, 3, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あ、これ\n弟くんが好きな\n味付けだね！", 1723, 0, 1, 3, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "弟くんが読んでいいか\nお姉ちゃんが先に\n中を確認しなくちゃ！", 1724, 0, 1, 3, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1726, 0, 1, 1, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…", 1727, 0, 1, 1, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "弟くんのお友達は\nみんな私の妹だよ♪", 1728, 0, 1, 1, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！", 1729, 0, 1, 1, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はっ！\n弟くんが困ってる\n気がする！", 1730, 0, 1, 1, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "はぁ～…弟くん、\n禁断症状だよ～", 1731, 0, 8, 1, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪", 1732, 0, 8, 1, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お姉ちゃん\nキミのお願いなら\nなんでも聞いて\nあげちゃうぞっ", 1733, 0, 1, 2, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～", 1734, 0, 1, 2, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お姉ちゃんの胸に\n飛び込んでおいでっ♪", 1735, 0, 1, 2, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？", 1736, 0, 1, 2, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？", 1737, 0, 8, 2, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お風呂にする？\nごはんにする？\nそれとも…うふふ♪", 1738, 0, 8, 2, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね", 1739, 1, 1, 2, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お姉ちゃんが\nお昼ごはん\n作ってあげようか？", 1740, 2, 1, 2, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "眠れないの？\nお姉ちゃんが子守歌\n歌ってあげるね！", 1741, 3, 1, 2, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "弟くんを\n誘惑しちゃうぞ～♪", 1742, 0, 1, 3, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪", 1743, 0, 1, 3, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\nお姉ちゃんチョップ！", 1744, 0, 1, 3, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お肌に潤いが\nでてきたみたい～♪", 1745, 0, 1, 3, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これ、弟くんみたいに\nあったかいね～", 1746, 0, 1, 3, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "ダイエットダイエット\nきれいなお姉ちゃんに\nならなくちゃ", 1747, 0, 1, 3, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "弟くんの手作りなら\nもっとおいしくなると\n思うんだけどなぁ～", 1748, 0, 1, 3, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "弟くんをきちんと\n教育するために\nお姉ちゃんは勉強を\nかかさないのだ☆", 1749, 0, 1, 3, 104902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ん～、エレガントで\n大人なお部屋ね！\nアタシにぴったり！", 1751, 0, 1, 1, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "身長とバスト以外は\n完璧な大人\nなのになぁ～", 1752, 0, 1, 1, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アタシの大人コーデで\nあいつも夢中ね♪", 1753, 0, 1, 1, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "朝顔の観察したら\n理系女子になれる\nかしら？", 1754, 0, 1, 1, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "レディは、どんな時も\nおしとやかに…って\nアタシも騒ぎたいー！", 1755, 0, 1, 1, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "大人っぽい子が\n多いわね…アタシも\n負けてられないわ！", 1756, 0, 4, 1, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アタシが待ってる\nなんて、アイツは\n幸せものよねー", 1757, 0, 8, 1, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "わーい、アメだー♪\n食べる食べるー♪", 1758, 0, 1, 2, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "熱いハニーラテが\n飲みたーい！\n淹れてー淹れてー！", 1759, 0, 1, 2, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なによ？　もしかして\n好きな子にイタズラ\nしたくなるってやつ？", 1760, 0, 1, 2, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アタシに合う服\n雑誌で探そうっと！\nサイズじゃないわ、\nデザインとかの話よ！", 1761, 0, 1, 2, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ねーねー！\nアタシ、かわいい？\nかわいいわよね？", 1762, 0, 4, 2, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！", 1763, 0, 8, 2, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝のスキンケアは\n大事なの！", 1764, 1, 1, 2, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹すいたー\nダイエット\nやめちゃおうかなー", 1765, 2, 1, 2, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "エイジングケアを\nしないとねー", 1766, 3, 1, 2, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この角度のほうが\n大人っぽく見えるかな\nそれともこっちかしら", 1767, 0, 1, 3, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！", 1768, 0, 1, 3, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "か、かわいい♪　けど\n大人はこんなもの…\nでも、かわいいし～！", 1769, 0, 1, 3, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "オシャレ～♪\n大人なレディって\n感じよね♪", 1770, 0, 1, 3, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかーい♪\nここで宿題\nしようかしら？", 1771, 0, 1, 3, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "運動したら成長\nしないかしら？\n背とか胸とか…", 1772, 0, 1, 3, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食べすぎると\n太っちゃうな…\nでも、おいしいし～っ", 1773, 0, 1, 3, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？", 1774, 0, 1, 3, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "レディは、どんな時も\nおしとやかに…って\nアタシも騒ぎたいー！", 1776, 0, 1, 1, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "恋人にするなら\nイケメンか\nただイケよね～", 1777, 0, 1, 1, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もう少し背が欲しいな\n…もっと牛乳を\n飲まなくちゃ！", 1778, 0, 1, 1, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "朝顔の観察したら\n理系女子になれる\nかしら？", 1779, 0, 1, 1, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "こ、これは補習の\nお知らせプリント！\nアイツに見つかる前に\n隠さなくちゃ！", 1780, 0, 1, 1, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "アイツおっそいなー\n別に会いたいわけじゃ\nないけど…\n来ないと気になる…", 1781, 0, 8, 1, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アタシが待ってる\nなんて、アイツは\n幸せものよねー ", 1782, 0, 8, 1, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なーに？\nアタシに甘えたいの？", 1783, 0, 1, 2, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "アタシに合う服\n雑誌で探そうっと！\nサイズじゃないわ\nデザインとかの話よ！", 1784, 0, 1, 2, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "頭撫でないで！\nお子様みたいに\nあつかわないでって\n言ってるのに～！", 1785, 0, 1, 2, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "壁ドンの練習…\nあれ？　壁ドンって\n男がするんだっけ？", 1786, 0, 1, 2, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ねーねー！\nアタシ、かわいい？\nかわいいわよね？", 1787, 0, 8, 2, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！", 1788, 0, 8, 2, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "レディの朝は\n忙しいのよ", 1789, 1, 1, 2, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹すいたー\nダイエット\nやめちゃおうかなー", 1790, 2, 1, 2, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "エイジングケアを\nしないとねー", 1791, 3, 1, 2, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "身だしなみチェック\nオッケー！　これで\nいつアイツが来ても\n大丈夫ね！", 1792, 0, 1, 3, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！", 1793, 0, 1, 3, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あたしがもっと\nオシャレにかわいく\nしてあげようか？", 1794, 0, 1, 3, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "オシャレ～♪\n大人なレディって\n感じよね♪", 1795, 0, 1, 3, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかーい♪\nここで宿題\nしようかしら？", 1796, 0, 1, 3, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "運動したら成長\nしないかしら？\n背とか胸とか…", 1797, 0, 1, 3, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "レディは、食べ物にも\n気を使うのよ", 1798, 0, 1, 3, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？", 1799, 0, 1, 3, 105002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "魔法と科学\nどっちも極めて\nみせるわ", 1801, 0, 1, 1, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "仕事も片付いたし\n部屋で\n実験実験…♪", 1802, 0, 1, 1, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "たまった治療代の\n請求書を\nまとめないと…", 1803, 0, 1, 1, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "新薬が出来たし\nすぐに試したいけど…\n実験台がいないわ", 1804, 0, 1, 1, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "部屋にこもりすぎると\n曜日の感覚が\nなくなるわね", 1805, 0, 1, 1, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの子の記憶を\n取り戻せる薬…\n作れないものかしら", 1806, 0, 4, 1, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら", 1807, 0, 8, 1, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あら、ヒマなら\n薬草の整理を\n手伝って", 1808, 0, 1, 2, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もしかして実験に\n付き合ってくれるの？\nえ？　違う？", 1809, 0, 1, 2, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "具合が悪い？\nなら診てあげる\nまずは触診から…", 1810, 0, 1, 2, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "植物に興味あるの？\nなら教えてあげるわ\n色々とね…", 1811, 0, 1, 2, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？", 1812, 0, 4, 2, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも", 1813, 0, 8, 2, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お昼までに調合用の\n花を集めたいの\n手伝ってくれる？", 1814, 1, 1, 2, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あら、もうお昼？\nそろそろ一息\n入れましょうか", 1815, 2, 1, 2, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜も更けて来たわね\n私は朝まで実験だけど\n見学していく？", 1816, 3, 1, 2, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "医者たるもの\nいつだって\n清潔に…♪", 1817, 0, 1, 3, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いいわねこれ\n仮眠の時に\n使わせてもらうわ", 1818, 0, 1, 3, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぬいぐるみなら\n動物も…", 1819, 0, 1, 3, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…\n仕事場にも\n置いてみようかしら", 1820, 0, 1, 3, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここにいると\nついウトウト\nしちゃうわ…", 1821, 0, 1, 3, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "座ってる時間が多いと\n運動不足になるし\nたまにはいいわね", 1822, 0, 1, 3, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "研究していると\nつい食べるのを\n忘れちゃうのよね", 1823, 0, 1, 3, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "実験もいいけど\nいつか成果を\n本にしないと…", 1824, 0, 1, 3, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "徹夜はツラいけど\n集中すると時間の\n感覚がなくなって…", 1826, 0, 1, 1, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "痛みに悶える顔って\nどうしてあんなに\n興奮するのかしら？", 1827, 0, 1, 1, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "彼に罵られたら\nどんな気分かしら\n意外と快感かも？", 1828, 0, 1, 1, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "毒を薄めると\n薬になるのって\n今でも不思議だわ", 1829, 0, 1, 1, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "綺麗なバラには\nトゲがあるけど\n魅力の一つよね", 1830, 0, 1, 1, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "カレをさりげなく\n惚れさせる方法を\n研究するわよ…♪", 1831, 0, 8, 1, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら", 1832, 0, 8, 1, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "構って欲しいの？\nじゃあ、君の体を\n調べさせて？", 1833, 0, 1, 2, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "実験に付き合って\n大丈夫よ、試すのは\nただの栄養剤だから", 1834, 0, 1, 2, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "欲しい薬が\nあったら言ってね\n調合してみるから", 1835, 0, 1, 2, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おしおきされたいの？\nキミにだったら\nいつでもしてあげる", 1836, 0, 1, 2, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？", 1837, 0, 8, 2, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも", 1838, 0, 8, 2, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝しか取れない\n植物があるの\n採取しに行くわよ", 1839, 1, 1, 2, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼時ってやけに\n眠たくなるわよね\n…調べたくなるわ", 1840, 2, 1, 2, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日くらいは\nゆっくり眠りたいわ\n…キミと一緒にね", 1841, 3, 1, 2, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "身なりについて\n研究するのも\n楽しそうね", 1842, 0, 1, 3, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休息に必要な道具は\n妥協せずに選ぶ！\nこれだけは譲れないわ", 1843, 0, 1, 3, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "たまにはこういう\n可愛らしいものに\n触れないとね♪", 1844, 0, 1, 3, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…\n仕事場にも\n置いてみようかしら", 1845, 0, 1, 3, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "仕事がなかったら\nこのまますーっと\n眠りたいのに…", 1846, 0, 1, 3, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "運動しないと\n体型の維持が…", 1847, 0, 1, 3, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "適度な食事も\n大切よね", 1848, 0, 1, 3, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "まさか私が\n恋愛読本を読む\n日が来るなんて…", 1849, 0, 1, 3, 105102);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ぺっぺっ！\n…い、いけないっ！", 1851, 0, 1, 1, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いっけな～い！\nひづめで床に傷が！", 1852, 0, 1, 1, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "太っちゃったかも～！\n伐採でダイエット\nしなくっちゃ！", 1853, 0, 1, 1, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "きちんと生活すると\n毛づやが良くなる\nみたいなのよね～", 1854, 0, 1, 1, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "みんな、体重\nどれくらいなのかな？", 1855, 0, 1, 1, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう", 1856, 0, 4, 1, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつか人間の女の子\nみたいなデート、\nしてみたいな～♪", 1857, 0, 8, 1, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私ね「どこにでもいる\n普通の女の子」って\n言葉が憧れなんだ～♪", 1858, 0, 1, 2, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "チャームポイント？\n自分では分からない\nけど…まつげかなぁ？", 1859, 0, 1, 2, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "リマリマ～♪\nはっ！？\nわ、私ったら今何を？", 1860, 0, 1, 2, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "力仕事ならまかせて！", 1861, 0, 1, 2, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪", 1862, 0, 4, 2, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？", 1863, 0, 8, 2, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今朝は寝癖がひどいわ\nしっぽの辺りとか～", 1864, 1, 1, 2, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ランチは\nおしゃれなカフェで\nしてみたいな～♪", 1865, 2, 1, 2, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お肌のケアに\nパックしながら\n寝ようかな～", 1866, 3, 1, 2, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "やだっ、\nまた寝ぐせついてる！\n直さないと！", 1867, 0, 1, 3, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ミシッっていった！\n私、重すぎるかも！？", 1868, 0, 1, 3, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ！　あなたも\n美人さんね～♪", 1869, 0, 1, 3, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はぁ、まったり…\n四足歩行しちゃい\nそうだわ…", 1870, 0, 1, 3, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったか～い♪\n…私、毛皮だから\n暑すぎるかも", 1871, 0, 1, 3, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "な、なんだか野生に\n帰っちゃいそう！", 1872, 0, 1, 3, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ぱくぱく、もぐもぐ、\nぺっぺっ…\nやだ、はしたない！", 1873, 0, 1, 3, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～", 1874, 0, 1, 3, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "素敵ね～、居るだけで\n女子力があがりそうな\nお部屋だわ～", 1876, 0, 1, 1, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私、大丈夫かしら？\n他の子に怖がられたり\nしないかな…？", 1877, 0, 1, 1, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "動物苑…って\n嫌なギルド名ね…", 1878, 0, 1, 1, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "好き、嫌い、好き…\nあっ！　うっかりして\n花占いのお花\n食べちゃった！", 1879, 0, 1, 1, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここ、女の子らしい\nものでいっぱいね～！\nときめいちゃうわ～♪", 1880, 0, 1, 1, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう", 1881, 0, 8, 1, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人が\n来てくれるまで薪割り\nでもしてよっかな？", 1882, 0, 8, 1, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "一緒にお出かけ？\nうれしいけど…\n心の準備が！\nはわわわ！", 1883, 0, 1, 2, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どうしたの？\n急に抱きついてきて…\n癒されたいの？", 1884, 0, 1, 2, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぺっぺっ！\n…い、いけないっ！", 1885, 0, 1, 2, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "メタモルアップルを\nここで食べたら、\nみんな驚くわよね", 1886, 0, 1, 2, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？", 1887, 0, 8, 2, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪", 1888, 0, 8, 2, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今朝は寝癖がひどいわ\nしっぽの辺りとか～", 1889, 1, 1, 2, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ダイエット中だから\nお昼は抜いてるの～", 1890, 2, 1, 2, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お肌のケアに\nパックしながら\n寝ようかな～", 1891, 3, 1, 2, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちゃんとかわいく\nしてないと刈られ…\n狩られちゃうもんね！", 1892, 0, 1, 3, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ミシッっていった！\n私、重すぎるかも！？", 1893, 0, 1, 3, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ！　あなたも\n美人さんね～♪", 1894, 0, 1, 3, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り～\n森の中にいるみたいに\nとっても落ち着く～", 1895, 0, 1, 3, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "素敵～♪　…\nきゃっ！　私の毛が\nたいへんなことに～！", 1896, 0, 1, 3, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "な、なんだか野生に\n帰っちゃいそう！", 1897, 0, 1, 3, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "何を食べるかより\n誰と食べるかが\n大事なのよね", 1898, 0, 1, 3, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～", 1899, 0, 1, 3, 105202);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ヴァイスフリューゲル\nを盛り上げる方法、\n共に語らおう！", 1901, 0, 1, 1, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私は子供ではない…！\nが、お菓子は\nいただこう！", 1902, 0, 1, 1, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "部屋はきちんと\n片づけておかなくては\n部屋の汚れは\n心の汚れだ", 1903, 0, 1, 1, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "むむむ…明日\n目が覚めたら、身長が\n伸びていないものか…", 1904, 0, 1, 1, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…", 1905, 0, 1, 1, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつとの新たな\n鍛錬が\n待ち遠しいな…！", 1906, 0, 4, 1, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "最近、あいつと\n過ごしていて、毎日が\n充実しているな…", 1907, 0, 8, 1, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "軍人の本分は日々の\n研鑽にあるからな。\n今日も鍛錬に\n行かないか？", 1908, 0, 1, 2, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…", 1909, 0, 1, 2, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "貴公にも、飴をくれて\nやろうか？\nあまいぞ～！\n美味しいぞ～！", 1910, 0, 1, 2, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "私ともっと高く、\n共に飛ぼう！", 1911, 0, 1, 2, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "貴公は、本当に頼りに\nなる男だな…いや、\nふとそう思っただけだ", 1912, 0, 4, 2, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "貴公と共にいられる\nことは私の喜びだ。\nこれからも\nよろしく頼むぞ", 1913, 0, 8, 2, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うむ、いい朝だ。\n本国の夜明けを\n思い出してしまうな！", 1914, 1, 1, 2, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろ昼食に\nするか。腹が減っては\n戦はできないからな", 1915, 2, 1, 2, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわああ…私は子供\nではないが…眠い時は\n眠いのだ…", 1916, 3, 1, 2, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "身だしなみは、心の\n在りようを映すから\n気をつけなくてはな", 1917, 0, 1, 3, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…", 1918, 0, 1, 3, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うむ…このかわいさ…\n本国に持って\n帰りたい…", 1919, 0, 1, 3, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "このともし火、戦いに\n明け暮れる我らの心を\n癒すものだな…", 1920, 0, 1, 3, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！", 1921, 0, 1, 3, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "うおおおおおっ！\n鍛錬、鍛錬、\n鍛錬っ！！", 1922, 0, 1, 3, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いつ戦いになっても\n困らぬように、\n腹八分目に\nしておくのだ！", 1923, 0, 1, 3, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "これを読んで、新たな\n戦術を編み出すぞっ！", 1924, 0, 1, 3, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "たまには掃除でも\nするか。部屋が\n綺麗になるのは\n喜ばしいことだ", 1926, 0, 1, 1, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "部屋の中では\n剣を振り回せないのが\n玉に瑕だな…", 1927, 0, 1, 1, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…", 1928, 0, 1, 1, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…", 1929, 0, 1, 1, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "家庭を守れない者が\n国を守れるはずが\nない。この部屋も\n私が守るぞ！", 1930, 0, 1, 1, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつは今頃、何を\nしているのだろうな…\nふふっ", 1931, 0, 8, 1, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あいつと会える日が\nこんなにも待ち遠しく\nなるとはな…", 1932, 0, 8, 1, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "軍人の本分は日々の\n研鑽にあるからな\n今日も鍛錬に\n行かないか？", 1933, 0, 1, 2, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おお、今日も鍛錬の\n時間だったか！\nすまないな\nすぐ行く！", 1934, 0, 1, 2, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私は子供ではない！\nが…たまには童心に\n帰りたい時もある…", 1935, 0, 1, 2, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "貴公にも、飴を\nくれてやろうか？\nあまいぞ～！\n美味しいぞ～！", 1936, 0, 1, 2, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私と歩きたいのか…？\nそうだな。二人で\n散歩でも行こうか", 1937, 0, 8, 2, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "貴公と共にいられる\nことは私の喜びだ\nこれからも\nよろしく頼むぞ", 1938, 0, 8, 2, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うむ、いい朝だ\n本国の夜明けを\n思い出してしまうな！", 1939, 1, 1, 2, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろ昼時だな\n鍛錬の手を緩めて\n昼食にするか", 1940, 2, 1, 2, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "寝る前に…あと少し\nだけ、鍛錬を…", 1941, 3, 1, 2, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ヴァイス\nフリューゲルの一員と\nして恥ずかしくないよう\n身なりを整えなくては", 1942, 0, 1, 3, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…", 1943, 0, 1, 3, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うむ…このかわいさ…\n本国に持って\n帰りたい…", 1944, 0, 1, 3, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "このともし火\n戦いに明け暮れる\n我らの心を\n癒すものだな…", 1945, 0, 1, 3, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！", 1946, 0, 1, 3, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "うおおおおおっ！\n鍛錬、鍛錬\n鍛錬っ！！", 1947, 0, 1, 3, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いつ戦いになっても\n困らぬように\n腹八分目に\nしておくのだ！", 1948, 0, 1, 3, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "うむ…脳細胞が\n活性化してきたぞ\n読書は大事だな", 1949, 0, 1, 3, 105302);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私たちの騎空艇\nどんなデザインに\nしよう…？", 1951, 0, 1, 1, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "団員募集の\nポスター\n作ろうっと♪", 1952, 0, 1, 1, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "父さん…\n今頃どこで\n何してるんだろ？", 1953, 0, 1, 1, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "騎空艇に乗って、\n誰もいったことがない\n場所を見つけたいな", 1954, 0, 1, 1, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "父さん以上の\n世界一の\n騎空士になりたい！", 1955, 0, 1, 1, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "仲間と行く空の旅…\n何度想像しても\nドキドキするなぁ", 1956, 0, 4, 1, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "父さん…\n私にもね、大切な\n仲間ができたよ", 1957, 0, 8, 1, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "仕事の依頼？\nすぐに支度\nしてくるね！", 1958, 0, 1, 2, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ねえねえ！\n団員募集のポスター\n一緒に作ろうよ！", 1959, 0, 1, 2, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なーにー？\nどうしたの？\n今呼んだよね？", 1960, 0, 1, 2, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今は休憩中だよ？\nだからあなたも\nゆっくりしてて", 1961, 0, 1, 2, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私にとってあなたは\nとっても頼りになる、\n自慢の団員だよ！", 1962, 0, 4, 2, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お父さんに会えたら、\n大切な仲間として\nあなたを紹介するね！", 1963, 0, 8, 2, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！\n体の調子はどう？\n今日は頑張れそう？", 1964, 1, 1, 2, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ねえねえ、お昼\n食べに行こうよ！\nお腹空いちゃった", 1965, 2, 1, 2, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…あれ？\nおしゃべりしてたら\nもうこんな時間？", 1966, 3, 1, 2, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうせならオシャレな\n騎空士って\n呼ばれたいな", 1967, 0, 1, 3, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅ、疲れた～…\nちょっとだけ\n休んじゃおっと", 1968, 0, 1, 3, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "よし！　キミは\n今から団長代理だ！\n…なんてね♪", 1969, 0, 1, 3, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り～♪\n気持ちが\n落ち着く～…", 1970, 0, 1, 3, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これって\n騎空艇に\n置けるかな…？", 1971, 0, 1, 3, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "どんな仕事でも\nこなせるような\n体力がないとね…！", 1972, 0, 1, 3, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あむっ…うん！\n美味しい～！\n今度作ってみよう♪", 1973, 0, 1, 3, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "空を冒険するには\n色んなことを\n知っておかないと…", 1974, 0, 1, 3, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…戻らなくなったよ\nどうすれば元に\n戻る…？", 1976, 0, 1, 1, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "暇だよ…\nどこかに強い人は\nいないか？", 1977, 0, 1, 1, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ジョブチェンジ！\n…叫んでも\n戻らないよ", 1978, 0, 1, 1, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今のうちに、\n魔物退治の\n仕事に行くね！", 1979, 0, 1, 1, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ハァ～…\nうん、気の巡りは\n問題ないね！", 1980, 0, 1, 1, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私の力の源は\n仲間との\n絆だよ！", 1981, 0, 8, 1, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつかこの拳を\n空を越えた、星まで\n届かせたいね", 1982, 0, 8, 1, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "功夫が足りない人は\nどうすればいいか？\nもちろん修行だよ！", 1983, 0, 1, 2, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私はいつも通りに\n喋ってるつもり\nだよ？", 1984, 0, 1, 2, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうした？\nもしかして手合せ\nしたいか？", 1985, 0, 1, 2, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "騎空士としても\n拳法家としても\n目指すは世界一ね！", 1986, 0, 1, 2, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "背中はあなたに\n預けたよ！\nよろしくね！", 1987, 0, 8, 2, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたと一緒なら\nきっと、今よりもっと\n強くなれるよ！", 1988, 0, 8, 2, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちゃんと起きてるか？\n寝ぼけてたら\nダメよ？", 1989, 1, 1, 2, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "腹減ったね…\nなにか食べに\n行くよ！", 1990, 2, 1, 2, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "修行のしすぎは\n良くないよ？\n気をつけるね", 1991, 3, 1, 2, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "美しい技は\n美しい体が\nあってこそ！", 1992, 0, 1, 3, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "よいしょっと…\nちょっとのんびり\nさせてもらうよ", 1993, 0, 1, 3, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…練習に\n使うのはさすがに\n可哀そうね", 1994, 0, 1, 3, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これは…\n瞑想の時にも\n使ってみたいね", 1995, 0, 1, 3, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "出来ればもっと\n熱いほうが\n嬉しいよ", 1996, 0, 1, 3, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "ここでも\n修行出来るなんて\n最高だよ！", 1997, 0, 1, 3, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "気力の源は体力！\n体力の源は\n健康とご飯！", 1998, 0, 1, 3, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "んー…\n難しいことは\nわかんないよ！", 1999, 0, 1, 3, 105702);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "わたしたちの\nギルドハウスへ\nようこそ～！", 2001, 0, 1, 1, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぐるるる～…\nあ、お腹が\n鳴っちゃいました…", 2002, 0, 1, 1, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ん？\n食べ物のにおい？", 2003, 0, 1, 1, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "みんなと仲良く食卓を\n囲みたいですね～", 2004, 0, 1, 1, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この部屋が、わたしの\n帰る場所です♪", 2005, 0, 1, 1, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人を見ると\n胸が満たされます～\nお腹は空いてますが！", 2006, 0, 4, 1, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人、\n大食いの子って\n嫌いかな？", 2007, 0, 8, 1, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "食べもの、くれるん\nですか？　わーい！\n恋しちゃいそう♪", 2008, 0, 1, 2, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "つ、つまみ食いなんて\nしてませんよ？\nこれは味見です！", 2009, 0, 1, 2, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おやつは別腹、\nごはんも別腹、\n魔物も別腹～", 2010, 0, 1, 2, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "好きなものを、\n好きな人達と食べる！\n最高の贅沢ですね☆", 2011, 0, 1, 2, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたは、\nごはん王子ですね～", 2012, 0, 4, 2, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "大好きです～\n愛してます～\nえへへ～♪", 2013, 0, 8, 2, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝ごはんも終わったし\n早速ブランチを\n食べませんか？", 2014, 1, 1, 2, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯、\nおいしかったですね～\nそれじゃあ、そろそろ\nおやつにしましょう☆", 2015, 2, 1, 2, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お夕飯も、晩ごはんも\n食べたし…さぁ！\nお夜食の時間ですよ☆", 2016, 3, 1, 2, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "身だしなみ、\n身だしなみ…\nきちんとしないとね♪", 2017, 0, 1, 3, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふい～\n消化中です～", 2018, 0, 1, 3, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おいしそ…\nか、かわいいです～", 2019, 0, 1, 3, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りですね～\n空気までおいしそう～\nじゅるり♪", 2020, 0, 1, 3, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ほっかほか～♪\n魔物の丸焼きが\n作れちゃいますね！", 2021, 0, 1, 3, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "走って食べて！\n走って食べて！\n\この無限ループです！", 2022, 0, 1, 3, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いくつでも\n食べられますよ！\n幸せ～☆", 2023, 0, 1, 3, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "料理の絵を\n見ているだけで、\nよ、よだれが～", 2024, 0, 1, 3, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この部屋が、わたしの\n帰る場所です♪", 2026, 0, 1, 1, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ギルドハウス\nどんどん素敵に\nなっていくな～♪", 2027, 0, 1, 1, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "「やばい」とか\n「おいっす」とか…\n民の言葉って難しい", 2028, 0, 1, 1, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お菓子の家に\n住みたいな～", 2029, 0, 1, 1, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あ、頼んでた出前が\n届いたかな？", 2030, 0, 1, 1, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "大切な人がいて\n大切な場所がある\nすごく幸せです♪", 2031, 0, 8, 1, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人\n大食いの子って\n嫌いかな？", 2032, 0, 8, 1, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ごはんに行きますか？\n作りましょうか？\n店屋物もいいですね～", 2033, 0, 1, 2, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "モグモグ…\nあげませんよ～", 2034, 0, 1, 2, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おやつは別腹\nごはんも別腹\n魔物も別腹～", 2035, 0, 1, 2, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "好きなものを\n好きな人達と食べる！\n最高の贅沢ですね☆", 2036, 0, 1, 2, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "大好きです～\n愛してます～\nえへへ～♪", 2037, 0, 8, 2, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "わたし食べても\n太らないんです♪\nほらほら～触って\nみてくださいよ～", 2038, 0, 8, 2, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝ごはんも終わったし\n早速ブランチを\n食べませんか？", 2039, 1, 1, 2, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯\nおいしかったですね～\nそれじゃあ、そろそろ\nおやつにしましょう☆", 2040, 2, 1, 2, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お夕飯も、晩ごはんも\n食べたし～。さぁ！\nお夜食の時間ですよ☆", 2041, 3, 1, 2, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お姫さまみたいに\nきれいに\nならないと…", 2042, 0, 1, 3, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "のんびりしていても\nお腹がすいちゃうん\nですよね～", 2043, 0, 1, 3, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おいしそ…\nか、かわいいです～", 2044, 0, 1, 3, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アップル系、ピーチ系\nオレンジ系…\n香りも色々ですね～", 2045, 0, 1, 3, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここでお魚を\n焼けたら\n最高ですね～♪", 2046, 0, 1, 3, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "身体も鍛えなきゃ～！\nお腹がすいちゃいます\nけど…", 2047, 0, 1, 3, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐもぐもぐもぐ\nもぐもぐもぐもぐもぐ\nもぐもぐもぐもぐ…", 2048, 0, 1, 3, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "流行語発表…\nこんな言葉遣いが！\nやばいですね", 2049, 0, 1, 3, 105802);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いろいろ美味しいもの\n食べられるし…\nけっこう幸せかも", 2051, 0, 1, 1, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "んーー、あたし\nなんで、このギルドに\n入っちゃったんだろ？", 2052, 0, 1, 1, 106001);
