INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この部屋のどこかに、\nあいつの秘密が\n隠されてるかも？", 2054, 0, 1, 1, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ま、まずいわ…\nギルド活動、\nけっこう楽しい♪", 2055, 0, 1, 1, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつを監視してる\nと…な、なんか\n変な気分", 2056, 0, 4, 1, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "主さま…\nだ、誰も聞いてない\nわよね！？", 2057, 0, 8, 1, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "気まぐれは\nチャームポイント\nみたいなもんよ", 2058, 0, 1, 2, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うひゃっ！？\nど、どうしてあんたは\nいつも驚かせるのよ！", 2059, 0, 1, 2, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぎゃー！\n虫もって近づくなー！", 2060, 0, 1, 2, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この部屋って、\n野良猫を拾ってきたら\nだめかな？", 2061, 0, 1, 2, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "遊びにいくわよ！\nあんたはあたしの\n言うとおりにすれば\nいいの♪", 2062, 0, 4, 2, 106001);
