INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "特訓特訓！\nあたしは\nやればできる！", 2072, 0, 1, 3, 106001);
