INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これ、あたしの能力で\n操れないかな？", 2094, 0, 1, 3, 106002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あたし、みんなや\nあいつと同じ香りを\n身に着けてるんだ…", 2095, 0, 1, 3, 106002);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うっ、のんびり\nしたくなる…\n特訓しなきゃ\nいけないのに～", 2096, 0, 1, 3, 106002);
