INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この空間は主さまの\n香りがします\n…ふふふ♪", 2101, 0, 1, 1, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "炊事、洗濯、お掃除、\nお買いものもしなくて\nはいけませんね", 2102, 0, 1, 1, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アメスさまへの、\nお祈りができそうな\n場所は…", 2103, 0, 1, 1, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "さすが都会…\nおいしいものが\nたくさんあるのですね", 2104, 0, 1, 1, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "主さまが不自由なく\n使える部屋に\nしなくては…", 2105, 0, 1, 1, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "できるなら…\n主さまと二人だけの\n部屋の方が…", 2106, 0, 4, 1, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "主さまの隣には\nわたくしが…\nわたくしの隣には、\n主さまが…幸せです", 2107, 0, 8, 1, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "わたくし、背が伸び\nましたでしょうか？\n…そうですか", 2108, 0, 1, 2, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もしお疲れでしたら\n肩でも\nお揉みしましょうか？", 2109, 0, 1, 2, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "主さま、なにか\nしてほしいことは\nありませんか？\n欲しいものは？", 2110, 0, 1, 2, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今日のおこづかいです\n何かおいしいものを\n召し上がってください", 2111, 0, 1, 2, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "主さまのおてて\n温かいですね…♪", 2112, 0, 4, 2, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "主さまのおそばに\nいられて、わたくし、\n嬉しいです…", 2113, 0, 8, 2, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます。\n洗濯をしなければ…", 2114, 1, 1, 2, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろお昼ですね。\nおいしいものを\n食べましょう", 2115, 2, 1, 2, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おやすみになる時は、\nお声をかけてください\nお供致します", 2116, 3, 1, 2, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もう少し…\nおっきくなりたい\nです", 2117, 0, 1, 3, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このふかふかの優しさ\n主さまのようです", 2118, 0, 1, 3, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\n主さまにそっくり♪", 2119, 0, 1, 3, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "故郷の香りとは\n違いますが、これも\n心地よいものです…", 2120, 0, 1, 3, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここで洗濯物を\n乾かせるでしょうか", 2121, 0, 1, 3, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "都会の人々は\nこんなふうに\n運動を…！？", 2122, 0, 1, 3, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これは…主さまにも\n食べさせて\n差し上げたい…\nあーんって♪", 2123, 0, 1, 3, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "よく学んで、\n主さまのお役に\n立たなければ", 2124, 0, 1, 3, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "主さまがいつ戻って\n来ても平気なよう\n部屋を綺麗に保たねば", 2126, 0, 1, 1, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "節約のためにも\n自家菜園などするのは\nどうでしょう…　", 2127, 0, 1, 1, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アメスさまへの\nお祈りができそうな\n場所は…", 2128, 0, 1, 1, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "瞑想をすると\n心が安らぎます…", 2129, 0, 1, 1, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "都会の方の身なりを\n勉強した方が\n良いのでしょうか？", 2130, 0, 1, 1, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "わたくしの居場所は\n主さまのお傍です\nずっと、ずっと…♪", 2131, 0, 8, 1, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "主さまの隣には\nわたくしが…\nわたくしの隣には\n主さまが…幸せです", 2132, 0, 8, 1, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "主さま、なにか\nしてほしいことは\nありませんか？\n欲しいものは？", 2133, 0, 1, 2, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わたくし、背が伸び\nましたでしょうか？\n…そうですか", 2134, 0, 1, 2, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お出かけですか？\nわたくしもお供\nいたします", 2135, 0, 1, 2, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ひゃん！\n主さま…\nいじわるです", 2136, 0, 1, 2, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "主さま、なにか御用は\nありませんか？\nわたくし、主さまの\nお役にたちたいのです", 2137, 0, 8, 2, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "主さまの優しさに\nわたくしはいつも\n癒されています…", 2138, 0, 8, 2, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます♪\n主さまの可愛らしい\n寝顔、堪能致しました", 2139, 1, 1, 2, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "のんびりした時間帯\nですね…ふぁ～…\nし、失礼致しました", 2140, 2, 1, 2, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふむ、都会は夜でも\nこんなにも、にぎやか\nなのですね", 2141, 3, 1, 2, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "主さまに会う前に\n身なりを整えなくては\nいけませんね", 2142, 0, 1, 3, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このふかふかの優しさ\n主さまのようです", 2143, 0, 1, 3, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\n主さまにそっくり♪", 2144, 0, 1, 3, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この心地よさ…\n主さまのようです♪", 2145, 0, 1, 3, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここで洗濯物を\n乾かせるでしょうか　", 2146, 0, 1, 3, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 6, "はぁっはぁっはぁっ\n…すべては\n主さまのため…", 2147, 0, 1, 3, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "都会の味…\nとてもおいしいです\n…もぐもぐもぐ", 2148, 0, 1, 3, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "都会のことを\n学ばないと…\nふむふむ", 2149, 0, 1, 3, 105902);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふぁ～…あっ\n見られちゃい\nましたか？", 2151, 0, 1, 2, 190801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ギルドハウスの\n使い心地は\nどうですか？", 2152, 0, 1, 2, 190801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ご用があれば\nなんでも言って\nくださいね～♪", 2153, 0, 1, 2, 190801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ときどきみなさんと\nクエストに行きたいな\nって思っちゃいます", 2154, 0, 1, 2, 190801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます！\nお掃除の方、\nはじめていきますね", 2155, 1, 1, 2, 190801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "皆さん、お昼ごはんの\nご要望がありましたら\n用意致しますよ♪", 2156, 2, 1, 2, 190801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ここは夜でも\nにぎやかですね", 2157, 3, 1, 2, 190801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…\n少しうとうと\nしてしまった", 2158, 0, 1, 1, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "室内だし兜を脱ぐか\n…いや\nやはりやめておこう", 2159, 0, 1, 1, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "部屋にいると\n鎧が蒸し暑くなるが\n我慢せねば…", 2160, 0, 1, 1, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "仕事が門番だからか\n部屋にいても\nじっとしてしまう…", 2161, 0, 1, 1, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "少年と会話したことを\n思いだすと\n自然と楽しくなるな", 2162, 0, 1, 1, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "少年のことを考えると\n顔がにやけてしまう", 2163, 0, 4, 1, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "少年は今頃\n平和に過ごせて\nいるかな…", 2164, 0, 8, 1, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ん？　悪いが\n兜は脱がないぞ", 2165, 0, 1, 2, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私と遊びたいのか？\nそう言われても\n何をしていいやら…", 2166, 0, 1, 2, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "鎧が重くないかって？\n大丈夫。けっこう\n鍛えているからな", 2167, 0, 1, 2, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "少年、寒くはないか？\nいや自分がこうなので\n人が薄着に見えてね", 2168, 0, 1, 2, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "君といると、兜の中が\nいつもより暑いんだ", 2169, 0, 4, 2, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私としゃべりたい？\n物好きだな\nでも、嬉しいよ", 2170, 0, 8, 2, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "早いな少年\nえ？　私の仕事に\n合わせてくれたのか", 2171, 1, 1, 2, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼食の誘い？\n嬉しいけど\n人前では食べないんだ", 2172, 2, 1, 2, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "王宮騎士団の\n日報を書かなければ…\n『何事もなし』、と", 2173, 3, 1, 2, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "鎧を着ているから\n感触が分かりづらい\nのが残念だ…", 2175, 0, 1, 3, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "か、かわいいな…\n私には似合わないが\nぎゅ…ってしよう", 2176, 0, 1, 3, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "良い香りだ…\n普段はどうしても\n鉄くさくなるからな", 2177, 0, 1, 3, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "わかっていたけど\n鎧を着たまま暖炉に\nあたると暑い…", 2178, 0, 1, 3, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "兜を脱がずに食べる\nうん、段々コツが\n掴めてきた…", 2180, 0, 1, 3, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "兜があっても\n意外と本くらいは\n難なく読めるんだ", 2181, 0, 1, 3, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "居心地よくて\nゴロゴロしちゃうよ～\n…いつも通りだね", 2183, 0, 1, 1, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ドングリの木\n近くに生えてない？", 2184, 0, 1, 1, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "快適な寝床があれば\nそれだけで幸せだねぇ", 2185, 0, 1, 1, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あたしと一緒に\nだらけてくれる人が\nいそうだねぇ", 2186, 0, 1, 1, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここなら牧場よりも\n速く配達が\n届きそうだね～", 2187, 0, 1, 1, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんパン買ったし\nあいつにも\n分けてあげよう", 2188, 0, 4, 1, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あいつと一緒に\nだらけられたら\n最高に幸せだね", 2189, 0, 8, 1, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ドングリでも\nつまみながら\n一緒にゲームしようよ", 2190, 0, 1, 2, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "横になりたいから\n枕になっておくれよ～\nあんたあったかいしさ", 2191, 0, 1, 2, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ドングリあげるから\nあんパン買ってきて～", 2192, 0, 1, 2, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "う～\n疲れちゃったよ～\nおんぶして運んで～", 2193, 0, 1, 2, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんたといると\nリア充って\n感じがするよ", 2194, 0, 4, 2, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんたが一生\n世話してくれたら\n人生安泰なんだけどね", 2195, 0, 8, 2, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふわ～っ…\nおはよう…あたしは\nまだ眠いよ", 2196, 1, 1, 2, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろお昼寝でも\nしたい気分だねぇ", 2197, 2, 1, 2, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "徹夜でゲームするけど\nあんたもどうだい？\nあたしは強いよ", 2198, 3, 1, 2, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ…だめだこれ。\n気持ち良くて\n落ちそう…", 2200, 0, 1, 3, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいものに\n囲まれて寝るのも\nよさそうだねぇ…", 2201, 0, 1, 3, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "心身ともに\nリラックスした状態で\nぐうたら出来そうだね", 2202, 0, 1, 3, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふい～…\nごくらくごくらく…\n暖かいねぇ", 2203, 0, 1, 3, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食べてすぐ寝ると\n牛になるって\n本当なのかな？", 2205, 0, 1, 3, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "おー！　この本なら\nあたしも居眠りせずに\n読めそうだよ", 2206, 0, 1, 3, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ランドソル…\nおっきな街だなぁ…", 2208, 0, 1, 1, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ロザリア…\nきっと、いるよね？", 2209, 0, 1, 1, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "最近、弓の練習\nサボっちゃってるな…", 2210, 0, 1, 1, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今日の私は\n森番じゃなくて\n家番だよ！", 2211, 0, 1, 1, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ちょっとだけ\n慣れてきたかも？", 2212, 0, 1, 1, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "いつか、\nあの人と一緒に…", 2213, 0, 4, 1, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…なんか最近、\nあの人のこと\nばっかり…", 2214, 0, 8, 1, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もしよかったら\n街に出かけない？", 2215, 0, 1, 2, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この部屋、\n妖精さんも\n気に入るかも！", 2216, 0, 1, 2, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日は\nなににしよっか？", 2217, 0, 1, 2, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今日はどこ行く？", 2218, 0, 1, 2, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "たまには二人で…\nな、なんちゃって！", 2219, 0, 4, 2, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "最近、\nずっと楽しいんだ！\nあなたのおかげかな", 2220, 0, 8, 2, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！\n今日も一緒に\n頑張ろうね！", 2221, 1, 1, 2, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼はどうする？\nあなたのオススメに\n連れて行って欲しいな", 2222, 2, 1, 2, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ランドソルは\n夜でも賑やかだね！", 2223, 3, 1, 2, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わぁっ！\nすっごく\nふわふわだよ！", 2225, 0, 1, 3, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわい～！\nぎゅってしたく\nなっちゃうかも！", 2226, 0, 1, 3, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "くんくん\nなんか…いい匂い？", 2227, 0, 1, 3, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "すっごいなー\nあったかいなー！", 2228, 0, 1, 3, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "わぁっ、おいしい！\nもっと食べたい\nかも…！", 2230, 0, 1, 3, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "も、文字は苦手…\nでも、頑張らないと\nだよね…！", 2231, 0, 1, 3, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "にんじんとピーマンを\n食べないでいい方法\nないかな…", 2233, 0, 1, 1, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "カップケーキが\n食べたいな…", 2234, 0, 1, 1, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "予習が終わりました！\nさて、次は復習を\nしないと…", 2235, 0, 1, 1, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あの人の部屋にいる\n私って…もしかして\nふしんしゃなんじゃ？", 2236, 0, 1, 1, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "男の人は、みんな\nへんたいだと\n聞きました…", 2237, 0, 1, 1, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人に、一緒に\n遊んでほしいけど…\nな、なんていえば？", 2238, 0, 4, 1, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "早く大人になりたいな\n…あの人と同じくらい", 2239, 0, 8, 1, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ぼ、防犯魔石を\n鳴らしますよ！？", 2240, 0, 1, 2, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "へんたい！？　…\nあ、あなたでしたか～\nやっぱりへんたーい！", 2241, 0, 1, 2, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これ宿題です\nやっておいて\nくださいね", 2242, 0, 1, 2, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あ、遅刻ですよ\n待っていたんですから", 2243, 0, 1, 2, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "にらめっこですか？\nあ、あなたの前で変顔\nするのはちょっと…", 2244, 0, 4, 2, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの…何歳まで\n子供だと思いますか？", 2245, 0, 8, 2, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "顔を洗って、着替えて\n朝ごはんを食べて、\n歯を磨いて…", 2246, 1, 1, 2, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "て、鉄棒の練習！？　\nほ、他のことを\nしませんか？", 2247, 2, 1, 2, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ね、眠くないです\n子供ではありません\nから…ふわぁ", 2248, 3, 1, 2, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ひと休みしよっと\n………うん、\nひと休みおしまい♪", 2250, 0, 1, 3, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "つ、つぶらな瞳には\n弱いんです", 2251, 0, 1, 3, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "リラックスできますね\n集中力も\n上がりそうです", 2252, 0, 1, 3, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいと\n眠くなっちゃうな…\n勉強しなくちゃなのに", 2253, 0, 1, 3, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ピーマンもこれくらい\nおいしければ\nいいのに…", 2255, 0, 1, 3, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本、むずかしい\n…もっと勉強\nがんばらなくちゃ", 2256, 0, 1, 3, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日はみんなに\nなにを読んで\nあげようかしら", 2258, 0, 1, 1, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "子どもたちと同じ\n目線で考えるのが\n大事よね", 2259, 0, 1, 1, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お天気が良い日は\nみんなでお散歩に\n行きたいわね～", 2260, 0, 1, 1, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "鬼ごっこにかくれんぼ\n…みんなは\nどっちが好きかしら", 2261, 0, 1, 1, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お遊戯会の配役、\n考え出すと\n大変だわ～", 2262, 0, 1, 1, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "彼は優しいから、\nきっと良い\nお父さんになるわね", 2263, 0, 4, 1, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "彼には私がいないと\n…っていうのは少し\n過保護すぎるかしら？", 2264, 0, 8, 1, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "保育園の行事を\n考えてるんだけど…\n良い案ないかしら？", 2265, 0, 1, 2, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今度、子どもたちと\nおやつを作るから、\n食べに来てね", 2266, 0, 1, 2, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "よかったら一緒に\n絵本を作らない？", 2267, 0, 1, 2, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あなたはいつも元気ね\n先生も見習わないと♪", 2268, 0, 1, 2, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "先生は\nずーっと、ずーっと、\nあなたの味方だからね", 2269, 0, 4, 2, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたみたいな\nいい子をお世話できて\n先生は幸せものだわ", 2270, 0, 8, 2, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう～\nちゃんと朝ごはんは\n食べた？", 2271, 1, 1, 2, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼寝の時間ね♪\nあなたも一緒に\n寝ましょうか", 2272, 2, 1, 2, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "すっかり真っ暗ね。\n今日も一日、\nよくできました♪", 2273, 3, 1, 2, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふかねぇ♪\n年甲斐もなく、\n飛び跳ねちゃいそう", 2275, 0, 1, 3, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あらあら、かわいい！\n保育園のみんなに\n見せてあげたいわ", 2276, 0, 1, 3, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りね～\n保育園にも\n置こうかしら", 2277, 0, 1, 3, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "寒い日は、ここで\n子どもたちに絵本を\n読んであげましょ♪", 2278, 0, 1, 3, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "美味しい～♪\n遠足に持っていったら\nみんな喜びそう", 2280, 0, 1, 3, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "みんなが\n楽しめる読み聞かせの\n方法特集♪　素敵ねぇ", 2281, 0, 1, 3, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "世界の前に、\nこの部屋を征服\nしてやろう♪", 2283, 0, 1, 1, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "拠点とはやはり\n斯くあるべきじゃの", 2284, 0, 1, 1, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "眷属の物はわらわの物\n故に、この部屋は\nわらわの部屋じゃな！", 2285, 0, 1, 1, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "永く眠っている間に\n随分と世界は変わった\nようじゃな…", 2286, 0, 1, 1, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うるさいのう～\nまったく、近頃の\n若いもんは…", 2287, 0, 1, 1, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あやつが来てから\n動悸が治まらぬ…\n如何ような病で\nあろうかの…", 2288, 0, 4, 1, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "眷属よ、どこに行った\nのじゃ？\nわらわの世話を\n許可するのじゃ", 2289, 0, 8, 1, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いずれ世界は\n我が手中に収まる\nふふふ、\n楽しみじゃのう", 2290, 0, 1, 2, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "眷属よ、わらわから\n離れてはならんぞ！\n子供に戻ってしまう\nではないか！", 2291, 0, 1, 2, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "トマトジュースが\n欲しいのじゃ！\n野菜ジュースでは\nダメだぞ！", 2292, 0, 1, 2, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "蚊にくわれたぞ！\nわらわの血を吸う\nとは～！", 2293, 0, 1, 2, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "こら、頭をなでるな\nお主はこの姿でも\n子供扱いするのか？", 2294, 0, 4, 2, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お主が望むなら世界の\n半分をくれてやっても\n良いのじゃぞ？", 2295, 0, 8, 2, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝早くから感心じゃの\nさすがわらわの\n眷属じゃ", 2296, 1, 1, 2, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "太陽は苦手じゃ…\nこの部屋の中で\n過ごそうぞ", 2297, 2, 1, 2, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜も更けてきた！\nわらわ達の時間は\nこれからじゃ～♪", 2298, 3, 1, 2, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "よい座り心地じゃ\nわらわの玉座としよう", 2300, 0, 1, 3, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "可愛いではないか\nわらわの眷属に\nしてやろうかのう", 2301, 0, 1, 3, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うむ、良い気持ちじゃ\nこれを作った者、\n褒めてつかわすぞ", 2302, 0, 1, 3, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あたたかい…\n身も心も\n浄化されるようじゃ", 2303, 0, 1, 3, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "吸血鬼のわらわが、\nこのようなもの…\nうまい♪", 2305, 0, 1, 3, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "このまま大人の姿を\n保つ方法…どこかに\n書いてないかのう", 2306, 0, 1, 3, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いろんな人がいて\nいろんな服を着てて…\n目の保養になります♪", 2308, 0, 1, 1, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "レイ様への新作\nどんな服にしよう…\n方向性が絞れない～！", 2309, 0, 1, 1, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "忘れないうちに\n隠し糸のメンテナンス\nやっておこうっと！", 2310, 0, 1, 1, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "むっ！　あの人の\nスリーサイズは…\nほほう…なるほど♪", 2311, 0, 1, 1, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ノゾミさんの\n衣装はああして\nチカさんのは…", 2312, 0, 1, 1, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私がアイドル…\n…実感ないけど\n精一杯やってみよう", 2313, 0, 4, 1, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "まさか私が\nアイドルになるなんて\n思ってなかったです", 2314, 0, 8, 1, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なんですかぁ？\n衣装作りで疲れて\n眠いんですぅ…", 2315, 0, 1, 2, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あーっ！　また\n服がほつれてる…\nしょうがないですね", 2316, 0, 1, 2, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "はっ！　ちょうど今\n新しいデザインが\n思い浮かびました！", 2317, 0, 1, 2, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "暇そうですね？\n時間あるなら仕事\n手伝ってください！", 2318, 0, 1, 2, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "どうしました？\n新しい服が\n欲しくなりましたか？", 2319, 0, 4, 2, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士さんのおかげで\nカルミナでも\n頑張れてますよ！", 2320, 0, 8, 2, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます…\nなんで朝って毎日\nやってくるんでしょう", 2321, 1, 1, 2, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹空きましたね\n騎士さんはちゃんと\n御飯食べましたか？", 2322, 2, 1, 2, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の方が\n作業が捗るのは\n私だけですかね？", 2323, 3, 1, 2, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このふかふか具合\nいい素材を\n使ってますね", 2325, 0, 1, 3, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "小さくて可愛い♪\nそうだ！　レイ様の\nぬいぐるみを…！", 2326, 0, 1, 3, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こういう時くらい\n何も考えずに\nリラックスしないと♪", 2327, 0, 1, 3, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "炎を使った服って\nカッコ良いかも…\nでも材料がな～…", 2328, 0, 1, 3, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "何をするにも\n食事は大切！\n体力が資本です！", 2330, 0, 1, 3, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "私もいつか\nデザインを\nまとめて本に…", 2331, 0, 1, 3, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "またお魚を\n捕りにいこうかな♪", 2333, 0, 1, 1, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろみんなも\nお腹が空くころ\nじゃないですか～？", 2334, 0, 1, 1, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ここなら、\n日焼けの心配は\nありませんね！", 2335, 0, 1, 1, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お刺身に焼き貝…\nお腹が魚介類を\n求めてますっ！", 2336, 0, 1, 1, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "泳ぐのも食べるのも\n大得意です！", 2337, 0, 1, 1, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人と二人で\n浜辺を散歩…\n素敵ですねぇ", 2338, 0, 4, 1, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人に水着を\n褒めてもらえたら、\nすごく嬉しいなぁ", 2339, 0, 8, 1, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "たまには釣りじゃなく\n一緒に素潜りでも\n行きませんか？", 2340, 0, 1, 2, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "男の子に水着を\n見られるのって\n少し緊張しちゃいます", 2341, 0, 1, 2, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ギルドハウスの\nみんなとも、\n海に行きたいですね！", 2342, 0, 1, 2, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あなたの水着、\n私が選んであげます！", 2343, 0, 1, 2, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "泳ぎの練習なら\n付き合いますよ！\n手取り足取り♪", 2344, 0, 4, 2, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "水着姿が好きなら\nいくらでも\n着てあげますよぉ♪", 2345, 0, 8, 2, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝の海も\n幻想的で\nいいですよねぇ～！", 2346, 1, 1, 2, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼はみんなで、\n海鮮バーベキューとか\nどうでしょう！", 2347, 2, 1, 2, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の海は星が\nきれいですよ！\n見に行きましょう！", 2348, 3, 1, 2, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "泳ぎ疲れたので\nちょっと休憩です～", 2350, 0, 1, 3, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなたにも、\n可愛い水着を\n着せてあげたいです", 2351, 0, 1, 3, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんだか、\nリゾート気分です…", 2352, 0, 1, 3, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふい～、泳ぎで冷えた\n身体を暖めましょう～", 2353, 0, 1, 3, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいひ～です～\nこれ、海水浴にも\n持っていきたいですね", 2355, 0, 1, 3, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "南国のフルーツ図鑑\n…じゅるり…", 2356, 0, 1, 3, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "わ～♪　おいしそ…\nか、かわいいですね～", 2358, 0, 1, 3, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "これくらい大きな貝…\n食べたいな～\n食べたいな～～", 2359, 0, 1, 3, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この格好で\n部屋をうろつくのは\n不思議な感じがします", 2360, 0, 1, 1, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "南国の果実を使って\n主さまにデザートを\nお作りしましょう", 2361, 0, 1, 1, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "せっかくの水着ですし\nこれから定期的に\n海水浴に行きたいです", 2362, 0, 1, 1, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "海の生き物も、\n森の生き物に負けず\n可愛かったです…", 2363, 0, 1, 1, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "クロールの練習なら、\n部屋でもできそうです", 2364, 0, 1, 1, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "主さまに、水着姿を\n褒めていただけた…\nえへへ♪", 2365, 0, 4, 1, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "水着で主さまの\nお世話をしたら、\n喜びますでしょうか…", 2366, 0, 8, 1, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お疲れでしたら\nわたくしの膝を\nお使いくださいね", 2367, 0, 1, 2, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "主さま、海の家で\nつかうおこづかいを\n渡しておきますね", 2368, 0, 1, 2, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海の美しさは、\n森とはちがう\n魅力がありました", 2369, 0, 1, 2, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この髪飾りですか？\n造花ですから\n水の中も平気です", 2370, 0, 1, 2, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "水着でくっついて\n眠ると、いつもより\n密着して暖かいです", 2371, 0, 4, 2, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "はじめての海が、\n主さまと一緒で\n幸せです♪", 2372, 0, 8, 2, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます。\n泳ぎに行く準備は\n万端です", 2373, 1, 1, 2, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "午後は泳ぐのをやめて\nスイカ割りなど\nいかがでしょう？", 2374, 2, 1, 2, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜も更けてきました…\n波の音を聞きながら\n少しお話しませんか？", 2375, 3, 1, 2, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あぅ…この家具には、\n人をダメにする魔法が\nかけられています…", 2377, 0, 1, 3, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふっ♪\nあなたも、海水浴に\n行きますか？", 2378, 0, 1, 3, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り…\nきっと主さまも\n気に入ります", 2379, 0, 1, 3, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これは暖かいです…\n後ほど主さまと一緒に\nあたりましょう", 2380, 0, 1, 3, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "泳いだ後の食事は\n一段と美味しく\n感じます", 2382, 0, 1, 3, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "深海魚の生態…\nこれは主さまにも\nお伝えしなくては…", 2383, 0, 1, 3, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "顔立ちが、主さまに\n似ております…\nかわいらしい♪", 2385, 0, 1, 3, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "ふかふかですね\n主さまのようです♪", 2386, 0, 1, 3, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お掃除、お掃除\nふんふふ～ん☆\nあ、聞かれてました？", 2387, 0, 1, 1, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "日焼けには回復魔法が\n効きますよ。どうして\n逃げるんですか～！", 2388, 0, 1, 1, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日はドジを\nしませんように！", 2389, 0, 1, 1, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "接客業を極めれば\nメイドとして\n成長できるかも？", 2390, 0, 1, 1, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "水着って\n動きやすいんですけど\n人の目が気になります", 2391, 0, 1, 1, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人の気持ちを知る\n魔法とかあれば…\nな、なんでもないです", 2392, 0, 4, 1, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "水着でご奉仕したら、\nあの人は喜ぶかな？", 2393, 0, 8, 1, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "暑いのでしたら、\n私が魔法で涼しく…\nえ？　いらない？", 2394, 0, 1, 2, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "何か御用ですか？\n特にないのでしたら、\nお話ししましょう♪", 2395, 0, 1, 2, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "水着姿でも\nメイドはメイドです\nご奉仕しますよ！", 2396, 0, 1, 2, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ひゃっ！　あ、危うく\n転ぶところでした…\n…きゃうっ！", 2397, 0, 1, 2, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "どうかしましたか？\nあなたの御用なら、\n喜んでお受けしますよ", 2398, 0, 4, 2, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "水着姿をあなたに\n見られると、\nドキドキしちゃいます", 2399, 0, 8, 2, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝は暑くてやる気が\n出ない？　でしたら、\nえぇい、元気になぁれ", 2400, 1, 1, 2, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹がぺこぺこなら、\nお昼は海の家で\n食べましょう♪", 2401, 2, 1, 2, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の浜辺でお散歩も\nいいですね。たくさん\n転びそうですけど…", 2402, 3, 1, 2, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休憩しながら、\nお掃除すれば\n一石二鳥です！", 2404, 0, 1, 3, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "きれいにすれば\nかわいさも倍増\nですよ～♪", 2405, 0, 1, 3, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "素敵な香りです～\n救護院に置けば、\nみんな喜ぶかも～", 2406, 0, 1, 3, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいですね…\nはっ！　いけません！\nメイドがサボるなんて", 2407, 0, 1, 3, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "料理のできない\nメイドなんて…\nはぐはぐ、おいしい♪", 2409, 0, 1, 3, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "水着姿で接客をすると\n売り上げが倍になる\n…本当ですか、これ", 2410, 0, 1, 3, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "えへへ♪\n南の島まで\n乗せてください！", 2412, 0, 1, 3, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "なんだか、\n人魚姫に\nなった気分です♪", 2413, 0, 1, 3, 107701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "みんなで過ごす\n休日っていいわよね…\nずっと続かないかな", 2414, 0, 1, 1, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海に浮輪でぷかぷか\n浮かぶのって\n癖になりそう", 2415, 0, 1, 1, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ビーチにいると\n日焼けが心配だわ", 2416, 0, 1, 1, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "水着姿って楽よね。\n室内だとちょっと\n落ち着かないけど…", 2417, 0, 1, 1, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お、泳ぎの練習なんて\nしないからね！", 2418, 0, 1, 1, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "楽しすぎて立場を\n忘れそう…あんたの\nせいなんだから！", 2419, 0, 4, 1, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "みんなで遊んで\n美味しいもの食べて\nほんっとに楽しいっ♪", 2420, 0, 8, 1, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "マジであっついわね…\nよっし！　海に入って\n涼みましょ！", 2421, 0, 1, 2, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "シャワー浴びたばかり\nなのに…また、遊び\nたくなってきたわ！", 2422, 0, 1, 2, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "遊び足りないって？\nしょうがないわね…\n付き合ってあげるわ♪", 2423, 0, 1, 2, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "一応伝えておくけど\n猫って水が苦手なの！\nわかった！？", 2424, 0, 1, 2, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あたしと話したいの？\nふふ。\nまぁ、いいわよ。\nほら隣に座りなさい", 2425, 0, 4, 2, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "こんなに楽しいの\n初めてかも…\nずっと続けばいいのに", 2426, 0, 8, 2, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "は、早起きしたのは、\n楽しみで眠れなかった\nからじゃないわよ！", 2427, 1, 1, 2, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼食後のストレッチ\n終わり！　さあ、\nビーチが待ってるわ！", 2428, 2, 1, 2, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の海に散歩に\n行こうかな～\nあんたも来なさいよ☆", 2429, 3, 1, 2, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海ではしゃぎすぎて\n疲れたわ…ちょっと\n休もうかしら？", 2431, 0, 1, 3, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こんな魔物がいたら\n操るのも楽しいかも", 2432, 0, 1, 3, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "にゃう～♪\nまるで南国にいる\n気分ね♪", 2433, 0, 1, 3, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかぁい♪\n身体が冷えてきたから\n丁度いいわ！", 2434, 0, 1, 3, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "運動後のご飯って\nなんでこんなに\n美味しいんだろ♪", 2436, 0, 1, 3, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "どんなカナヅチでも、\n絶対必ず泳げる方法、\n書いてないかしら？", 2437, 0, 1, 3, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "あんたもあたしが\n操ってあげる！\nなんてね～♪", 2439, 0, 1, 3, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "リゾートリゾートっ\nのんびりしましょ♪", 2440, 0, 1, 3, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ここなら思う存分\nデスクワークに\n励めるわね！", 2441, 0, 1, 1, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "武器のメンテナンスも\nしっかりしないと\n最高効率は望めないわ", 2442, 0, 1, 1, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "準備をしっかり整えて\nもっともっと\n稼がなくちゃね！", 2443, 0, 1, 1, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "少し休んだら\n次のバイトに\n行ってくるわね！", 2444, 0, 1, 1, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この格好でここに\nいるのって\n気恥ずかしいわね…", 2445, 0, 1, 1, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミが望むなら\n今日のバイト\n休んでもいいわよ？", 2446, 0, 4, 1, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミだけね…\n私のことをここまで\n理解してくれるのは", 2447, 0, 8, 1, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "普段と違う格好\nだからって\nそんなに見ないでよ…", 2448, 0, 1, 2, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "キミを立派な\nバイト戦士にするのが\n師匠としての役目よね", 2449, 0, 1, 2, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ次のバイトに\n行かないと…\nキミも一緒に来る？", 2450, 0, 1, 2, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "効率は大事だけど\nゆっくりするのも\n悪くないわね", 2451, 0, 1, 2, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "一緒の時間が楽しくて\nバイトのことを\n忘れちゃいそうね", 2452, 0, 4, 2, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミと一緒なら\nどんなミッションも\n楽勝ね！", 2453, 0, 8, 2, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう、いい朝ね！\n今日もめいっぱい\n稼ぐわよ！", 2454, 1, 1, 2, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もうお昼だったのね…\n内職のバイトに\n集中しすぎちゃったわ", 2455, 2, 1, 2, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "スケジュールは、と…\nこういう管理の徹底が\n効率を生み出すのよ♪", 2456, 3, 1, 2, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "しっかり働いて休む…\n最高効率にまた一歩\n近づいたわね", 2458, 0, 1, 3, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なごんじゃうわね…\nよぉし、次のバイトも\n頑張らないと！", 2459, 0, 1, 3, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りね…\n働く意欲が\n湧いてくるわ", 2460, 0, 1, 3, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "身体が冷えたから\n助かるわ…冷えは\n女の天敵だもの", 2461, 0, 1, 3, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "海のバイトは\n体力勝負よ\nエネルギーはしっかり\n摂取しないとね！", 2463, 0, 1, 3, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "座学も大切ね\nもっと知識を\n身につけないと…", 2464, 0, 1, 3, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "海の楽園みたいね…\n今だけは効率を\n忘れちゃいそう…", 2466, 0, 1, 3, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "落ち着くわ…\n海とひとつになった\n気分ね！", 2467, 0, 1, 3, 108001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちょっと休憩にゃ～\n潮風は体に\n良くないにゃ～", 2468, 0, 1, 1, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "猫グッズで\n海の家を飾りたいにゃ", 2469, 0, 1, 1, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海の幸は美味しいけど\n水はイヤだにゃ…", 2470, 0, 1, 1, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "開店にゃ！\nこのたい焼きなら\nきっと大繁盛にゃ！", 2471, 0, 1, 1, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "海と言えば水着にゃ\n似合ってるかにゃ？", 2472, 0, 1, 1, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミが頼むなら\n手伝ってあげても\nいいにゃ", 2473, 0, 4, 1, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あたしの宝は\nここにあるにゃ～", 2474, 0, 8, 1, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "にゃ？\nそんなに見つめても\n何も出ないにゃ", 2475, 0, 1, 2, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今からキミを\nあたしの相棒に\n任命するにゃ！", 2476, 0, 1, 2, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これから\n開店の準備にゃ\nキミも手伝って\nくれるのかにゃ？", 2477, 0, 1, 2, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "海の家で出す\n新しいメニューを\n考え中なのにゃ～", 2478, 0, 1, 2, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミと一緒なら\n売上げナンバーワンに\nなれるにゃ！", 2479, 0, 4, 2, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミと一緒にいると\n楽しくて、もっと\nいたくなるにゃ", 2480, 0, 8, 2, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようにゃ！\n今日も頑張って\nいくにゃー！", 2481, 1, 1, 2, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹すいたにゃ～…\nお魚、ちょっとだけ、\nつまみ食いするにゃ", 2482, 2, 1, 2, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日の準備は万端にゃ\nいつでも\n出発できるにゃ", 2483, 3, 1, 2, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このふかふか具合\nまるで子猫の\n毛並みのようにゃ～", 2485, 0, 1, 3, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "にゃにゃ～\nなんてかわいさにゃ～", 2486, 0, 1, 3, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この匂い…\nもう少し香ばしいと\nいいかもしれないにゃ", 2487, 0, 1, 3, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "にゃ～…\nあったかくて\nぬくぬくだにゃ～", 2488, 0, 1, 3, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "働くにはまず体力にゃ\nしっかり食べて\nスタミナアップ\nだにゃ!", 2490, 0, 1, 3, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…\nここにお宝が\n眠ってるんだにゃ", 2491, 0, 1, 3, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "シードレイクにゃ！\n本物は怖かったけど、\nぬいぐるみなら\nかわいいにゃ～", 2493, 0, 1, 3, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "貝なのにふかふかの\nクッションにゃ！\n屋台の前にも\n置いてみたいにゃあ", 2494, 0, 1, 3, 107901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "人の家って、道場とは\n違った香りがするね", 2495, 0, 1, 1, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっと退屈だね…\nあの人をからかいに\n行こうかな♪", 2496, 0, 1, 1, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "普通の女の子みたいに\n遊びたいって思う\nこともあるんだよね", 2497, 0, 1, 1, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "剣の手入れを怠らない\nようにしないと。\nいざという時、困るし", 2498, 0, 1, 1, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "もっと\n上手く立ち回って\n出世したいな", 2499, 0, 1, 1, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おかえりなさい！\nふふ、なんだか奥さん\nになった気分だよ♪", 2500, 0, 4, 1, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "恥ずかしくて、あなた\nを見られないよ…\n私らしくないなぁ…", 2501, 0, 8, 1, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私、お話好きなんだ。\nどうせなら楽しい話を\nしたいな♪", 2502, 0, 1, 2, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "女の子っぽい子と、\n男勝りな子、あなたは\nどっちが好き？", 2503, 0, 1, 2, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ見回りの\n時間かな。あなたも\n一緒に行く？", 2504, 0, 1, 2, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "構って欲しいのかな？\nそれじゃ一緒に\nランニングに行こうか", 2505, 0, 1, 2, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "二人で出かけるなら、\n手を繋がないとね。\nあはは、冗談冗談♪", 2506, 0, 4, 2, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ねえ、あなた♪\nおや、顔が真っ赤だ！\n…ふふ、私も、かな？", 2507, 0, 8, 2, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私は朝から鍛錬だよ。\n慣れてるけど大変だ。\nお互いに頑張ろうね", 2508, 1, 1, 2, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "鍛錬でお腹ぺこぺこ。\nお昼ごはんが\n楽しみだね", 2509, 2, 1, 2, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日も一日見回りと\n鍛錬を頑張ったよ。\nあなたもお疲れさま", 2510, 3, 1, 2, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いざという時のため\nにも、休憩は大事だね", 2512, 0, 1, 3, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こういうものには\n今まで\n縁がなかったけど。\nうん、可愛いね♪", 2513, 0, 1, 3, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "精神統一に通じる\nものがあるね。\nふぅ、癒されるなぁ", 2514, 0, 1, 3, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいなぁ。\nたまにはのんびり\nしようか", 2515, 0, 1, 3, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "鍛錬後はすごくお腹が\n空くんだよね。\nう～ん、おいしい♪", 2517, 0, 1, 3, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "剣術書だけで強くなる\nには飛びぬけた才能と\n努力が必要だよね", 2518, 0, 1, 3, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "正義の刃で\n悪を挫く！\n…キマったッス♪", 2520, 0, 1, 1, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ヒーローの\n秘密特訓を\n始めるッスよ～！", 2521, 0, 1, 1, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "正義の味方目指して\n今日も明日も\n全力ッスよ♪", 2522, 0, 1, 1, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "一日一善！\nヒーローだったら\n当たり前ッス♪", 2523, 0, 1, 1, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "どうッスか\nこのポーズ！\nイイ感じッスか？", 2524, 0, 1, 1, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "た、たまには\nよく頑張ったねって\n褒めてほしいッス…", 2525, 0, 4, 1, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "自分を信じてくれる\nあんたと一緒なら\n何でもやれるッス！", 2526, 0, 8, 1, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おつかれッス♪\n冒険の準備は\nばっちりッスよ！", 2527, 0, 1, 2, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どうしたんッスか？\n…はっ！　もしや敵が\n迫ってるんスかっ！？", 2528, 0, 1, 2, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "べ、別に\n頭を撫でてほしいとか\n思ってないッスよ？", 2529, 0, 1, 2, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "スーパーヒーロー\nトラタイガーは\n絶対無敵ッス！", 2530, 0, 1, 2, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんたと自分で\n正義の心を燃やして\n悪を一網打尽ッス！", 2531, 0, 4, 2, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんたと一緒だと\n幸せな気持ちに\nなるんッス…♪", 2532, 0, 8, 2, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お、早いッスね～♪\n今日も一日一善\nよろしくッス！", 2533, 1, 1, 2, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一休みしながら\nヒーローについて\n語り合うッスよ～！", 2534, 2, 1, 2, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜のパトロールで\n一緒に平和を\n守るッス！", 2535, 3, 1, 2, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅぅ…\n落ち着くッスね\n戦士の休息ッス♪", 2537, 0, 1, 3, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "くぅぅ、可愛いッス…\nヒーローが守るべき\n愛らしさッスね！", 2538, 0, 1, 3, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんスかこの香り？\nすぅぅ…ふぅぅ…\n力がみなぎるッス！", 2539, 0, 1, 3, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "優しい光ッスね…\nヒーローの優しさ\nそのものッス！", 2540, 0, 1, 3, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あむあむあむ…\nんぅう、元気が溢れて\n止まらないッス！", 2542, 0, 1, 3, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "トラタイガーのお話は\n笑いあり涙ありで\n超おすすめッス！", 2543, 0, 1, 3, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ハッピーハロウィン\nお父さん、お菓子は…\n食べられないね", 2545, 0, 1, 1, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "トリックオアトリート\nお菓子をくれないと\n不吉な占いをします", 2546, 0, 1, 1, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふ、あなたの後ろで\n霊のみなさんが\n踊り始めました", 2547, 0, 1, 1, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "霊感がいつも以上に\n冴えているので\n占いの調子も良好です", 2548, 0, 1, 1, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "父はハロウィンが\n大好きだそうです\n大胆な格好をする子が\n多いので…", 2549, 0, 1, 1, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたは霊たちにも\n大人気ですよね\n私も見てほしいな…", 2550, 0, 4, 1, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ハロウィンの賑やかさ\n今は好きです…\nあなたといられるので", 2551, 0, 8, 1, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "霊のみなさんとの\nダンスパーティー…\n楽しみです", 2552, 0, 1, 2, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お父さん、元気だね\nえ？　ここは色んな\n女の子に会えて幸せ？", 2553, 0, 1, 2, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ハロウィンのお菓子\n食べすぎちゃったな…\nでも、美味しかった…", 2554, 0, 1, 2, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あなたの女難の相…\n悪化していますね\nお祓いが必要かも", 2555, 0, 1, 2, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの、霊のみなさんが\nあなたと踊りたいと…\nえっと、私も…", 2556, 0, 4, 2, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたと手を繋ぐと\n胸が苦しくなります\nでも、繋ぎたいな…", 2557, 0, 8, 2, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ハッピーハロウィン…\n父が元気なので\n今日の運気は良好です", 2558, 1, 1, 2, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "父はお昼寝中です\n本当に寝ているかは\n私にも分かりませんが", 2559, 2, 1, 2, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お父さん、\nもう眠っちゃったの？\n…眠れるんだったっけ", 2560, 3, 1, 2, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "落ち着きますね…\n霊のみなさんも\n喜んでいます", 2562, 0, 1, 3, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "つん、つん。ふふっ♪\n癒やされます…", 2563, 0, 1, 3, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "精神が研ぎ澄まされる\n香りですね…\n占いが捗ります", 2564, 0, 1, 3, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいね\nお父さん…\nえ？　分からない？", 2565, 0, 1, 3, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "霊のみなさんは\n食べられないので…\n私がいただきます", 2567, 0, 1, 3, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "お父さんを元に戻す\n手掛かり…\n書かれていないかな？", 2568, 0, 1, 3, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "わぁ、お菓子が沢山…", 2570, 0, 1, 3, 108101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "無料でプリンが\nもらえるなんて、\nハロウィンはすごいの", 2572, 0, 1, 1, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "生きてるときも、\nミヤコはハロウィンが\n好きだった気がするの", 2573, 0, 1, 1, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "みんなに仮装を\n見せつけて、\nプリンをもらうの～", 2574, 0, 1, 1, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この仮装で、\nみんなに恐怖を\n教えてやるの！", 2575, 0, 1, 1, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "アオーン、アオーン！\nミヤコ、狼女に\nなりきってるの～", 2576, 0, 1, 1, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "アイツに秘密で、\nパーティーの\n飾り付けをするの♪", 2577, 0, 4, 1, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アイツが狼男の\n仮装をすれば、\nおそろいなの～", 2578, 0, 8, 1, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "プリンをくれなきゃ、\nオマエをカボチャに\nしてやるの～", 2579, 0, 1, 2, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ハロウィンは幽霊でも\n参加できるから\n楽しいの～！", 2580, 0, 1, 2, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "プリンがないなら\nカボチャプリンを\n食べればいいの！", 2581, 0, 1, 2, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "プリンの可能性は\n無限大なの～", 2582, 0, 1, 2, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "オマエの隣で\nプリンを食べると、\nいつもより美味しいの", 2583, 0, 4, 2, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "オマエが死んでも、\nミヤコはずーっと\n一緒にいてやるの～", 2584, 0, 8, 2, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝ごはんは\nカボチャプリンなの！\nハロウィンっぽいの～", 2585, 1, 1, 2, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ランチは豪華に\nプリンアラモードなの", 2586, 2, 1, 2, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜は幽霊たちと\nハロウィンするの！\nオマエも来るの！", 2587, 3, 1, 2, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "幽霊にも休息は\n必要なの！\nプリンもってこいなの", 2589, 0, 1, 3, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "オマエもミヤコの\nパーティーに\n招待してあげるの～", 2590, 0, 1, 3, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "癒されるの～\nまるで天国なの～", 2591, 0, 1, 3, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここでなら、\n焼きプリンが\n作れるの！", 2592, 0, 1, 3, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "腹が減っては\nハロウィンは\nできぬなの！", 2594, 0, 1, 3, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "丸ごとカボチャ\nプリン特集！？\n美味しそうなの～♪", 2595, 0, 1, 3, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "お菓子がたくさんで、\nミヤコはとっても\nハッピーなの♪", 2597, 0, 1, 3, 108201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "魔女以外にも、\n色々な仮装を\nしてみたいわね", 2599, 0, 1, 1, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "チョコやアメよりも、\nアタシに相応しい\nスイーツがあるはず…", 2600, 0, 1, 1, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お菓子の食べ過ぎは、\nお母さんに\n怒られるかも…", 2601, 0, 1, 1, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この格好で学院に\n行ったら、\nみんな驚くかしら", 2602, 0, 1, 1, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "大人のレディは、\nどういうハロウィンを\n過ごすべきかしら…？", 2603, 0, 1, 1, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お菓子、アイツの分も\nとっといてあげよ！\n大人の余裕ってやつね", 2604, 0, 4, 1, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アイツを魅了する\n魔法とかないかしら？", 2605, 0, 8, 1, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おしゃれスイーツを\nくれなきゃ\nイタズラするわよ！", 2606, 0, 1, 2, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "アタシの大人センスで\nアンタに似合う仮装を\n選んであげるわ！", 2607, 0, 1, 2, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "不気味よねぇ…\nジャックオーランタン\nこ、怖くないわよ？", 2608, 0, 1, 2, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ハロウィンが楽しくて\n宿題やり忘れてたわ…\nて、手伝って～！", 2609, 0, 1, 2, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お菓子をもらうのも\nアンタと一緒なら\n恥ずかしくないわ！", 2610, 0, 4, 2, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アタシのエスコートを\n任せられるのは、\nアンタだけなんだから", 2611, 0, 8, 2, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝食はオシャレに\nグリーンスムージー！\n…に、にがぁ", 2612, 1, 1, 2, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼下がりはカフェで\n優雅なティータイム\n…憧れるわ～", 2613, 2, 1, 2, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ハロウィンナイトの\nはじまりよ！\n街に繰り出しましょ！", 2614, 3, 1, 2, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あう～、お菓子の\n食べすぎで\n動けな～い", 2616, 0, 1, 3, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アンタも仮装する？\nいまよりもーっと\nかわいくなるわよ！", 2617, 0, 1, 3, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "大人な香りに\n包まれてる～♪", 2618, 0, 1, 3, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ポカポカね～♪\n…ああー！\nチョコが溶けてる！", 2619, 0, 1, 3, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしい～♪\n…じゃなくて！\nび、美味ですわ～", 2621, 0, 1, 3, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この服かわい～♪\nって、なにこの値段！\nお小遣い何年分よ！？", 2622, 0, 1, 3, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "お、お菓子なんかで\n喜ぶほど、子供じゃ…", 2624, 0, 1, 3, 108301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "次はどんな策で団長を\nからかってみようか…", 2626, 0, 1, 1, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "む？\n血の臭いがするな\n祭りの時間か☆", 2627, 0, 1, 1, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "平和に飼い殺される\n前に、混沌の愛を\n育みたいね", 2628, 0, 1, 1, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "本気を出した団長と\nいつか手加減なしに\n殺り合いたいな", 2629, 0, 1, 1, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "おばさん呼ばわりする\n新米騎士の小娘を\n懲らしめてやろうか", 2630, 0, 1, 1, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "胸を触られるまで\n誓約のことなど\nすっかり忘れていたな", 2631, 0, 4, 1, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "まさかこのワタシが\nプロポーズするとはな\n…笑えるじゃないか", 2632, 0, 8, 1, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "面白い暇つぶしを\n思いついたんだ\n戯れに付き合え☆", 2633, 0, 1, 2, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "退屈で死にそうだ\n愉しい話題を\nワタシに提供してくれ", 2634, 0, 1, 2, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なんだ、暇なのか？\n心躍ることでも探しに\n出かけようではないか", 2635, 0, 1, 2, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "このワタシを愉快に\nさせてくれる事でも\nあったのか？", 2636, 0, 1, 2, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ワタシに求婚した男の\n数だと？\nいちいち覚えてないな", 2637, 0, 4, 2, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "最強無敵の女と\n結婚できるんだ\n誇りに思えよ☆", 2638, 0, 8, 2, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なにか愉快なことが\n起こりそうな朝だ☆\nワクワクするね", 2639, 1, 1, 2, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うーむ、腹がすいたな\n愉快なことで\nこの空腹を満たしたい", 2640, 2, 1, 2, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これからは大人の\n時間だ。愉しみ方を\n知りたいのかい？", 2641, 3, 1, 2, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このワタシとした事が\n穏やかな気分に\nなってしまうとは…", 2643, 0, 1, 3, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "可愛い姿をしたものが\n惨たらしい\n醜態を晒すのを\n想像してしまう", 2644, 0, 1, 3, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "悪くはない香りだ\nだが、ワタシは血の\n臭いを嗅ぎたいぞ☆", 2645, 0, 1, 3, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぬるい、ぬるすぎる！\n地獄の業火には\nほど遠い熱さだ！", 2646, 0, 1, 3, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ワタシの腕前に\n勝るとも劣らない\nなかなかの味だ", 2648, 0, 1, 3, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "意中の男性を絶対に\n落とす方法…？\nく、下らんっ！", 2649, 0, 1, 3, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "明日はあの釣り場に\n行くとしようかな\nあの子も誘ってみるか", 2651, 0, 1, 1, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぷはーっ！\n体を動かしたあとの\n一杯は格別だね", 2652, 0, 1, 1, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "天気が良いと\n昼寝か釣りかで\n迷っちまうな…", 2653, 0, 1, 1, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "大物が釣れたときの\n快感は、他じゃ\n味わえないね", 2654, 0, 1, 1, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふあぁ～…\n昼寝でもするか", 2655, 0, 1, 1, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふふっ…\nあの子、見た目より\n根性あるんだね", 2656, 0, 4, 1, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの子が強くなるには\nどんな魚を食べさせて\nあげればいいのやら…", 2657, 0, 8, 1, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "姉御って呼ぶんじゃ\nないよ。からかうと\nタダじゃおかないよ", 2658, 0, 1, 2, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "釣りのコツ？\n何事も経験が大事だ\n今から行くかい？", 2659, 0, 1, 2, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうしたのさ？\n助太刀が必要かい？\nアタシにまかせときな", 2660, 0, 1, 2, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "困ってる人がいたら\nまた力を貸しておくれ\n頼りにしてるよ", 2661, 0, 1, 2, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "なにか困りごとかい？\nどうやら昼寝は\nまた今度だね", 2662, 0, 4, 2, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "よしよし！\nお人好しのお前さんを\n労ってあげるよ", 2663, 0, 8, 2, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう、お前さん\n魚屋は早起きでなきゃ\nつとまらないよ？", 2664, 1, 1, 2, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼飯かい？　今朝\n仕入れた魚があるんだ\n食べてみるかい？", 2665, 2, 1, 2, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜釣りにぴったりの\n月が出てるよ\nいい釣りが出来そうだ", 2666, 3, 1, 2, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "コイツに座って\nのんびり釣りが\nできりゃいいのにな", 2668, 0, 1, 3, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "よしよし…♪\nおっと、かわいい物も\nつい抱きしめちまうな", 2669, 0, 1, 3, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これで魚の臭いを\n消せれば、猫も\n寄らなくなるのかね", 2670, 0, 1, 3, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "冬場の釣りも\nこれくらい暖かけりゃ\nいいんだけどね", 2671, 0, 1, 3, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "腹が減っては\n釣りもできぬ、ってな\nまずは腹ごしらえだ", 2673, 0, 1, 3, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "へぇ…こんな魚が\nいたとは…いつか\n釣りたいもんだね", 2674, 0, 1, 3, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "流石に室内で\n魔法ぶっぱしたら\n怒られるよねぇ", 2676, 0, 1, 1, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "可愛い女の子が\nたくさんいる！\nここは楽園か！？", 2677, 0, 1, 1, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "みんなに漫画とか\n勧めてみようかな！\n布教用のがあるし！", 2678, 0, 1, 1, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "わ、私一人の\n部屋じゃないから\n色々自重せねば！", 2679, 0, 1, 1, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "「ぬるぽ」\n…くっ、\n誰も反応なしか！", 2680, 0, 1, 1, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "次はどの漫画を\n貸そうかなー♪", 2681, 0, 4, 1, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "次の定期巡回で\nとっておきの店に\n連れてってあげよう！", 2682, 0, 8, 1, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "君に似合いそうな\n衣装を買ったよ！\n君もいざ魔法少女に！", 2683, 0, 1, 2, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さあ！\n暇なら定期巡回に\nレッツラゴー！", 2684, 0, 1, 2, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "戦闘だけじゃなくて、\n日常にも役立つ\n魔法を習得したいね！", 2685, 0, 1, 2, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "新魔法思いついた！\n私って天才！？", 2686, 0, 1, 2, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "決め台詞は超大事！\n君の決め台詞も\n私が考えてあげよう！", 2687, 0, 4, 2, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私ってもしやリア充？\n…そんなバカな！\n非リア代表のはずが！", 2688, 0, 8, 2, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよー…\n徹夜で本読んでたから\nまだ眠い～", 2689, 1, 1, 2, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼飯食べて、\n午後の定期巡回も\n頑張りましょー！", 2690, 2, 1, 2, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜からが、\nオタ活本番でしょ！", 2691, 3, 1, 2, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふいー！\nくつろいで本を読む！\n最高だねー！", 2693, 0, 1, 3, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "君、可愛いね～♪\n魔法少女の\n使い魔みたい！", 2694, 0, 1, 3, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "良い匂いに\n釣られてしまった…\nまさか、孔明の罠！？", 2695, 0, 1, 3, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖かいけど、\nここで本を読むのは\nちょっち危ないかな", 2696, 0, 1, 3, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ウマ―！\nこれの詳細きぼんぬ！", 2698, 0, 1, 3, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "こ、古代語の本！？\n現代語でおk…", 2699, 0, 1, 3, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふふふっ♪\n次はどんな悪戯を\nしてやろうかしら♪", 2701, 0, 1, 1, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "幻影湖の霧を吸った\n人間たちの\nリアクションって、\nサイコーよねぇ～♪", 2702, 0, 1, 1, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "室内だけとはいえ…\n自由に動けるって、\nやっぱりいいわ～♪", 2703, 0, 1, 1, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "改めて見ると良い\n部屋ね…悪戯とか\nしやすそうだしぃ♪", 2704, 0, 1, 1, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "私を封じていた部屋\nなのに…急に居心地が\n良くなったわね♪", 2705, 0, 1, 1, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あんたの頭、座り心地\n良いわね…私専用の\n椅子にしてあげる♪", 2706, 0, 1, 2, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "外は大変みたいねぇ…\nまあ、私は好き勝手に\nやらせてもらうわ♪", 2707, 0, 1, 2, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "顔に落書された？\n誰か知らないけど、\n悪いことする奴も\nいるものねぇ～♪", 2708, 0, 1, 2, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "フィオのやつ…\nどこをウロチョロ\nしてるのかしら？", 2709, 0, 1, 2, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "人間の朝は大変ねぇ…\n私はその様を見ながら\nゆっくりするわね♪", 2710, 1, 1, 2, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "う～私も、お日様を\n浴びながら、お外を\nお散歩したーい！", 2711, 2, 1, 2, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この暗さ…閉じ込め\nられていた時を\n思い出すわね…", 2712, 3, 1, 2, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "悪戯しすぎて\n疲れたから、ちょっと\n休憩しよっと♪", 2714, 0, 1, 3, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ガイド妖精たる私が、\nこんな造形物に\n惹かれる…わけが……\nかわいい♪", 2715, 0, 1, 3, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香りを囮にして、\n周りに悪戯を仕込む…\n完璧ね♪", 2716, 0, 1, 3, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "不思議ねぇ…私は\n温度とか関係ないのに\n離れられないわ", 2717, 0, 1, 3, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食事の必要がない体…\nつまり、食べたければ\n食べていいのよね～♪", 2719, 0, 1, 3, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "へぇ…最近はこんな\n悪戯もあるのねぇ…\nあいつで試さないと♪", 2720, 0, 1, 3, 190901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "メリークリスマス！\n歌で幸せを\n届けます…！", 2722, 0, 1, 1, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あなたと出会えたのは\n偶然ではなくて…\nクリスマスの奇跡だと\n思うんです", 2723, 0, 1, 1, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "クリスマスは華やかで\nつい子供のように\nはしゃいでしまいます", 2724, 0, 1, 1, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "曲が書けるのは\nあなたが側に\nいてくれるからです…", 2725, 0, 1, 1, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "感動を与えられる歌…\nあなたと一緒になら\n生み出せるはず…", 2726, 0, 1, 1, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "クリスマスの幸せを\nあなたと\n感じ合えたらな…", 2727, 0, 4, 1, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたの幸せを願った\nクリスマスソング…\nいつか披露しますね", 2728, 0, 8, 1, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "みなさんの笑顔を\n守りたいから…\n私は歌い続けます", 2729, 0, 1, 2, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "歌を届ける\nサンタさんに\nなりたいな…", 2730, 0, 1, 2, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お暇でしたら\nクリスマスのお祝いを\nしませんか？", 2731, 0, 1, 2, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ステージに立つ前に\n喉を整えないと…\n発声練習は念入りに…", 2732, 0, 1, 2, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "まわりはかわいい子\nばっかりだけど…\nこの服なら\nアピールになるかな？", 2733, 0, 4, 2, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "歌でならいくらでも\nあの人への気持ちを\n込められるのに…", 2734, 0, 8, 2, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日も一日\n幸せな歌で世界が\n包まれますように…", 2735, 1, 1, 2, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お茶を飲みながら\n好きな音楽を\n語り合いませんか？", 2736, 2, 1, 2, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふ、寝かしつけの\n子守唄を\nお望みですか？", 2737, 3, 1, 2, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふかですね\n心地良すぎて\n眠ってしまいそう…", 2739, 0, 1, 3, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "素敵…\n優しい歌みたいに\n気持ちが落ち着く…", 2740, 0, 1, 3, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "インスピレーションが\n溢れてくる…\nいい曲が書けそう…", 2741, 0, 1, 3, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この光みたいに\n灯火になるような\n歌を歌いたい…", 2742, 0, 1, 3, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "喉の健康のためにも\n食事はしっかり\nとるようにしています", 2744, 0, 1, 3, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "物語には\n曲作りのヒントが\n詰まっているんです", 2745, 0, 1, 3, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "絵が飛び出してくる\nなんて…精霊が宿って\nいるのでしょうか？", 2747, 0, 1, 3, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "か、可愛い…♪\nちょっとだけ触っても\nいいですよね…？", 2748, 0, 1, 3, 108401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "クリスマスでも、\n演劇の練習は\nしっかりやらないと！", 2749, 0, 1, 1, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あうぅ…\nクリスマスの準備が\n終わらないよぅ…", 2750, 0, 1, 1, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アヤネちゃんが\n摘み食いしないように\n見ておかないと…", 2751, 0, 1, 1, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "サンタさんみたいに、\n皆に笑顔で接する…\nうぅ…私には無理ぃ…", 2752, 0, 1, 1, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "新しいお洋服～♪\nスズメお姉ちゃんに\nお礼をいわないと♪", 2753, 0, 1, 1, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんの為に、\nプレゼントを\n用意しないと♪", 2754, 0, 4, 1, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "クリスマス…\n恋人の日…ひゃわっ！\nわ、私ってば何を…！", 2755, 0, 8, 1, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "メリー\nクリスマスです、\nお兄ちゃん♪", 2756, 0, 1, 2, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そ、そんなに\n見られると…\n恥ずかしいよぉ…", 2757, 0, 1, 2, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ひゃわぁっ！？\n急に触られると、\n驚くからやめてぇ…", 2758, 0, 1, 2, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あ…クリスマスの\n準備を手伝って\nくれるんですか？", 2759, 0, 1, 2, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんと\n過ごすクリスマス、\n楽しみですぅ…♪", 2760, 0, 4, 2, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "クリスマスはその…\n二人で…あうぅ…\nなんでもないですぅ…", 2761, 0, 8, 2, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うう…パーティーが\n楽しみで、あんまり\n眠れなかったよぅ…", 2762, 1, 1, 2, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ケーキを食べられなく\nなっちゃうから、\nお昼は軽めにしないと", 2763, 2, 1, 2, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ちょっと眠いけど…\n今日は少しだけ\n夜更かししたいです♪", 2764, 3, 1, 2, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふかぁ…\nクリスマスの準備中に\n眠くなっちゃいますぅ", 2766, 0, 1, 3, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この子と一緒に\nおままごとしたいな♪", 2767, 0, 1, 3, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい匂い…♪\nみんなで\nアロマパーティー\nしたいなぁ…♪", 2768, 0, 1, 3, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぬっくぬく…♪\nもう、ここから\n離れたくないよぉ…♪", 2769, 0, 1, 3, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "はむはむ…♪\nクリスマスのお料理\nより美味しいかも～♪", 2771, 0, 1, 3, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "すごい…\nクリスマスの\n演劇って、\nこんなにあるんだ…", 2772, 0, 1, 3, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "すごい…まるで、\nクリスマスの演劇を\n観てるようですぅ…♪", 2774, 0, 1, 3, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "とっても可愛いです♪\nお芝居の相手役に\nしたいなぁ…♪", 2775, 0, 1, 3, 108501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "甘ぁいケーキも、\nデッカイ七面鳥も、\nぜーんぶ私のだー♪", 2776, 0, 1, 1, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "毎日が\nクリスマスだったら\nいいのにな～♪", 2777, 0, 1, 1, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "プレゼントはあるし、\n料理は美味しいし、\nクリスマス最高ー♪", 2778, 0, 1, 1, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ここでぷうきちの\nクリスマス一発芸♪\n『無茶ぶりするな！』", 2779, 0, 1, 1, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぷうきちがいつもより\n重いかも…太ったの？\n『衣装の重さだよ！』", 2780, 0, 1, 1, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんが\n一緒にいてくれると\nクリスマス楽しいね♪", 2781, 0, 4, 1, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄ちゃんに抱きつく\nと、なんだかドキドキ\nする…なんでかな？", 2782, 0, 8, 1, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "メリークリスマス♪\nプレゼントは、\nいつでも受付中だよ♪", 2783, 0, 1, 2, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このクマさん耳\n可愛いでしょ♪\nぷうきちと\nお揃いなんだー♪", 2784, 0, 1, 2, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お兄ちゃん…私、\n甘ぁいケーキが\n食べたいなぁ…♪", 2785, 0, 1, 2, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "クリスマスぷうきちは\nぬくぬく感が凄いよ！\nお兄ちゃんもさわる？", 2786, 0, 1, 2, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "えへへ…お兄ちゃんの\n手は、大きくて、\n暖かくて大好き～♪", 2787, 0, 4, 2, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "来年のクリスマスも、\nこうやって\nお兄ちゃんに\n甘えていたいな～♪", 2788, 0, 8, 2, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あれぇ…\n私のケーキはぁ…？\n『ちゃんと起きろ』", 2789, 1, 1, 2, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼はデッカイ\n七面鳥が食べたーい♪\n『夜まで我慢しろ』", 2790, 2, 1, 2, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "『もう寝る時間だぞ』\nサンタさんが来る\nまで起きてるぅ…", 2791, 3, 1, 2, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このふかふか具合…\nぷうきち！\n負けてられないよ！", 2793, 0, 1, 3, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この子、\nすっごくかわいい～♪\n『ライバル登場か！』", 2794, 0, 1, 3, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "良い匂い…あっ！\nぷうきちにこの\n匂いを移せば…！\n『匂い袋にするな』", 2795, 0, 1, 3, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったか～い♪\nえへへ、ぷうきちも\nあっためてあげる♪", 2796, 0, 1, 3, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ぷうきち！　これ、\nとってもおいしいよ♪\n『食べすぎるなよ』", 2798, 0, 1, 3, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "お、大人の私なら、\nこれぐらい…読め…\n『無理するな…』", 2799, 0, 1, 3, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "絵が飛び出す…\nぷうきちに絵本を\n入れれば、イタズラに\n使えるかも…♪", 2801, 0, 1, 3, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "か、可愛いけど…\nぷうきちサンタの方が\n可愛いんだからぁ…！", 2802, 0, 1, 3, 108601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "着物も慣れると\n動きやすいものさ", 2803, 0, 1, 1, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "鼻緒が緩んでしまった\n下駄で修業は\n無理があったかな…", 2804, 0, 1, 1, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "小腹が空いた…\nユイが作った餅、\nまだ食べられるかな？", 2805, 0, 1, 1, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "服装も変わったし\nいつもと違う戦い方を\n想定しないと…", 2806, 0, 1, 1, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "…ヒヨリは動きすぎて\n着崩れしてないか\n心配だ", 2807, 0, 1, 1, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "これからもずっと\n仲間と、彼と\n一緒に…", 2808, 0, 4, 1, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "願いを叶えるために\nもっと自分を\n鍛えていかないと！", 2809, 0, 8, 1, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "頭の飾りがずれてた？\nそうか、直してくれて\nありがとう", 2810, 0, 1, 2, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "着物がそんなに\n珍しい？\nキミも着てみる？\n…冗談だよ", 2811, 0, 1, 2, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "肩掛けの触り心地が\n気に入った？\nならもっと触る？", 2812, 0, 1, 2, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ああ、この刀？\n釣り仲間に見繕って\nもらったんだ", 2813, 0, 1, 2, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミといると\n気持ちが段々と\n安らいでいくよ", 2814, 0, 4, 2, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミは私の行く先を\n照らしてくれる\n光のような存在だよ", 2815, 0, 8, 2, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう\n朝の修行を始めるけど\nキミもどう？", 2816, 1, 1, 2, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この時間に軽く\n休憩をとるといい\n能率がよくなるよ", 2817, 2, 1, 2, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もう夜か…\n明日もまた頑張ろう\nそれじゃ、おやすみ", 2818, 3, 1, 2, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "…疲れていたのかな\nもう少しで眠る\nところだった…", 2820, 0, 1, 3, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふっ、正月衣装を\n着せてやるのも\nよさそうだ", 2821, 0, 1, 3, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふぅ…いい香りだ\n慌ただしい日々から\n心が解放される", 2822, 0, 1, 3, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この心地よさ…\n寝てしまわないよう\n気をつけないと", 2823, 0, 1, 3, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしいけど\n帯がきつくなる前に\n手を止めよう…", 2825, 0, 1, 3, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "外を出歩くのも\nいいけど、中で\n読書もありだな", 2826, 0, 1, 3, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…騎士クンって\nおせち料理で\n何が好きなんだろう？", 2828, 0, 1, 1, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "着物でお掃除や\nお洗濯するの\n慣れてきた♪", 2829, 0, 1, 1, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今年は\nどんな福袋を\n買おうかな…♪", 2830, 0, 1, 1, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お餅に使う調味料\nみんなで違うから\n色々用意しなきゃ", 2831, 0, 1, 1, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ほっぺがお餅みたいに\nぷにぷに…\n食べ過ぎちゃった…", 2832, 0, 1, 1, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "来年も、再来年も\nみんなで一緒に\n新年を迎えたいな", 2833, 0, 4, 1, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お願いです…\nいつかこの気持ちが\n伝わりますように…", 2834, 0, 8, 1, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "髪飾りが落ちそう？\nじゃあ…騎士クン\nつけ直してくれる？", 2835, 0, 1, 2, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "着物が着たいの？\nじゃあ今度一緒に\n買いに…行く？", 2836, 0, 1, 2, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あっ、騎士クン\nお雑煮のお餅\nいくつ入れたい？", 2837, 0, 1, 2, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "外、寒かったよね？\nはいこれ。熱い甘粥\n飲むと温まるよ", 2838, 0, 1, 2, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "今年は騎士クンと…\nえっ？　騎士クン！？\nな、なんでもないよ！", 2839, 0, 4, 2, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士クンの願い事\nわたしが\n叶えてあげたいな…", 2840, 0, 8, 2, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう\n太陽の光に当たると\n元気が出るよ", 2841, 1, 1, 2, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ごはん\n作らなきゃ…\n騎士クンも食べる？", 2842, 2, 1, 2, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "一日が終わるのは\nあっという間だよね\n一年も同じなのかな？", 2843, 3, 1, 2, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅ…\n帯も少し\nゆるめちゃおう…", 2845, 0, 1, 3, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お正月用に\n着物を縫って\nあげたいな", 2846, 0, 1, 3, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これでお肌が\n保湿出来たら\nいいのになぁ", 2847, 0, 1, 3, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ん～…\nぬくぬくしてて\n動きたくないよ～", 2848, 0, 1, 3, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "…冬眠しないのに\n熊さんみたいに\n食べちゃいそう", 2850, 0, 1, 3, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "年末年始は\n告白のチャンス…\nむ、無理無理！", 2851, 0, 1, 3, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "みんな忙しそう…\n待っててね、\nすぐ助けるから！", 2853, 0, 1, 1, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ユイちゃんと\nレイさん…よし！\nどっちも手伝おう！", 2854, 0, 1, 1, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あっ、着崩れてる！\nわわっ、どうしよ！\n帯が結べないよー！", 2855, 0, 1, 1, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "初詣楽しみー！\n出店はどこから\n行こうかな？", 2856, 0, 1, 1, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お正月だし\nみんなで楽しく\n遊んじゃおー！", 2857, 0, 1, 1, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "うーん…\n騎士くんはお正月\n何してるんだろ…", 2858, 0, 4, 1, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ううぅー…\n騎士くんを見てると\nドキってなっちゃう…", 2859, 0, 8, 1, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あたしから\nおいしそうな匂い？\nくんくん…ソースだ！", 2860, 0, 1, 2, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ヘアピンが…\n拾ってくれたんだ！\nありがとう騎士くん！", 2861, 0, 1, 2, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "髪飾りがかわいい？\n耳の近く触りたい？\n…優しくね？　", 2862, 0, 1, 2, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "グローブで食べるの\n大変そう？　特訓して\n今はお箸も使えるよ！", 2863, 0, 1, 2, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "えっ、ほっぺが赤い？\nそうかな…？\n気のせい気のせい！", 2864, 0, 4, 2, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士くんといるとね…\nなんでもない！\nまだ内緒っ！", 2865, 0, 8, 2, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよー！\n今日も明るく元気に\nがんばろー！", 2866, 1, 1, 2, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹すいてない？\n一緒にご飯食べよ！\n何にしようかなー♪", 2867, 2, 1, 2, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日もいっぱい\nがんばったー！\nいつも？　…そう？", 2868, 3, 1, 2, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休憩休憩♪\nちょっと休んで\nガンガン動くぞー！", 2870, 0, 1, 3, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい♪\nでも、壊しそうで\nちょっと怖い…", 2871, 0, 1, 3, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はぁー♪\nいい香りー…\n気分スッキリ♪", 2872, 0, 1, 3, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ほっこりしてて\nぬくぬく…\n丸まりたい…", 2873, 0, 1, 3, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ど、どうしよう…！\n手が、止まんないよ！", 2875, 0, 1, 3, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "へー…お年玉って\n昔はお餅だったんだ\n…今のほうがいいね", 2876, 0, 1, 3, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "甘いチョコの香りを\n漂わせて…ふふっ\nこれで準備万端ですわ", 2878, 0, 1, 1, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここを私のチョコで\n埋め尽くしますわ", 2879, 0, 1, 1, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "エプロンを着て\nあの方を待つ私…\nまるで…クスクス", 2880, 0, 1, 1, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "キッチンはどこかしら\n今のうちに作って\nおきたいものが…", 2881, 0, 1, 1, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あのお方を私のチョコ\nなしでは生きられない\n体に…ふふっ\n冗談ですわ…", 2882, 0, 1, 1, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "このチョコは運命の味\n一口食べれば私の虜…\nそれも運命ですわ…", 2883, 0, 4, 1, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私ともあろうものが\nなんだかドキドキして\nきましたわ…", 2884, 0, 8, 1, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あなた様。私に\n隠しているものなど\nありませんよね…？", 2885, 0, 1, 2, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私の手作りチョコです\n味の方にも自信\nありますのよ？", 2886, 0, 1, 2, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "少し苦いのは\nチョコがビターなだけ\nお気になさらず…", 2887, 0, 1, 2, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "解毒薬はどこに\nいれたかしら…？", 2888, 0, 1, 2, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "運命で結ばれている\nあなた様と私…\nチョコも特別でないと\nいけませんわ", 2889, 0, 4, 2, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "チョコを食べた後は\nメインディッシュ…\nさぁ、私を召し上がれ", 2890, 0, 8, 2, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "目覚めのチョコですわ\nすっきり目が覚めます\nしばらく眠れなく\nなりますけど…", 2891, 1, 1, 2, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おやつのチョコですわ\nデザートにどうぞ\n空腹を感じなく\nなりますわ…クスクス", 2892, 2, 1, 2, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お夜食のチョコですわ\nとてもよく眠れます\nさ、溶けてしまう前に", 2893, 3, 1, 2, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この心地良さ…\n参考になりますわ\n次の薬は…クスクス", 2895, 0, 1, 3, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この中、何か\n入りそうですわね\n…チョコレート、とか", 2896, 0, 1, 3, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…この香りと\n同じものを調合して\n私も持っていたい", 2897, 0, 1, 3, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この暖かさ…\nチョコが溶けないよう\n気を付けなくては", 2898, 0, 1, 3, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いい味をしていますわ\n私も腕を磨きましょう\n料理と、調合の腕を…", 2900, 0, 1, 3, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "勉強になりますわ\n知識はいくらあっても\n困りませんもの\n特に、人体の知識は…", 2901, 0, 1, 3, 109001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "弟くんのことを\n考えると\nあっという間に時間が\n過ぎちゃう…", 2903, 0, 1, 1, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お姉ちゃんの\n元気の源は、弟くんの\n喜ぶ顔なんだから♪", 2904, 0, 1, 1, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "弟くんと会ったら\nまずは抱きしめて\nそれからそれから…", 2905, 0, 1, 1, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今日のお姉ちゃんは\n昨日のお姉ちゃんより\nいいお姉ちゃんだよ♪", 2906, 0, 1, 1, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "弟くん、もっと\nお姉ちゃんに\n甘えてもいいのに♪", 2907, 0, 1, 1, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お姉ちゃんのチョコ\n食べさせてあげたい…", 2908, 0, 4, 1, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ドキドキしてきた…\nお姉ちゃんなのに\nどうしてかなぁ…", 2909, 0, 8, 1, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お姉ちゃんを\n好きなだけ\n触っていいよ♪", 2910, 0, 1, 2, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そんなにお姉ちゃんの\nチョコが欲しいの？\n食いしん坊さん♪", 2911, 0, 1, 2, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ナデナデするのは\nお姉ちゃんの仕事！", 2912, 0, 1, 2, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ありがとうなんて…\nお姉ちゃんとして\n当たり前だよ♪", 2913, 0, 1, 2, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "どうしたのかなっ？\nお姉ちゃんはいつでも\n弟くんのそばにいるよ", 2914, 0, 4, 2, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "チョコを作ったよ\n隠し味は、たくさんの\n弟くんへの愛情♪", 2915, 0, 8, 2, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよ。お姉ちゃんが\n顔を洗うの\n手伝ってあげるね♪", 2916, 1, 1, 2, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ご飯を食べたら\n眠たくなるよね…\nお姉ちゃんと寝る？", 2917, 2, 1, 2, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ眠くなった？\nお姉ちゃんが添い寝\nしてあげるね♪", 2918, 3, 1, 2, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この気持ちよさは\nお姉ちゃんも太鼓判♪", 2920, 0, 1, 3, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "このかわいさは\nお姉ちゃんも大満足♪", 2921, 0, 1, 3, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り、チョコに\n使えるかな…？", 2922, 0, 1, 3, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "弟くんと一緒に\nぬくぬくしたいな…♪", 2923, 0, 1, 3, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "すごくおいしいねっ♪\nあとで運動しなきゃ…", 2925, 0, 1, 3, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "本を読んでる\n知的なお姉ちゃん\n素敵でしょ♪", 2926, 0, 1, 3, 109101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "アタシって…\nここにいても\nいいのか…？", 2928, 0, 1, 1, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちゃんとした建物に\nいるのが久しぶりで\nそわそわする…", 2929, 0, 1, 1, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ここで天楼覇断剣\n出す練習したら\nアイツら怒るかな？", 2930, 0, 1, 1, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ギルドハウスか…\nこういう隠れ家\n欲しかったんだよな", 2931, 0, 1, 1, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "めちゃくちゃ暇だ…\n…なんかやること\nないのか？", 2932, 0, 1, 1, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "みんなが早く\nアタシのこと\n思い出さないかな", 2933, 0, 4, 1, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アイツはいいヤツだし\n戦う時はアタシも\n協力してやるか！", 2934, 0, 8, 1, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちゃんはいらん！\nノウェムでいい！\n分かったか？", 2935, 0, 1, 2, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どうした？\n戦うのか！？\n…なんだ、違うのか", 2936, 0, 1, 2, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "身長のことは\nあんまり言うな！\n気にしてるからな！", 2937, 0, 1, 2, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アタシの戦い方は\nなんでもアリだ！\nだから見習うなよ？", 2938, 0, 1, 2, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "オマエとの思い出か…\n敵として戦ってばっか\nだったな！", 2939, 0, 4, 2, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "オマエやオクトーと\n一緒に、あちこち\nいってみたいんだ！", 2940, 0, 8, 2, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "よっ！　おはよう！\n朝だぞー！\n起きてるかー？", 2941, 1, 1, 2, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "腹減ったー！\n飯食うぞ、飯！\nオマエも行くよな？", 2942, 2, 1, 2, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわぁ…\nまだ起きてんのか？\n元気だなオマエ…", 2943, 3, 1, 2, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぃ～…\n極楽極楽…", 2945, 0, 1, 3, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おいオマエ！\n寝技の練習に\n付き合ってもらうぞ", 2946, 0, 1, 3, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "くんくん…\nたまにはこういうのも\n悪くないかもな", 2947, 0, 1, 3, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あー…\nもっと前にコイツと\n出会いたかった…", 2948, 0, 1, 3, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "VRでも飯はうまい！\n腹が減るのはちゃんと\n生きてる気がするな", 2950, 0, 1, 3, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "勉強は大事だな！\nうん！…だめだ！\n全然わからん！", 2951, 0, 1, 3, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "探偵というのは\n謎を追い求める\n生き物なのさっ！", 2953, 0, 1, 1, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "事件のオチは\n往々にして\n取るに足らないものさ", 2954, 0, 1, 1, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "読書で得る知識が\n探偵の\n血肉になるんだよ", 2955, 0, 1, 1, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この前の\n捜査資料…\nどこにあったかな？", 2956, 0, 1, 1, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "どんな小さな謎も\n私にとっては\n宝石みたいなものさ！", 2957, 0, 1, 1, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "助手くんと一緒だと\nよい発想が浮かぶ…\nどうしてだろうね？", 2958, 0, 4, 1, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "助手くんの好きな\nタイプって…\nす、推理してみるっ！", 2959, 0, 8, 1, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "珈琲、淹れたてだよ\n一杯どうだい？", 2960, 0, 1, 2, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "事件の考察を\nまとめてみたんだけど\n聞いてくれるかな？", 2961, 0, 1, 2, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "小さな違和感を\n見逃さない…\n探偵の心得だよ", 2962, 0, 1, 2, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "機能的な手帳とペン…\nこの仕事には\n欠かせないね！", 2963, 0, 1, 2, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "助手くんに\n珈琲…\n淹れてほしいなぁ～", 2964, 0, 4, 2, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "助手くんは\n私にとって\n最高の相棒だよ☆", 2965, 0, 8, 2, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝はいいひらめきが\n得られるんだ…\nさあ捜査を始めよう！", 2966, 1, 1, 2, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一休みしたら\n推理の答え合わせを\nしてみようか？", 2967, 2, 1, 2, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の張りこみかい？\nなら私も\n同行させてほしいな！", 2968, 3, 1, 2, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "脳を酷使した後は\nゆっくり休む…\nこれも仕事だよ？", 2970, 0, 1, 3, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この愛らしさ…\n要捜査対象だね！", 2971, 0, 1, 3, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "思考が活性化される\n素敵な香りだね…", 2972, 0, 1, 3, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "くぅ、心地よすぎる…\n今だけは捜査も\n一休みだね♪", 2973, 0, 1, 3, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いっぱい食べて\nいっぱい考える\n探偵の本分だね！", 2975, 0, 1, 3, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "探偵だからね\nミステリには\n一家言あるんだ", 2976, 0, 1, 3, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "先輩、素敵だなぁ…\nもっと近づければ\nいいのに…", 2978, 0, 1, 1, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "せ、先輩がいた部屋！\n私には刺激が強い…", 2979, 0, 1, 1, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "先輩を観察しやすい\n場所はあるかな…", 2980, 0, 1, 1, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "バ、バイト代出たし、\nせ、先輩をご飯とかに\n誘いたい…な", 2981, 0, 1, 1, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "今頃先輩は\nあの辺かな…？\n見に行ってみよう！", 2982, 0, 1, 1, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私と先輩の出会いって\n思い返すと少女漫画\nみたい…えへへ", 2983, 0, 4, 1, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "せ、先輩になら\n観察されてもいいなぁ", 2984, 0, 8, 1, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "バイト先に新しい子が\n入って来たんです…\nわ、私、先輩です♪", 2985, 0, 1, 2, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "せ、先輩…？\nえっと、あの、その、\nあわわわわ…！", 2986, 0, 1, 2, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "えへへ…えへへ～\nせ、先輩から\n話しかけてくれました", 2987, 0, 1, 2, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ま、また…\n先輩と一緒に\nバイトしたい…です", 2988, 0, 1, 2, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私と先輩が同じ空間に\n…ゆ、夢みたいです", 2989, 0, 4, 2, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "せ、先輩のそばに\n居られて、私\n今、とっても\n幸せです…", 2990, 0, 8, 2, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "せ、先輩…！\nおひゃっ！\nおはようございます！", 2991, 1, 1, 2, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "先輩ランチに\n行きましょう！\nよし、練習はバッチリ", 2992, 2, 1, 2, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ、せ、先輩。\nえと、そ、外…\nもう真っ暗ですねぇ", 2993, 3, 1, 2, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こ、ここで先輩も\n休んだり…はっ！\nわ、私ったらなにを！", 2995, 0, 1, 3, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいですねー\n君も一緒に、\n先輩を観察する？", 2996, 0, 1, 3, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ここから先輩の\n香りがすればなあ", 2997, 0, 1, 3, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "先輩と一緒に\nぬくぬくできたら\n最高なんだけどなぁ", 2998, 0, 1, 3, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいし～\nこれは\n先輩も好きな味かな", 3000, 0, 1, 3, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "す、好きな人に\n近づく方法…", 3001, 0, 1, 3, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私の力は、大切な\n人たちを護るために\n役立てたいんだ", 3003, 0, 1, 1, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "きれいな景色と\n美味しいご飯！\nこの世界も素敵だね", 3004, 0, 1, 1, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この世界のみんなとも\nもっと仲良く\nなりたいな！", 3005, 0, 1, 1, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "わー！\nあれもこれも\n気になっちゃうな！", 3006, 0, 1, 1, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "しっかりしなきゃって\n思ってても、\nグレアといるとつい\n甘えちゃうんだよね～", 3007, 0, 1, 1, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "違う世界でも\n友だちができて、\nすごくうれしいよ！", 3008, 0, 4, 1, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "みんなとも一緒に\n授業とか受けたいな～\n絶対楽しそうだもん！", 3009, 0, 8, 1, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "歩き方がきれい？\nえへへ、そうかな…？", 3010, 0, 1, 2, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "勉強は好きだよ！\n知識が増えていくのは\nやっぱり楽しいから", 3011, 0, 1, 2, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私たちの国マナリアは\n人々の間に魔法が\n伝えられた、その\n始まりの地なんだ！", 3012, 0, 1, 2, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この部屋にも、\nもっとたくさん本棚が\n増えないかな～…？", 3013, 0, 1, 2, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたも魔法、\n覚えてみる？\n私、教えるよ！", 3014, 0, 4, 2, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お茶の時間に\nしたいな～…\n一緒にどう？", 3015, 0, 8, 2, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようっ！\n今日も素敵な\n一日にしようね！", 3016, 1, 1, 2, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯は\nちゃんと食べた？\n午後も頑張ろうね！", 3017, 2, 1, 2, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "つい本の続きが\n気になって、夜更かし\nしちゃうんだよね～…", 3018, 3, 1, 2, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ、気持ちいい～…\nちょっとだけ\n眠っちゃおうかな…", 3020, 0, 1, 3, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わあ、これ可愛い！\nグレアにも見せて\nあげたいな", 3021, 0, 1, 3, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り～！\nなんだか気持ちが\n落ち着くね", 3022, 0, 1, 3, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あぁ、あったかくて\n幸せ～♪　身体が\nポカポカしてきたよ！", 3023, 0, 1, 3, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "こ、これ美味し～！\n止められないよー！", 3025, 0, 1, 3, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふんふん…\n…はっ！　む、夢中に\nなっちゃってた…", 3026, 0, 1, 3, 109201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "新しい建物に入ると\n必ず一度は迷子に\nなっちゃうですよ…", 3028, 0, 1, 1, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おやつはどこですか？\nお腹が空いて\nきちゃったですぅ", 3029, 0, 1, 1, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "宿題、７つぐらい\n出しそびれたですけど\nまあ大丈夫ですぅ！", 3030, 0, 1, 1, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "不思議なこと\nばかりですけど…\nまぁ大丈夫です！\nこれもせいしゅんです", 3031, 0, 1, 1, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "なにか面白そうなもの\nないですかね～？", 3032, 0, 1, 1, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ここのみんなとも\nもうお友だちですぅ！", 3033, 0, 4, 1, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おなかが減ったです…", 3034, 0, 8, 1, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ごはんも美味しいし\nここはいいところです\nルゥは幸せですぅ！", 3035, 0, 1, 2, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "魔法の話ですか？\nそれはアンせんぱいに\n聞いてほしいですぅ…", 3036, 0, 1, 2, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなたもお勉強\n苦手ですか？", 3037, 0, 1, 2, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ルゥの帽子、\nかわいいです？\nお気に入りですぅ♪", 3038, 0, 1, 2, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お友だちいっぱいで、\nルゥはうれしいです♪", 3039, 0, 4, 2, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "一緒にお勉強…！？\nぐえぇ、イヤですぅ！", 3040, 0, 8, 2, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝ですねぇ…ふわわ…\nルゥはまだ夢の中に\nいたいですぅ…", 3041, 1, 1, 2, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "午後もいっぱい\n遊ぶですよ～！", 3042, 2, 1, 2, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜ふかしって\nドキドキするです！\nせいしゅんですぅ！", 3043, 3, 1, 2, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふかですぅ～♪\nおひるねが\nしたくなるですぅ！", 3045, 0, 1, 3, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これふかふかですぅ！\n机でうとうとする時の\n枕によさそうですぅ", 3046, 0, 1, 3, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふぁぁ、いいにおい…\nなんだか気持ちが\nよくなってきたですぅ", 3047, 0, 1, 3, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽっかぽかですぅ～！\nあったまったら\nまた遊びにいくですぅ", 3048, 0, 1, 3, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お、おいしいですぅ！\n全部ルゥに\nくださいですぅ！", 3050, 0, 1, 3, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "本は…読むと、\nすぐ眠気がぁ…\n…ぐぅ…", 3051, 0, 1, 3, 109301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ピアノ…\nどこかにないかな？", 3053, 0, 1, 1, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅ…\n落ち着くな…", 3054, 0, 1, 1, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "マナリアはいつも\n賑やかなんだ…", 3055, 0, 1, 1, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "みんな…\n今頃何してるかな？", 3056, 0, 1, 1, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "まさか違う世界に\n来ちゃうなんて…\nびっくりだよね…", 3057, 0, 1, 1, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "人と話すのは\n得意じゃないな…", 3058, 0, 4, 1, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ここのみんなと一緒に\n学院に通えたら…\nちょっと面白いかも", 3059, 0, 8, 1, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "やっぱり、私の翼や\n尻尾…気になる？", 3060, 0, 1, 2, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一番得意なのは、\nやっぱり炎魔法かな…\n加減は難しいけど…", 3061, 0, 1, 2, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私の故郷は竜の国…\n険しい山脈を\n越えた先にあるんだ", 3062, 0, 1, 2, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アン…？\nあっ、ご、ごめんね！\n間違えちゃった…", 3063, 0, 1, 2, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふん…ふん…♪\n…わっ！\n今の、聞いてた…？\nは、恥ずかしい…", 3064, 0, 4, 2, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私に手伝えること、\nなにかある…？\nなんでも言ってね", 3065, 0, 8, 2, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝の空気って\nすごく\n静かで透き通ってて…\nなんだか落ち着くよね", 3066, 1, 1, 2, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "学院食堂のランチも\n美味しいけど…\nここのご飯も好きかな", 3067, 2, 1, 2, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろベッドに\n行かないとだね\n…寝相、今夜こそ\n気を付けよう…！", 3068, 3, 1, 2, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "羽を伸ばしたく\nなっちゃうね…ふふ", 3070, 0, 1, 3, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わ、私が持つには\nかわいすぎるかな…\nでも、素敵だね", 3071, 0, 1, 3, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…\nこれ、\nアンも好きそう…", 3072, 0, 1, 3, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "火を見ていると\n少し落ち着くんだ…\nへ、変かな？", 3073, 0, 1, 3, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "わ、美味しい…！\nこれ、どうやって\n作ったのかな…？", 3075, 0, 1, 3, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本…アンにも\n見せてあげたら\n喜ぶかな、ふふっ", 3076, 0, 1, 3, 109401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "着物はきれいですが\n歩きにくいです…\nいっそ脱いで…ぐふふ", 3078, 0, 1, 1, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あっ、いけません\n着物がはだけて…はっ\nもしやドＳさんが…！", 3079, 0, 1, 1, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この部屋は妄想する\nのにうってつけです…\nぐふふ…じゅるり", 3080, 0, 1, 1, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "扇をゆっくりと開く\nこの感触…なぜだか\n艶めかしさを感じます", 3081, 0, 1, 1, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "「マッサージをすると\n言いながらドＳさんの\n手は次第に」…ぐふふ", 3082, 0, 1, 1, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…ドＳさんの視線を\n思い出しながら踊りの\n練習です…イイ！", 3083, 0, 4, 1, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "よいではないか\nよいではないか～\nいけませんご堪忍を～", 3084, 0, 8, 1, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あ～れ～～～！\nドＳさんもお好きな人\nですねぇ…ぐふふ", 3085, 0, 1, 2, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どこにいてもドＳさん\nの気配を感じ取れる\nようになりました…", 3086, 0, 1, 2, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こんな場所で\nなんというプレイを！\n…妄想でした", 3087, 0, 1, 2, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "クウカを押し倒して\nそのまま…じゅるり\nああっ、着物が…！", 3088, 0, 1, 2, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ドＳさんは優しいです\n優しいのにドＳとは\nさすが人格破綻者…！", 3089, 0, 4, 2, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ドＳさんの考えている\nことが伝わってきます\nはい…クウカ脱ぎます", 3090, 0, 8, 2, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "眩しい朝日がクウカの\n体を焦がします\n…それもイイ！", 3091, 1, 1, 2, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼のランチは\nクウカがいいだなんて\n大胆過ぎです…じゅる", 3092, 2, 1, 2, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…今夜のドＳさんは\n大胆です…ぐふふ…\nはっ、視線が…！？", 3093, 3, 1, 2, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この心地良さ、\n心が休まりすぎて\n体が疼いてきます…！", 3095, 0, 1, 3, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "すごく愛らしいです…\n妄想も出てこない\nくらい…じゅるり", 3096, 0, 1, 3, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香りに包まれて\nいると、いい気持ちに\nなって…いきますぅ…", 3097, 0, 1, 3, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "「熱を帯びた体は\nどうしようもなく\n誰かを求め…」ぐふふ", 3098, 0, 1, 3, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お腹が膨らんで\nいきます…それは\nまるで…ぐふふ", 3100, 0, 1, 3, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "クウカの探している\nジャンルはどこに\nありますかね？", 3101, 0, 1, 3, 109501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "カチョーフーゲツは\nトーゴクの心を\n表した言葉デスね", 3103, 0, 1, 1, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "オー！　新しい忍法を\n思いついたデス！\nさっそく試すデス！", 3104, 0, 1, 1, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "トーゴクの天気には\n槍が降る日も\nあるそうデス…", 3105, 0, 1, 1, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "我がショーグンは\n永遠にフメツデース\nいざ出陣デース！", 3106, 0, 1, 1, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "壁に耳あり\n障子に…ん？\nメアリーって誰デス？", 3107, 0, 1, 1, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ショーグンがいれば\nワタシはどんな\n忍法も使いこなせマス", 3108, 0, 4, 1, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "不届き者はどこで\nゴザルデス？　忍法で\n退治してくれヨウ！", 3109, 0, 8, 1, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ショーグン！　新しい\n忍法を覚えたデス！\n見てほしいデース！", 3110, 0, 1, 2, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "レッツ手裏剣道デス！\n投げてソウロウで\nゴザルデース！", 3111, 0, 1, 2, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふりかかる火の粉は\nワタシが払うデス！\nバンバン！", 3112, 0, 1, 2, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "とっておきの忍法が\n吹き荒れるデス！\nよそ見はダメデスヨ？", 3113, 0, 1, 2, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ショーグンは\n何階建てのお城を\n建てたいデスか？", 3114, 0, 4, 2, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "テンシュカクから\n平和な城下町を\n眺めてみたいデス…", 3115, 0, 8, 2, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございマス！\n本日はオヒガラモヨク\n良い日になりそうデス", 3116, 1, 1, 2, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹すいたデース…\nショーグンもご飯に\nしまショウ！", 3117, 2, 1, 2, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "闇討ちに遭わぬよう\n夜は気を付けて\n歩くデスよー？", 3118, 3, 1, 2, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "天下分け目の\n戦いに備えて…\nマッタリデース", 3120, 0, 1, 3, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "口寄せの術で\n召喚したいくらい\nかわいいデース", 3121, 0, 1, 3, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい匂いデ～ス\n香り玉の開発の\n参考になりそうデスね", 3122, 0, 1, 3, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ワタシの懐よりも\nゾーリが暖まりマス…\nライバル出現デス…！", 3123, 0, 1, 3, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "腹が減っては\n戦はできぬデース！\n天下統一に向けて\n腹ごしらえデス！", 3125, 0, 1, 3, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ムム、暗号文デス！？\n解読には時間が\nかかりそうデース…", 3126, 0, 1, 3, 109601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "掃除も終わりましたし\nそろそろ、食事の\n準備をしなくては", 3128, 0, 1, 1, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "異世界の演劇…\n許されるならば、\n観てみたいです", 3129, 0, 1, 1, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こちらの世界には、\nマヨネーズが普通に\n存在するのですね…", 3130, 0, 1, 1, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こちらの世界は食材も\n面白い物が多いですね\nなにかレシピを\n考えてみましょうか", 3131, 0, 1, 1, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "みょんみょんみょん…\n魔法の練習は\nこれぐらいですね", 3132, 0, 1, 1, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "倒木の撤去で思わぬ\n収入となりました\nサレン様に\nお渡ししておかないと", 3133, 0, 4, 1, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "料理を美味しく\n召し上がって頂けると\nメイド冥利につきます", 3134, 0, 8, 1, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お出かけでしたら、\nレムも同行\nさせてくださいね", 3135, 0, 1, 2, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "レムにできること\nでしたら、なんでも\nお申し付けください", 3136, 0, 1, 2, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "じーー。いえ、\nその髪の長さが少し、\nとても少し、かなり\n少し気になったもので", 3137, 0, 1, 2, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "鉄球ですか？\nあれは護身用ですので\n問題はありませんよ？", 3138, 0, 1, 2, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "計算の勉強は\n進んでおりますか？\nレムでよろしければ、\nいつでもお教えします", 3139, 0, 4, 2, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "次はもっと、大きな\n魔物料理に挑戦します\nワイバーンの姿焼き\nなんてどうでしょうか", 3140, 0, 8, 2, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n朝食の準備が\nできておりますので、\n食卓におこしください", 3141, 1, 1, 2, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼食の時間ですね\n何か食べたいものは\nありますか？", 3142, 2, 1, 2, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "寝ないのか、ですか？\nメイドの就寝は、\n屋敷で最後と\n決まっておりますので", 3143, 3, 1, 2, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふんわり…\nこのふんわりさは、\n鬼をも黙らせます…", 3145, 0, 1, 3, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふっ…異世界でも\nかわいいものは\n共通なのですね", 3146, 0, 1, 3, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "よい香りですね\n魔女教の悪臭とは\n大違いです", 3147, 0, 1, 3, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぬくぬくです…はっ！\nこれはいけません！\n人を…いえ、\n鬼をだめにします！", 3148, 0, 1, 3, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "はむはむ…美味しい！\nこの味を再現できたら\n褒めてもらえる\nかもしれません…！", 3150, 0, 1, 3, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "絵がいっぱい…\n異世界の本は\nとても面白いですね", 3151, 0, 1, 3, 109701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "異世界であろうと、\nラムのやるべきことは\n変わらないわ\nまずは休憩するわよ", 3153, 0, 1, 1, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "マヨネーズがある\nということは、\nバルスの故郷が近い\nのかもしれないわね", 3154, 0, 1, 1, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この世界では、バルス\nの言う言葉が使われる\nときがあるのね\n忌々しいかぎりだわ", 3155, 0, 1, 1, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ラムたち以外にも\nメイドが居るのね\nラムが…いえ、\n仕事を押しつけるわ", 3156, 0, 1, 1, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "…千里眼で視るかぎり\n周囲に異変はないわね\n危険がないなら、\nあとはレムに任せるわ", 3157, 0, 1, 1, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…ラムもまた、\n「お姉ちゃん」って\n呼ばれる日が\nくるのかしらね", 3158, 0, 4, 1, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ハッ！　ラムが作る\n蒸かし芋は完璧ね\n…気が向いたら、また\n作ってやろうかしら", 3159, 0, 8, 1, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ラムに構う暇が\nあるなら働きなさい\nそうすれば、\nラムが楽をできるわ", 3160, 0, 1, 2, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ラムに何かを\n期待しても無駄よ\nラムに命令できるのは\nロズワール様だけだわ", 3161, 0, 1, 2, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "暇なら買い物に\n付き合いなさい\n荷物を\n持たせてあげるわ", 3162, 0, 1, 2, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ラムになんの用？\nふざけた内容なら\nねじ切るわよ", 3163, 0, 1, 2, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "そういえば、あなたは\n記憶喪失だったわね…\n思い出す努力をなさい\n…家族が悲しむわよ", 3164, 0, 4, 2, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "蒸かし芋が欲しい？\n随分と厚かましいわね\n…まだ残りがあるから\n好きに食べなさい", 3165, 0, 8, 2, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "だらしない顔ね\n顔を洗って\nしゃんとなさい", 3166, 1, 1, 2, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹が空く時間ね\nラムの昼食を\n用意させてあげるわ", 3167, 2, 1, 2, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "メイドが寝るのは\n屋敷で最後…\nラムが寝るために、\nさっさと寝なさい", 3168, 3, 1, 2, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "…ここから動かない\nという、誓いを\n立てたくなるわね", 3170, 0, 1, 3, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これは…かわいいわね\nもちろん、\nラムほどではないけど", 3171, 0, 1, 3, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…香炉かしら？\nこちらの世界にも\n質のよい物があるのね", 3172, 0, 1, 3, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "見つけてしまったの\nかもしれないわ…\nラムの楽園を！", 3173, 0, 1, 3, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "…はむっ\nラムの蒸かし芋ほど\nではないけど、\nなかなかいけるわね", 3175, 0, 1, 3, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "異世界ならではの\n面白い内容もあるわね\nとても興味深いわ", 3176, 0, 1, 3, 109801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ねえパック、\nにゃんにゃか\nにゃかにゃんしよっか", 3178, 0, 1, 1, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "時間もあるし、\nこっちの世界の石で\n石積みしようかな", 3179, 0, 1, 1, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私もお姉さんだし、\nサレンさんを\n見習わないと…うん！\n私、すごーく頑張る！", 3180, 0, 1, 1, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この世界は、銀髪で\nハーフエルフでも受け\n入れてくれるのね…\nなんだか嬉しいな", 3181, 0, 1, 1, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "今日のご飯…\nピーマルは\n入ってないわよね…？", 3182, 0, 1, 1, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "また、みんなで\n一緒に買い物に\n行きたいな", 3183, 0, 4, 1, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "パック以外から\n家族って呼ばれたの\n初めて…ふふっ♪\nちょっと嬉しいかも！", 3184, 0, 8, 1, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今からパックの\n毛繕いをするけど…\n一緒にする？", 3185, 0, 1, 2, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私も何かお手伝いを…\nあ、そうだ！\n料理とかどうかな！", 3186, 0, 1, 2, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ねえ、ここで\n歌の練習って、\nしてもいいかな？", 3187, 0, 1, 2, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…あ、ごめんなさい！\n話しかけられるのって\nあまり慣れてなくて…", 3188, 0, 1, 2, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "すごーく頑張るから、\nこれからも勉強を\n手伝ってね", 3189, 0, 4, 2, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "せーの、びくとりー！\nふふっ…また、一緒に\nラジーオタイソー\nしようね♪", 3190, 0, 8, 2, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちゃんと起きてる？\nふふっ…よかった。\nあ、べ、別に心配した\nわけじゃないからね？", 3191, 1, 1, 2, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯が楽しみね♪\nあ、こっちの世界って\nまよねーずはあるの？", 3192, 2, 1, 2, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ寝る時間よ。\n夜更かししたら、\nめっ！　だからね！", 3193, 3, 1, 2, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "勉強も終わったし…\nちょっ、ちょっとだけ\n休んでもいいよね…？", 3195, 0, 1, 3, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "か、かわいい…！\nパックのかわいさに\n匹敵するかも…！", 3196, 0, 1, 3, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "良い香り…\nロズワールの屋敷にも\nこういうのって\nあるのかな？", 3197, 0, 1, 3, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかい…\nずっとここに…はっ！\nダメダメ！　王選の\nために勉強しないと！", 3198, 0, 1, 3, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あ…これ美味しい！\nこっちの世界は色んな\n食べ物があるのね。", 3200, 0, 1, 3, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "知らないことが\nいっぱい書いてある…\n異世界の本って、\n面白いのね", 3201, 0, 1, 3, 109901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "海ってマジ最高！\nビーチの撮影も\n超楽しいしー♪", 3203, 0, 1, 1, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "20パーって何パ？\n今度ヒデサイに\n聞いてみよっ！", 3204, 0, 1, 1, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夏の思い出を\nヒデサイと一緒に\n作りたいな～", 3205, 0, 1, 1, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "テンションあがる\n水着ゲットして\n超ラッキーだよ～♪", 3206, 0, 1, 1, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "休憩が終わったら\n撮影にもどらないと！\n気合入れてこ♪", 3207, 0, 1, 1, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ヒデサイとビーチで\nパーティーしたいな～\n超楽しそうだよね！", 3208, 0, 4, 1, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ヒデサイといると\n楽しくてうれしくて…\nカレシってこんな感じ\nなのかなぁ？", 3209, 0, 8, 1, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "見て見て～！\n夏らしいネイルに\nしてみたんだ～♪", 3210, 0, 1, 2, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ヒデサイ～\nこの水着どうかな？\nイケてるっしょ♪", 3211, 0, 1, 2, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "水着姿の写真？\nもちいいよ！\nかわいく撮ってね！", 3212, 0, 1, 2, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うちだって\n夏の海みたいに\nキラキラしちゃうよ！", 3213, 0, 1, 2, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ヒデサイとうちの\nフィーリングって\nめっちゃエモいよね♪", 3214, 0, 4, 2, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ねーねーヒデサイ！\n一緒に泳ぎにいこっ！\nほら、手繋いで♪", 3215, 0, 8, 2, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "水着オッケー！\nネイルもばっちり！\n朝から遊んじゃおー♪", 3216, 1, 1, 2, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼食べたら\n昼寝して\nリフレッシュしよー♪", 3217, 2, 1, 2, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "水着ってマジで\n最強かも…このまま\nお風呂にも入れるし♪", 3218, 3, 1, 2, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "マジ気持ちいいー♪\nおに癒やされるん\nですけど～！", 3220, 0, 1, 3, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "やばばばばー！\nかわいすぎだってば！\nマジらぶだよ～♪", 3221, 0, 1, 3, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あ、この香り超好き！\nモデル仲間に\n教えたげよ～♪", 3222, 0, 1, 3, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったか～い♪\n夏の太陽みたい！", 3223, 0, 1, 3, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "マジ美味しいねこれ♪\nビーチで\n流行っちゃうかも！", 3225, 0, 1, 3, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "夏のために\n最新ファッションを\n勉強ちう！", 3226, 0, 1, 3, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "なにコレもにカワ～♪\nなんて生き物？\nヒデサイ知ってる？", 3228, 0, 1, 3, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "うわっ超フカフカ～\nなんかうち眠く\nなってきちゃった…", 3229, 0, 1, 3, 110001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "海の家でのんびり\n過ごしましょう\n熱中症には注意してね", 3230, 0, 1, 1, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ、どうやったら\n泳げるように\nなれるのかしら～", 3231, 0, 1, 1, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海で日焼け止めを\n塗らないと、あとで\n大変なことになるわよ", 3232, 0, 1, 1, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "久しぶりに水着を\n着たんだけど\n変じゃなかったかな…", 3233, 0, 1, 1, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "波の音って落ち着くわ\n授業中に聞いたら\nみんな寝ちゃうかも？", 3234, 0, 1, 1, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "海が楽しいって\n思えたのも\nあの子のおかげね", 3235, 0, 4, 1, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの子と二人で海に\n来られてよかったわ\n一日があっという間ね", 3236, 0, 8, 1, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "男の子と海だなんて\n少女漫画みたいで\n憧れてたの～", 3237, 0, 1, 2, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夏休みの宿題は\nちゃんとやった？\n遊んでばかりではダメ", 3238, 0, 1, 2, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "昼の海と夜の海\nどっちが好き？　私は\n君といる海が一番よ", 3239, 0, 1, 2, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふう、疲れたわ～\n冷たいジュースで\n元気回復ね！", 3240, 0, 1, 2, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "海で見た君の背中\nすごく大きく見えたわ\nやっぱり男の子なのね", 3241, 0, 4, 2, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "君と一緒に見た\n夜の海…\n忘れられそうにないわ", 3242, 0, 8, 2, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "準備ができたら\n海に出かけようよ\n今日も楽しみましょう", 3243, 1, 1, 2, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あら、もうお昼？\n海の家でランチに\nしましょ♪", 3244, 2, 1, 2, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の海岸についてきて\nくれる？　暗がりは\n一人じゃ怖くて…", 3245, 3, 1, 2, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "泳ぐ練習をしたら\n疲れちゃったわ～\nちょっと一休み…", 3247, 0, 1, 3, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいわね～\n浮き輪に乗せて\n海に浮かべたいわ～", 3248, 0, 1, 3, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この匂い…\nなんだか夏の海を\n思い出すわ～", 3249, 0, 1, 3, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "夜の海風で冷えない\nように、しっかりと\n身体を暖めましょうね", 3250, 0, 1, 3, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "海で遊ぶ前に\nしっかり食べて\n体力つけましょう", 3252, 0, 1, 3, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "夏休み中でも\nしっかりお勉強\nしないと！", 3253, 0, 1, 3, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "この子に乗れば\n海の上でも\nすいすい進めるかしら", 3255, 0, 1, 3, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "ビーナスの誕生！\n…なんちゃって\nはしゃぎすぎかしら？", 3256, 0, 1, 3, 110101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夏の海には商機が\nあるはず…\nのがす手はないわね♪", 3257, 0, 1, 1, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あたしが作った\n日焼け止め…\nこれは売れそうね！", 3258, 0, 1, 1, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "子どもたちのために\n浮き輪を用意して\nおかないと…", 3259, 0, 1, 1, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "海っていいわよね！\nみんなで羽を伸ばしに\n行きたいわ！", 3260, 0, 1, 1, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "波の音を聞いて\nのんびりするのも\n悪くないわね…", 3261, 0, 1, 1, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ただの砂遊びも\nあんたと一緒なら\n楽しいから不思議ね…", 3262, 0, 4, 1, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんたがあたしの\nなんであれ、大切な\n存在ではあるのよね…", 3263, 0, 8, 1, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夏の海って\nすごい人よね…\n迷子にならないでよ？", 3264, 0, 1, 2, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぼんやり海に浮かんで\n波に揺られるのも\n悪くないわよ？", 3265, 0, 1, 2, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ビーチで子どもたちと\n一緒に砂のお城を\n作りたいわ♪", 3266, 0, 1, 2, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "海で食べる\n焼きそばパン…\nいいかもしれないわね", 3267, 0, 1, 2, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あたしの水着\n似合ってる？\nそう、ありがとう♪", 3268, 0, 4, 2, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんたが居ると\nうれしい…って、\n子どもたちが\n言ってたわ！", 3269, 0, 8, 2, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝の浜辺って\nいいわよね\n散歩しに行きたいわ", 3270, 1, 1, 2, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海の家のご飯って\nなんであんなに\nおいしいのかしら♪", 3271, 2, 1, 2, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の海って、\nロマンチックよね。\nずっと眺めてたいわ…", 3272, 3, 1, 2, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "やわらかくて\n気持ちいい…\nこのまま寝ちゃいそう", 3274, 0, 1, 3, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海に一緒に入れる\nぬいぐるみとか\nないかしら？", 3275, 0, 1, 3, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夏らしい\nいい香りね…\nなんの香りかしら？", 3276, 0, 1, 3, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかい…\n濡れた体を乾かすには\nちょうどいいわね♪", 3277, 0, 1, 3, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "泳いだ後の食事は\n普段の何倍も\nおいしく感じるわね！", 3279, 0, 1, 3, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "海に行く前にいろいろ\n調べなきゃね。備え\nあれば憂いなしよ！", 3280, 0, 1, 3, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "海の守り神？\nずいぶんかわいらしい\n神様ね♪", 3282, 0, 1, 3, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "このぐらい\n大きな貝があったら\n食費も浮くかしら？", 3283, 0, 1, 3, 110301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "浜辺で食うものって\nなんであんなに\nうまいのかな～", 3284, 0, 1, 1, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いてて…\nちょっと日焼け\nしすぎたかな", 3285, 0, 1, 1, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "砂浜で走ると\nいいトレーニングに\nなるんだぜ", 3286, 0, 1, 1, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夏ならではの\n料理…か\n何がいいかな…", 3287, 0, 1, 1, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "やっぱりここは\n涼しくて快適だな", 3288, 0, 1, 1, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "泳ぎの練習だったら\nいつでも付き合って\nやるからな！", 3289, 0, 4, 1, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "水着で部屋の中に\nいるのって\n変な感じだな…", 3290, 0, 8, 1, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うおっ！\nきゅ、急に\n触るなって…\nびっくりした", 3291, 0, 1, 2, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "え、砂がついてた？\n払ってくれたのか\nありがとよ", 3292, 0, 1, 2, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夏バテしてないか？\nここで休んでけよ", 3293, 0, 1, 2, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…そう見られると\n照れるっていうか…", 3294, 0, 1, 2, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "カキ氷とか\n食いたくないか？\n氷、削ってやるよ", 3295, 0, 4, 2, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おまえと\n夏の思い出ができて\nよかったよ", 3296, 0, 8, 2, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふう…\n朝一番で泳ぐの\nやっぱ気持ちいいな", 3297, 1, 1, 2, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一番あちぃ時間だ\n水分補給は\nこまめにな！", 3298, 2, 1, 2, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日もお疲れ\n明日のパトロールも\nよろしくな", 3299, 3, 1, 2, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "泳ぎ疲れたからな\n少し休憩だ…", 3301, 0, 1, 3, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "か、かわいい…\nいや、なんでもねぇ！", 3302, 0, 1, 3, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り落ち着くな\nこういうのも\n悪くねーかも…", 3303, 0, 1, 3, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったけえ…！\n泳ぎ終わった後って\nけっこう体冷えてよ…", 3304, 0, 1, 3, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "海で食べると\nまた一味違うよな", 3306, 0, 1, 3, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "夏のサバイバル特集…\nちょっと読んでみるか", 3307, 0, 1, 3, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "へー！　こいつ、\nよくできてんな！\nいいなあ、実物も\n乗れたらいいのに", 3309, 0, 1, 3, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "か、かわ…！\nいや、じゃなくて\nあ、あたしがここに\n寝ていいのか…？", 3310, 0, 1, 3, 110401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "故郷の花を飾っても\nいいかな～？\n部屋が楽しくなるよ～", 3311, 0, 1, 1, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "水着で歩いてると\n泳ぎたくなるさ～\n我慢できないさ～！", 3312, 0, 1, 1, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夏が眩しいのは\nてぃーだがにこにこ\n笑ってるからさ～！", 3313, 0, 1, 1, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "泳ぎ疲れたら\n涼しい木陰で\nお昼寝するさ～", 3314, 0, 1, 1, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "クロールも\n犬かきも\n大得意さ～！", 3315, 0, 1, 1, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "なんだか歌いたい\n気分さ～\nキミもどう～？", 3316, 0, 4, 1, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "海の近くに住んで\nキミと歌って踊って\nそれが理想さ～！", 3317, 0, 8, 1, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私とキミ\nどっちがたくさん\n泳げるか\n競争するさ～！", 3318, 0, 1, 2, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "キミも三線に興味が\nあるのかな～？\n私が教えるさ～！", 3319, 0, 1, 2, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "嫌なことがあっても\n私と歌って踊れば\nなんくるないさー！", 3320, 0, 1, 2, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "たまには時間を忘れて\n私とのーんびり\n海を眺めるさ～", 3321, 0, 1, 2, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ぶるぶるぶるっ！\n毛が濡れちゃっても\nへっちゃらさ～！", 3322, 0, 4, 2, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "泳ぐ前は準備体操～！\n背中押してあげるから\nしっかりやるさ～！", 3323, 0, 8, 2, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝の浜辺は\nちゅらさんよ～\n一緒に歩こうよー！", 3324, 1, 1, 2, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯は\n決まったかな～？\n私はタコライスさ～！", 3325, 2, 1, 2, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "星と波音の中で\n三線鳴らすのも\nオツなものさ～", 3326, 3, 1, 2, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょうどよかったさー\nゆっくり休んだら\nまた泳ぎに行くさ～！", 3328, 0, 1, 3, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "砂浜に飾って\nおきたいさ～\nきっとかわいいさ～！", 3329, 0, 1, 3, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "くんくん…はあ\n癒されるさ…\n故郷の夏の匂いさ～", 3330, 0, 1, 3, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "おおー…！\n濡れた髪が\nみるみる乾いてくさ～", 3331, 0, 1, 3, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ん～！　これ、\n海で食べたら\nもっとおいしいさ～", 3333, 0, 1, 3, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "海の生物図鑑ね～\nこの前みかけた魚も\n載ってるかな～？", 3334, 0, 1, 3, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "わぁ～！　みてみて！\n背中に乗れるさー！\nキミと一緒に\n乗りたいさ～！", 3336, 0, 1, 3, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "ふかふかさ～\n海の底の\n人魚になった気分さ～", 3337, 0, 1, 3, 110501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あの人が\nわたしの騎士だったら\nいいのにな…", 3338, 0, 12, 1, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あなたのおかげで\nわたしの心はいつも\nお腹いっぱいです♪", 3339, 0, 12, 2, 105801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "許されるのならば、\n今すぐにでも、\n主さまのおそばに\n行きたいです…", 3340, 0, 12, 1, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "主さま…\nお慕いしております…\nいつまでも、おそばに\n居させてください…", 3341, 0, 12, 2, 105901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "なんか最近、\nあいつのことしか\n考えてない…\nあたし…どうしよう…", 3342, 0, 12, 1, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "そ、外に行くなら、\n連れていきなさいよね\nその…あたしが\n守ってあげるから…", 3343, 0, 12, 2, 106001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "部屋の中は涼しくて\n気持ちええどすなぁ\n天国やわぁ", 3344, 0, 1, 1, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "クラゲはんって\nフリルいっぱいの\nドレスみたいやねぇ", 3345, 0, 1, 1, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "外でセミはんが\n元気に鳴いてはるねぇ\n今日もええ天気やわぁ", 3346, 0, 1, 1, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こないに暑いと\n海に入って\n涼みたくなるわぁ", 3347, 0, 1, 1, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "いつか\nマホマホ王国にも\n海の家作りまひょ♪", 3348, 0, 1, 1, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "うちも\n付き合いますえ\n泳ぎの練習しまひょ♪", 3349, 0, 4, 1, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "うちの里帰り\n王子はんも一緒に\n来まへんか？", 3350, 0, 8, 1, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "王子はんは日焼けより\n色白美人の方が\n好きでっしゃろか？", 3351, 0, 1, 2, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うちと一緒に\n浮き輪で海、\nプカプカしまへん？", 3352, 0, 1, 2, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "日が落ちたら\n線香花火\nやりたいわぁ♪", 3353, 0, 1, 2, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "木陰でのんびり\nお昼寝…\n最高やね～", 3354, 0, 1, 2, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お祭ではぐれても\n王子はんなら見つけて\nくれはります？", 3355, 0, 4, 2, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "楽しい夏やわぁ\nずっとこんな日が\nつづくとええね", 3356, 0, 8, 2, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うちにしては早起き？\n暑くて目が早う\n覚めてもうたんどす", 3357, 1, 1, 2, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼は冷たい\nおそうめんとか\nどうでっしゃろ", 3358, 2, 1, 2, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜は星がきれいやね\n二人で浜辺でも\n行きまへんか？", 3359, 3, 1, 2, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うーん、遊び疲れた\n身体にちょうどええ\nほっこり具合やわぁ", 3361, 0, 1, 3, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かいらしい子は\nみーんな\nマホマホ王国の\n住人どすえ♪", 3362, 0, 1, 3, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り…\n南国にいる気分やねぇ\n癒されるわぁ～", 3363, 0, 1, 3, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これで\n冷えた身体も\nポカポカやねぇ", 3364, 0, 1, 3, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "外はまだ暑いやろうし\nバテんよう\nしっかり食べんとね", 3366, 0, 1, 3, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "海の中にもお城が\nあるんやねぇ\n行ってみたいわぁ", 3367, 0, 1, 3, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "この子、ふかふかやね\nこのままマホマホ王国\n乗せてってくれはる？", 3369, 0, 1, 3, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "人魚姫になっても\n最後は王子はんと\nハッピーエンド\nどすえ～", 3370, 0, 1, 3, 110601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "真似したくなる\n人がここには\n大勢いますね", 3371, 0, 1, 1, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "偽物を一人\n紛れこませました\n…冗談です", 3372, 0, 1, 1, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "動物に変身して\nその辺りを\n散歩してきます", 3373, 0, 1, 1, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "失った記憶は\nどの程度回復するの\nでしょうね", 3374, 0, 1, 1, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "人や物だけでなく\nいずれは世界すら\n真似てみせます", 3375, 0, 1, 1, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "次は彼に\nどんなことを\n教えましょうか…", 3376, 0, 4, 1, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "知識はともかく\n私の力はまだ\n必要なようですね", 3377, 0, 8, 1, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうしました？\n…何でもない？\n…そうですか", 3378, 0, 1, 2, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "退屈しています\n芸でもして\n楽しませなさい", 3379, 0, 1, 2, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "研究のためです\n少し話し相手に\nなりなさい", 3380, 0, 1, 2, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "何か真似して欲しい？\n私の能力を何だと\n思っているのですか", 3381, 0, 1, 2, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "貴方にはまだ色々と\n教えるべきことが\nありますね", 3382, 0, 4, 2, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "随分多くの女性と\n知り合いなのですね\n驚きました", 3383, 0, 8, 2, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…\nおはようございます\n…まだ朝ですよ", 3384, 1, 1, 2, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "食事にします\n…どうしました？\n早く持ってきなさい", 3385, 2, 1, 2, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "早く寝なさい\n夜更かしすると\n背が伸びませんよ？", 3386, 3, 1, 2, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "マサキより\n座り心地は\nいいですね", 3388, 0, 1, 3, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "意外に複雑な\n構造ですね", 3389, 0, 1, 3, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "真似るなら\n香りまで\n再現しなくては", 3390, 0, 1, 3, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "発火現象の\n模倣…なかなか\n難しいものです", 3391, 0, 1, 3, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "偽物や分身を作るには\nエネルギーが\n必要不可欠なのです", 3393, 0, 1, 3, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "暇つぶしには\nちょうどよさそうです\n…", 3394, 0, 1, 3, 107001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "学院かぁ…\n友達の作り方の\n授業はないかな？", 3396, 0, 1, 1, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "学院でぼっちに\nなったときのために、\n避難場所を\n探しておかないと…", 3397, 0, 1, 1, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぼっちの私が学院…\nな、なんだか\n目まいがしてきました", 3398, 0, 1, 1, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "クラスメイトに\n話しかける練習…\nむ、難しすぎます…！", 3399, 0, 1, 1, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "目指せ友達100人…\n無理かな…10人…\nや、やっぱり一人！", 3400, 0, 1, 1, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたと学院生活が\n送れるなんて、\nとっても\nうれしいです！", 3401, 0, 4, 1, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "えへへ…\n学院でも、\nあなたと一緒に\n居られてうれしいな♪", 3402, 0, 8, 1, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "が、学院ってあんなに\n人が居るんですね…\n友達作りのイメトレを\nやり直さないと！", 3403, 0, 1, 2, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私にとって\n部活動とはＢＢ団！\n今日もたくさん\n活動しましょうね！", 3404, 0, 1, 2, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "休み時間は寝たふり…\nご飯はおトイレ…\nぼっち対策は完璧です", 3405, 0, 1, 2, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "学院で友達を作る\n勉強は完璧ですよ！\n購買部でパンを買って\n渡すんですよね！", 3406, 0, 1, 2, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "学院でも、\nBB団の活動を\nしていきましょうね♪", 3407, 0, 4, 2, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ぼっちに学院生活は\n厳しいですね…でも、\nあなたと一緒なら\n乗りこえられそうです", 3408, 0, 8, 2, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もうこんな時間…\nあの…一緒に学院に\n行ってくれませんか？", 3409, 1, 1, 2, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ですね！\n言ってくれれば、\nパンでもお握りでも\n買ってきますよ！", 3410, 2, 1, 2, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日もぼっち…\nいつか友達と一緒に、\nパジャマパーティー\nしたいなぁ…", 3411, 3, 1, 2, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "森とは違う\n心地良さが…このまま\n眠っちゃいそうです…", 3413, 0, 1, 3, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい…この子を、\n話す練習の相手役に\nしてみようかな？", 3414, 0, 1, 3, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…\nいつ友達ができても\nいいように、私の\n部屋にも置こうかな", 3415, 0, 1, 3, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "こ、これは…\nぼっちで\n日陰者の私には\n暖かすぎます！", 3416, 0, 1, 3, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしい…！\nお弁当にして、学院に\n持っていけないかな？", 3418, 0, 1, 3, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "学院の授業に\nついていくためにも、\n勉強しておこうかな…", 3419, 0, 1, 3, 110701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あんた、何してんの。\nいいけど、なんでも", 3421, 0, 1, 1, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "邪魔。どいて。\nいや怒ってないし。\nコレがフツーだから", 3422, 0, 1, 1, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いいけど、\n散らかしめの部屋だと\n片付けたくなるよね…", 3423, 0, 1, 1, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "暇なときは明日の\nコーデ考えてるよ。\n考えるのはタダだし", 3424, 0, 1, 1, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "昔よくシオリン\n構いすぎてハツネに\n文句言われたなァ…", 3425, 0, 1, 1, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "なんかさ。あんたって\n謎に女子トモ多いよね\n…いいけど、べつに", 3426, 0, 4, 1, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ねえ。あのさあ。\nあんた弁当で好きな\n具とかってあんの", 3427, 0, 8, 1, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あ？　何。なんか用。\nや、ないならないで\nいいけど、べつに", 3428, 0, 1, 2, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ごめ、ちょっと\n黙っててくんない。\n明日の試験ヤバだから", 3429, 0, 1, 2, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "歩き方が静か？\n癖になってるんだよね\n足音を殺すの", 3430, 0, 1, 2, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うちの血液型？\n大雑把のОだけど。\nなんか文句あんの", 3431, 0, 1, 2, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ひゃんっ！\nや、だからさ…急に\n話しかけんなっての", 3432, 0, 4, 2, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "な、何…あんまジッと\n見ないでくんない…\nなんか、その、ハズい", 3433, 0, 8, 2, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "早起きは得意な方だと\n思うけど。昔から\nそれがデフォだったし", 3434, 1, 1, 2, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こんな時間か…\n昼ごはん\nサクッと作っちゃお", 3435, 2, 1, 2, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ？　夜遊び？\nはッ…そんなん\n５歳で卒業したっての", 3436, 3, 1, 2, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あーヤバじゃんコレ…\nふかついてる場合\nじゃないっつーのに…", 3438, 0, 1, 3, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なんだこれ\nかわいいかよ", 3439, 0, 1, 3, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふーん。\nこの匂い…\nなんかいいじゃん", 3440, 0, 1, 3, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖炉はアドじゃん。\n煮物、焼き物、蒸し物\nいろいろ作れそう", 3441, 0, 1, 3, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "何コレ\n食べ物困んないじゃん\nうちにも一台くんない", 3443, 0, 1, 3, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "本かァー…んー\n学校の勉強だけで\nいいかなァ…", 3444, 0, 1, 3, 110801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "イタズラってなにを\nしたらいいのかな？", 3446, 0, 1, 1, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "カップケーキ\n上手に作れました\n食べてくれるかな…", 3447, 0, 1, 1, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あの人、\nお菓子くれるかな？\nくれなかったら…ふふ", 3448, 0, 1, 1, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "オバケ…いないよね？\n怖くなんてないけど！", 3449, 0, 1, 1, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ハロウィンは\n楽しいけどオバケの\nお祭りなんだよね…", 3450, 0, 1, 1, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "にゃ～、にゃお～！\nちゃんと怖いかな？\n早く帰ってこないかな", 3451, 0, 4, 1, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人のことだから\nお菓子欲しがるよね…\n準備はバッチリです♪", 3452, 0, 8, 1, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "えへへ。猫さんのお耳\nよく出来てるでしょ？", 3453, 0, 1, 2, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "触りましたね？\nイタズラしましたね？\nへんた～い！", 3454, 0, 1, 2, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "フー！　頭を撫でたら\n怒りますよ！　あれ？\n猫みたいでした？", 3455, 0, 1, 2, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "きゃっ！　も、もう、\n脅かさないでください\n怖くありませんけど！", 3456, 0, 1, 2, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お菓子ですか？\nありがとうございます\nハッピーハロウィン♪", 3457, 0, 4, 2, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ゴロゴロ…\nね、猫さんの真似です\n…似てましたか？", 3458, 0, 8, 2, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さぁ、お菓子作りを\n始めますよ。下準備は\n大事ですからね！", 3459, 1, 1, 2, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今、つまみ食い\nしましたね！？　あっ\nおやつの時間でしたか", 3460, 2, 1, 2, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さぁ、ハロウィンの\n始まりです…ふぁ…\nね、眠くありません！", 3461, 3, 1, 2, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっと疲れたかも…\nパーティの時間まで\nひと休みしなきゃ", 3463, 0, 1, 3, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私も今、こんな感じ\nなのかな？　こんなに\nかわいいといいなぁ", 3464, 0, 1, 3, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "甘い匂いがいっぱい…\nお菓子の香りかな？", 3465, 0, 1, 3, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "温かくなると、\n丸まりたくなって…\n…猫になっちゃう！？", 3466, 0, 1, 3, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ニンジンもこれくらい\nおいしければ\nいいのに…", 3468, 0, 1, 3, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ハロウィンの本、\nオバケがたくさん\n載ってて怖いかも…", 3469, 0, 1, 3, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "美味しそうなお菓子が\nいっぱい…これなら\nイタズラされませんね", 3471, 0, 1, 3, 111101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "たくさんいたずら\nできるから\nハロウィン大好き！", 3473, 0, 1, 1, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ハロウィンだから\nいつもよりすごい\nいたずらしたいな～！", 3474, 0, 1, 1, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "カボチャを綺麗に\nくり抜いてすごく怖い\nランタン作っちゃお！", 3475, 0, 1, 1, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お菓子がたくさんで\nどれから食べるか\n迷っちゃうな～！", 3476, 0, 1, 1, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "どうすればみんなを\nびっくりさせられる\nかな～？", 3477, 0, 1, 1, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "カボチャ見てたら\nお腹空いて来たな～\nお菓子食べちゃお♪", 3478, 0, 4, 1, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "にいちゃんには\n特別ないたずらを\n用意してあげるね！", 3479, 0, 8, 1, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "カボチャにクラッカー\nを仕掛けて…わっ！？\nみ、見ちゃダメだよ！", 3480, 0, 1, 2, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ん？　なぁに？\nお菓子ほしいの？\nもう、しかたないな～", 3481, 0, 1, 2, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "にいちゃんの\n面白い仮装が\n見てみたいな～！", 3482, 0, 1, 2, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お菓子くれたお礼に\nとびっきりの\nいたずらしちゃうね！", 3483, 0, 1, 2, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "にいちゃんは\nハロウィンでも最高の\nいたずら相手だよ！", 3484, 0, 4, 2, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "にいちゃんと一緒に\nハロウィンパレード\n歩きたいな～！", 3485, 0, 8, 2, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようにいちゃん！\n仮装して出かける\n準備しなきゃ！", 3486, 1, 1, 2, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹すいたな～\nもらったお菓子\n食べちゃだめかな？", 3487, 2, 1, 2, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "たくさんいたずらして\nもうクタクタ～\nミソギもう寝るね…", 3488, 3, 1, 2, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "やわらか～い…\nここでひと休みして\nまたいたずらしよう！", 3490, 0, 1, 3, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいもので\n油断させてわっ！\nってするのどうかな？", 3491, 0, 1, 3, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いいにお～い！\nいたずらのアイデアが\nわいてくるよ！", 3492, 0, 1, 3, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "もらったお菓子\nあったかくしたら\nおいしいかな～？", 3493, 0, 1, 3, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お菓子ばっかりじゃ\n飽きちゃうもんね！\nご飯も食べよう！", 3495, 0, 1, 3, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "本のなかに\nいたずらのヒント\nないかな～？", 3496, 0, 1, 3, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "お菓子がたくさん！\n一人で食べていいの？\nやっぱりだめか～！", 3498, 0, 1, 3, 111201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "お勉強は順調ですよ\nやっぱりお兄ちゃんの\nおかげなんでしょうか", 3500, 0, 12, 1, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "お兄ちゃんとの\n思い出の場所\nまた行きましょうね", 3501, 0, 12, 2, 101101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "えへへ～♪\nハロウィンの\nミイラさんうさぎさん\nぴょんぴょ～ん！", 3502, 0, 1, 1, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "るんたった～\nハロウィンハロウィン\n楽しいな～♪", 3503, 0, 1, 1, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ハロウィンって\nどんなお菓子を\nもらえるのかな～？", 3504, 0, 1, 1, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お菓子をもらう\n練習をしなくちゃ！\nトリックオア\nトリート～♪", 3505, 0, 1, 1, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "おにいちゃんと\nハロウィンするの\nミミ楽しみだな～♪", 3506, 0, 1, 1, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おにいちゃんと\nいっしょにお菓子を\n食べたいな～", 3507, 0, 4, 1, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おにいちゃんと\n毎日ハロウィン\nできたらいいな～♪", 3508, 0, 8, 1, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "えへへ～\nおにいちゃん！\nハッピーハロウィン♪", 3509, 0, 1, 2, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おにいちゃんも\nいっしょに\nハロウィンパレード\nしようね～！", 3510, 0, 1, 2, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ミイラさんうさぎさん\nだぞ～…えへへ\nミミこわかったかな？", 3511, 0, 1, 2, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おにいちゃん！\nハロウィンのお菓子\nおいしいね～♪", 3512, 0, 1, 2, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おにいちゃんと\nいっしょなら\nおばけさんも\nこわくないよ！", 3513, 0, 4, 2, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ミミね\nハロウィンも\nおにいちゃんも\nだ～いすき♪", 3514, 0, 8, 2, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おひさまさんも\nハロウィンの\nおようふく\n着たいかな～？", 3515, 1, 1, 2, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ねえねえおにいちゃん\nお昼ごはんはもらった\nお菓子でもい～い？", 3516, 2, 1, 2, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "まだハロウィン…？\nうぅん…眠くないよぅ\nでもちょっと…ふぁ～", 3517, 3, 1, 2, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふか～♪\nおばけさんが\n中にいるのかな～？", 3519, 0, 1, 3, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わぁ、かわいい～♪\nミミといっしょに\nあそぼ～！", 3520, 0, 1, 3, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふわぁ～\nミミ、このにおい\nだ～いすき♪", 3521, 0, 1, 3, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいね～♪\nおばけさんも\nポカポカしてるかな？", 3522, 0, 1, 3, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしい～♪\nおにいちゃんも\n食べようよー！", 3524, 0, 1, 3, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本\nおにいちゃんと\nいっしょに\n読みたいな～", 3525, 0, 1, 3, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "ハッピーハロウィン♪\nえへへ、お菓子が\nいっぱいだね～！", 3527, 0, 1, 3, 111301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ここ、好きだよ。\nみんな優しいから…", 3529, 0, 1, 1, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "なんかさみしいな", 3530, 0, 1, 1, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "知らない人怖いな", 3531, 0, 1, 1, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お部屋おっきいねー", 3532, 0, 1, 1, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ルナね…\nお昼寝したいかも", 3533, 0, 1, 1, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おにいさん！\n今日は何して遊ぶの？", 3534, 0, 4, 1, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あのね、\nお料理教えてほしい！", 3535, 0, 8, 1, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あっ、おにいさんだ！", 3536, 0, 1, 2, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ルナは元気だよ！\nいいこだもん！", 3537, 0, 1, 2, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日は何しようかな", 3538, 0, 1, 2, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ルナと遊んでよ！", 3539, 0, 1, 2, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ねーねー、\nルナとお出かけして！", 3540, 0, 4, 2, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おにいさんと、\n遊びたいなー！", 3541, 0, 8, 2, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふふっ！\nなんかまぶしいね！", 3542, 1, 1, 2, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ルナ、お腹空いたな", 3543, 2, 1, 2, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どこに行こうかな？", 3544, 3, 1, 2, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ルナ、これ好きだな", 3546, 0, 1, 3, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい！　好き！", 3547, 0, 1, 3, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんかいい匂い！", 3548, 0, 1, 3, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいねー", 3549, 0, 1, 3, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ふふっ\nおいしいね", 3551, 0, 1, 3, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ルナ、\n眠くなっちゃう…", 3552, 0, 1, 3, 111401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "えへへ。あの人と\nランドソルでデート\nできたらうれしいな♪", 3554, 0, 12, 1, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あなたとなら\nどんなことだって\nできる気がするわ♪", 3555, 0, 12, 2, 105201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あーあ、退屈だな\nカレでも探しに\nいこうかな", 3556, 0, 1, 1, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この前のケンカは\n最高に燃えたなぁ\n…拳が疼いてきたぜ", 3557, 0, 1, 1, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "一体、この世界は\nどうなっちまったって\nいうんだ…？", 3558, 0, 1, 1, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "もう仕事の時間か\nボスも人使いが荒いぜ\n…ま、いいけどさ！", 3559, 0, 1, 1, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "オレたち以外に\nドラゴン族はあと何人\nいるんだろうな…", 3560, 0, 1, 1, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "カレの真剣な顔\n面白かったな\nまた遊びたいぜ", 3561, 0, 4, 1, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "どうしてカレがそばに\nいると、腹の底から\n力が湧いてくるんだ？", 3562, 0, 8, 1, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "よっす！\nなんかオイシイ話でも\nあったりしない？", 3563, 0, 1, 2, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "なあ、オレと遊ぼうぜ\n心配すんなよ。危ない\nことはよしとくからさ", 3564, 0, 1, 2, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうした。オレに\nケンカ売ろうってか？\n…ははは、冗談だよ！", 3565, 0, 1, 2, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ちょうど退屈してた\nところだ、特訓に\n付き合ってくれよ", 3566, 0, 1, 2, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ったくよぉ…\nオレがかわいいなんて\n冗談はもうよせよ？", 3567, 0, 4, 2, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "次の仕事も一緒に\n来るだろ？　断っても\n連れて行くけどな！", 3568, 0, 8, 2, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！　今日の\n予定はまずケンカして\nで、その後もケンカだ", 3569, 1, 1, 2, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "よっす！\n腹ごしらえが済んだら\nオレと遊ぼうぜ！", 3570, 2, 1, 2, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜は危ないから\nあんま出歩くな？\n…だから面白えんだろ", 3571, 3, 1, 2, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "次のケンカに備えて\n今は休んでおくか…\n全力で暴れたいからな", 3573, 0, 1, 3, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ボスの飼ってる\nラーゴが、中に\n入ってるんじゃ？", 3574, 0, 1, 3, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ああ、たぎる匂いが\nする…ひと暴れ\nしたくなってきた！", 3575, 0, 1, 3, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "おおぉ…\nオレの拳もなんだか\n熱くなってきたぜ…！", 3576, 0, 1, 3, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いつでも全力で\nケンカするために\n力を蓄えないとな", 3578, 0, 1, 3, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "やっぱりな…オレが\n知ってる地図とは\nまるで違ってやがる", 3579, 0, 1, 3, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さぁプレゼントで\n埋め尽くしてやろう！\n大いに喜ぶがいいよ！", 3581, 0, 1, 1, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "メリークリスマス☆\n聖夜の宴だ\n派手に楽しむとしよう", 3582, 0, 1, 1, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "煙突から入る？\nいいや、ワタシは\nいつでも正面からさ♪", 3583, 0, 1, 1, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "サンタクロースの\nお出ましだ！\n歓迎するがいいよ♪", 3584, 0, 1, 1, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "飾り付けが足りん！\nワタシが演出して\nやろうじゃないか！", 3585, 0, 1, 1, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "人の喜ぶ顔を見るのも\n悪くはないな…おっと\nワタシらしくないな☆", 3586, 0, 4, 1, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "プレゼントはまだか？\nワタシを喜ばせたら\nお返しは弾むぞ♪", 3587, 0, 8, 1, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ワタシを呼んだか？\n退屈な要件だったら\n覚悟しておくことだ", 3588, 0, 1, 2, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "なんだ？\nワタシへの挑戦か？\nよし、受けた♪", 3589, 0, 1, 2, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おっと、当たらんよ\nワタシの乱数聖域は\n絶対だからな…♪", 3590, 0, 1, 2, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんだ、オマエも\n暇なのか？\n奇遇だな、ワタシもさ", 3591, 0, 1, 2, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "なにか愉しいことでも\nしようじゃないか\nさぁ、何をする？", 3592, 0, 4, 2, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "こうもワタシに\n気安く触れるのは\nオマエくらいだよ…♪", 3593, 0, 8, 2, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝だろうと関係ない！\nさぁ愉しく苛烈に\n騒ごうじゃないか♪", 3594, 1, 1, 2, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "調子の出てくる時間だ\nしっかりワタシを\n愉しませてくれよ♪", 3595, 2, 1, 2, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "眠いなどと言わせんぞ\nまだまだ一日は\n終わらんからな！", 3596, 3, 1, 2, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いい具合じゃないか\nこのまま持って帰って\nしまおうか…♪", 3598, 0, 1, 3, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なかなか愛らしい\n造形をしているな？\nワタシには負けるがな", 3599, 0, 1, 3, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ほう、悪くない香りだ\n戦いの匂いをうまく\n隠してくれそうだ…♪", 3600, 0, 1, 3, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "体が温まってくると\nひと暴れしたくなるな", 3601, 0, 1, 3, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ワタシの舌は厳しいぞ\n…ふーむ、なるほど\n認めざるをえんな", 3603, 0, 1, 3, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "クリスティーナさんは\n知識の収集も\n欠かさないんだよ", 3604, 0, 1, 3, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "これは驚いたな\nだがもっと、もっとだ\nワタシを退屈させるな", 3606, 0, 1, 3, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "こんな戯れだって\n軽くこなしてしまう\nクリスティーナさんさ", 3607, 0, 1, 3, 111501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "メリークリスマス！\nさあ、パーティーを\n盛り上げるよ！", 3608, 0, 1, 1, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "衣装一つで全然\n気分が違うね！\n最高のクリスマスに\nなりそうだよ！", 3609, 0, 1, 1, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ツリーのてっぺんの\n星って、なんだか\n欲しくなるんだよね", 3610, 0, 1, 1, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "めいっぱい\nクリスマスを楽しむよ\n遊びだって本気\nなんだからね！", 3611, 0, 1, 1, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "赤、白、緑、金\nクリスマスカラー\nってお洒落だよね", 3612, 0, 1, 1, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "雪、降らないかな？\nホワイトクリスマス\nってちょっと\n憧れるなぁ", 3613, 0, 4, 1, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミと過ごすこの\n楽しい時間がずーっと\n続けばいいのにな", 3614, 0, 8, 1, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "クリスマスライブ\nチケット用意するから\n絶対来てよね！", 3615, 0, 1, 2, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "カンパーイ！\nジュースだけど\nちょっと大人の\n気分だね", 3616, 0, 1, 2, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "クリスマス衣装どう？\nかわいいでしょ\nあっ、どこ見てるの！", 3617, 0, 1, 2, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ねえ、後で街に\n行こうよ\n大きなツリーを\n一緒に見たいんだ♪", 3618, 0, 1, 2, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ねえ、ダンスの練習に\n付き合ってくれない？\n大丈夫、手取り足取り\n教えてあげるから♪", 3619, 0, 4, 2, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "来年のクリスマスも\n隣にキミが\nいてくれたら\nうれしいのにな", 3620, 0, 8, 2, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "クリスマスって朝から\nドキドキしちゃうね\nなんだか子どもみたい", 3621, 1, 1, 2, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "パーティーの準備も\n大分進んだね\n一息ついて\nランチにしよっか", 3622, 2, 1, 2, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "静かな夜だね\n心臓の音まで\n聞こえちゃいそう…", 3623, 3, 1, 2, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ～、この絶妙な\n柔らかさ…\nいい仕事してるなぁ…", 3625, 0, 1, 3, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アイドル顔負けの\nかわいさ、ズルい！\nでもかわいい！", 3626, 0, 1, 3, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん～、落ち着くなぁ\n今日はゆっくり\n眠れそうだよ", 3627, 0, 1, 3, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぬくぬく～\nどうしよう、ここから\n動きたくないなぁ", 3628, 0, 1, 3, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ダンスの練習もしたし\nちょっとくらいなら\nいいよね！", 3630, 0, 1, 3, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "アイドルといえど\nかわいいだけじゃダメ\n知識も必要だよね", 3631, 0, 1, 3, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "面白ーい！\nこの演出、ライブでも\nできないかな？", 3633, 0, 1, 3, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "もふもふ～♪\n寒い日には最高の\n抱き心地だね！", 3634, 0, 1, 3, 111601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "彼ともっとお話し\nしたいな…もう少し\n補習を増やそうかしら", 3635, 0, 12, 1, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "君のこともっともっと\n教えて欲しいな。私に\n補習授業してくれる？", 3636, 0, 12, 2, 101801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この姿ならあやつも\n子ども扱いできまい！\n…じゃがなぜか、少し\n物足りないような…", 3637, 0, 1, 1, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "時間もあるし、\n聖夜の宴の\n準備をするかのう♪", 3638, 0, 1, 1, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…わらわの知る聖夜と\n随分違うが、宴は宴\n楽しませて\nもらおうかのう♪", 3639, 0, 1, 1, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "大人の姿で\nできること…ふむ\n少しあやつを\nからかってやるか♪", 3640, 0, 1, 1, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "…クリスマスは\n恋人たちの夜！？\nち、近頃の若いもんは\n破廉恥なのじゃ！", 3641, 0, 1, 1, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…あやつがおらんと、\n宴も物足りぬな\n…馬鹿者が\n早く帰ってこい…", 3642, 0, 4, 1, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "誰も見ておらぬな…？\n…よし、あやつへの\nプレゼントを\n準備するとしようか！", 3643, 0, 8, 1, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "クリスマスの\nチキンにケーキ…\nべ、別に楽しみになど\nしておらぬぞ！", 3644, 0, 1, 2, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この姿では、わらわの\n頭をなでるのは\n難しかろう…べ、\n別に残念ではないわ！", 3645, 0, 1, 2, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "メリー\nクリスマスじゃ！\nさあ、わらわのために\n宴の準備をするのじゃ", 3646, 0, 1, 2, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そんなにこの衣装が\n気になるのか？\n…だったら、直に\n触ってみるがよい♪", 3647, 0, 1, 2, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "いつもと逆に、お主を\n子ども扱いしてやるか\nほれ、膝枕をしてやる\nからそばに来い♪", 3648, 0, 4, 2, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…せ、聖夜の予定は\n空けておくのじゃぞ？\nなんでって…\nな、なんでもじゃ！", 3649, 0, 8, 2, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もう朝か…聖夜の宴が\n楽しみで…ではなく！\n準備のせいで、\nあまり眠れんかったぞ", 3650, 1, 1, 2, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "…ずっと雪が\n降っておれば、\n陽光が強いこの時間も\n怯えずにすむのにのう", 3651, 2, 1, 2, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "時は来た…\nさあ眷属よ！\nわらわと共に、\n聖夜の宴を楽しもうぞ", 3652, 3, 1, 2, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "良い椅子ではないか\nここから聖夜の宴を\n眺めるのもよいかもな", 3654, 0, 1, 3, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "か、かわい…こほん\nなかなか良い\nデザインをしておるな", 3655, 0, 1, 3, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふむ、良い香りじゃ\n聖夜の宴でも\nこれを使うとしよう", 3656, 0, 1, 3, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これが癒し…はっ！\nあやうく浄化される\nところであった…", 3657, 0, 1, 3, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ニ、ニンニクは\n入っておらぬよな？\n…うむ、美味じゃ♪", 3659, 0, 1, 3, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "聖夜は恋人たちの夜…\n…き、気になるわけ\nではないが、\n少し調べてみるか", 3660, 0, 1, 3, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "ほう…これは面白い\n魔法の使い方じゃな\nまるで本物の\n演劇のようじゃ", 3662, 0, 1, 3, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "こ、この程度の\nかわいさに誘惑される\nわらわでは…\nふわもこなのじゃ～♪", 3663, 0, 1, 3, 111701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おせち料理も\n魔物尽くしだったり\nしないわよね！", 3664, 0, 1, 1, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "初詣で何をお祈り\nしようかしら…\n定番でいいわよね？", 3665, 0, 1, 1, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "初日の出って\n特別な感じがして\nいいわよね…", 3666, 0, 1, 1, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "寒い中並んで飲む\n甘酒って不思議なほど\nおいしいわよね", 3667, 0, 1, 1, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "羽根つきで勝負…\nあいつにだったら\n勝てるかしら？", 3668, 0, 1, 1, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "年賀状になんて書こう\n…いろいろと\n恥ずかしくなるのよね", 3669, 0, 4, 1, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今年もあいつと\n居られること…\n結構うれしいわ", 3670, 0, 8, 1, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "何じっと\n見てんのよ？\nお年玉はあげないわよ", 3671, 0, 1, 2, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おせち料理一緒に\n食べる？\n結構おいしいわよ", 3672, 0, 1, 2, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "羽根つきで負けたら\n顔に墨塗られるのよ\n覚悟しなさい！", 3673, 0, 1, 2, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "門松飾るから\nちょっと手伝って\nくれる？", 3674, 0, 1, 2, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんたと一緒に\n初詣行くのも悪くない\n…かも", 3675, 0, 4, 2, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "初詣で何をお祈り\nしたか？　うっさい！\n内緒よ！内緒！", 3676, 0, 8, 2, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もう朝なの…\n正月くらいゆっくり\n寝ていたいわよね…", 3677, 1, 1, 2, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おせちに飽きたら\n次は何を食べよう\nかしら…", 3678, 2, 1, 2, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ寝ましょ\nいい初夢が見られると\nいいわね", 3679, 3, 1, 2, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この格好でいるのも\nなかなか疲れるわね\n休憩～", 3681, 0, 1, 3, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "か、かわいい…う～ん\n鏡餅も顔を描けば\nかわいくなるかしら？", 3682, 0, 1, 3, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい匂いね\n落ち着いて\n眠れそう…", 3683, 0, 1, 3, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここでお餅焼いたら\n一段とおいしく\nなりそうね", 3684, 0, 1, 3, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "正月に食べるものは\nなんでもおいしく\n感じちゃうわね！", 3686, 0, 1, 3, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "魔物を使わない\nおせちを\n調べておかなきゃ…", 3687, 0, 1, 3, 112001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "新年を気持ちよく\n過ごせるように\nお掃除がんばります！", 3689, 0, 1, 1, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "神殿に通っていたら\nいつの間にか足腰が\n鍛えられたような…", 3690, 0, 1, 1, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "神殿付近は屋台も\nあるので、良い香りが\n漂ってくるんですよ～", 3691, 0, 1, 1, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おせちを作れるように\nなれば、子どもたちも\n喜んでくれるかな…？", 3692, 0, 1, 1, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "コホォォォォォ…！\nふぅ、深呼吸すると\n落ち着きますね♪", 3693, 0, 1, 1, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お仕事以外の時も\nあなたと…い、いえ！\nなんでもないです！", 3694, 0, 4, 1, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたと一緒だと\nなんだかポカポカ\nしてくるんです…", 3695, 0, 8, 1, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この格好をしていると\nなんだか神殿にいる\n気分になりますね", 3696, 0, 1, 2, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そういえば神殿で\n甘酒をもらったんです\nあなたも飲みますか？", 3697, 0, 1, 2, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あっ、髪飾りが\nズレちゃってました！\nいけないいけない…", 3698, 0, 1, 2, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ひゃわっ！？\nく、くすぐったり\nしないでください～", 3699, 0, 1, 2, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "そ、そんなに\n見つめられると\nて、照れちゃいます…", 3700, 0, 4, 2, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今度、私が考えた\n運気上昇のおまじない\nかけてあげますね♪", 3701, 0, 8, 2, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n神殿のお手伝いに行く\n準備もしなきゃですね", 3702, 1, 1, 2, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼になりましたし\nご飯は私が作…\nえっ、ダメですか！？", 3703, 2, 1, 2, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日も早いですし\nそろそろ寝る支度を…\nふわぁ…", 3704, 3, 1, 2, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お掃除も終わったので\n少し休憩を…ふわぁ…\n急に眠気が…", 3706, 0, 1, 3, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "新年を気持ちよく\n過ごせるようこの子も\nきれいにしましょう♪", 3707, 0, 1, 3, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "神殿のお香のような\n香りだと落ち着いて\n過ごせそうですよね", 3708, 0, 1, 3, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽかぽかですね～…\n甘酒も飲んで体の\n芯から温めましょう", 3709, 0, 1, 3, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "今年こそ\n料理も上手に…\nもぐもぐもぐもぐ…", 3711, 0, 1, 3, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "失敗続きだと\n逆に運が良くなる…\nほ、本当ですかぁ…？", 3712, 0, 1, 3, 112101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "キミにならもう\nどんな私を見られても\n大丈夫かな…♪", 3714, 0, 12, 1, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "なになにどしたのぉ？\nお姉さんが撫でたげる\nこっちにきなさぁい♪", 3715, 0, 12, 2, 103401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "わたくしの舞を\n主さまは喜んで\nくださるでしょうか…", 3716, 0, 1, 1, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "年を越したあとに\n食べるおそばも\nおいしいです", 3717, 0, 1, 1, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "甘酒を飲むと\n心まで温まる\n気がいたします", 3718, 0, 1, 1, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "主さまのために\n真心を込めたおせちを\nご用意しなくては", 3719, 0, 1, 1, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "おみくじを引くのは\nドキドキしつつも\n楽しいものです", 3720, 0, 1, 1, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "主さまの温もりは\n心まで温めてくれる\nようです", 3721, 0, 4, 1, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "うまくできなくとも\n心を込めて精いっぱい\n舞いましょう", 3722, 0, 8, 1, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "主さま、この晴れ着は\n似合っている\nでしょうか？", 3723, 0, 1, 2, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お餅はゆっくりと\n召し上がって\nくださいまし", 3724, 0, 1, 2, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "主さまのお顔の\n福笑いなら、完璧に\nできる気がいたします", 3725, 0, 1, 2, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "主さまはどのような\n初夢をご覧になった\nのでしょう？", 3726, 0, 1, 2, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "甘酒の飲み過ぎは\nいけませんよ？\nめっ、でございます", 3727, 0, 4, 2, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "二人羽織とは\nあんなにも暖かい\nものなのですね…", 3728, 0, 8, 2, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n寒い季節の朝日は\nとても美しいですね", 3729, 1, 1, 2, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おいしくとも\n食べ過ぎは正月太りの\nもとでございます", 3730, 2, 1, 2, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いい夢が見られるよう\n暖かくして\n眠るといたしましょう", 3731, 3, 1, 2, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふか…\nこのまま\n寝てしまいそうです", 3733, 0, 1, 3, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなたと一緒に\nお正月遊びを\n楽しんでみたいです", 3734, 0, 1, 3, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "神殿の独特な香りを\nおうちに持ち込むのは\nどうでしょうか", 3735, 0, 1, 3, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "風邪をひきませんよう\n暖かくいたしましょう", 3736, 0, 1, 3, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食べ過ぎは\n正月太りの\nもとだというのに…", 3738, 0, 1, 3, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "主さまのために\n参拝の作法を\n予習しておきましょう", 3739, 0, 1, 3, 111901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…この杖、変身前には\n無いパーツがあるけど\nこれはどこから…うん\n考えないようにしよう", 3741, 0, 1, 1, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "フ、フリフリの\nかわいい衣装…はっ！\n素に戻ってはダメだ！", 3742, 0, 1, 1, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "魔法探偵\nミスティ★カスミ！\n魔法の力で捜査開始！\n…練習終わりっと", 3743, 0, 1, 1, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "怪しい視線を感じる…\nまさか、近くに\n闇の力を持つ人が！？", 3744, 0, 1, 1, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "時間もあるし、\n魔法少女の修行を…\nじゃ、じゃなくて！\n探偵の仕事をしよう！", 3745, 0, 1, 1, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "助手くんとずっと\n一緒に居られるし、\n魔法少女も\n案外悪くないかも♪", 3746, 0, 4, 1, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "魔法少女の訓練のため\n助手くんの所に行こう\nかな…あ、あくまで\n訓練のためにね！", 3747, 0, 8, 1, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…髪型が急に\n変わって驚いた？\nき、気になるなら…\n少し触ってみるかい？", 3748, 0, 1, 2, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "助手くんは魔法少女に\nなりたいのかい？\nその場合は魔法騎士…\nいや、魔法助手とか？", 3749, 0, 1, 2, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "頭に浮かぶ呪文…\n強制変身…助手くん\n魔法少女とは\n呪いか何かなのかな？", 3750, 0, 1, 2, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あ、あまり触らないで\nくれ…魔法少女になる\nと感覚が鋭くなって、\n耳も敏感に…ひゃう！", 3751, 0, 1, 2, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "や、やっぱりこの\n格好は変かな…え、\nかわいい？　じゃあ…\nいや、でも、う～ん", 3752, 0, 4, 2, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…この変身は助手くん\nのせいでもあるんだよ\nだから…せ、責任を\n取ってもらうからね！", 3753, 0, 8, 2, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう助手くん\nさあ、そろそろ\n街のパトロールに\n行こうじゃないか！", 3754, 1, 1, 2, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もうお昼…助手くん、\nそろそろ本業に戻ろう\n…その顔は何かな？\n私の本業は探偵だぞ！", 3755, 2, 1, 2, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜だけど、私は\nもう少し仕事をするよ\n魔法少女の強い体は\nこんなときに便利だね", 3756, 3, 1, 2, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "気持ちいい…\nこの癒しを、魔法と\n論理の二つの観点から\n解明したいね…", 3758, 0, 1, 3, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ダ、ダメ！！\nここで感情のままに\n飛びついたら、私の\nイメージがぁ～！", 3759, 0, 1, 3, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "心が安らぐ香りだね…\n…今なら、魔法少女も\nすんなりと受け入れ…\nてはダメだっ！", 3760, 0, 1, 3, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかい…\n魔法少女だろうと\n休息は必要だし、少し\n休んでいこうかな", 3761, 0, 1, 3, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "魔法少女も探偵も、\nやっぱり体が資本！\n食べられるときに\n食べておかないとね♪", 3763, 0, 1, 3, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "…魔法少女\nセリイちゃんの本は\nどこにあるのかな？", 3764, 0, 1, 3, 112201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "魔法少女かぁ…\nせっかくだし思う存分\n体を動かしてみたいな", 3766, 0, 1, 1, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ニャットちゃん…\nこの格好を見て\n私って気づくかな？", 3767, 0, 1, 1, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふ…\n今日はなんだか\n調子がいいかも", 3768, 0, 1, 1, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "魔法は便利だけど\nあまり頼りすぎちゃ\nダメだよね", 3769, 0, 1, 1, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "さっき街で小さな子に\n声かけられちゃった\n照れるけどうれしいな", 3770, 0, 1, 1, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人がいると\nなんだかホッとする\n不思議…", 3771, 0, 4, 1, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "魔法少女になっても\nあの人への気持ちは\nずっと同じ…", 3772, 0, 8, 1, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日の私…ですか？\nはいとっても元気です\n…あなたのおかげかも", 3773, 0, 1, 2, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "よかったら魔法の\n練習に付き合って\nくれませんか？", 3774, 0, 1, 2, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あの…\nこの格好どうですか？\n似合ってると…いいな", 3775, 0, 1, 2, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…な、なんですか？\nあまり見られると\n恥ずかしいです…", 3776, 0, 1, 2, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私、あなたのそばに\nいられたら、それで…", 3777, 0, 4, 2, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "想い人と結ばれる\n魔法は…ひゃっ！？\n今の聞いてましたか？", 3778, 0, 8, 2, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n今日も街の平和の\nために頑張らなきゃ", 3779, 1, 1, 2, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹すきましたね。\nあの…一緒にランチは\nいかがですか？", 3780, 2, 1, 2, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ、もうこんな時間…\nふふ、まだこんなに\n体力が余ってるのに", 3781, 3, 1, 2, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "気持ちいい…\nこの気持ち良さは\nどんな魔法も勝てない", 3783, 0, 1, 3, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "何これ、かわいい…\nお姉ちゃんにも\n見せてあげたいな", 3784, 0, 1, 3, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん～、いい香り\n…これ、魔法で\n出せたりしないかな？", 3785, 0, 1, 3, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったか～い\nえへへ…なんだか\nお姉ちゃんみたい", 3786, 0, 1, 3, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしいなぁ、これ\n魔法少女になってから\n食欲旺盛かも…", 3788, 0, 1, 3, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふふ…\n魔法少女になっても\n読書はやめられないな", 3789, 0, 1, 3, 112301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "みらくるまほりん\nくるりんぱ～♪\n王子はんのために\n花嫁修業や～♪", 3791, 0, 12, 1, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あ、あのな王子はん\nできたらその…\nお姫さまだっこを\nお願いしてもええ…？", 3792, 0, 12, 2, 101001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "やっぱりわたしたちの\nギルドハウスの\n居心地は最高ですね☆", 3793, 0, 1, 1, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "王宮じゃできないこと\nやっちゃいましょう♪\n例えば、えっと～…", 3794, 0, 1, 1, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そうだ、隠しておいた\nおやつがありました！\nまだ食べられますね☆", 3795, 0, 1, 1, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ごはんはみんなで\n楽しく食べましょう！\nそれが一番の\n調味料です♪", 3796, 0, 1, 1, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "やっぱりここが、\nわたしの帰る場所です\n…ただいま☆", 3797, 0, 1, 1, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "なんだか物足りません\nきっと、あの人が隣に\nいないからですね…", 3798, 0, 4, 1, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "どこを見ても、大切な\n思い出がたくさん\n詰まっていますね♪", 3799, 0, 8, 1, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "無礼者～、なんて\n冗談です♪　どんどん\n触っちゃってください", 3800, 0, 1, 2, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぷにぷにでしょう～？\nい～っぱい食べるのが\nぷにぷにの秘訣です！", 3801, 0, 1, 2, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "握手したいんですか？\nはい、にぎにぎ～！\nもう離しませんよ♪", 3802, 0, 1, 2, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "どうかしましたか？\n退屈してるんでしたら\nお散歩に行きましょう", 3803, 0, 1, 2, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ごはん王子♪\nわたしは王女ですから\nこれでピッタリですね", 3804, 0, 4, 2, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "大好きです～\n愛してます～\n…ほんと、ですよ♪", 3805, 0, 8, 2, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝ごはんは大事です！\n山盛りごはんを食べて\n元気いっぱいですよ☆", 3806, 1, 1, 2, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹ぺこぺこになる\n時間ですね～！\nごはん特盛、一つ！", 3807, 2, 1, 2, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お腹いっぱい、今日は\nよく眠れそうですね♪\n明日もおいしい一日を", 3808, 3, 1, 2, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休憩休憩～♪\nお腹を休めて、次の\nごはんに挑みます…☆", 3810, 0, 1, 3, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいらしい\nぬいぐるみですね～\nキャルちゃんみたい☆", 3811, 0, 1, 3, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "すんすん…この匂い\n食欲増進の効果が\nありそうですね…？", 3812, 0, 1, 3, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "体温が上がってくると\n眠くなっちゃいます…\nほわぁ～", 3813, 0, 1, 3, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐもぐもぐもぐ\nむぐむぐむぐむぐむぐ\nはぐはぐはぐはぐはぐ", 3815, 0, 1, 3, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "教養を身に着けるには\n読書が一番です！\nえっと次のレシピは～", 3816, 0, 1, 3, 180401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "アイドルらしくなる\nコツって、何か\nあるんでしょうか？", 3818, 0, 1, 1, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "色んな人と話すのが\n好きなんです。つい\n長くなっちゃって…", 3819, 0, 1, 1, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アイドルを目指すって\n決めてから、毎日が\nワクワクなんです♪", 3820, 0, 1, 1, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ちゃんとストレッチ\nしておかなくっちゃ\nよいしょ、よいしょ…", 3821, 0, 1, 1, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "リンちゃんミオちゃん\n二人に負けないように\n私、頑張ります！", 3822, 0, 1, 1, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私の笑顔は素敵だって\n誰かに褒められた…\nそんな気がするんです", 3823, 0, 4, 1, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私たちを支えてくれる\n誰かが、ずっと一緒に\nいてくれたような…", 3824, 0, 8, 1, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうかしましたか？\n何か困ってるのなら\nお手伝いしますよ！", 3825, 0, 1, 2, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "みなさん個性的で\n普通じゃない人ばかり\nいるような気が…", 3826, 0, 1, 2, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日はポカポカした\nいい天気ですね～\nお散歩日和です！", 3827, 0, 1, 2, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今、ミルクティーを\n淹れてたんです♪\nあなたも飲みますか？", 3828, 0, 1, 2, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私の得意なこと？\nうーんなんでしょう…\nあっ、肩たたきです！", 3829, 0, 4, 2, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "生・ハム・メローン！\nあ、ライブの掛け声を\n練習してたんですよ♪", 3830, 0, 8, 2, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます！\n今日も一日\n頑張りましょうね！", 3831, 1, 1, 2, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "しっかりお昼を食べて\n午後からも張り切って\nいきましょうね♪", 3832, 2, 1, 2, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぐっすり眠れるよう\n早めに用事を済ませて\nお休みしましょうね", 3833, 3, 1, 2, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっと休んだら\nレッスンの続きも\n頑張ります！", 3835, 0, 1, 3, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "えへへ～\nふわふわもこもこで\nかわいいです～♪", 3836, 0, 1, 3, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "リラックスできる\nいい香りですね～♪", 3837, 0, 1, 3, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "わぁ、ポカポカです♪\n温かい飲み物も\nほしくなりますね", 3838, 0, 1, 3, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "レッスンしたら\nお腹が空いちゃって…\nぱくぱくもぐもぐ…", 3840, 0, 1, 3, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "レッスンに役立つ\n運動の情報とか\n載ってるでしょうか…", 3841, 0, 1, 3, 112401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "きらきらーん☆\nよし、次のステージは\nこれで行けるかも！", 3843, 0, 1, 1, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私の元気でみんなも\n元気になってくれたら\nうれしいな～", 3844, 0, 1, 1, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ちょっとレッスンで\n疲れちゃったかも…\nでも頑張るぞっ！", 3845, 0, 1, 1, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "晩ごはん何にしよう？\nそーだ、しぶりんにも\n聞いてみよっと！", 3846, 0, 1, 1, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "元気だから笑顔になる\nじゃなくて\n笑顔だから\n元気になるんだよね～", 3847, 0, 1, 1, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "声援を聞いてる時ね\nすごく懐かしいって\n思うことがあるんだ", 3848, 0, 4, 1, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私を応援してくれる\n一番大事な人が\n隣にいた気がする…", 3849, 0, 8, 1, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なになにー？\nミオちゃんに\n何か用かな～？", 3850, 0, 1, 2, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おっ、やっほー！\n元気そうだね～、キミ\n私？\nもちろん元気～！", 3851, 0, 1, 2, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ねぇねぇ、ちょっと\n遊びに行かない？\nたまには息抜きで！", 3852, 0, 1, 2, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ね、この魔物料理さ\nプリンって言い張れば\n食べてもらえそうかな", 3853, 0, 1, 2, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "えへへ\nいつもありがとねっ！\nパワーもらってるよ～", 3854, 0, 4, 2, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "どうしたどうした～\nミオちゃんの魅力に\nメロメロなのかい？", 3855, 0, 8, 2, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おっはよ～！\n一日の始まりだし\nテンション上げてこ！", 3856, 1, 1, 2, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹空いた～…\nねぇねぇ、一緒に\nお昼食べようよ～", 3857, 2, 1, 2, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわぁ～…\n眠くなってきちゃった\nそろそろ休もっかなぁ", 3858, 3, 1, 2, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わぁ、ふっかふか～！\nレッスンの疲れも\n吹っ飛んじゃうね☆", 3860, 0, 1, 3, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "何これ…かわいーっ！\n早くしまむーに\n教えてあげなきゃ！", 3861, 0, 1, 3, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "すぅ～…\nうんっ、これ私の\n好きな香りだな～♪", 3862, 0, 1, 3, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ポッカポカだね～♪\n…あ～ん、ここから\n動きたくないーっ！", 3863, 0, 1, 3, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "わっ、おーいしー！\nこれはテンション\n上がっちゃうね♪", 3865, 0, 1, 3, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…\nふむふむふむ…！\n勉強になった、ブイ☆", 3866, 0, 1, 3, 112601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "なんでドキドキが\n止まらないの…？\n騎士くんのせいだー！", 3868, 0, 12, 1, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ドキドキしてるの\nあたしだけ、かな…\n騎士くんはどう…？", 3869, 0, 12, 2, 100101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "騎士クンの前で\n好きって言えるように\n練習しないと…", 3870, 0, 12, 1, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "騎士クン…大好き\n…き、騎士クン！？\nなんでここに！？", 3871, 0, 12, 2, 100201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "困ったな…\n彼が居ないだけで、\nここまで\n寂しいと思うなんて…", 3872, 0, 12, 1, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "えっと…\n今日は訓練じゃなくて\nその…二人でゆっくり\n過ごしたいな…", 3873, 0, 12, 2, 100301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "アイドルの心構え…\nどういう風に考えると\nしっくりくるのかな", 3874, 0, 1, 1, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "何か始めるのって\nドキドキするよね\nだから最近楽しいんだ", 3875, 0, 1, 1, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "冒険者の時って毎日\nバタバタしてたけど…\n目標ができると違うね", 3876, 0, 1, 1, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "少しお腹が空いた…\nチョコレート一粒だけ\n食べようかな", 3877, 0, 1, 1, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ウヅキもミオも\n頑張ってるし\n私も負けられないね", 3878, 0, 1, 1, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "レッスンしてる時さ\n何か、誰かが足りない\nそう思うことがあるの", 3879, 0, 4, 1, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "大事なのは笑顔…\n誰か、大切な人から\n言われた気がするんだ", 3880, 0, 8, 1, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうしたの、何か用？\n手伝えることがあれば\nすぐに言ってね", 3881, 0, 1, 2, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "姿勢がいい？\n普段から鍛えてるし\n自然とそうなるのかも", 3882, 0, 1, 2, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さっき散歩してたら\n犬を見かけたんだ\n人懐っこい子だったよ", 3883, 0, 1, 2, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今から冒険？\nなら私も一緒に行くよ\n前衛は任せておいて", 3884, 0, 1, 2, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "今からレッスンに\n行くつもりだったんだ\n少し手伝ってくれる？", 3885, 0, 4, 2, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "蒼の剣を受けよ！\nえ、何してるのって？\nただの発声練習だけど", 3886, 0, 8, 2, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう、早いね\n今日は依頼もないし\nゆっくりしようかな", 3887, 1, 1, 2, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろお昼だね\nうーん、今日は\n何を食べよう…", 3888, 2, 1, 2, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間…\n明日も早いし\nそろそろ寝なくちゃ", 3889, 3, 1, 2, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "レッスンで疲れたし\nちょっとだけ\n休んでおこうかな", 3891, 0, 1, 3, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふっ、かわいい\nふわふわしたものって\n撫でたくなるんだよね", 3892, 0, 1, 3, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うん、いい香り…\nこういうものがあると\n落ち着くからいいよね", 3893, 0, 1, 3, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "温かい場所って\n居心地がいいから\nのんびりしちゃうよ", 3894, 0, 1, 3, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "レッスン頑張ったら\nすぐお腹が空くし\n食べておかないと…！", 3896, 0, 1, 3, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "アイドルのことを\nもっと勉強して\n成長しなくちゃ", 3897, 0, 1, 3, 112501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ああ、知りたい…\nなんでもかんでも\nとにかく知りたい…", 3899, 0, 1, 1, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ああ、眠い…\nいつでもどこでも\nとにかく眠い…", 3900, 0, 1, 1, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "君、気を付けたまえ\nぼーっと歩いていると\nほわっ！　転んだ…", 3901, 0, 1, 1, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ミツキ師にいただいた\n新作サプリ…丁度よい\n被験体はいないものか", 3902, 0, 1, 1, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "サレンディア救護院に\nユニちゃん８歳として\n潜入済みだが何か？", 3903, 0, 1, 1, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "君がユニちゃんズの\n同志であること、\nぼくは誇りに思うぞ", 3904, 0, 4, 1, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ぼくは青春がしたい\nおい、君\nぼくと青春しないか", 3905, 0, 8, 1, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ああ、そうだな。\nぼくもそう思う。\n……えっ、何が？", 3906, 0, 1, 2, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "待て、話しかけるな。\n今の閃きをメモに…\n…ああっ、忘れた！", 3907, 0, 1, 2, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "歩き方が綺麗？\n何を今更なこと\n言っとるんだ君は", 3908, 0, 1, 2, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ぼくの血液型？\n大らかのОだ。\n何か異論あるかね", 3909, 0, 1, 2, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "君の声は精神に\n高揚をもたらすな…\n波形を分析したいぞ", 3910, 0, 4, 2, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "妙だな…最近\n君に話しかけられると\n心拍に乱れを覚える", 3911, 0, 8, 2, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おっと、朝だな。\nそろそろ寝るか、\n朝更かしは体に悪い", 3912, 1, 1, 2, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふむ、昼餉時か…\n今日のランチは\nサプリ定食にしよう", 3913, 2, 1, 2, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もう夜だな、\nそろそろ起きるか。\n最高の一日にするぞ！", 3914, 3, 1, 2, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ほわぁ～\n副交感神経が…\n優位に…ふふっひ", 3916, 0, 1, 3, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいすぎるな…\nセクシーユニには\nミスマッチか…", 3917, 0, 1, 3, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ほぁあアあァぁー…\nいい香りー…\nあアァあ…イイ…", 3918, 0, 1, 3, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "炎はいいぞ\nそこには人類発展の\nドラマがある", 3919, 0, 1, 3, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "フオオー！\n次から次へと固形食物\n原理気になるー！", 3921, 0, 1, 3, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "良書は時間を忘れる\n…ふむ、今度\n布団を持ってこよう", 3922, 0, 1, 3, 111001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "きらーん☆\nハツネちゃんに\n不可能はないのだ☆", 3924, 0, 12, 1, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "キミと一緒だと\n寝ちゃうのが\nもったいないよ～", 3925, 0, 12, 2, 101201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちぇるーん☆", 3933, 0, 1, 2, 192101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちぇる～ん☆\n今日もチエルは\nかわいいですよね～？", 3951, 0, 1, 1, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どこかに楽しいもの\n落ちてないかにゃー", 3952, 0, 1, 1, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "チエルのオキニは\n甘々カフェラテ！\nシクヨロでぇ～す☆", 3953, 0, 1, 1, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "先輩、ひまですよね？\nチエル遊んであげても\nいいですけど？", 3954, 0, 1, 1, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はぁー…しゅき…\nカルミナ尊い…\n一生すこれる…", 3955, 0, 1, 1, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "先輩、ひまー\nちょっとは構えよーう\nデュクシ！デュクシ！", 3956, 0, 4, 1, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "先輩なんか\nおごって～！\nてか…おごらなくても\nいいから遊んでよ…", 3957, 0, 8, 1, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "え、なんですか？\n告白だったら\n間に合ってますけど", 3958, 0, 1, 2, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっと静かに！\n今ヤバかわポーズの\nイメトレ中なんです！", 3959, 0, 1, 2, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "足取りが軽やか？\nあー…ダンスとか\n習ってるからですかね", 3960, 0, 1, 2, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "チエルの血液型？\n大型新人のОです\n何か問題でも？", 3961, 0, 1, 2, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "先輩って何気に\nいい声してますよね\n言うことは変だけど", 3962, 0, 4, 2, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "え、なんですか？\nたまにだったら\n告白してもいいですよ", 3963, 0, 8, 2, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはちぇる～ん☆\nハイ、ご一緒に～？", 3964, 1, 1, 2, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日のランチは\nどこで\n映えよっかにゃー", 3965, 2, 1, 2, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こんばんちぇるるん☆\nハイ、ご一緒に～？", 3966, 3, 1, 2, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふかチエルン\n略して、ふかルン♪", 3968, 0, 1, 3, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいこの子と\nかわいいチエル！\n映ぁ～え～る～！", 3969, 0, 1, 3, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "かわいい香り～！\n持って帰ろっと！\nすぅーっ…", 3970, 0, 1, 3, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "マシュマロは\n焼かない方のが\nかわいくないです？", 3971, 0, 1, 3, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "チエル食べても\n太らない体質\nなんでぇ～！", 3973, 0, 1, 3, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "読書は好きですよ\nシンプルに楽しいし\nギャップ萌えでしょ？", 3974, 0, 1, 3, 110901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "みんなのあたしを\n見る目が違うね\nま、気にしないけどね", 3976, 0, 1, 1, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日も疲れた～\nやる気ゼロだし\nもう寝ちゃおうかな", 3977, 0, 1, 1, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あたしの代わりに誰か\n働いてくれないかね", 3978, 0, 1, 1, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "労働の後に食べる\nあんパン最高～", 3979, 0, 1, 1, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "仕事の合間に\nちょっと一息いれよ\nあ～ドングリ美味し～", 3980, 0, 1, 1, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "報酬も入ったことだし\nあいつに何か\n買ってあげようかな", 3981, 0, 4, 1, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "次の休みはあいつと\n一日中だらだら\nしたいな～", 3982, 0, 8, 1, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あたしは褒められて\n伸びるタイプなんだ\nだから褒めて褒めて", 3983, 0, 1, 2, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お、差し入れ？\n気が利くねぇ\nあんがと", 3984, 0, 1, 2, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "新しい依頼？\n今日はもう無理～\n閉店で～す", 3985, 0, 1, 2, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "サ、サボってないよ！\nちょっと休憩してた\nだけだから！", 3986, 0, 1, 2, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ねえ、一緒に\nサボろうよ？\n働き過ぎはよくないよ", 3987, 0, 4, 2, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんたが近くにいると\n仕事の疲れも\n和らぐんだよね～", 3988, 0, 8, 2, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "はぁ…もう起きなきゃ\nつらい労働の\nはじまりだ～", 3989, 1, 1, 2, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うぅ、お昼に\nあんパン食べ過ぎた…\n苦しい…眠い…", 3990, 2, 1, 2, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日は仕事ないし\nガッツリ夜ふかし\nしちゃうよ～", 3991, 3, 1, 2, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "猫みたいに\n丸くなっちゃうよ～\nあたしリスだけどね", 3993, 0, 1, 3, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふかふか～\nあたしの尻尾と\n互角とはやるね～", 3994, 0, 1, 3, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あんパンの香りの\nアロマとか\nあればいいのにな～", 3995, 0, 1, 3, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これは危険な\nあたたかさだね～\n労働意欲が\nなくなるよ～", 3996, 0, 1, 3, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いっぱい働いたから\nいっぱい食べても\nカロリー０だよ", 3998, 0, 1, 3, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "あたしだってたまには\n本くらい読むって\n全然似合わないけどね", 3999, 0, 1, 3, 112701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あたしの作った\nオリジナルたい焼き…\nあいつ、\n喜んでくれるかにゃ？", 4001, 0, 12, 1, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あ、お帰りにゃー♪\nえへへ…キミに\nお帰りって言えるのが\nなんかうれしいにゃ♪", 4002, 0, 12, 2, 104601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "フロンティア\nスピリッツを\nお見せするべ！", 4003, 0, 1, 1, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この鎧を着ると\n気が引き締まる\n感じがするべ", 4004, 0, 1, 1, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "搾りたての牛乳飲んで\n今日も一日\nがんばるべ！", 4005, 0, 1, 1, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "みんなに牧場の\n乳製品を\n味わってもらいてぇべ", 4006, 0, 1, 1, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここはいいとこだべ\nうちの動物たちも\n連れてきてやりてぇな", 4007, 0, 1, 1, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "みんなオラより\n若ぇのに働いてて\n立派だべな", 4008, 0, 4, 1, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "牧場もギルドの\nみんなもオラが\nまとめて面倒見るべ！", 4009, 0, 8, 1, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さあ、今日も\n忙しくなるべよ\n気合入れてくべ！", 4010, 0, 1, 2, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お、あんちゃん\n丁度いいとこに！\n一緒に街に\n行商しに行くべ！", 4011, 0, 1, 2, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "牧場仕事で培った力が\n戦いでも役立つなら\n一石二鳥だべさ！", 4012, 0, 1, 2, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "疲れた時は牧場産の\nミルク菓子で\n糖分補給だべ", 4013, 0, 1, 2, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "これ、牧場の\n新製品だべ\n一番最初に味見\nしてほしいべさ", 4014, 0, 4, 2, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "働きづめはよくねぇベ\n膝枕してやっから\nこっち来るべさ", 4015, 0, 8, 2, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふぁあ…\n酪農家の朝は\n早ぇんだべ…", 4016, 1, 1, 2, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ごはんの時間だべ！\n腹が減っては酪農も\n戦いもできねえべ！", 4017, 2, 1, 2, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ寝るべ！\n健全なお笑いは\n健全な肉体に宿るべ！", 4018, 3, 1, 2, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "牧草みたいに\nふっかふかだべ～", 4020, 0, 1, 3, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この子、目の感じが\nエリザベスに似てるべ", 4021, 0, 1, 3, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい匂いだべ～\n疲れた体に\nしみるべな～", 4022, 0, 1, 3, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったけぇな～\n牧場にも\n置いてみっかな～", 4023, 0, 1, 3, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "うまいべ！\n生産者のこだわりを\n感じるべさ", 4025, 0, 1, 3, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "酪農も戦いも\nまずは知識だべ！", 4026, 0, 1, 3, 112801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ぴょん、ぴょん♪\nこの服のおかげで、\n体が軽いなぁ…♪", 4028, 0, 1, 1, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今の内に部屋の\n掃除をしておこっと…\nみんな喜んで\nくれるといいなぁ", 4029, 0, 1, 1, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "耳と尻尾…この服、\n本当にウサギさん\nみたいだなぁ", 4030, 0, 1, 1, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんだか先輩の\n気配がするような…\n気のせいかな？", 4031, 0, 1, 1, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ウサギさんの真似を\nしたら、存在感が薄い\nとか言われないかな？\nア、アユミだぴょん♪", 4032, 0, 1, 1, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "えへへ…\nいつもとは違う先輩が\nたくさん見られて、\nうれしいな♪", 4033, 0, 4, 1, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "本の中の世界で先輩と\n旅をするなんて…\n幸せすぎて、罰が\n当たりそうだよぉ…", 4034, 0, 8, 1, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "じ～…はっ！？\nす、すみません！\n話しかけてもらえる\nなんて思ってなくて！", 4035, 0, 1, 2, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "先輩がすぐそばに…\nし、幸せすぎて\n倒れそうですぅ！", 4036, 0, 1, 2, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "え、えっと…あの…！\nうう…いざ先輩と\n向き合うと\n緊張しちゃうよぉ…", 4037, 0, 1, 2, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はうっ！？\nしょ、正面から見る\n先輩は、私にとって\n神々しすぎますぅ…！", 4038, 0, 1, 2, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "先輩…その…\nい、一緒にご飯でも\nどうでひゅか！\nうう…またかんだぁ…", 4039, 0, 4, 2, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "せ、先輩…\nハーブティーを\n入れたんですが、\n一緒にどうですか…？", 4040, 0, 8, 2, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "せ、先輩！\nおはようございます！\nえへへ、練習通りに\nバッチリ言えたぁ♪", 4041, 1, 1, 2, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ、もうお昼ですね\n時計を持ってて\n良かったです", 4042, 2, 1, 2, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間…\nお休みする\n準備をしちゃいますね", 4043, 3, 1, 2, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ…ちょっとだけ\n先輩の匂いがする…\nえへへ、幸せだなぁ♪", 4045, 0, 1, 3, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…私もウサギさんの\nぬいぐるみとして、\n先輩のそばに…はっ！\n私ったら何を…！", 4046, 0, 1, 3, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あ、いい香り…\n先輩もこういうのが\n好きなのかな？", 4047, 0, 1, 3, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "先輩が隣に\n居たら、もっと\n暖かいのになぁ…♪", 4048, 0, 1, 3, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしい…でも、\n先輩と一緒に\n食べたら、もっと\nおいしいだろうな…", 4050, 0, 1, 3, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ウサギさんって、穴を\n掘ったりするんだ…\n私も、隠れたいときに\n掘ってみようかな？", 4051, 0, 1, 3, 113001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ネビアさまのように\n普段からパタパタと\n飛んでみるのも…", 4053, 0, 1, 1, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ご立派になられた\n主さまと並べるように\nもっと精進しなくては", 4054, 0, 1, 1, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "月々の食費が\n増えてしまいました\n申し訳ございません…", 4055, 0, 1, 1, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ワンワンのほうの\n主さまは、この姿に\n驚くでしょうか…？", 4056, 0, 1, 1, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "主さまと離れていても\n主さまとの絆は\n胸に感じております…", 4057, 0, 1, 1, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "このギルドハウスは\nみなさまの帰る場所…\nわたくしが守ります", 4058, 0, 4, 1, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "どんな未来が\n待ち受けようとも\n主さまと添い遂げます", 4059, 0, 8, 1, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おでかけですか？\nではわたくしも\nお供いたします", 4060, 0, 1, 2, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もう二度と主さまと\n離れたくはありません\nいつ何時も…", 4061, 0, 1, 2, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なにかお困りごと\nでございますか？\nわたくしに何なりと…", 4062, 0, 1, 2, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "どうぞゆっくりと\n心ゆくまでくつろいで\nくださいまし、主さま", 4063, 0, 1, 2, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "この羽で主さまを\nどこまでも遠く…\n高くへと導きます", 4064, 0, 4, 2, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "主さま、主さま…♪\nおそばにいられるのが\nうれしくて、つい…", 4065, 0, 8, 2, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n今日も一日、主さまの\nサポートをいたします", 4066, 1, 1, 2, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日も頑張っている\n主さまに、スタンプを\nもう一つ…ポン！", 4067, 2, 1, 2, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "寝付けないのでしたら\nわたくしが子守唄を\n歌ってさしあげます", 4068, 3, 1, 2, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふか…\nまるで主さまのような\n柔らかさでございます", 4070, 0, 1, 3, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなたも一緒に\n主さまと遊びますか？\n至福の時間ですよ♪", 4071, 0, 1, 3, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "主さまの優しくて\nくすぐったい匂いが\nたまらなく恋しいです", 4072, 0, 1, 3, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "主さまの心と\n繋がったときのような\n温もりを感じます", 4073, 0, 1, 3, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いけませんっ…！\n元の姿に戻ると、また\n食べてしまうのに…！", 4075, 0, 1, 3, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "主さまに読み聞かせる\n絵本は…妖精が主役の\n物語にいたしましょう", 4076, 0, 1, 3, 180501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "…彼のこと弟みたいに\n思ってきたのに…私、\nどうしたらいいの…？", 4078, 0, 12, 1, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "よ、予定がなかったら\nでいいんだけど…\nその、ふ、二人で\n訓練とか…どうかな？", 4079, 0, 12, 2, 104801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おめかしもしたし\nあとはお兄ちゃんを\n待つだけですね～♪", 4080, 0, 1, 1, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お兄ちゃんの身の回り\nをお片付け～、これぞ\nデキる妹アピール！", 4081, 0, 1, 1, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ、衣装がほつれてる\nこれくらいなら自分で\n繕えますね…！", 4082, 0, 1, 1, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この格好で歩いてると\n見慣れた景色も\n違うものに見えますね", 4083, 0, 1, 1, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "勉強もちゃんとします\n…でも、一人だと\n集中力がもちません～", 4084, 0, 1, 1, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんを大好きな\n妹が待ってますよ～\n…まだですかね～", 4085, 0, 4, 1, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄ちゃんのために\n掃除洗濯をする私って\nお嫁さんみたい…\n…えへへ～", 4086, 0, 8, 1, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おに～いちゃん！\n縫い物、一緒に\nやりましょうよ！", 4087, 0, 1, 2, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "かわいい妹を\n愛でたくなりました？\n思う存分、どうぞ♪", 4088, 0, 1, 2, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わっ、ビックリした～\nもう、お兄ちゃんてば\nイタズラっ子ですね～", 4089, 0, 1, 2, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "一緒にお買い物\n行きませんか？\n妹とデートですよっ♪", 4090, 0, 1, 2, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃん…頭を\n撫でてくれませんか？\nえへへ、これが一番♪", 4091, 0, 4, 2, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄ちゃん大好き♪\n何度でも言いますよ！\nお兄ちゃん大好きっ♪", 4092, 0, 8, 2, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよ～お兄ちゃん！\n妹モーニングコールの\n時間ですよっ♪", 4093, 1, 1, 2, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろ休憩ですね！\n甘いお菓子で\n元気回復しましょ～！", 4094, 2, 1, 2, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜更かし厳禁！\nでも、もう少しだけ\nお話ししたいなぁ～", 4095, 3, 1, 2, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふっかふかですよ！\nお兄ちゃんと一緒に\n座りたいなぁ…♪", 4097, 0, 1, 3, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "このぬいぐるみの\nかわいさ…う～ん\n負けられません…！", 4098, 0, 1, 3, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "香りにも気をつかって\nパーフェクトな妹に\nなっちゃいますから！", 4099, 0, 1, 3, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はぁ～ぬくぬくです～\nお兄ちゃんと一緒に\n温まりたいなぁ…♪", 4100, 0, 1, 3, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これは止まりませんね\nもぐもぐ…いくらでも\n食べられちゃいます", 4102, 0, 1, 3, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "これ、デザインの\n参考になりそう！\n私にも作れるかなぁ", 4103, 0, 1, 3, 112901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "退屈です…\nなにか楽しいことは\nないですか？", 4105, 0, 1, 1, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ギャングの仕事は\n今日はお休みです\nのんびりするですよ", 4106, 0, 1, 1, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ひうっ！　あたしの\n尻尾なんて食べても\nおいしくないですよ？", 4107, 0, 1, 1, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふう…どうやら\n例の件はまだボスに\nバレてないですね…", 4108, 0, 1, 1, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "下克上…いい言葉です\nって、ボスに聞かれて\nないですよね…？", 4109, 0, 1, 1, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "いつか絶対ビッグに\nなってやるです！\nあたしを信じるです！", 4110, 0, 4, 1, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あたしが覚醒したら\nきっと誰よりも\n強くなるはずです！", 4111, 0, 8, 1, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なんですか？\n貢ぎ物なら\nいつでも歓迎ですよ！", 4112, 0, 1, 2, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あたしだって\nやる時はやるですよ！\nその時がこないだけ！", 4113, 0, 1, 2, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "しりとり勝負ですか？\nいい度胸ですね、\nかかってくるです！", 4114, 0, 1, 2, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お兄さんは\nヒマそうですね…\nうらやましいです", 4115, 0, 1, 2, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "かまってほしいです？\nまったく…いいですよ\nしょうがないですね", 4116, 0, 4, 2, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄さんのことは\nこのあたしが\n守ってやるですよ！", 4117, 0, 8, 2, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "デキるギャングの\n朝は早いのです…\nふぁあ…", 4118, 1, 1, 2, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹がすいたですね\nなにか食べにいくです\nお兄さんのおごりで！", 4119, 2, 1, 2, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふぁあ…むにゅう…\nまだ起きてるですよぉ", 4120, 3, 1, 2, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ～…\nもうここから一歩も\n動きたくないです", 4122, 0, 1, 3, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なかなかいいモフりを\nしてやがるです…\n舎弟にしてやるですよ", 4123, 0, 1, 3, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんかおしゃれな\n匂いがするですね…", 4124, 0, 1, 3, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふふーん！\nあたしのブレスの方が\n火力は上ですね！", 4125, 0, 1, 3, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あたしに貢ぎ物とは\nよく分かってるですね\n食べてやるですよ", 4127, 0, 1, 3, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふーむ…\nもっと楽しい本は\nないですかね？", 4128, 0, 1, 3, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "海に眠る秘宝…\n心躍る響きだ！\n早く見つけたい…！", 4130, 0, 1, 1, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うう～、暑いぃ…\nかき氷を食べて\nすっきりしたいぃ…", 4131, 0, 1, 1, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アターック！\nいや、もっとこう…\nアタァーック！", 4132, 0, 1, 1, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "スイカ割りで\n目を回さない\nコツはなんだろうか…", 4133, 0, 1, 1, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "せっかく海に来たのだ\n泳ぎも上手に\nなりたいものだな", 4134, 0, 1, 1, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふっふっふ…\n疼く…疼くぞ！\n日焼けの痕が…", 4135, 0, 4, 1, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "シグルドと私は\n来世でも共にある…\nつまり我らはずっと…\nはわわ…！", 4136, 0, 8, 1, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "シグルド、私と共に\n日光浴に行かないか？\n光の力を集めよう！", 4137, 0, 1, 2, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この格好だからできる\n必殺技を考えている\n何か案はないか？", 4138, 0, 1, 2, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "シグルド～！\nスイカを貰ったから\n一緒に食べよう！", 4139, 0, 1, 2, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こう日差しが強いと\n日焼けしそうだな\n跡になってないか…？", 4140, 0, 1, 2, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "我らの夏の黙示録\nしっかりと記録\nしておかねばな", 4141, 0, 4, 2, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ちゃんと日焼けどめを\n塗ってもらうべき\nだったかな…？\nシ、シグルドに…！", 4142, 0, 8, 2, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝だぞシグルド！\nさぁ、日光を浴びて\n光の加護を得るのだ！", 4143, 1, 1, 2, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もう昼食の時間か…\n私の魔力も減ったし\n早く補給しなければ", 4144, 2, 1, 2, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜でも我らの活動は\n終わることはない！\nさぁ準備を…ふわぁ…", 4145, 3, 1, 2, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海で遊んでいると\n疲れてしまうからな\n少し休まるとしよう", 4147, 0, 1, 3, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "えへへ～、君の名前は\n何にしまちょうかね♪\n…はっ、見たのか！？", 4148, 0, 1, 3, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "心地よい香りで\n我が精神も安らぐ…", 4149, 0, 1, 3, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "別に寒くなどないぞ！\n寒くないが、ちょっと\n暖まりたくなってな！", 4150, 0, 1, 3, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐ…食べ過ぎた分は\n魔力に変換されるのだ\n…たぶん", 4152, 0, 1, 3, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "…なな、なんだ！？\nシグルドはこういう\n趣味なのか…！？", 4153, 0, 1, 3, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "むむ、この乗り心地…\nいざゆかん、\nシードラゴンよ！", 4155, 0, 1, 3, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "疾風の冥姫の名に\nふさわしき\n深海の玉座よ…\nふああ…柔らかい～", 4156, 0, 1, 3, 113201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この姿でいると\nわたしもお姫様に\nなれた気がする…♪", 4157, 0, 1, 1, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹空いてきちゃった\nまずは買い出しに…\n…変身解かなくちゃ！", 4158, 0, 1, 1, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "胸のところが空いてて\nスースーするの\nまだ慣れないな…", 4159, 0, 1, 1, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "治癒魔法に使ってた\n魔力を攻撃魔法に…\n頭の中でも練習練習", 4160, 0, 1, 1, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "何もできなかった\nわたしから、少しは\n変われたのかな…？", 4161, 0, 1, 1, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "騎士クン…\n今どこにいるの…？\n…会いたいな", 4162, 0, 4, 1, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "離れてても分かるよ…\n温かい力で騎士クンに\n守られてるの", 4163, 0, 8, 1, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "わたしが戦えてるのは\n騎士クンのおかげだよ\nいつもありがとう！", 4164, 0, 1, 2, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹空いてそう…？\n…内緒で作ったおやつ\n騎士クンも食べる？", 4165, 0, 1, 2, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ひゃうっ！　え！？\nせ、背中はダメ～！\n言ってから触って～！", 4166, 0, 1, 2, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この格好、どうかな？\nえ？　似合ってる…？\n本当？　…うれしい！", 4167, 0, 1, 2, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "かわいい？　そうだね\nひらひらが…わたし？\nええっ、そ、そんな！", 4168, 0, 4, 2, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士クン、これからも\nずっと…わたしの\nそばにいてください", 4169, 0, 8, 2, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝からこんなに\n食べる日が来るなんて\n思ってなかったよ…", 4170, 1, 1, 2, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼を作らなくちゃ\n騎士クン、一緒に\nお料理してみる？", 4171, 2, 1, 2, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "騎士クン、もう眠い？\n眠るまで、わたしが\nずっとそばにいるね", 4172, 3, 1, 2, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "攻撃参加するからこそ\n適度に体を休めるのは\n大切だよね！", 4174, 0, 1, 3, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい…騎士クンと\nシェフィちゃんにも\nプレゼントしたいな", 4175, 0, 1, 3, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り～…\nあれ？　お腹が空いて\nきちゃった…！？", 4176, 0, 1, 3, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "温かい…\n騎士クンがくれる\n力みたい…", 4177, 0, 1, 3, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ぱくっ、\nあむ、はむっ…\nううぅ～…やっぱり\n手が止まらないよぉ～", 4179, 0, 1, 3, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "新しく覚えたいな…\nみんなで食べられる\n大皿向けの料理♪", 4180, 0, 1, 3, 180201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "お姉ちゃんの愛\nこのままじゃ\nあふれちゃうよ…♪", 4182, 0, 12, 1, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "弟くん♪\n弟くんっ♪\nおっとうっとくんっ♪", 4183, 0, 12, 2, 104901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "泳ぐのもいいけど\n今日は砂浜で\nのんびりしようかね", 4184, 0, 1, 1, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さてと\nちょっくらひと泳ぎ\n行ってくるかね", 4185, 0, 1, 1, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あっついねぇ…\nうちわがないと\nしんどいったらないよ", 4186, 0, 1, 1, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "冷たすぎる飲み物で\n体を冷やさないよう\n気をつけないと…", 4187, 0, 1, 1, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "夏はあっという間だし\n悔いがないように\n楽しまないとね", 4188, 0, 1, 1, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "きっとこの夏は\nアタシにとって大事な\n想い出になるね…", 4189, 0, 4, 1, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…前に比べたら\nアタシたちの距離も\n近づいたみたいだね", 4190, 0, 8, 1, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もし暇なら\n今日も笹舟釣り\n一緒にどうだい？", 4191, 0, 1, 2, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お前さん、釣りに\n興味が湧いたなら今度\n道具を見に行こうよ", 4192, 0, 1, 2, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今から砂浜に行くんだ\nお前さんも一緒に\n散歩するかい？", 4193, 0, 1, 2, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "え、日焼け跡？\nおや…本当だ\nすぐ焼けちまうねえ", 4194, 0, 1, 2, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ひゃっ！？\nちょっと！\n日焼け跡をいきなり\n触らないでおくれ！", 4195, 0, 4, 2, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お前さんは、その…\nアタシと一緒にいて\n楽しかったかい？", 4196, 0, 8, 2, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようさん\n今日も砂浜に行って\nゆっくりしようか", 4197, 1, 1, 2, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼か…\nそうだ、よかったら\n刺身定食、作ろうか？", 4198, 2, 1, 2, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の空を見てるとさ\nなつかしい気持ちに\nなるんだよね", 4199, 3, 1, 2, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "適度に休憩して\n夏バテしないよう\n気をつけないとね", 4201, 0, 1, 3, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あんたたちも\n海を楽しみたいって\n思っているのかね", 4202, 0, 1, 3, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん～…香りでも\nバカンスらしさを\n楽しめるもんだね", 4203, 0, 1, 3, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "こういう格好だと\n少し冷えちまうんだよ", 4204, 0, 1, 3, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐもぐ…\n遊んだ分、お腹が\n空いちまってねぇ", 4206, 0, 1, 3, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "…ん、なんだいこの本\n催眠…うーん読めない\nナナカに聞いてみるか", 4207, 0, 1, 3, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "へえ…\nなかなかいい\n乗り心地じゃないか", 4209, 0, 1, 3, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "そうそうハマグリって\n竿でも釣れるんだよ\n知ってたかい？", 4210, 0, 1, 3, 113101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "海を満喫しなきゃね\nちょっとひと泳ぎ\n行ってこようかな？", 4211, 0, 1, 1, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "う～ん…♪\nいつもと違った\n開放感～\nなんちゃって！", 4212, 0, 1, 1, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今のナナカちゃんは\nたぶん水属性！", 4213, 0, 1, 1, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "水着もバッチリ！\nサイカワサイツヨ\nナナカちゃ～ん☆", 4214, 0, 1, 1, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "んっふっふ\nドキ！　水着だらけの\nギルドハウス！\nとかどうかな？", 4215, 0, 1, 1, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "そんなに見られると\nちょ～っと\n恥ずかしいかも…\nなんてねなんてね！", 4216, 0, 4, 1, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ちょっとくらい\nドキッとしてくれても\nいいのにな～、もう…", 4217, 0, 8, 1, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "水着魔法少女の\n相方がほしいなぁ～…\nね、君やってみない？", 4218, 0, 1, 2, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いつもの格好と同じ？\nも～、わかってない！\nセクスィー度が違う！", 4219, 0, 1, 2, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうかなどうかな？\nこのひらひらのとこが\nかわいーかなー\nとか思うんだけど！", 4220, 0, 1, 2, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "せっかくだから\nギャルゲーイベント\nごっことか\nやってみる？", 4221, 0, 1, 2, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ナナカちゃんの\n好感度を上げたい？\nならおでかけだー！", 4222, 0, 4, 2, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おうちで水着って\nなんだかコスプレ\nみたいで楽しいかも♪", 4223, 0, 8, 2, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おっはよーう！\n今日はバカンス日和！\n海へゴーですぞ～♪", 4224, 1, 1, 2, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯どうしよ～…\nあ、ナナカちゃんと\nどっか食べに行く？", 4225, 2, 1, 2, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜は本を読むのが\n捗りまくりですな～！\n今日はなに読もっかな", 4226, 3, 1, 2, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "次のイベントもあるし\nちょっと休んで体力を\n回復しなきゃね～", 4228, 0, 1, 3, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こういうマスコット\n私にもいたらなぁ\nいっそ作っちゃう…？", 4229, 0, 1, 3, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "水着魔法少女に\n似合う香りってのも\n考えてみよっかな♪", 4230, 0, 1, 3, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "夜になると急に冷えて\n肌寒いんだよね～…", 4231, 0, 1, 3, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あんまり食べると\nお腹が出て…でも…\nうう、止まらない～！", 4233, 0, 1, 3, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この催眠魔法の本\n誰にもばれないように\n保管しとかなきゃね…", 4234, 0, 1, 3, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "ゴーゴーゴーゴーゴー\nナナカちゃーん♪", 4236, 0, 1, 3, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "ナナカちゃんの\n誕生～\nなんちゃって", 4237, 0, 1, 3, 113301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ファイトファイト☆\n一生懸命\n応援するね！", 4238, 0, 1, 1, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "みんながんばってる！\n私も応援でみんなを\n盛り上げなきゃ！", 4239, 0, 1, 1, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もし元気のない人が\nいたら…応援で少し\nでも元気にしたいな！", 4240, 0, 1, 1, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "がんばれ～☆\nよし、発声練習OK！\n応援は、声も大事！", 4241, 0, 1, 1, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "せっかく水着なんだし\n泳いだり潜ったりして\n遊びたいな～！", 4242, 0, 1, 1, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "チアリーダーとして\nキミを精一杯\n応援したいな…！", 4243, 0, 4, 1, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミへの応援\nちゃんと\n届いてるかな…", 4244, 0, 8, 1, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "えへへ…今ね、\nキミへの応援歌を\n考えてたのだ～♪", 4245, 0, 1, 2, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どうしたの？\n元気がないなら\n私が応援するよ☆", 4246, 0, 1, 2, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "がんばったあとは休憩\nしなきゃね！　私と\n一緒にお昼寝する？", 4247, 0, 1, 2, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "シオリンとおそろいの\n水着で応援…\nしてみたいなぁ～", 4248, 0, 1, 2, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "次はなにして遊ぶ？\nキミがしたいことを\n教えてよ！", 4249, 0, 4, 2, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミを応援\nすることができて…\n私、すごく幸せ…", 4250, 0, 8, 2, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "キミって早起き\nなんだね！　私も\n見習わなきゃ！", 4251, 1, 1, 2, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっとお疲れかな？\nそれじゃあ\n応援してあげるね♪", 4252, 2, 1, 2, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "遅い時間まで\nがんばってえらいね！\nでも無理はダメだよ♪", 4253, 3, 1, 2, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっとだけ休憩…\n…あう、座り心地が\n良すぎて…眠気が…", 4255, 0, 1, 3, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ここにいるみんなを\n私の応援でもっと\n元気にするのだ～！", 4256, 0, 1, 3, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "元気の出る香り～♪\nこれもうまく応援に\n活かせないかな～？", 4257, 0, 1, 3, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽかぽかあったまって\n元気をチャージ\nするのだ～☆", 4258, 0, 1, 3, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いっぱい食べて、\nみんなを応援する\nパワーをつけなきゃ！", 4260, 0, 1, 3, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "みんなを元気にする\n方法は…どこかに\n書いてないかなぁ…？", 4261, 0, 1, 3, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "わぁ、この子\n怪獣さんみたいで\nかわいいね～♪", 4263, 0, 1, 3, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "水着でこれに\n乗ってると海にいる\n気分になれるね！", 4264, 0, 1, 3, 113401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "すごく忙しいけど\nとても充実した気分\nこれが青春なのかしら", 4265, 0, 1, 1, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "森の静かな雰囲気も\n海の開放的な空気も\nどちらも素敵ね～", 4266, 0, 1, 1, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "汚れたお洗濯物は\nみんなが頑張った証\nなんだか愛おしいわ", 4267, 0, 1, 1, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "みんなを見てると\n何だか私も\n走りたくなっちゃうわ", 4268, 0, 1, 1, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "せっかくの水着だし\n泳ぐ練習でも\nしてみようかしら", 4269, 0, 1, 1, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "みんな～ファイト～！\n応援するのも大事よね\n練習しておかなきゃ♪", 4270, 0, 4, 1, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "先生に教えられること\nまだまだい～っぱいね\n次は何がいいかしら♪", 4271, 0, 8, 1, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日も暑くなりそうね\nこまめな水分補給を\n忘れないでね", 4272, 0, 1, 2, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "手伝ってくれるの？\nありがとう♪\n先生、頼りにしてるわ", 4273, 0, 1, 2, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "休憩はこまめに\nとりましょうね\n無理は厳禁よ", 4274, 0, 1, 2, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "海の遊びって\nどんなのがあるの？\n先生に教えてね", 4275, 0, 1, 2, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "水着は初めてだけど\nどう？　変じゃない？\nふふ、ありがとう", 4276, 0, 4, 2, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたと過ごした\nこの夏は、きっと…\n忘れられない思い出ね", 4277, 0, 8, 2, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう～\n朝練前にちゃんと\nごはん食べましょうね", 4278, 1, 1, 2, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お弁当作ってきたの\n栄養いっぱい摂って\n午後も頑張ろうね", 4279, 2, 1, 2, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうお休みしなきゃね\n先生が子守唄を歌って\nあげましょうか？", 4280, 3, 1, 2, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふふ、いい気持ちねぇ\n先生、少しだけ\n休憩しちゃおうかしら", 4282, 0, 1, 3, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あらかわいい♪\nチームにもこういう\nマスコットが欲しいわ", 4283, 0, 1, 3, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あら、海の香り？\n波の音まで聞こえて\nきちゃいそうだわ", 4284, 0, 1, 3, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うふふ\nこれなら濡れた水着を\n乾かすのも簡単ね♪", 4285, 0, 1, 3, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これ、美味しいわね♪\nでも、食べ過ぎは\n禁物よ", 4287, 0, 1, 3, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "先生だって日々勉強よ\n新しいことを知るのは\nとても楽しいわ♪", 4288, 0, 1, 3, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "あらあら、楽しいわね\nみんなもきっと\nおおはしゃぎね", 4290, 0, 1, 3, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "ふふ、これで\n夏らしい気分を\n満喫するわよ♪", 4291, 0, 1, 3, 113501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "サンドイッチも\n作ったし、\nお兄ちゃんのお出迎え\n準備は完璧だね♪", 4292, 0, 12, 1, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "えへへ、お兄ちゃんと\nぷうきちが居てくれる\nだけで、なんだか\nうれしくなっちゃう♪", 4293, 0, 12, 2, 102301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "少し赤くなっているな\n日焼けなんてしたのは\nいつ以来だろう", 4294, 0, 1, 1, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この格好で\n過ごすのは\n少し勇気がいるな…", 4295, 0, 1, 1, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "暑いのは平気だが\n肌が外気に触れるの\nにはまだ慣れないな…", 4296, 0, 1, 1, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この格好でも\n堂々としていれば\n恥ずかしくはない…\nのかな？", 4297, 0, 1, 1, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "おっと…鎧姿の時と\n重心が違うせいか\nちょっと不安定だな", 4298, 0, 1, 1, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "この水着…\n私に似合って\nいるのだろうか…？\n少年には聞きづらいな", 4299, 0, 4, 1, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "少年との\n海のバカンス…\nまた行きたい\nものだな", 4300, 0, 8, 1, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あまり見るのは\nよしてくれ…\n恥ずかしいじゃ\nないか…", 4301, 0, 1, 2, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どうかしたのかい？\n私でよければ\n話し相手くらいには\nなろうじゃないか", 4302, 0, 1, 2, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ひゃっ！\nす、すまない\nちょっと過敏に\nなっているようだ", 4303, 0, 1, 2, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…っくしゅん！\nすまない\n薄着には慣れて\nないものでね", 4304, 0, 1, 2, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "まあ、少年になら\n見られても…\nい、いや！\nなんでもない！", 4305, 0, 4, 2, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私がこうして\nゆっくりできるのは\n少年がそばにいて\nくれるからだよ", 4306, 0, 8, 2, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この時間なら\nビーチにも人は\n少ないだろうね…\n遊びに行くかい？", 4307, 1, 1, 2, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼食のお誘いかい？\nいいよ、付き合おう", 4308, 2, 1, 2, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もう夜か…\n一日が経つのは\nはやいものだね", 4309, 3, 1, 2, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "これは楽でいいな…\nいつもは鎧姿で\n家具を傷つけないか\n気を使っているからね", 4311, 0, 1, 3, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うん…ふわふわの\n感触が\nよくわかるな…", 4312, 0, 1, 3, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いつもは\n鎧に匂いが\n移ってしまうのが\n悩みなんだよ…", 4313, 0, 1, 3, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うーむ…\n涼しいのに暖かい\nなんだか奇妙な気分だ", 4314, 0, 1, 3, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "兜を気にせず\n食べられるのは\n楽でいいな…", 4316, 0, 1, 3, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむ…鎧がないと\nページがめくりやすい", 4317, 0, 1, 3, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "身軽でいいな…\n鎧を着ていると\n騎乗訓練の時\n馬に申し訳がなくてね", 4319, 0, 1, 3, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "貝をうまく使えば\n水中でも\n守りを固められそうだ", 4320, 0, 1, 3, 113601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どこをアジトと\nつなげようかな～…\nこのへんにしよっと♪", 4321, 0, 1, 1, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここってちょっと\n変わった建物だね\n妖精がいるでしょ？", 4322, 0, 1, 1, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "色んな人を観察できて\n眼福眼福…♪", 4323, 0, 1, 1, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "家具の配置変更なら\nアタシにおまかせあれ\n…家の形は変えない？", 4324, 0, 1, 1, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "新メニューどうしよう\n思いついた人がいたら\nアタシに教えてね！", 4325, 0, 1, 1, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "少年、早く帰って\nこないかな…\nよし、迎えに行こう！", 4326, 0, 4, 1, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "結局またあちこち\n移動する日々だし…\n少年に会いたいな～", 4327, 0, 8, 1, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どしたの少年？\nお姉さんに何でも\n相談してみな～？", 4328, 0, 1, 2, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あれをああして…\nおや少年！　ごめんね\nすぐに気づけなくて！", 4329, 0, 1, 2, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "何？　クリスが\nアタシを探してる？\n…いないって言って！", 4330, 0, 1, 2, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "よければリノちゃんと\nシズルちゃんにも\n顔を見せてあげて", 4331, 0, 1, 2, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "少年～！\nもうヘトヘトだよ～！\nお願い癒して～！", 4332, 0, 4, 2, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…アタシが素直に\n助けてって言えるのは\n少年だけだよ", 4333, 0, 8, 2, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝だよ少年！\n爽やかな朝の\nクレープはいかが？", 4334, 1, 1, 2, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹空いたな～\nお昼のクレープ\n少年は食べる？", 4335, 2, 1, 2, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜までクレープは\nやめとけ？　ごめん\nそれだけは無理…！", 4336, 3, 1, 2, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "アタシこんなに\nゆっくりしちゃって\nいいんだっけ～？", 4338, 0, 1, 3, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…これ\nネネカが変身\nしてないよね？", 4339, 0, 1, 3, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りだ…\n解析完了\n今度生成しようっと♪", 4340, 0, 1, 3, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "安心するな～…\nアジトに置けないから\n羨ましいよ", 4341, 0, 1, 3, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食べ物を消化するって\n仕組み、どんなものか\n気になる…", 4343, 0, 1, 3, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "速読できるけど\n本を読む時くらい\n文字にじっくり\n浸かりたいんだよね…", 4344, 0, 1, 3, 106801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "エンジェルとして\nみんなを元気に…！\nアカリ、頑張ります♪", 4346, 0, 1, 1, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お姉ちゃんと一緒に\nお兄ちゃんを…えへへ\nまだかな、お兄ちゃん", 4347, 0, 1, 1, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "エンジェルの音色を\n目指して、今日も\nサックスの練習です♪", 4348, 0, 1, 1, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お兄ちゃんとの特訓も\n頑張らないと…\n厳しくしてくださいね", 4349, 0, 1, 1, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "かわいいエンジェルの\n格好、お兄ちゃんなら\n喜んでくれますよね♪", 4350, 0, 1, 1, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "エンジェルの力で\nお兄ちゃんのハートも\nイチコロですよ♪", 4351, 0, 4, 1, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アカリが一番\n元気にしたいのは\nお兄ちゃんですよ♪", 4352, 0, 8, 1, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お兄ちゃん？\n触りたいなら…\nこことかどうですか♪", 4353, 0, 1, 2, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "特訓の時間ですか？\nアカリ、楽しみに\nしてたんですよ♪", 4354, 0, 1, 2, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ、お兄ちゃん！\nそろそろアカリと\n休憩…しませんか♪", 4355, 0, 1, 2, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この羽、触り心地\nいいですか？　あんっ\nくすぐったいですよぉ", 4356, 0, 1, 2, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんも元気に\nなりたいんですか？\nアカリにお任せです♪", 4357, 0, 4, 2, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "やんっ♪\nお兄ちゃんったら\nダイタンですね♪", 4358, 0, 8, 2, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お兄ちゃん、朝ですよ\nすっごく気持ちのいい\nお天気ですよ…♪", 4359, 1, 1, 2, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼寝しませんか\nお兄ちゃん？\nアカリの膝枕で…♪", 4360, 2, 1, 2, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜ですね、お兄ちゃん\nアカリ、なんだか胸が\nドキドキしちゃいます", 4361, 3, 1, 2, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "フカフカですね…\n隣にお兄ちゃんが\nいてくれたらなぁ…♪", 4363, 0, 1, 3, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "えへへ、アカリも\nこんな風にかわいく\nなりたいな～", 4364, 0, 1, 3, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お兄ちゃんが好きな\n匂いなのかな？\n参考にしますね！", 4365, 0, 1, 3, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "体が火照ってきて\nなんだかアカリ…\nクラクラしちゃう…", 4366, 0, 1, 3, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "はむ、んぐ…あっ\nほっぺについちゃった\nベトベトですよぉ～", 4368, 0, 1, 3, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "エンジェルって色んな\n物語に出てきますよね\nもっと調べなくちゃ！", 4369, 0, 1, 3, 113701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あの方の前では\n常に気高く\nありたいですわね", 4371, 0, 12, 1, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "どんなに道に迷っても\nあなたさまの元には\n絶対に辿り着く\n自信がありますわ", 4372, 0, 12, 2, 103201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あんたと一緒に\nいるときが一番楽しい\n一時かもしれないわ", 4373, 0, 12, 1, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "いつかあんたと一緒に\nサレンディア救護院を\n切り盛り…なんてね♪", 4374, 0, 12, 2, 102801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日も\nエンジェルとして、\nみんなの幸せの\nために頑張らないと", 4375, 0, 1, 1, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "せっかく羽が\nついてるのに\n飛べないのが残念だわ", 4376, 0, 1, 1, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この格好、子供たちに\n妙にウケがいいわね\nま、悪くないけど", 4377, 0, 1, 1, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "や、やっぱりみんな\n注目してくるわね…\nエンジェルって珍しい\nからしかたないか", 4378, 0, 1, 1, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "エンジェルになると\n人見知りがなおる！\n…わけないか", 4379, 0, 1, 1, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "エンジェルの活動は\n大変だけど、自分が\n成長してるって\n実感がうれしいわね", 4380, 0, 4, 1, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もし誰かの願いを\nかなえられるなら\n私はアイツの…\nって何考えてるのよ！", 4381, 0, 8, 1, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "何ボサっとしてるの！\nさあ、街に出て\n人助けするわよ！", 4382, 0, 1, 2, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "エンジェリック\nアロー！\nなんてね…え、アンタ\nいつから見てたのよ！", 4383, 0, 1, 2, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "コラ！\n羽は触らないで！\n壊れたらどうするのよ", 4384, 0, 1, 2, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "エンジェルじゃなく\nても、アンタはいつも\n人助けしてるわよね\n…ちょっと尊敬するわ", 4385, 0, 1, 2, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "この服なら他の子より\n私を見てくれるかも…\nって、な、何\n見てるのよ！", 4386, 0, 4, 2, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ね、ねえ、もし私が\n困ってたら、一番に\n駆けつけて…やっぱり\n何でもないわ！", 4387, 0, 8, 2, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう…あ、あの、\nエンジェルとして\n町に行くんだけど…\n一緒に行かない？", 4388, 1, 1, 2, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅ、いいことした\n後のランチは\nおいしいわね", 4389, 2, 1, 2, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間…\n夜更かししてないで\n早く寝なさいよね", 4390, 3, 1, 2, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いい座り心地ね～\nまさに天にも昇る\n心地よさだわ～", 4392, 0, 1, 3, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふ、かわいい…\nあ、羽付けたら\nもっとかわいく\nなるんじゃないかな？", 4393, 0, 1, 3, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はぁ～落ち着くわ～\n回復アイテムみたいで\n癒やされちゃうわ～", 4394, 0, 1, 3, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "わっ、とと…\n危ない、羽が\nこげちゃうところ\nだったわ", 4395, 0, 1, 3, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "人の役に立つのって\nすごく大変だから、\nこれでライフ回復よ！", 4397, 0, 1, 3, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "エンジェルに関する\n本はあるかしら…あ！\nこれ探してた攻略本！", 4398, 0, 1, 3, 113801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふっふっふ\n吸血鬼らしく\n驚かせてあげましょう", 4400, 0, 1, 1, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "獲物はどこですか～！\nう～ん、もうちょっと\n迫力が欲しいですね", 4401, 0, 1, 1, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "トリックオアトリート\n…返事がないので\nイタズラしておきます", 4402, 0, 1, 1, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ハロウィンですし\nたまには騎士さんでも\n誘ってあげますかね", 4403, 0, 1, 1, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "マントは動きに\nメリハリがついて\nいいですね", 4404, 0, 1, 1, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "色んな仮装が見られて\nやっぱりハロウィンは\n最高ですね", 4405, 0, 4, 1, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "吸血鬼らしい行動って\n噛みついたり…いや\nそれは大胆過ぎです！", 4406, 0, 8, 1, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "呼びましたか？\n手短にお願いしますよ\n忙しいんですから！", 4407, 0, 1, 2, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "え？　衣装に穴が？\nありがとうございます\n…よく見てるんですね", 4408, 0, 1, 2, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわあ…吸血鬼の\n姿でも、眠い時は\n眠いんですよね…", 4409, 0, 1, 2, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ハロウィンってライブ\nとは違った賑やかさが\nあってワクワクします", 4410, 0, 1, 2, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私を驚かそうとしても\n無駄ですよ！\nすぐ分かるんですから", 4411, 0, 4, 2, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士さん、一緒に\nハロウィンを…いいえ\nなんでもないですっ！", 4412, 0, 8, 2, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "仕事で寝不足だから\n太陽がまぶしいです…\n私、吸血鬼っぽいかも", 4413, 1, 1, 2, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯は真っ赤な…\nトマト尽くしのお弁当\nにしてみました", 4414, 2, 1, 2, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜はハロウィンが\n盛り上がる時間…\n行きますよ騎士さん！", 4415, 3, 1, 2, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このフィット感\nどうにか服作りにも\n活かせれば…！", 4417, 0, 1, 3, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "よく出来てますね…！\nぬいぐるみの服を作る\nのも楽しそうですね！", 4418, 0, 1, 3, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい感じですね…\n服に合わせた香りって\nいうのも、いいかも…", 4419, 0, 1, 3, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はぁ、温まりますね…\nおっと、マントに火が\n点いちゃいそうです！", 4420, 0, 1, 3, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あぁ、美味しい～\n食べた分は、働いて\n燃焼しますからね！", 4422, 0, 1, 3, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "伝説の吸血鬼…\n夜を統べる者…\nほうほう…", 4423, 0, 1, 3, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "やっぱりハロウィンと\nいえばお菓子です！\nさぁ配りましょうか！", 4425, 0, 1, 3, 113901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この格好…\nカッコイイのに\n動きやすくて\n着心地も最高ッス！", 4427, 0, 1, 1, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "キメポーズはこう…\nいやこっちのほうが…\nなやましいッス…！", 4428, 0, 1, 1, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "トリックオア\nジャスティス！\nって言ったら何か\nもらえるッスかね？", 4429, 0, 1, 1, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "新しい必殺技の\n特訓もしなくちゃ\nいけないッスね…\n忙しいッス！", 4430, 0, 1, 1, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "自分のこの姿\nトモね～ちゃんにも\nみせてあげるッス！", 4431, 0, 1, 1, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ホワイトタイガー\n参上ッス！\n今のポーズは\nキマったッス！", 4432, 0, 4, 1, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人と一緒だと\nほんとにヒーローに\nなれる気がするッス！", 4433, 0, 8, 1, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうッスか？\nこの色、自分に\n似合ってるッスかね？", 4434, 0, 1, 2, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ヒマだったら\n必殺技の特訓に\n付き合ってもらって\nいいッスか？", 4435, 0, 1, 2, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ちょうどいいところに\n来たッスね！\nこのキメポーズ\nどうッスか？", 4436, 0, 1, 2, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お！　この格好、\n気になるッスか？\nじっくり見ても\nいいッスよ♪", 4437, 0, 1, 2, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんたも一緒に\n新しい技の練習\nどうッスか？", 4438, 0, 4, 2, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今日もあんたと一緒に\nランドソルの平和を\n守るッスよ！", 4439, 0, 8, 2, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝ッス！\n一緒に早朝特訓\nやるッスよ！", 4440, 1, 1, 2, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼休憩ッス！\nヒーローにも\n休息は必要ッス！", 4441, 2, 1, 2, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "闇夜に映える\n白い衣装で\n平和を守るッスよ！", 4442, 3, 1, 2, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "トラも狩りの時以外は\nごろごろしてるって\n本で読んだッスよー", 4444, 0, 1, 3, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もこもこッスね♪\nこのかわいらしさを\n守ってあげるのも\nヒーローの役目ッス！", 4445, 0, 1, 3, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい匂いッスね…\nリラックスして\n瞑想するッス！", 4446, 0, 1, 3, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "燃える炎は\nヒーローの心意気ッス\nいつまでも\n見てられるッスよ", 4447, 0, 1, 3, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…\nいっぱい食べて\n強いヒーローに\nなるッスよ！", 4449, 0, 1, 3, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ちゃんと勉強の本も\n読んでるッスよ…！\nヒーローには賢さも\n必要らしいッス！", 4450, 0, 1, 3, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "わわっ、お菓子が\nいっぱいッス！\nみんなで\n食べるッスよ！", 4452, 0, 1, 3, 114101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ワタシがチューシンと\nなった今、天下統一は\n目の前デス！", 4454, 0, 12, 1, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "もうショーグンってば\nそれはセイシツに\nすることデ～ス…", 4455, 0, 12, 2, 103001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "女幽霊…うらめしや…\nうーん、これは\nちょっと違う気が\nするな…", 4456, 0, 1, 1, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "何だか寒気がする…\nま、まさか\nこの部屋にも幽霊が？", 4457, 0, 1, 1, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ハロウィンは楽しいね\n童心に帰ったような\n気分だよ", 4458, 0, 1, 1, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今度のハロウィンは\nユイとヒヨリを\n誘ってみようかな", 4459, 0, 1, 1, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ハロウィンのお菓子は\nどれもかわいいね\n…一つくらいなら\nいいかな？", 4460, 0, 1, 1, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "次は彼と\nどんなハロウィンを\n過ごそうかな…", 4461, 0, 4, 1, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "こんな賑やかさも\nいいものだね\n彼といられるのなら\nなおさら…", 4462, 0, 8, 1, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…いたずらしようと\nしてない、キミ？\nふふ、お見通しだよ", 4463, 0, 1, 2, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "え、私にもお菓子を？\nありがとう…ふふ\nうれしいものだね\nハッピーハロウィン！", 4464, 0, 1, 2, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうしたの？\n出かけるなら\n私も同行しようか", 4465, 0, 1, 2, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この格好、舞踏会にも\n出られそうだね\n一曲、踊ってみる？", 4466, 0, 1, 2, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "やるからには本気で\nやらせてもらおう\nトリックオア\nトリート！", 4467, 0, 4, 2, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "他の子に目移りする\nのも分かるが、その…\nせっかくの特別な衣装\n見てほしいな", 4468, 0, 8, 2, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "寝起きの体を\n慣らしておこうか\nほら、剣を取って", 4469, 1, 1, 2, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お菓子もいいけど\nちゃんと昼食も\nとるんだよ", 4470, 2, 1, 2, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さあ、行こうか！\nハロウィンは\nこれからが本番だよ", 4471, 3, 1, 2, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ハロウィンはまだ\nこれからだ\n一休みしようか", 4473, 0, 1, 3, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "キミたちも\n仮装に興味は\nあるかな？　…ふふ", 4474, 0, 1, 3, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りだけど\n幽霊が集まったり\nしないだろうか…？", 4475, 0, 1, 3, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖かい…一息ついたら\nハロウィンの\nパレードを\n見に行こうかな", 4476, 0, 1, 3, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ハロウィンを本気で\n楽しむなら\n食事もしっかり\nとっておかないとね", 4478, 0, 1, 3, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ハロウィンの\nホラー小説か…\nけ、結構\n怖いものだね…？", 4479, 0, 1, 3, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "お菓子がいっぱいだ…\nこういうのって\n見ているだけで心が\n躍ってしまうね", 4481, 0, 1, 3, 114001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "こんなにかわいい\n武器で戦えるとは…\nすごいものだな\n魔法少女は", 4483, 0, 1, 1, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "決めポーズの訓練も\nしっかりやっておくか\n…誰も見ていないな？", 4484, 0, 1, 1, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こういう格好は\nユキあたりがすごく\n似合いそうだな", 4485, 0, 1, 1, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "子どもたちにサインを\n求められてしまった…\nこれもまた私の使命！", 4486, 0, 1, 1, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この格好は目立つな…\nいや、提督とは人々の\n視線を集めるものだ！", 4487, 0, 1, 1, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつと作戦会議を\nしておくか。あれで\nなかなか頼れるからな", 4488, 0, 4, 1, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あいつには私の勇姿を\nちゃんと見ていて\nほしいものだな", 4489, 0, 8, 1, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "一仕事終えたことだし\n一緒に甘いものでも\n食べに行くか？", 4490, 0, 1, 2, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "怪しげな気配がするな\n貴公も警戒を\n怠るなよ！", 4491, 0, 1, 2, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "シオリに魔法少女の\n本を借りたんだ\n一緒に読まないか？", 4492, 0, 1, 2, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "巡回の時間まで\nお茶にでもするか\n貴公も付き合うがいい", 4493, 0, 1, 2, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "貴公がサポートして\nくれるのなら心強いな\n頼りにしているぞ", 4494, 0, 4, 2, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "頭を撫でるな～！\n…まったく、貴公だけ\nだぞ、こんな風に私を\n撫でてくるのは…", 4495, 0, 8, 2, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "起きろ貴公！\n魔法少女の朝は\n早いぞ！", 4496, 1, 1, 2, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ほら、食後の\nデザートだ\nて、適度な糖分は\n体に必要なんだ！", 4497, 2, 1, 2, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわぁ…魔法少女も…\n眠気、には…い、いや\n寝てないぞ！？", 4498, 3, 1, 2, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "任務や訓練で\n疲れた体に\nこれは効くなぁ…", 4500, 0, 1, 3, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うむ、かわいいな\nモーラのやつを隣に\n並べようか", 4501, 0, 1, 3, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ああ、身も心も\n安らぐ…\nまるで魔法だな…", 4502, 0, 1, 3, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この温かさ…\n愛と希望に\n通じるものがある…", 4503, 0, 1, 3, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食事の大切さは\n魔法少女も軍人も\n変わりない\nしっかり食べるんだ！", 4505, 0, 1, 3, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "魔法少女の本を\n読んでるのだが\nわ、私もこんななのか", 4506, 0, 1, 3, 114201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "オラとあんちゃんは\nボケもツッコミも\nあうんの呼吸だべ♪", 4508, 0, 12, 1, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あんちゃんと二人で\nネタ合わせ…初めての\n共同作業だべ♪", 4509, 0, 12, 2, 103301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ぴっぷる！", 4510, 0, 1, 1, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぴっぷるぴっぷる♪", 4511, 0, 1, 1, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぴっ！", 4512, 0, 1, 1, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ぷっぷー", 4513, 0, 1, 1, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぴぃ？", 4514, 0, 1, 1, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ぴっぷるんるん♪", 4515, 0, 1, 2, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぷぅ！", 4516, 0, 1, 2, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぴぴっ♪", 4517, 0, 1, 2, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ぷぅー…", 4518, 0, 1, 2, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちゅ！", 4519, 1, 1, 2, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぷはー", 4520, 2, 1, 2, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぴぇー", 4521, 3, 1, 2, 192501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "魔法少女になったら\n髪型も変わるんだね\n色々試してみようかな", 4531, 0, 1, 1, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "…煌く剣技で、\n悪を断つ！\nうん、今日も\n完璧なポーズだね♪", 4532, 0, 1, 1, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ミクマ流剣術で、\n魔法少女の技に使え\nそうなものは…よし、\n早速試してみよっと♪", 4533, 0, 1, 1, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "魔法少女になったから\nには、サインの練習も\nしないと…\nよし、頑張るぞ！", 4534, 0, 1, 1, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "魔法少女の姿はすごく\nかわいいけど…この\n姿はジュンさんたちに\n見せられないなぁ…", 4535, 0, 1, 1, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人は魔法少女\nのこと好きなのかな？\n…好きだったら\nうれしいな♪", 4536, 0, 4, 1, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…やっぱり、\nあの人がいないと\n特訓に身が入らない…\n早く帰ってこないかな", 4537, 0, 8, 1, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もし時間があるなら、\n私と街の見回りに\n行かない？", 4538, 0, 1, 2, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ、いいところに！\n新しい魔法剣術を\n編み出したから、\n見てくれないかな？", 4539, 0, 1, 2, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "魔法少女の姿が気に\nなるのは分かるけど…\nず、ずっと見られる\nのは照れるからやめて", 4540, 0, 1, 2, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "変身ポーズ中の動き、\n少し変えた方が\nいいかな…\nあなたはどう思う？", 4541, 0, 1, 2, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "よければ、\n魔法少女の特訓に\n付き合ってくれない？\nその…二人きりでさ…", 4542, 0, 4, 2, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私…あなただけの\n魔法少女になっても…\nふふっ、な～んてね♪", 4543, 0, 8, 2, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日もいい朝だね\nさあ、一緒に\n街の見回りに行こうか", 4544, 1, 1, 2, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もう昼か…なにか\n食べたいものある？\n簡単なのでいいなら、\n私が作ってあげるよ", 4545, 2, 1, 2, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ休もうか\n…なんなら、添い寝\nしてあげようか？\nふふっ、冗談だよ♪", 4546, 3, 1, 2, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "これは…\n心身ともに安らぐね\nなんだか\n眠くなっちゃいそう", 4548, 0, 1, 3, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "か、かわいい…これ、\n魔法で動かせたり\nしないかな？", 4549, 0, 1, 3, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りだね\nなんだか頭が冴えて\nきたし、新しい技でも\n考えようかな", 4550, 0, 1, 3, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいな…\nこの温もりは、\n魔法少女の魔法でも\n再現不可能だね…", 4551, 0, 1, 3, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "こ、これは…\nおいしすぎて手が\n止まらないかも", 4553, 0, 1, 3, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本の\nキャラの動き、\n変身ポーズの\n参考にできるかも！", 4554, 0, 1, 3, 114301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "メリークリスマス！\nさあ、素敵な\nパーティーを始めると\nいたしましょう！", 4556, 0, 1, 1, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふふっ、\nいくつになっても、\nやはりクリスマスは、\nワクワクしますわね♪", 4557, 0, 1, 1, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "自分で料理をしてみて\nシェフたちのすごさが\n改めて分かりましたわ", 4558, 0, 1, 1, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "何事も自分で\n体験してみると\n新しい発見が\nあるものですわね♪", 4559, 0, 1, 1, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "やはり、クリスマスは\n街が活発になり\nますわね…これは、\n絶好の商機ですわ♪", 4560, 0, 1, 1, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "他のクリスマス料理も\n作れるようになったら\nあのお方は食べて\nくださるかしら…？", 4561, 0, 4, 1, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あのお方に贈る\nプレゼント…\nこれはかなりの\n難題ですわね…", 4562, 0, 8, 1, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "メリークリスマス！\nよろしければ、一緒に\nクリスマスの準備を\nいたしませんか？", 4563, 0, 1, 2, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "まあ、クリスマスの\n飾りつけを手伝って\nいただけるのですか？\nありがとうございます", 4564, 0, 1, 2, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "クリスマスに合わせて\nあつらえた自慢の衣装\nなのですが…その、\nいかがでしょうか？", 4565, 0, 1, 2, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "幼い頃はサンタさんが\nいらっしゃるのを\n待ちわびたものです\n今は…内緒ですわ♪", 4566, 0, 1, 2, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "も、もしお時間が\nあるようでしたら、\nクリスマスの街を\n一緒に歩きませんか？", 4567, 0, 4, 2, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "来年のクリスマスも\nあのお方と一緒に\n迎えられたら…", 4568, 0, 8, 2, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "時は金なり…\nせっかくの朝ですもの\n時間を有効活用\nいたしましょう！", 4569, 1, 1, 2, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼になりましたわね\nさあ、\nパーティーの準備を\n進めますわよ！", 4570, 2, 1, 2, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "静かな夜ですわね…\nもうちょっとだけ、\nあなたさまとお話を\nしていたい気分です", 4571, 3, 1, 2, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "適度な休息は\n成功の秘訣ですわ！", 4573, 0, 1, 3, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "このかわいらしさ…\nいつまでも見て\nいられそうですわ♪", 4574, 0, 1, 3, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "人をもてなすには\nこうしたところにも\n気を配らないと\nいけませんわね", 4575, 0, 1, 3, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖かい…\nこういう憩いの\nひと時こそ、大事に\nしたいものですわね", 4576, 0, 1, 3, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "この奥深い味わい…\n何か隠し味など\n使われていまして？", 4578, 0, 1, 3, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "クリスマス料理の\nレシピも、\nこれだけあると\n迷ってしまいますわね", 4579, 0, 1, 3, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "この絵本、とっても\n面白いつくりですわね\nうちの商品に\nしたいぐらいですわ", 4581, 0, 1, 3, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "これだけ大きな\n着ぐるみ…\n職人の技術が\n光りますわね", 4582, 0, 1, 3, 114401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "クリスマスといえば\nパーティーよね！\nいっぱい飲むわよ～♪", 4583, 0, 1, 1, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私を麦しゅわだけの\n女と思ったら\n大間違いなんだから♪", 4584, 0, 1, 1, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "クリスマスらしい\n飲み物も結構いいわね\n私も今度\n作ってみようかしら", 4585, 0, 1, 1, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "暖かい部屋で飲む\n麦しゅわも\nまた格別なのよね…", 4586, 0, 1, 1, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "今日はオフの日だし\n朝から飲んでも\n怒られないわよね？", 4587, 0, 1, 1, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "クリスマスの\nデートスポットで\n彼と一緒に…ってなに\n考えてるのユカリ！？", 4588, 0, 4, 1, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "背伸びしなくても\nありのままの自分を\n受け入れてくれるって\nすごく…幸せ…", 4589, 0, 8, 1, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "大丈夫よ～\n飲んでない\n飲んでないひゃら～", 4590, 0, 1, 2, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "クリスマスは\n特別だもの\n特別な一杯を\n飲まないとね♪", 4591, 0, 1, 2, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "メリークリスマース！\nほらほらぁ\n乾杯しましょ♪", 4592, 0, 1, 2, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お姉さんの\n頼れるところ\n見せてあげるわね", 4593, 0, 1, 2, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "何かあったら\n頼ってくれても\nいいんだからね？", 4594, 0, 4, 2, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ふふ…これからも\nキミのこと…\n頼りにしちゃうからね", 4595, 0, 8, 2, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さわやかな朝ね\n…二日酔いがないと\n朝ってこんなに\n気持ちいいのね", 4596, 1, 1, 2, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼間から飲むのって\nまた格別よね…って\nガマン、ガマンよ…", 4597, 2, 1, 2, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間かあ…\nあとは寝るだけだし\nちょっとくらいは…", 4598, 3, 1, 2, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ゴロゴロするのって\n最高ね～\nあとは麦しゅわが\nあればなぁ", 4600, 0, 1, 3, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私だって…\nかわいいものは\n好きでいいわよね？", 4601, 0, 1, 3, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "んっ～…いい香りね\n日頃の疲れが\n取れる気がするわ", 4602, 0, 1, 3, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ポカポカする～\n…なんだかのどが\nかわいてきたわね", 4603, 0, 1, 3, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…労働の\n後のご飯はやっぱり\nおいしいわぁ…", 4605, 0, 1, 3, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "クリスマスデート\n完全攻略マニュアル？\n…読んでおかなくちゃ", 4606, 0, 1, 3, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "あら、絵が飛び出して\n見えるけど…\n酔っ払ってるせいじゃ\nないわよね…？", 4608, 0, 1, 3, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "いい手触りね～\nウチにもほしいけど\n麦しゅわをこぼしたら\n大変そうだわ…", 4609, 0, 1, 3, 114601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ヒデサイの視線\nずっと独り占め\nしてたいな～", 4610, 0, 12, 1, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ヒデサイといるだけで\nうち、おに楽しいし！\nヒデサイもっしょ～？", 4611, 0, 12, 2, 101601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "メリークリスマス！\nふふ、口にするだけで\n何だか楽しくなるわね", 4612, 0, 1, 1, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いつもは子どもたちを\n見守る方だけど\n今ははしゃいでも\nいいわよね？", 4613, 0, 1, 1, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ツリーや料理\nそしてプレゼント！\nいくつになっても\nやっぱり心躍るわね♪", 4614, 0, 1, 1, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "飾り付けも料理も\nいいセンスしてるわね\n救護院のパーティーの\n参考にさせてもらうわ", 4615, 0, 1, 1, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "焼きそばパンを\nクリスマスの定番に\nするにはどうすれば…", 4616, 0, 1, 1, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "これ、あいつの\n好きそうな料理だわ\n取っといて食べさせて\nあげようかしら♪", 4617, 0, 4, 1, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あいつのプレゼント\nちょっとだけ奮発\nしたのよね…\n喜んでくれるかしら", 4618, 0, 8, 1, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "このドレス\n似合ってるかしら？\n今だけは見とれても\n許してあげるわ♪", 4619, 0, 1, 2, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "見て、このケーキ！\nおいしそうでしょ\nたまにはこんな贅沢も\nいいわよね♪", 4620, 0, 1, 2, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "料理も飲み物も\nおいしいわね！\nいっぱい食べて\n元を取らないと♪", 4621, 0, 1, 2, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "子どもたちと一緒に\n雪遊び、楽しそうね\nあんたもどう？", 4622, 0, 1, 2, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "せっかくの\nクリスマスなんだもの\nエスコート\nよろしくね♪", 4623, 0, 4, 2, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "寒い？　そう…\nなら、もっとこっち\n来ていいわよ…？", 4624, 0, 8, 2, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ほら、早く起きて？\nパーティー用の\n買い出しに\n付き合ってちょうだい", 4625, 1, 1, 2, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "パーティーの料理の\n準備をしながらお昼も\n作っておいたわ\n我ながらいい手際ね", 4626, 2, 1, 2, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "にぎやかなパーティー\nもいいけど、聖夜の\n余韻を感じるのも\n結構素敵ね", 4627, 3, 1, 2, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いい座り心地だわ～\n腕のいい職人の仕事ね\nうちでも扱いたいわ", 4629, 0, 1, 3, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい！\n子どもたちに\nプレゼントしたら\n喜んでくれるかも", 4630, 0, 1, 3, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "華やかな香りね\nクリスマスに\nピッタリだわ", 4631, 0, 1, 3, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "寒い日にはやっぱり\nこれよね…\nはぁ、極楽極楽♪", 4632, 0, 1, 3, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "んー、おいしいわ！\n焼きそばパン味の\nものも、作れない\nかしら？", 4634, 0, 1, 3, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "たまにはのんびり\n読書でも…なんだか\nラブロマンスばかりね\nクリスマスだから？", 4635, 0, 1, 3, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "これ、面白いわね！\n子どもたちの\nプレゼントに\nピッタリだわ", 4637, 0, 1, 3, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "こんないい毛並み\n初めて見るわ…\n一体どこで手に\n入るのかしら？", 4638, 0, 1, 3, 114501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "アタシもみんなと\n一緒に正月を\n楽しんでいいのか？", 4639, 0, 1, 1, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今年こそ、もう少し\n身長が伸びます\nように…", 4640, 0, 1, 1, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "げっ！　お年玉が\n全然残ってないぞ！？\nそんな、嘘だろ…？", 4641, 0, 1, 1, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "大勢で過ごす\n正月か…初めてだけど\n悪くないもんだな", 4642, 0, 1, 1, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "んー…ここじゃ\n天楼覇断剣の\n出番はなさそうだな", 4643, 0, 1, 1, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "アイツらと作る\n戦い以外の思い出も\nもっと増やしたいな", 4644, 0, 4, 1, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "こんなに賑やかな\n正月は初めてだ\n…温かくて、いいな", 4645, 0, 8, 1, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "記憶がなくったって\n楽しい思い出は\n新しく作れるよな？", 4646, 0, 1, 2, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "早くでかけるぞ！\nアタシはもっと\n正月を楽しみたい！", 4647, 0, 1, 2, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なあ、オマエはもう\nノウェムって名前\n覚えてくれたよな？", 4648, 0, 1, 2, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この服、アタシに\n似合ってるのか？\n…そっか。\nありがとな！", 4649, 0, 1, 2, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "オマエらと見た朝日は\nきっと忘れないぞ！\n思い出ができたな！", 4650, 0, 4, 2, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつかオクトーも\n一緒に、みんなで\n正月を過ごせたらな…", 4651, 0, 8, 2, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝から元気だな！\nアタシもいっちょ\n見習ってみるか！", 4652, 1, 1, 2, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼飯は何にする？\n正月はうまいものが\n多くて迷うよな！", 4653, 2, 1, 2, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いい夜だな！\nアタシと一緒に\n夜更かしを楽しむか？", 4654, 3, 1, 2, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "正月らしく、たまには\nゆっくりするのも\nいいかもな…", 4656, 0, 1, 3, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なんだ？\nオマエも初詣に\n行きたいのか？", 4657, 0, 1, 3, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "すーはー…\n神殿のニオイがするな\nいい事ありそうだ！", 4658, 0, 1, 3, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "コイツがあれば\nうまい魚が\n焼けそうだな…", 4659, 0, 1, 3, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ううー\n食べ過ぎて帯が\nきつくなってきたぞ…", 4661, 0, 1, 3, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "おみくじって\n書いてあることが\nむずかしいんだよな…", 4662, 0, 1, 3, 114701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "困ってる人は\nいないみたいだし…\nちょっとここで、\n特訓しようかな♪", 4664, 0, 1, 1, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "空が飛べるんだから\nもっとたくさんの人を\n助けにいけちゃう！\n…ここじゃ飛べないや", 4665, 0, 1, 1, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "炎の翼\nかっこいいなー！\nこれ、もっと大きく\nできないのかな？", 4666, 0, 1, 1, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "やっぱり変身すると\nお腹すくんだね…\n…今ならペコさんの\n食欲の理由が分かるよ", 4667, 0, 1, 1, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "色なんかは違うけど…\nマントがあるから\n騎士くんとお揃いに\nなったみたい♪", 4668, 0, 1, 1, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…騎士くんがいないと\nなんか調子でない…\n早く会いたいよぉ…", 4669, 0, 4, 1, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この姿になると、\n騎士くんを近くに\n感じる…なんだろ\nドキドキしちゃう…", 4670, 0, 8, 1, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "騎士くん騎士くん！\n今大丈夫？\nトレーニングメニュー\n考えるの手伝って！", 4671, 0, 1, 2, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "…うにゃっ！？\nこ、この姿になっても\n尻尾は触っちゃ\nダメー！", 4672, 0, 1, 2, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もしかして、この服が\n気になってるの？\nだったら、もっと\n近くで見ていいよ♪", 4673, 0, 1, 2, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あ、騎士くん！\n困ってる人がいないか\n見回りに行くんだけど\nついてきて欲しいな！", 4674, 0, 1, 2, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "耳に触りたいの？\nだったら頭もなでて！\nそしたら、好きなだけ\n触っていいよ♪", 4675, 0, 4, 2, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…あたし、強くなって\n騎士くんを守るよ！\nだから…これからも\n一緒にいていい？", 4676, 0, 8, 2, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おっはよー！\nさあさあ騎士くん！\n今日も一緒に\nはりきっていこー♪", 4677, 1, 1, 2, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼、お昼～♪\n今日のご飯は何かな～\nあ、騎士くん！\n早くお昼食べ行こ！", 4678, 2, 1, 2, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日もお疲れ様ー！\n騎士くん、あたしが\nマッサージしよっか？\n結構評判なんだよ！", 4679, 3, 1, 2, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うにゃぁ…\nこの気持ちよさ…\n溶けちゃいそう…\nにゃぁ…", 4681, 0, 1, 3, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "か、かわいい～\nこれ、なでなで\nしていいんだよね…？\nよしよし…♪", 4682, 0, 1, 3, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "とってもいい香り！\n気分も落ち着くし、\n特訓の後なんかに\nいいかもー！", 4683, 0, 1, 3, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぬくぬくだぁ…\nなんだか、\nふにゃふにゃに\nなっちゃうよぉ…", 4684, 0, 1, 3, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お、おいひぃ…！\nこの姿になると\nお腹すくし、すっごく\n助かっちゃった！", 4686, 0, 1, 3, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本で勉強して、\nぶんぶりょーどーの\n超ウルトラヒヨリに\nなっちゃうぞー！", 4687, 0, 1, 3, 180101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今年もみんなで\nおいしいものを\nたくさん食べたいです", 4689, 0, 1, 1, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "挑戦は大切ですよね☆\nというわけで\nおせちに魔物を…", 4690, 0, 1, 1, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おせちは縁起物です！\n食べれば食べるほど\n幸せになるはずです！", 4691, 0, 1, 1, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "食べ物がたくさん\n入った福袋は\nないんでしょうか…？", 4692, 0, 1, 1, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "初詣で何を\nお願いしましょう…\n五穀豊穣？", 4693, 0, 1, 1, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ずっとこうして\n年の始まりを\n過ごしたいですね", 4694, 0, 4, 1, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつか二人きりで\n初日の出を\n見たいです", 4695, 0, 8, 1, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お餅おかわりです！\nいくらでも\n食べられますよ！", 4696, 0, 1, 2, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おせちの食材を\n取りに行きませんか？\nいい運動です☆", 4697, 0, 1, 2, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "凧揚げって\n難しいですね～\n糸が絡まっちゃいます", 4698, 0, 1, 2, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "一年の計は元旦にあり\n今年一年分の\n献立を作りましょう！", 4699, 0, 1, 2, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ほらほら！\nもっと近くで着物を\n見ていいんですよ☆", 4700, 0, 4, 2, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたはどんな\n初夢を見ましたか？\nわたしは…内緒です☆", 4701, 0, 8, 2, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "年明けの朝は\n心なしか\n気持ちいいですね☆", 4702, 1, 1, 2, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お雑煮のあとは\nおしるこで\nおやつタイムです！", 4703, 2, 1, 2, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あたたかくして\n幸せな初夢を\n見ましょうね", 4704, 3, 1, 2, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ～屋台巡りを\n満喫しました☆\n一休み一休み", 4706, 0, 1, 3, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "縁起のいい\nぬいぐるみを並べて\n福を呼びましょう！", 4707, 0, 1, 3, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おしるこのアロマって\nないんでしょうか？\nそれなら作るしか…", 4708, 0, 1, 3, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここでお餅を\n焼いたらおいしく\nなりそうですね～♪", 4709, 0, 1, 3, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしすぎて\n食べる手が\n止まりません～", 4711, 0, 1, 3, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "新しいおせち料理の\nヒントは…なるほど…\nふむふむ…", 4712, 0, 1, 3, 111801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "お兄ちゃんとあんな\n特訓やこんな特訓が\nしたいなぁ、えへへ♪", 4714, 0, 12, 1, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "お兄ちゃんに褒めて\nもらうと、身体が\nじぃーんと\n熱くなっちゃいます♪", 4715, 0, 12, 2, 100601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "見目麗しい衣装に\n身を包むのも\n悪い気分では\nありませんね", 4716, 0, 1, 1, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "縁起物で\n験を担ぐというのも\nたまにはよいでしょう", 4717, 0, 1, 1, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "非効率なので\nあまり行いませんが\n私も手料理くらいは\n作れるのですよ", 4718, 0, 1, 1, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "研究のためなら\n時に遠路を超え\n実地へ赴くことも\n必要なのです", 4719, 0, 1, 1, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "トゥンヌスの\n突然変異…\n大いに興味を\nそそられますね", 4720, 0, 1, 1, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "漁師の技法も\n再現できたことで\nまた一つ、仮説が\n実証できました", 4721, 0, 4, 1, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "正月くらいは\n私ものんびりしたい\n気持ちなのですよ\n意外ですか？", 4722, 0, 8, 1, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "模倣に頼らずとも\n衣装に合わせた\n所作程度は\nできて当然です", 4723, 0, 1, 2, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お年玉の使い道は\n思いつきましたか\nゆっくり考えても\nいいのですよ", 4724, 0, 1, 2, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "トランプでも花札でも\n相手をしましょう\n手心が必要なら\nいつでも言いなさい", 4725, 0, 1, 2, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "初詣でお祈りする\n内容ですか\n…ヒミツ、として\nおきましょう", 4726, 0, 1, 2, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私たちでオーマ中の\nトゥンヌスを\n釣り上げましょうか\n…冗談ですよ", 4727, 0, 4, 2, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "見返りを求めない願い\nそれは祈りに通じるの\nかもしれませんね", 4728, 0, 8, 2, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…貴方がその眠たげな\n顔を洗ってくる間に、\n温かいお茶でも\n淹れておきましょう", 4729, 1, 1, 2, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さて、本格的に\n活動を再開します\n貴方も同行しなさい\n昼食は済みましたか？", 4730, 2, 1, 2, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私はもう少し\n作業を片付けてから\n寝ることにします\n早く眠りなさい", 4731, 3, 1, 2, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "少し休みます…\n時間が来たら\n起こすように", 4733, 0, 1, 3, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "贈り物を模倣して\n潜入…試してみる\n価値はありそうですね", 4734, 0, 1, 3, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "嗅覚から得られる\n情報量は侮れません\n動物の模倣において\n注意すべき点ですよ", 4735, 0, 1, 3, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "穏やかな炎による\nリラックス効果は\n本能によるものかも\nしれませんね", 4736, 0, 1, 3, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いかなる強者でも\n兵站、補給は\n必要なものです", 4738, 0, 1, 3, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "あらゆる学問は\n完璧な模倣のための\n大きな礎となります", 4739, 0, 1, 3, 115001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "新たに得たこの力で\n仲間と目指す未来を\n切り拓いてみせます", 4741, 0, 1, 1, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここは、みなさまと…\nわたくしの\n帰る場所でございます", 4742, 0, 1, 1, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "主さまも精霊の召喚を\n試してみますか？", 4743, 0, 1, 1, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "主さま、おこづかいは\n足りていますか？\n遠慮は無用ですよ", 4744, 0, 1, 1, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この装束をまとうと\n自然と背筋が伸びる\n思いがいたします", 4745, 0, 1, 1, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "進化した精霊に\n負けぬよう\n修行に励みます", 4746, 0, 4, 1, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "仲間たちといられる\nこの幸せが、末永く\n続きますように…", 4747, 0, 8, 1, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "主さまのお手手は\n大きくて温かいですね\nぎゅっぎゅっ…ふふ♪", 4748, 0, 1, 2, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今度、主さまにも\n里に伝わる昔話を\nお話しいたしましょう", 4749, 0, 1, 2, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "里で採れた果物を\n持って参りました\n召し上がってください", 4750, 0, 1, 2, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "里のお土産を\nここのみなさまに\nお配りいたしましょう", 4751, 0, 1, 2, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "仲間と囲む食卓…この\n温もりは、みなさまの\n心の温かさなのですね", 4752, 0, 4, 2, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "主さまに名前を\n呼んでいただくと\n心が温かくなります♪", 4753, 0, 8, 2, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふふっ…主さま\n寝癖がついて\nおりますよ？", 4754, 1, 1, 2, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日の昼食は\n里の伝統料理です\nお口に合うでしょうか", 4755, 2, 1, 2, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "主さまが眠れるよう\n安らぎの風を…\nおやすみなさいませ", 4756, 3, 1, 2, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この癒し…\n主さまにも味わって\nいただきたい…", 4758, 0, 1, 3, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この愛らしさ…\n精霊たちと似たものを\n感じます…♪", 4759, 0, 1, 3, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "精霊よ…この安らぐ\n香りを、隅々まで\n届けてくださいまし", 4760, 0, 1, 3, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "瞑想するのに\nちょうどよい暖かさで\nございます", 4761, 0, 1, 3, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "進化した精霊を\n使役するためにも\nよく食べて体力を…！", 4763, 0, 1, 3, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "風の精霊について\nもっと詳しく知って\nおかなければ…", 4764, 0, 1, 3, 115501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "儀式の時を思い出して\n精霊に呼びかける…\n出ておいで～♪", 4766, 0, 1, 1, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ひゃうっ！　もう…\n急に背中を触るなんて\nいたずら好きな精霊に\n育てた覚えはないのに", 4767, 0, 1, 1, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "儀式用の衣装…\nあんまり激しい動きは\nできないよね…でも\n戦う時は気にしない！", 4768, 0, 1, 1, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そうだ…精霊に\n騎士クンのそばで\n見守っていてって\n頼んでみようかな…", 4769, 0, 1, 1, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふふっ、こうやって、\n楽しく精霊とお話し\nしていられる、平穏な\n日々が続くといいな", 4770, 0, 1, 1, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "き、きき、騎士クン！\nわたしと、あの…！\nうう…練習ですら\n上手く誘えないよぉ…", 4771, 0, 4, 1, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あっ、精霊が…\nふふ、応援ありがとう\nわたしの想い…いつか\n必ず伝えるね", 4772, 0, 8, 1, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "新しく覚えた料理\n作ってみたんだけど\n騎士クンも食べない？", 4773, 0, 1, 2, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "騎士クン、\n疲れてない？\nわたしと精霊で\n治療するよ？", 4774, 0, 1, 2, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もう、いたずらしない\n…騎士クン！？\nご、ごめんなさい！\n精霊だと思って！", 4775, 0, 1, 2, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "騎士クン！\n時間が合ったら、\n精霊と一緒に\nお話しない？", 4776, 0, 1, 2, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…こういう服着るの\n初めてなんだけど…\nえっ、かわいい…？\nあ、ありがとう…！", 4777, 0, 4, 2, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "困ったことがあったら\n相談してね。わたし、\n騎士クンのためなら…\n色々できるよ、色々！", 4778, 0, 8, 2, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう騎士クン！\n今からお外で\n瞑想するんだけど…\n騎士クンもどうかな？", 4779, 1, 1, 2, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼の時間だ\nご飯ならわたしが\n用意するから\nゆっくりしてて", 4780, 2, 1, 2, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間…\n騎士クン、はいどうぞ\n寝る前の温かいミルク\nぐっすり眠れるよ♪", 4781, 3, 1, 2, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "…うん、落ち着く\n精霊との魔法で\nこんな風に誰かを\n安心させたいな", 4783, 0, 1, 3, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい…\n精霊も気に入ってる…\nそうだ、同じ物\n作ってあげようかな？", 4784, 0, 1, 3, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…これ、\nうちに置いたら、\nお母さん喜ぶかも！", 4785, 0, 1, 3, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかい…\nまるで誰かが\n抱きしめてくれた\nみたい…", 4786, 0, 1, 3, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "自然の恵みに\n感謝して…\nいただきます♪", 4788, 0, 1, 3, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "もっと精霊について\n勉強して、みんなを\n守れるように\nなりたいな…", 4789, 0, 1, 3, 115601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "アイツといると胸が\nぎゅーっとなる…\nこれってもしかして…", 4791, 0, 12, 1, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "アンタとならきっと\nどんなゲームでも…\nそ、その、たた、\n楽しいって思えるわ！", 4792, 0, 12, 2, 102201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "色んな人と話したら\n記憶探しの手がかりが\n見つかるかも…？", 4793, 0, 1, 1, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "アイスクリームでも\n作ろうかしら？\nバニラにミントに…", 4794, 0, 1, 1, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ネビアに話しかけると\n逃げられるのよね…\nもう、襲わないのに…", 4795, 0, 1, 1, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "「コッコロさん」、\n「コッコロさん」…\n…間違えないように…", 4796, 0, 1, 1, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "最近少し太ったかも？\nきっとおいしいもの、\n食べ過ぎね…", 4797, 0, 1, 1, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ここにいると、\nとても落ち着くわ…\n自分の家、だものね", 4798, 0, 4, 1, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "みんなと一緒の時間、\nずっと記憶に残したい\n…そう思っているのよ", 4799, 0, 8, 1, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ドラゴン族って、\nそんなに珍しいの？\nあまり実感ないけど…", 4800, 0, 1, 2, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "料理、練習してるのよ\n…味見してもらえる？\n期待はしないでね", 4801, 0, 1, 2, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "頭を叩いたら、\n記憶が戻ったり\nしないかしら…？\nやらなくていいわよ？", 4802, 0, 1, 2, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "赤ちゃんみたいだった\n時のことは、忘れて…\nお願いだから…", 4803, 0, 1, 2, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ひゃんっ！？\nし、しっぽを掴むのは\nダメよ？", 4804, 0, 4, 2, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "記憶が戻っても…\n私は、あなたたちと\n一緒にいたいわ", 4805, 0, 8, 2, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう。\n寝ぐせついてるわよ？\n…ふふっ、これでよし", 4806, 1, 1, 2, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろお昼かしら？\nおいしいごはんを、\nみんなで一緒に…ね", 4807, 2, 1, 2, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間ね。\nそろそろ休みましょ？\n…ふわぁ…", 4808, 3, 1, 2, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふか、ぎゅう～…\n…あっ、これはその…\nストレッチしててっ…", 4810, 0, 1, 3, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あまり、興味ないわ。\nけど…けど…\n…か、かわいい…", 4811, 0, 1, 3, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りね。\nとっても落ち着くわ…\n…っくしゅっ", 4812, 0, 1, 3, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "冷やす方が得意だけど\nあったかいのも、\nキライじゃないのよ", 4813, 0, 1, 3, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "別に、食いしん坊\nじゃないのよ？\nでも、もう一口だけ…", 4815, 0, 1, 3, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ん…なるほどね。\n勉強になるわ…", 4816, 0, 1, 3, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "水着の探偵か…\nちょっと恥ずかしい\n気がしてきたよ…", 4818, 0, 1, 1, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "依頼があれば\n海でも山でも\n赴くさ！", 4819, 0, 1, 1, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今のうちに\n助手くんの秘密を…\nわ…私はなにをっ！？", 4820, 0, 1, 1, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "休暇も時には必要さ\n海でゆっくりと…\nむっ？　事件の気配！", 4821, 0, 1, 1, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "探偵の秘密道具…\n水着だと隠す\n場所がない…！", 4822, 0, 1, 1, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "そろそろ助手くんが\n現れる時間かな？\nふふっ、楽しみだね", 4823, 0, 4, 1, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "真実は私と助手くん\n二人だからこそ\n解き明かせるのさ", 4824, 0, 8, 1, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ひゃああっ！？\nわ、私の不意を突く\nとは…やるね助手くん", 4825, 0, 1, 2, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さて、なにか気づいた\nことはあるかな？\n言ってごらん♪", 4826, 0, 1, 2, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この感触…分かった！\n助手くんだね！\nふふっ、やっぱり♪", 4827, 0, 1, 2, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "水着…どうかな？\n探偵らしさは\n残してるつもりだけど", 4828, 0, 1, 2, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ん？　依頼かな？\n助手くんの頼みなら\nなんでもお安い御用さ", 4829, 0, 4, 2, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "助手くん、私と海に\n行かないかな\n…事件じゃないよ？", 4830, 0, 8, 2, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "珈琲でも淹れて\n目を覚ますとしよう\n一緒に飲むかい？", 4831, 1, 1, 2, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼食は済ませた？\nなにを食べたか\n当ててあげよう！", 4832, 2, 1, 2, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜は謎が深まる時間…\n闇に覆い隠された真実\n必ず暴いてみせる！", 4833, 3, 1, 2, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さて、推理の時間だ\n…サボってないよ？\n考えてるんだからね？", 4835, 0, 1, 3, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これはもしや、中に\n秘密のメッセージが？\n…かわいいだけだね", 4836, 0, 1, 3, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふむ、なんだか\n頭がスッキリするね\n…閃いた！", 4837, 0, 1, 3, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ポカポカするね…\n助手くん\n君もおいでよ", 4838, 0, 1, 3, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "はむ、はむ…んぐっ\nた、食べてるところを\n見つめられると～…", 4840, 0, 1, 3, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "秘密の依頼とか\nこういう場所に\n隠したりするよね…♪", 4841, 0, 1, 3, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "これはいい乗り心地だ\n事件現場にこれで登場\n…は、やめておこう", 4843, 0, 1, 3, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "不思議な感触だね…\nでも、いい発想が\n生まれてきそうだ…♪", 4844, 0, 1, 3, 115701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "これはあたしが\n前へ進むために\nあいつがくれた\n大切な力…！", 4845, 0, 1, 1, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "チェンジ・\nプリンセスフォーム！\n練習練習、っと", 4846, 0, 1, 1, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうあいつに助けて\nもらいっぱなしの\nあたしは…\n卒業しなきゃね", 4847, 0, 1, 1, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "気ままに、お気楽に\nあいつと冒険する…\nそれって幸せよね", 4848, 0, 1, 1, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "プリンセスフォーム…\nお姫様みたいね\nあたしがお姫様か…\nそっかぁ…ふふ♪", 4849, 0, 1, 1, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつと繋がって\n生まれたこの絆は\nあたしの宝物だわ", 4850, 0, 4, 1, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あたしの命の使い方…\n全て受け止めてくれた\nあいつにだったら…", 4851, 0, 8, 1, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふふ～ん♪\nプリンセスフォームの\n天才魔法使い\nキャル様に用かしら？", 4852, 0, 1, 2, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "これからは\nあたしの力で\nなんでもパパっと\n解決してあげるわね！", 4853, 0, 1, 2, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "魔力がみなぎってる…\nねえ、もしかして\n今のあたしって本気で\nすごいんじゃない？", 4854, 0, 1, 2, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "変身の反動で\nお腹が空いても\n魔物料理だけは\nいやだからね！？", 4855, 0, 1, 2, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ねぇ、あんたになら\nあたしの心…\n全部預けていいかも", 4856, 0, 4, 2, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あいつと一緒に\nいられたら、他には\n何も…って、あああ\nあんたいつの間に！？", 4857, 0, 8, 2, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "早起きも悪くないわね\n読みかけの魔導書\n今のうちに\n読んじゃおうかしら", 4858, 1, 1, 2, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ねぇ～お腹すいたー\nあんたなんか\n作りなさいよ\n魔物料理以外でね！", 4859, 2, 1, 2, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふぁぁ…眠すぎて\n今なら変身しても\nお腹が減らない\n自信があるわ…", 4860, 3, 1, 2, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あー♪　最っ高！\n休んで魔力を高めて…\nあいつの役に\n立ってあげなきゃね", 4862, 0, 1, 3, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なにこれかわいい…！\nコレクションにしたく\nなっちゃうじゃない", 4863, 0, 1, 3, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り…すごく\nリラックスできるわ…\nあ、いい感じの魔法\n思いついちゃったかも", 4864, 0, 1, 3, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかい…\n落ち着くわ…\nあいつの手の\nぬくもりみたいね", 4865, 0, 1, 3, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "プリンセスフォーム…\nこ、こんなに\nお腹が減るのね\n甘く見てたわ…！", 4867, 0, 1, 3, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ま、魔物料理の本！？\n誰よこんな本\n買ったの！　って…\n一人しかいないか", 4868, 0, 1, 3, 180601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "憧れの舞踏会…\n私、きちんと\n踊れるかしら", 4870, 0, 1, 1, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "アン・ドゥ・トロワ\nアン・ドゥ・トロワ\n練習はばっちりね♪", 4871, 0, 1, 1, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こんなにすてきな\nドレスを着られて\n本当に夢みたいだわ♪", 4872, 0, 1, 1, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "魔法はいつか解ける…\nでも、その時間は心に\n残り続けるわ♪", 4873, 0, 1, 1, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ガラスの靴は夢へ\n踏み出す魔法の道具…\n私、がんばっちゃう！", 4874, 0, 1, 1, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "舞踏会であなたと\n一緒に踊れたら\nいいのにな", 4875, 0, 4, 1, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "舞踏会に行く前に\n運命の王子様には\n出会ってるのよね", 4876, 0, 8, 1, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうかしら？\n私、きちんとドレス\n着られてる？", 4877, 0, 1, 2, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あなたも一緒に\n踊ってみる？\nしゃなりしゃなり♪", 4878, 0, 1, 2, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなたにエスコート\nされてきれいなお城を\n歩いてみたいわ♪", 4879, 0, 1, 2, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "どう？　レッスンの\n成果はきちんと\n出てるかしら？", 4880, 0, 1, 2, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたが隣にいれば\n私も立派なお姫様に\n見えるかしら♪", 4881, 0, 4, 2, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私にとって\n一番の魔法はあなたが\nくれる勇気よ♪", 4882, 0, 8, 2, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さぁ！　今日も一日\n立派な淑女を目指して\nいきましょう♪", 4883, 1, 1, 2, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ごはん代わりに\nメタモルアップルを\n食べておきましょう", 4884, 2, 1, 2, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ魔法が解ける\n時間…でも淑女の\n心得は忘れないわ♪", 4885, 3, 1, 2, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "淑女にも休息は\n必要よね…少しだけ\n休ませてもらおっと", 4887, 0, 1, 3, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいものに\n囲まれた部屋も\n女の子の夢よね…", 4888, 0, 1, 3, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "すてきな香り…\nお花かしら？\n森で探してみようかな", 4889, 0, 1, 3, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖かい…暖炉のそばで\nおとぎ話を聞くのも\nいいわよね♪", 4890, 0, 1, 3, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "レッスンのために\n栄養補給して\nおかないと！", 4892, 0, 1, 3, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "教養を身に着ける\nことも大切よね！\nなになに…", 4893, 0, 1, 3, 115801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "や、やっぱスカートは\n落ち着かねえな…\nなんか、\nスースーするしよ…", 4895, 0, 1, 1, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "せっかくこんな格好\nしてるし、いつもとは\n違う剣術の訓練を\nしてみるかな", 4896, 0, 1, 1, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さて、他の連中が\n帰ってくる前に、\nなんか料理でも\n作っといてやるか", 4897, 0, 1, 1, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こ、こんな服着てる\nわけだし、紅茶とか\n楽しんじゃっても\n変じゃないよな！", 4898, 0, 1, 1, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暇だし運動でも…\nあ、あぶねえ！\nスカートなの忘れてた\n…誰も見てねえよな？", 4899, 0, 1, 1, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "紅茶が切れてるな…\nよし、あいつと一緒に\n買い物にでも行くか♪", 4900, 0, 4, 1, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…あいつがいねえと、\nつまんねえな…ったく\n飯用意してやるから、\n早く帰ってこいよな…", 4901, 0, 8, 1, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あ、あんまり\nジロジロ見んなよ\n…結構、\n恥ずかしいんだからな", 4902, 0, 1, 2, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ダンスの相手は\n無理だが、\n剣の訓練なら\nいつでも付き合うぜ！", 4903, 0, 1, 2, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この服に\n触りたいのか？\nすごい作りだし、\n気持ちは分かるぜ", 4904, 0, 1, 2, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お、いいところに！\nクッキーを焼く\nところだったんだが、\nおまえも食うか？", 4905, 0, 1, 2, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おまえにもこういう服\n似合うんじゃねえか？\n今度あたしが\n選んでやるよ♪", 4906, 0, 4, 2, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…おまえの前でなら、\nこういう格好を\nすんのも…\nな、なんでもねえよ！", 4907, 0, 8, 2, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝の訓練を始めるか\n時間あるなら、\nおまえも付き合えよな", 4908, 1, 1, 2, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もうこんな時間か…\n昼飯作るけど、\nなんか\n食いたいものあるか？", 4909, 2, 1, 2, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "眠れないなら、\nホットミルク飲むか？\n体あったまって、\n眠くなると思うぜ", 4910, 3, 1, 2, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっと休憩して…\nおっと、服にしわが\nできないように\nしねえとな", 4912, 0, 1, 3, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "だ、誰も\n見てねえよな？\n…よ～しよしよし、\nかわいいなおまえー♪", 4913, 0, 1, 3, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "すげぇいい香りだな\nうちの居酒屋にも…\nいや、合わねえか", 4914, 0, 1, 3, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったけぇ…\nちょっとだけなら、\n寝ちまっても\nいいよな…？", 4915, 0, 1, 3, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これうめえな！\nたぶん材料は…よし！\nあたしも作ってみるか", 4917, 0, 1, 3, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本は…\n誰でも分かる作法…か\n最低限このぐらいは\n勉強しとくか…", 4918, 0, 1, 3, 115901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ミミがおとなに\nなっても\nおにいちゃんとは\nずーっといっしょ♪", 4920, 0, 12, 1, 102001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ミミとくべつなだっこ\nしてほしいな…うん！\nおひめさまだっこ～♪", 4921, 0, 12, 2, 102001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "次はにいちゃんに\nどんなイタズラしよう\n早く会いたいな～", 4922, 0, 12, 1, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ミソギの特別な\nイタズラ見てくれる？\nいいよねっ♪", 4923, 0, 12, 2, 100401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "大人になったら、\nあの人と何しようかな\n…楽しみだなぁ", 4924, 0, 12, 1, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "頭を撫でないで\nください！　もう、\n少しだけ、ですからね", 4925, 0, 12, 2, 103601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "くるくる〜♪\nうちのドレス\nかわええなぁ", 4926, 0, 1, 1, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "日差しは苦手やけど\nたまにはひなたの下で\nぽかぽかしたいわぁ", 4927, 0, 1, 1, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "外はお花が咲いてる\n久しぶりにお花を\n活けたいなぁ", 4928, 0, 1, 1, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お花をたくさん集めて\nギルドハウスに飾れば\n喜んでくれはるかな", 4929, 0, 1, 1, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あたたかい日は\n紅茶を飲みながら\nゆっくりしたいなぁ", 4930, 0, 1, 1, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お稽古事を始めるなら\nうちに言ってな\nどんなことも教えたる", 4931, 0, 4, 1, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "うちにいろんな夢を\n見せてくれはって\nほんま、おおきにな♪", 4932, 0, 8, 1, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "王子はん\n一緒におとぎの国へ\nお散歩にいきまひょ♪", 4933, 0, 1, 2, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふんふんふ〜ん♪\n今な、王子はんに\n花冠を作ってるんよ", 4934, 0, 1, 2, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "王子はんは\nお菓子好きどす？\nうち、作りますわ", 4935, 0, 1, 2, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うーん。ドレスの柄は\nお花とお星さま\nどっちにしまひょか", 4936, 0, 1, 2, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "王子はんとの\n思い出が増えるたび\nうちの宝物も増えます", 4937, 0, 4, 2, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "王子はんと一緒なら\nどんな場所でも\n夢の国になりますわ", 4938, 0, 8, 2, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夢の中におりたいけど\n王子はんに会いたくて\n起きてもうたわ♪", 4939, 1, 1, 2, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "王子はん一緒に\nアフタヌーンティー\nいかがやろか？", 4940, 2, 1, 2, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の舞踏会…\n夢が広がるわぁ\nもちろんお相手は…♪", 4941, 3, 1, 2, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふわふわや〜\nなんや心地よぉて\n眠ってしまいそうや…", 4943, 0, 1, 3, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かいらしいなぁ\n新しいお洋服でも\n作ってあげまひょか♪", 4944, 0, 1, 3, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お花やろうか…\nリラックスできて\nええ香りやねぇ", 4945, 0, 1, 3, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "こういう場所で\n絵本を読むと\n気分が出てええなぁ♪", 4946, 0, 1, 3, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "舞踏会を楽しむなら\nたくさん食べて\nたくさん踊りまひょ", 4948, 0, 1, 3, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "うち、この本好きや\n王子さまと結ばれる\nお姫さまのお話なんよ", 4949, 0, 1, 3, 116001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "はぁ、宿題めんどい…\nこれは楽しくない…\nこんな青春いらない…", 4951, 0, 1, 1, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "奨学金の道は遠いなぁ\nメルクリちゃんたちが\nお金くれればいいのに", 4952, 0, 1, 1, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アオイちゃん元気かな\nチエルに会いたくて\n泣いてるんだろうな…", 4953, 0, 1, 1, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "暇だし鏡でも見るか…\nうわ、顔良っ！\nえ誰この超絶美少女！", 4954, 0, 1, 1, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ワンツーワンツー♪\nうーん…カルミナの\n振りコピ難しいにゃー", 4955, 0, 1, 1, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "先輩も運動してます？\nチエルが一緒に走って\nあげてもいいですよ？", 4956, 0, 4, 1, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "来年のテレフェスも\n今から楽しみだなあ…\nまた一緒にお化け屋敷\n入ってくださいね", 4957, 0, 8, 1, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちぇる～ん☆\nフェス仕様でも\nかわいいちえるん！", 4958, 0, 1, 2, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いま話しかけないで！\n来年の聖学祭ライブの\nイメトレ中なんです！", 4959, 0, 1, 2, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "クロエ先輩のウェア姿\nめっちゃカッコよ！\n思わずおへそ触ったら\nぶたれましたけど", 4960, 0, 1, 2, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ユニ先輩の体操着姿…\nあれはあれで実に良き\n一生見てられますよね", 4961, 0, 1, 2, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "先輩って体操着持って\nないんですか？　ハ？\nチエルのを貸せと…？\nえっ…変態かな？", 4962, 0, 4, 2, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "テレフェスでは先輩も\n地味に頑張ってました\nね。まあ格好よかった\nんじゃないですか…", 4963, 0, 8, 2, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはちぇる～ん☆\nさあ今日も楽しいを\n探しに行きますよー！", 4964, 1, 1, 2, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "先輩ビッグニュース！\n今からお昼ごはん\nおごらせてあげます！", 4965, 2, 1, 2, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こんばんちぇるるん☆\nさあ朝まで楽しいを\n探しに行きますよー！", 4966, 3, 1, 2, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ…ふかふか～…\n運動の後は…眠たく…\nなり…ま…", 4968, 0, 1, 3, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ユニ先輩に似合いそ！\nいやクロエ先輩かな？\nチエルは当然すぎて…", 4969, 0, 1, 3, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "やん、いい香り～！\nまるでチエルのために\n存在するみたい！", 4970, 0, 1, 3, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この火を使って\n聖火リレーしましょう\n先輩、一本抜いて！", 4971, 0, 1, 3, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あむあむ…ちゃんと\n食べないとユニ先輩\nみたいになっちゃう！", 4973, 0, 1, 3, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…ちゃんと\n読まないとクロエ先輩\nみたいになっちゃう！", 4974, 0, 1, 3, 116301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "今なら書ける気がする\n私の本当の\n想いを込めた\nラブソングを！", 4976, 0, 12, 1, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "輝きを増した私を\nいっぱい見てね！\n…ちょ、ちょっと\n見つめすぎだよ！", 4977, 0, 12, 2, 102901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "テレフェスかぁー…\nあんまいい記憶ないな\nよし、忘れとこ", 4978, 0, 1, 1, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "暇だし鏡でも見るか…\nふふ～ん…いいじゃん\nあ？　何見てんだコラ", 4979, 0, 1, 1, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ワンツー、ワンツー♪\nああクソ、難しいな…\nあ？　何見てんだコラ", 4980, 0, 1, 1, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アオイ元気してるかな\nまた絶叫したり白目\n剥いたりしてんのかな", 4981, 0, 1, 1, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ミフユねえさんが\nバイトリーダーしてる\n工場…うちも行くか…", 4982, 0, 1, 1, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "うーん…今日の晩御飯\n何にすっかなァ…\nあんたも食べてく？", 4983, 0, 4, 1, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "来年のテレフェスは\nどーなンだかねえ？\nま、一緒にまた弟の\n相手してやってよ", 4984, 0, 8, 1, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "体操着なんてフツーに\n着てもつまんないし？\nその辺センス出るよね", 4985, 0, 1, 2, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "奨学金の道、遠くね？\nアキノ先輩と仲良く\nなった方が早いかも…", 4986, 0, 1, 2, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あんた体操着は持って\nないの。ハ？　うちの\n貸せって？　いいけど\n…いや、よくねえよ", 4987, 0, 1, 2, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "にゃんっ！\nや、だからさ…急に\n話しかけんなっての", 4988, 0, 1, 2, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "え、なに？　この服？\nハ？　似合ってる？\n…え、聞こえなかった\nちょ、もっかい言って", 4989, 0, 4, 2, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんたもテレフェスで\n一応は頑張ってたよね\nま格好よかったんじゃ\nないの。知んないけど", 4990, 0, 8, 2, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふぁ～あ…おはーす\n昨日も寝たの遅くて\nまだ目がショボだよ…", 4991, 1, 1, 2, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "なに。あんた昼御飯\nまだなの。じゃ、うち\n適当になんか作ろうか", 4992, 2, 1, 2, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜っていいよね。色々\n見えすぎない感じとか\n…この話したっけ？", 4993, 3, 1, 2, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ、ヤバ…運動の後に\nこのフカついたのは…\n秒でスヤれる…すやぁ", 4995, 0, 1, 3, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "へーこんなんチエルに\n似合いそうじゃん。\n…いやユニ先輩かな？", 4996, 0, 1, 3, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お、なんか良さげな\n香りじゃん。これは\n何の…いや分かんね", 4997, 0, 1, 3, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "熱ッ！　この野郎なに\n爆ぜてンだコラァ！\n濡らすぞ木、てめえ！", 4998, 0, 1, 3, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "何コレよく分かんない\nけど、今日モヤシしか\n食ってないから助かる", 5000, 0, 1, 3, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "今日、体操着だしね。\n読書には逆アドかな。\nうん帰ろ。いやあ残念", 5001, 0, 1, 3, 116201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ビッグボス・イノリ様\nふっふっふ…\nしびれる響きです！", 5003, 0, 1, 1, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いつかお兄さんを\nあたしの側近に\nしてやるですよ！", 5004, 0, 1, 1, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ビッグボスになったら\nみんなからたくさん\nお菓子をもらうです！", 5005, 0, 1, 1, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふふん！\nこの服はあたしにしか\n着こなせませんよ！", 5006, 0, 1, 1, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ばーんと立って\nどーんと腕を組む！\nこれがボスのポーズ！", 5007, 0, 1, 1, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "イノリ様の側近に\n選ばれるなんて\n名誉なことですよ！", 5008, 0, 4, 1, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "未来の側近として\nあたしをしっかり\n甘やかすですよ！", 5009, 0, 8, 1, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あたしがお兄さんを\n立派なギャングに\nしてあげますからね！", 5010, 0, 1, 2, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "側近たるもの\nボスを甘やかなさいと\nだめですよ！", 5011, 0, 1, 2, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なに見てやがるです…\nくぅ、分かりました！\nお菓子は半分こです！", 5012, 0, 1, 2, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お兄さんも\nあたしがボスなら\nうれしいですよね！", 5013, 0, 1, 2, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄さんが側近なら\nあたしも安心して\n夜眠れるですよ！", 5014, 0, 4, 2, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ビッグボスになったら\nお兄さんにいい思い\nさせてあげますから！", 5015, 0, 8, 2, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ボスたるもの\n早起きは鉄則ですよ！\nふぁあ…", 5016, 1, 1, 2, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹が空きました…\nご飯食べにいきますよ", 5017, 2, 1, 2, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ボスたるものぉ〜…\n夜更かしぐらい当然…\nぐー…", 5018, 3, 1, 2, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "は〜これは人をだめに\nしやがるやつですね\nあたし専用です", 5020, 0, 1, 3, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これはけしからん\nかわいらしさですね\nあたしにぴったりです", 5021, 0, 1, 3, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "高級な香りがするです\nボスになったら\n部屋に置いてやるです", 5022, 0, 1, 3, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいですねぇ\nちょっとこのまま\n一休憩です…", 5023, 0, 1, 3, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "はむはむ♪\nボスたるもの食べねば\n戦はできませんよ！", 5025, 0, 1, 3, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ボスなら経済書ぐらい\n…う。難しくて\n読めねーです…", 5026, 0, 1, 3, 116501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あなたはドジな私を\n受け入れてくれる…\nだから、頑張れます！", 5028, 0, 12, 1, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "何でも仰ってください\nちょっぴり大胆な\nことでも…な～んて♪", 5029, 0, 12, 2, 102501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あーあー、よし\nのどの調子もいいし\nはりきってガイド\nしてくるか！", 5030, 0, 1, 1, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さあ、そろそろ行くか\nガイドが\n遅刻したんじゃ\n話になんないからな", 5031, 0, 1, 1, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "しれっとドラゴン族が\n旅行に来たり\nしてくれないかな", 5032, 0, 1, 1, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "たぎるガイド先…\n火山、魔物の巣…\nダメだ、そんなとこ\nオレしか行けないや", 5033, 0, 1, 1, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この前行った絶景\nスポットよかったな\nキレイな景色を見る\nのもいいもんだぜ", 5034, 0, 1, 1, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お、今日はカレと\n一緒か。なんだか\nやる気出てきたぜ！", 5035, 0, 4, 1, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "カレにガイドして\nもらったら\nどこに行っても\n楽しいだろうな", 5036, 0, 8, 1, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "よっしゃあ！\nどっちが上手く\nガイドできるか\n勝負しようぜ！", 5037, 0, 1, 2, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "飯でも食いがてら\nおススメの店の\n下調べでもしようぜ！", 5038, 0, 1, 2, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なかなかいいだろ？\nこの格好。キミも\n作ってもらったら\nどうだ？", 5039, 0, 1, 2, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "普通は行けない\n場所とか行きたいよな\nキミならどんな\nとこがいい？", 5040, 0, 1, 2, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ガイドの仕事は\nキミの方が得意そうだ\n参考にさせてもらうぜ\nよろしくな！", 5041, 0, 4, 2, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミの探してきた店\n結構よさそうじゃん\nそうだ、今度二人で\n下見に行こうぜ！", 5042, 0, 8, 2, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いい朝だな。絶好の\n仕事日和だぜ！\n今日もよろしくな！", 5043, 1, 1, 2, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "よし、昼飯にしよう\nこの後も激務だし\n飯抜きじゃあ\nぶっ倒れちまうからな", 5044, 2, 1, 2, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お疲れさん！　さーて\n次はオレと遊んで\nくれよ。まだまだ\nいけるだろ？", 5045, 3, 1, 2, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ガイドは一日\n歩きっぱなしだからな\nゆっくり休ませて\nもらうぜ", 5047, 0, 1, 3, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これ、どこで\n売ってるんだろ？\n土産の情報も\n仕入れとかなきゃな", 5048, 0, 1, 3, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アロマとかよく\n分かんねえけど\n土産にはいいかもな\n覚えておくぜ", 5049, 0, 1, 3, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "体が温まると心も\n熱くなるんだよな\nいい仕事が\nできそうだぜ", 5050, 0, 1, 3, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食べ放題か\nこれはお客さんも\n喜んでくれそうだな！", 5052, 0, 1, 3, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "へえ、こんなスポット\nあったんだ。やっぱ\nたまには勉強も\nしとくもんだな", 5053, 0, 1, 3, 116601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "バイト先になじめる\nように笑顔の練習を！\nに、にへぇ〜…", 5055, 0, 1, 1, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "働いて働いて働いて\n…いつかその先に\nぼっちの出口が\n見えるのかも…！", 5056, 0, 1, 1, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "バイトのイメトレを\n始めます。ポーズを\n決めて…よし！\n角度を変えて…よし！", 5057, 0, 1, 1, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "バイト仲間に入る\nためには厳しい修業が\n必須と聞きました…！", 5058, 0, 1, 1, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "どんどん技術を磨いて\nバイト仲間として\n認めてもらうんです！\n目指せ職人技…！", 5059, 0, 1, 1, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人が応援して\nくれる…だから必ず\nバイト仲間の輪に\n入ってみせます…！", 5060, 0, 4, 1, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人がいてくれると\n勇気が湧いてきます…\nぼっち卒業を夢見ても\nいいんだ、って…♪", 5061, 0, 8, 1, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "緊張するけど\n思い切って声をかけて\nみます…バイト仲間に\n入るために…！", 5062, 0, 1, 2, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぼっちの私が\nおもちゃ作りで\n人と共同作業…！\nか、感動です…！", 5063, 0, 1, 2, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "好きなおもちゃって\nありますか？　私は\nもちろんマイフレンド\nくんです！", 5064, 0, 1, 2, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "私が作ったおもちゃも\n誰かの友達に\nなってたら\nいいなぁ…♪", 5065, 0, 1, 2, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "今日も明日もバイト\nですね！　バイト\n仲間ができる日が\n楽しみです…♪", 5066, 0, 4, 2, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "脱ぼっちを目指して\nこれからも一緒に\n頑張りましょう！\n目指せ、バイト仲間！", 5067, 0, 8, 2, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n今日も気合いを入れて\nおもちゃ作りします！", 5068, 1, 1, 2, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ランチの時間です…♪\nもちろん工場の隅で\nぼっち飯です…！", 5069, 2, 1, 2, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわぁ…今日も\nお疲れさまでした\n明日も働きます～！", 5070, 3, 1, 2, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "バイトで頑張った日は\nふわふわの誘惑に\n勝てません…", 5072, 0, 1, 3, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こういうおもちゃの\nアイデアも\n素敵かも…♪", 5073, 0, 1, 3, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りがする\nおもちゃはどうかな…\n森の薬草を使って…", 5074, 0, 1, 3, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽかぽか…\n幸せなひとときですね", 5075, 0, 1, 3, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…たくさん\n食べて厳しいバイトを\n乗り切ります…！", 5077, 0, 1, 3, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…おもちゃの\n設計図を見るのも\n勉強になりますね！", 5078, 0, 1, 3, 116701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "う～ん\n次はどんなたい焼きを\n作ろうかにゃぁ…", 5080, 0, 1, 1, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あたしが売る\nたい焼きには\n夢が詰まってるにゃ！", 5081, 0, 1, 1, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いつか絶対に\nたい焼き工場を\n建て直してみせるにゃ", 5082, 0, 1, 1, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "たまにたい焼き以外の\nおやつも食べるにゃ\nたとえば煮干しとか！", 5083, 0, 1, 1, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "悪い商売人がいたら\nファントムキャッツに\n知らせるにゃ！", 5084, 0, 1, 1, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミと一緒にいると\nたい焼きのアイデアが\n次々出てくるにゃ♪", 5085, 0, 4, 1, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "出来ないことも\nキミと一緒にいれば\n出来る気がするにゃ♪", 5086, 0, 8, 1, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なんにゃ～？\nお姉さんにかまって\nほしいのかにゃ♪", 5087, 0, 1, 2, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "キミ、いいところに！\nあたしとライバル店へ\n視察にいくにゃ！", 5088, 0, 1, 2, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "くんくん…この匂い！\nたい焼き持ってるなら\nちょうだいにゃ♪", 5089, 0, 1, 2, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "次はどんなたい焼きを\n売ろうかにゃ～\nキミの案も欲しいにゃ", 5090, 0, 1, 2, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ファントムキャッツに\n相棒が必要にゃ\nたとえばキミとか…", 5091, 0, 4, 2, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "相棒！\n…ってキミのこと\n呼んでいいかにゃ？", 5092, 0, 8, 2, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "早起きは三文の徳にゃ\n今日もたい焼き\n売れますよーににゃ！", 5093, 1, 1, 2, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹空いたにゃ…\n賄いのたい焼きを\nいただくにゃ！", 5094, 2, 1, 2, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "猫は夜が本番にゃ\nでもあたしは…\nふわぁ～眠いにゃ…", 5095, 3, 1, 2, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふかにゃ～\nここで体を丸めて\n一眠りしたいにゃ", 5097, 0, 1, 3, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これは…！\n猫にも負けない\nかわいさだにゃ…！", 5098, 0, 1, 3, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りにゃ～\nゴロゴロのどが\n鳴りそうだにゃ～", 5099, 0, 1, 3, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふにゃ～…\nこのまま働かずに\nまるまってたいにゃ…", 5100, 0, 1, 3, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "商売は戦いにゃ\nたくさん食べて\nたくさん働くにゃ！", 5102, 0, 1, 3, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ。たい焼きの\nアレンジレシピ集…\nためになるにゃ…", 5103, 0, 1, 3, 116801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "お芝居の前に\nお兄ちゃんの顔を\n見ると、とっても\n落ち着きますぅ…♪", 5105, 0, 12, 1, 102101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "お兄ちゃんにもっと\n見てもらいたい…\nだから私…\n強くなりたいです…！", 5106, 0, 12, 2, 102101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さらなる効率化で\nみんなといい仕事を\nしたいわね！", 5107, 0, 1, 1, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "他のバイトとの\nスケジュールを\n調整しないと…", 5108, 0, 1, 1, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "時給がアップしたわ！\n働きが認められると\nやる気が出るわね", 5109, 0, 1, 1, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "効率的に動ければ\n業務を追加できる…\n燃えてきたわ！", 5110, 0, 1, 1, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "帳簿付けのコツ…\nユカリさんに教わって\nみようかしら", 5111, 0, 1, 1, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "バイトリーダーとして\nみんなをビシバシ\n鍛えていくわ！", 5112, 0, 4, 1, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "戦いでもバイトでも\nキミなら安心して\n背中を預けられるわね", 5113, 0, 8, 1, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうしたの？\n仕事のことなら\nなんでも相談してね！", 5114, 0, 1, 2, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さすがは私の弟子ね\nこれなら安心して\n仕事を任せられるわ", 5115, 0, 1, 2, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "みんなのお手本になる\n働きぶりを見せないと\nいけないわね！", 5116, 0, 1, 2, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "キミのこと…もっと\n頼りにしちゃっても\nいいのかしら…？", 5117, 0, 1, 2, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふふ、キミも一人前の\nバイト戦士として\n立派に成長したわね！", 5118, 0, 4, 2, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "新しいおもちゃの\n企画書を作ってみたの\nちょっと見てくれる？", 5119, 0, 8, 2, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝は一番効率がいい\n時間帯よ！\nバリバリ働くわよ！", 5120, 1, 1, 2, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さ、お昼に行きましょ\n今日の日替わり定食は\n何かしら…楽しみね♪", 5121, 2, 1, 2, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間…\nちゃんと寝て明日に\n備えなくちゃね", 5122, 3, 1, 2, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "適度な労働と休息の\nサイクルが最大効率を\n生み出すのよ…ふぅ…", 5124, 0, 1, 3, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "はぁ～なんて素敵な\n抱き心地なのかしら…\n最高効率の癒やしね♪", 5125, 0, 1, 3, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "落ち着く香りね…\nなんだか集中力が\nアップした気がするわ", 5126, 0, 1, 3, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふぅ…癒されるわね…\n仕事のオンオフの\n切り替えは重要よね", 5127, 0, 1, 3, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "働くためには\nエネルギーをちゃんと\n摂っておかないと", 5129, 0, 1, 3, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "効率を上げるため\n生産管理の勉強も\nしておきたいわね", 5130, 0, 1, 3, 116901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "変身している間に\n色々と試しておこう\nまずは…", 5132, 0, 1, 1, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "飛べるというのは\n便利だな。料理が\n暖かいうちに\n持ち帰れる", 5133, 0, 1, 1, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "プリンセスか…\n柄ではないけれど\n嫌な気はしないな", 5134, 0, 1, 1, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この力で\n何を成すべきなのか…\n剣に聞いてみよう", 5135, 0, 1, 1, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "変身したとて私は私\n一時的に強くなろうと\n元が弱くてはだめだ", 5136, 0, 1, 1, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "変身していない時でも\n彼がそばにいると\n力が湧いてくる…", 5137, 0, 4, 1, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私の思い…\nいつか伝えてみせるよ\n…きっといつか！", 5138, 0, 8, 1, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "何者かと戦うの？\nそれとも修行？\nどちらだとしても\n付き合うよ", 5139, 0, 1, 2, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "変身し続けたら\nどれだけ空腹に…\n私は試さないからね？", 5140, 0, 1, 2, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "本物のプリンセスに\nなるのは御免だが\nナイトがいて\nくれるのは頼もしいよ", 5141, 0, 1, 2, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いつかこの力を\n誰かを救うために…\n戦い以外に使える時が\nくることを願うよ", 5142, 0, 1, 2, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "キミに感じてほしいな\n私に流れてくる\nキミからの力を…\nその…私の、思いも…", 5143, 0, 4, 2, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "思いを告げる…\nそれがこんなにも\n難しいなんて…\nでも、いつか必ず…！", 5144, 0, 8, 2, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！\nいい変身日和だ！\n…ふふっ、冗談だよ", 5145, 1, 1, 2, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いつもより多く\n昼食を用意しよう\n変身が解けたら大変だ", 5146, 2, 1, 2, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "一日お疲れ様\n私もそろそろ変身を\n解いて休むとするよ", 5147, 3, 1, 2, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "変身してしまうと\n動かずにいても\n空腹になるのかな…？", 5149, 0, 1, 3, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私もキミたちくらい\n可愛げがある姿に\nなっているかな？", 5150, 0, 1, 3, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "香りに対する感覚も\nいつもより鋭く\nなっているみたいだ…", 5151, 0, 1, 3, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ありがたいな\n少し足元が\n冷えていたところだ", 5152, 0, 1, 3, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これは…！\n持ち運べるように\n改良できないかな？", 5154, 0, 1, 3, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "祖父に貰った\n技法書を読んで\n初心に帰ろう", 5155, 0, 1, 3, 180301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "最強の惚れ薬を作って\nあのおかたの心を\n私の思いのままに…", 5157, 0, 1, 1, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夏といえば海にスイカ\n花火に水着…\nそして惚れ薬ですわ…", 5158, 0, 1, 1, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あのおかたの心を\n手に入れるための\n準備を進めましょう\nこの夏こそ確実に…", 5159, 0, 1, 1, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あのおかたに近づく\n虫どもを、どうやって\n片付けようかしら…\nまったく忌々しいこと", 5160, 0, 1, 1, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "…クスクス\n薬の調合を考えるのは\n至福の時間ですわ…", 5161, 0, 1, 1, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あのおかたの全てが\n早く私のものに\nなりますように…", 5162, 0, 4, 1, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "かき氷も花火も海も…\nあなた様がいてこそ…\nそう、あなた様は\n私の全てなのですわ", 5163, 0, 8, 1, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "二人だけの夏を\n楽しみましょう…？\n…クスクス", 5164, 0, 1, 2, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あら、あなた様\n私に秘密でどこに\n行こうとして\nいますの…？", 5165, 0, 1, 2, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海に行きませんか？\nあなた様と一緒に\n過ごすには\n最高の場所ですから…", 5166, 0, 1, 2, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ちょうどいいところに\nいらっしゃいました\nできたての薬を…\nさぁどうぞ…クスクス", 5167, 0, 1, 2, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "夏の海のきらめきも\nあなた様の存在が\nなければ色あせて\nしまいますわ…", 5168, 0, 4, 2, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私とあなた様は\n結ばれる運命に\nあるのです…\n逃がしませんわ…", 5169, 0, 8, 2, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "起きてすぐに会いに\n来てくださるなんて\nようやく私の伴侶たる\n自覚が…クスクス", 5170, 1, 1, 2, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お食事はまだですか？\n特製の薬草ランチを\n召し上がれ…クスクス", 5171, 2, 1, 2, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私の夢を見られる薬を\n差し上げますわ…\nおやすみなさいませ\nあなた様…クスクス", 5172, 3, 1, 2, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いい肌触りですわ…\n考え事にもぴったり\n眠くなるのが\n玉に瑕ですが…", 5174, 0, 1, 3, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こういったものに\n揮発性の薬を仕込む\nのも一つの手ですわね", 5175, 0, 1, 3, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り…開発中の\n薬に使えそうな気が\nしますわ…クスクス", 5176, 0, 1, 3, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あのおかたの\nぬくもりを\n思い出しますわ…", 5177, 0, 1, 3, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "美味しい…この味なら\n薬を混ぜても違和感は\nなさそうですわ…", 5179, 0, 1, 3, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この薬の調合法…\n今度試してみましょう\nもちろんあのおかたに\n飲んでいただいて…", 5180, 0, 1, 3, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "二人乗りができると\nいいですわね…", 5182, 0, 1, 3, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "ふかふかですわ…\nあのおかたの分も\n欲しくなります…", 5183, 0, 1, 3, 117001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "今日はキミと\nいつまでも歌って\n踊りたい気分さ～♪", 5184, 0, 12, 1, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あは～♪\nキミの隣は、故郷より\n落ち着くかも～…♪", 5185, 0, 12, 2, 101701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この水着…\n一番に弟くんに\n見せたいな♪", 5186, 0, 1, 1, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "弟くんをこっそり\n海に運んで…\nサプライズしちゃお♪", 5187, 0, 1, 1, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いつもと違う髪型に\nしてみたけど…\n気に入ってくれるかな", 5188, 0, 1, 1, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "海は楽しみだけど\n日焼けしないように\n気を付けなきゃね", 5189, 0, 1, 1, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "まだかな、弟くん\n水着のお姉ちゃんが\nお出迎えだよっ♪", 5190, 0, 1, 1, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "海が見えるおうちで\n弟くんと一緒に\n暮らしたいなぁ～", 5191, 0, 4, 1, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "弟くんの水着…\nどんな感じかなぁ\n…あ、想像してたら\nドキドキして…えへへ", 5192, 0, 8, 1, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "こーら、水着の\nお姉ちゃんは\nおさわり禁止♪\n…なんてね？", 5193, 0, 1, 2, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "なぁに？\nふふっ、何回でも\n呼んでいいんだよ♪", 5194, 0, 1, 2, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海で迷子に\nならないように\n手を繋ごうね♪", 5195, 0, 1, 2, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お姉ちゃんが\n海の楽しみ方を\n教えてあげるねっ！", 5196, 0, 1, 2, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "わっ、弟くん\nどこ触ってるの？\nも～驚いちゃったぞ♪", 5197, 0, 4, 2, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お姉ちゃん、海でも\nずっとキミを見てるよ\n…安心してね", 5198, 0, 8, 2, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "まだ眠そうだね？\nほら、海が待ってるよ\n早く起きて起きて♪", 5199, 1, 1, 2, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "大丈夫、疲れてない？\n海で遊び疲れた時は\n素直に休憩しようね", 5200, 2, 1, 2, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ほら、早く寝ないと\n明日もお姉ちゃんと\n遊べないぞ♪", 5201, 3, 1, 2, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "だらけたお姉ちゃんは\n弟くんには\n見せられないな～", 5203, 0, 1, 3, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふっ、かわいいね♪\n弟くんが持つと\nもっとかわいいよっ♪", 5204, 0, 1, 3, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りだね…\n一味違うお姉ちゃんに\nなれそう…♪", 5205, 0, 1, 3, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったか～い♪\nほら、弟くんも\nおいでよ♪", 5206, 0, 1, 3, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "よく食べて、いつでも\n弟くんの呼び声に\n応える準備を…！", 5208, 0, 1, 3, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "弟くんの水着の写真\nこの辺りに隠して\nおこうかな", 5209, 0, 1, 3, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "この子の背に乗って\nお姉ちゃんと弟くんの\n楽園へ…な～んて♪", 5211, 0, 1, 3, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "海を感じる感触だね\n弟くんとの楽しい夏を\n思い出しちゃうな…♪", 5212, 0, 1, 3, 117101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この夏、誰よりも\nキラキラしてみせる！\nだって私は\nアイドルだから！", 5213, 0, 1, 1, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "日傘にアームカバー\n帽子にサングラス…\n紫外線対策は完璧！", 5214, 0, 1, 1, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "とっておきの\nサマーソングを\nみんなに届けるよ！", 5215, 0, 1, 1, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんにもしないのって\n苦手かも…\n彼、早く来ないかな？", 5216, 0, 1, 1, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ラムネって\n夏って感じするよね\n後で彼と飲もっと♪", 5217, 0, 1, 1, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "夏は恋の季節！\n燃えるような恋…\nいつかしたいな", 5218, 0, 4, 1, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今年の夏の目標は\n…彼との思い出を\nいっぱい作ること！", 5219, 0, 8, 1, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私の水着写真集\n見てくれたんだ！\nどう、かわいかった？", 5220, 0, 1, 2, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "スイカ割りしたいの？\nいいね、楽しそう！\nみんなも誘おうよ♪", 5221, 0, 1, 2, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ねぇ、見て見て！\n水着の映える\nポーズ考えたんだ！", 5222, 0, 1, 2, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ライブ中に\n花火を打ち上げたら\n絶対盛り上がるよね！", 5223, 0, 1, 2, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "最近、忙しいけど…\nキミの顔見たら\n疲れなんて\n消えちゃった！", 5224, 0, 4, 2, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この夏もいーっぱい\nドキドキさせるから！\n覚悟しててよね♪", 5225, 0, 8, 2, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "外は朝から暑いね\nけど、負けないから！\nお仕事、頑張るぞー！", 5226, 1, 1, 2, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "自分へのご褒美に、\nアイス食べちゃお♪\nキミも一緒に食べよ！", 5227, 2, 1, 2, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夏の夜って\nワクワクするね♪\nホタル見に行こうよ！", 5228, 3, 1, 2, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふわぁ…眠い…\n仕事とかの疲れ、\nたまってるのかな…？", 5230, 0, 1, 3, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私のぬいぐるみが\nグッズになったら…\n彼にかわいがって\nもらえるかな？", 5231, 0, 1, 3, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り…\n夏限定のやつでしょ？\nいいセンスしてるね♪", 5232, 0, 1, 3, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暑～い！\nけど…汗かいて\n気持ちいいかも！", 5233, 0, 1, 3, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "レッスンの後のご飯は\n特別おいしい♪\n…もうひとつだけ\n食べちゃおっかな", 5235, 0, 1, 3, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "あ、この前撮影した\n水着グラビアだ\nうんうん、いい感じ！", 5236, 0, 1, 3, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "この子、もふもふだね\n触るのクセになりそう\nもふもふもふもふ…", 5238, 0, 1, 3, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "わ、かわいい♪\n今度のグラビア撮影で\nこれ使ってもいい？", 5239, 0, 1, 3, 117201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "水着っていいですよね\n海に浮かぶ一輪の花\nって感じがして！", 5240, 0, 1, 1, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "自分の水着を作るのも\n誰かの水着を作るのも\n楽しいですね♪", 5241, 0, 1, 1, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "水着の最終チェック！\n伸縮性や動きやすさは\n…いい感じですね！", 5242, 0, 1, 1, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "振り付けや衣装作りに\n歌や踊りの練習…\n…やることがいっぱい", 5243, 0, 1, 1, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はぁ…レイ様の水着…\n私に作らせて\nもらえないかなぁ～…", 5244, 0, 1, 1, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "騎士さんのことは\n気に入らないですけど\n別に嫌いという\nわけじゃなくて…", 5245, 0, 4, 1, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士さん暇そうですね\nに、荷物持ちとして\n誘ってみようかな…", 5246, 0, 8, 1, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "騎士さんいいところに\nこの衣装\nどう思います？", 5247, 0, 1, 2, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "何見てるんですか？\nもしかしてこの水着の\n良さが分かります！？", 5248, 0, 1, 2, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "真夏でも涼しい…\nそれも水着の良さの\n一つですね", 5249, 0, 1, 2, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "仕立て屋も\nアイドルも\n諦めません！", 5250, 0, 1, 2, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "夏と言えば\nバカンスですけど…\n予定、あるんですか？", 5251, 0, 4, 2, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "う～ん…騎士さんを\n海へ誘うには…って\nなんでもないですよ！", 5252, 0, 8, 2, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふー…夏はやっぱり\n朝が一番過ごしやすい\nですね～！", 5253, 1, 1, 2, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "暑い時こそ海です！\n体力づくりのためにも\n泳ぎにいきますよ！", 5254, 2, 1, 2, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "外で虫が鳴いてる…\n夏って感じがして\n風流ですねぇ…", 5255, 3, 1, 2, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "少し休憩です…\nこのまま寝ないよう\n気をつけないと…", 5257, 0, 1, 3, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "か、かわいい…！\nこの感動を次の\nステージ衣装にも…！", 5258, 0, 1, 3, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りですね～\n波の音が聞こえて\nきそうです…", 5259, 0, 1, 3, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "泳いだ後は\n少し寒いので\nちょうどいいですね", 5260, 0, 1, 3, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "夏バテしないように\n栄養はしっかり\n取らないと！", 5262, 0, 1, 3, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "次のトレンドは…\nふむふむ、やっぱり\nこう来ましたか…", 5263, 0, 1, 3, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "デザインはもちろん\n触り心地も\n最高ですね♪", 5265, 0, 1, 3, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "夏の撮影スポットに\n活用できそうですね\nさっそく衣装考えて…", 5266, 0, 1, 3, 117401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "えへへ…♪\n団長さんが初めての\n友達で本当に良かった", 5267, 0, 12, 1, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あっ、団長さん！\n今日のＢＢ団の活動\nなんですけど…二人で\n大縄跳びしませんか！", 5268, 0, 12, 2, 104001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この衣装で\nライブするのは\n恥ずかしいな…", 5269, 0, 1, 1, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "せっかくの夏だし\n肝試しに\n行ってみたいかも…", 5270, 0, 1, 1, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "歌もダンスも\nより上を目指すために\n夏合宿をしよう…！", 5271, 0, 1, 1, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夏の暑さにも負けない\n熱いライブに\nしてみせる…！", 5272, 0, 1, 1, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "新曲のアイデア\nまとめたいな…\n少し海辺を散歩しよう", 5273, 0, 1, 1, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "かき氷、食べたいな\n…あの人は何味が\n好きなんだろう？", 5274, 0, 4, 1, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "水着、似合ってるって\n言ってもらえるかな…", 5275, 0, 8, 1, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "サインして、ですか？\nいいですけど…\n少し照れますね…", 5276, 0, 1, 2, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "少し待ってください\n今、新曲の楽譜を\n書いているので…", 5277, 0, 1, 2, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なんでしょう？\nもしかして…\nボイトレに興味が？", 5278, 0, 1, 2, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今度のライブでは\n夏らしい爽やかな歌を\nファンにお届けします", 5279, 0, 1, 2, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…水鉄砲で遊ぼう？\nふふ。楽しそうですね\nお手柔らかに…♪", 5280, 0, 4, 2, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたの声を\n聴いていると、\n何だか落ち着きます…", 5281, 0, 8, 2, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日も暑くなりそう…\nお互いしっかりと\n水分補給しましょうね", 5282, 1, 1, 2, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹空きましたよね\n海の家で、\nなにか買ってきます", 5283, 2, 1, 2, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の海で月明かりと\n波の音を楽しもうかと\n…一緒に行きますか？", 5284, 3, 1, 2, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "レッスンだけでなく\nリラックスすることも\n大事、ですよね", 5286, 0, 1, 3, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふ、かわいい\n精霊も負けないくらい\nかわいいですけどね", 5287, 0, 1, 3, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夏らしい爽やかで\nいい匂い…あなたに\nピッタリな香りですね", 5288, 0, 1, 3, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "海に入った後は、\n体が冷えてしまいます\n一緒に温まりましょう", 5289, 0, 1, 3, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "アイドルとして、\n食べすぎには\n気をつけないと…", 5291, 0, 1, 3, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "夏は恋の季節…\nガンガン攻めるべし…\nなるほど…", 5292, 0, 1, 3, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "この子に乗りながら\nライブをする…\nというのはどうですか", 5294, 0, 1, 3, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "まるで人魚になった\n気分…なんて、ふふ", 5295, 0, 1, 3, 117301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お姉ちゃんとして\nシオリンにかっこいい\nとこ見せなくっちゃ☆", 5296, 0, 1, 1, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いつかシオリンと\n一緒に空を飛んで\n空中散歩してみたいな", 5297, 0, 1, 1, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "すこし眠くなってきた\nかも…シオリンと\nお昼寝しようかな", 5298, 0, 1, 1, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お散歩してこよっと！\nシオリンとお出かけ\nするのにいい場所\n探さなくっちゃ！", 5299, 0, 1, 1, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "シオリンに過保護って\n言われちゃった…♪\nそれでも心配しちゃう\nのが姉心…だよね？", 5300, 0, 1, 1, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "気持ちいい日差し！\nシオリンと彼と、\nお昼寝したら\n気持ちよさそ～♪", 5301, 0, 4, 1, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今度天気がいい日には\nシオリンと彼を誘って\n一緒にお出かけ\nしたいな～♪", 5302, 0, 8, 1, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日はご機嫌なんだ♪\nだって、シオリンの\n調子がいいんだもん☆", 5303, 0, 1, 2, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今からシオリンと\nピクニックに\n行くんだ♪　そうだ！\nキミも一緒にどう？", 5304, 0, 1, 2, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わっ、びっくりした！\nシオリンから借りた本\n読むのに集中\nしてたから…", 5305, 0, 1, 2, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うん？　どうしたの？\nあっ、もしかして\nこの服、気になる？", 5306, 0, 1, 2, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "シオリンもキミも元気\nいっぱいだと、私も\n元気になっちゃうよ☆", 5307, 0, 4, 2, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "シオリンの前だけ\nじゃなくて、キミにも\nかっこいい私の姿を\n見てほしいな☆", 5308, 0, 8, 2, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！　えへへっ\n今日は早起きなんだ♪\nシオリンにかっこ悪い\nとこ見せたくないから", 5309, 1, 1, 2, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おなかすいたなぁ～…\nシオリンと一緒に\nおいしいもの食べに\n行こうかな！", 5310, 2, 1, 2, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間！？\nシオリンと一緒だと\n時間が早く\n過ぎていっちゃうね！", 5311, 3, 1, 2, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この快適な寝心地…！\nシオリンにもおすすめ\nしなきゃ…！", 5313, 0, 1, 3, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わあ、かわいい！\nそれにさわり心地も\nいいし、抱き枕に\nちょうどいいかも！", 5314, 0, 1, 3, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いいにおい…♪\nなんだかリラックス\nできて…すやぁ…", 5315, 0, 1, 3, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽかぽか～☆\nシオリンと一緒に\nぬくぬくしたら\n気持ちよさそう♪", 5316, 0, 1, 3, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "仲のいい人が一緒だと\nつい食が進んじゃうね\nえへへ…♪", 5318, 0, 1, 3, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…この本…\nシオリンが好きかも！\n今度おすすめしよっと", 5319, 0, 1, 3, 118301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お姉ちゃん、\n私のために無理は\nしてないかな…？", 5322, 0, 1, 1, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "新しく買った絵本…\nこういうのなら\nお姉ちゃんと楽しく\n読めるよね", 5323, 0, 1, 1, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ニャットちゃんを\nここに連れてきて\nみんなで遊べないかな", 5324, 0, 1, 1, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "本屋さんに行こうかな\nみんなで読める\n面白い本が\nあるといいなぁ", 5325, 0, 1, 1, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "たまには…読むだけ\nじゃなくて、自分で\nお話を書いて\nみようかな…？", 5326, 0, 1, 1, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "時々…お姉ちゃんと\nあの人が似てるって\n思うことがあります…", 5327, 0, 4, 1, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お姉ちゃんとあの人…\n優しくて頼もしい\n二人に囲まれて…\n私、幸せ者だなぁ…", 5328, 0, 8, 1, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうかしましたか？\nもしかして…あなたも\n一緒にこの本を\n読みたい…とか？", 5329, 0, 1, 2, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "けほっ…けほっ…\nあっ、心配いりません\n飲み物を飲んで\nむせただけですから", 5330, 0, 1, 2, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この格好…\n似合ってますか…？\nえへへ、照れますね…", 5331, 0, 1, 2, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なぁに、お姉ちゃん？\n…あっ、すみません\n読書に集中していて…\n間違えちゃいました…", 5332, 0, 1, 2, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お姉ちゃん、時々無理\nしちゃうから…\nあなたも一緒だと\n安心できます", 5333, 0, 4, 2, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お姉ちゃんとあなたと\n頼れる人に囲まれて\n私は幸せものですね", 5334, 0, 8, 2, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なんだか朝から\n調子がいい…今日は\nいい日になりそうです", 5335, 1, 1, 2, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "せっかくだから、\nお姉ちゃんを誘って\nお外でランチも\nいいかも", 5336, 2, 1, 2, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お姉ちゃんに心配\nかけないように…もう\nちょっと本を読んだら\n寝なくちゃね", 5337, 3, 1, 2, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふんわり柔らかくて\n気持ちいい手触り…\nお姉ちゃんが寝るのに\nちょうどよさそう", 5339, 0, 1, 3, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふっ、かわいい♪\n絵本の物語みたいに\nおしゃべりできない\nかな…？", 5340, 0, 1, 3, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "素敵な落ち着く香り♪\nなんだかお姉ちゃん\nみたい、ふふっ", 5341, 0, 1, 3, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかくてほっと\nするなぁ\nここでゆっくり\n読書しようかな", 5342, 0, 1, 3, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "この味…\nお姉ちゃんが好きそう\n少しもらって、\n持って行こうかな…？", 5344, 0, 1, 3, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この本みたいな、\n心躍る大冒険も\nお姉ちゃんと一緒なら\nできちゃいそう", 5345, 0, 1, 3, 118401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いい部屋ね\nここを私の分院に\nするのもいいかも\nしれないわね…♪", 5348, 0, 1, 1, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "珍しいカンポーが\n手に入ったから\n色々試してみたいわ\n色々と、ね♪", 5349, 0, 1, 1, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この服を着ると\n自分が医者だって\nより実感するわね\nまあ、闇医者だけどね", 5350, 0, 1, 1, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "新薬開発のために\n薬草を採取して\nおこうかしら", 5351, 0, 1, 1, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "いつ急患が来ても\n対応できるように\nしておきましょうか", 5352, 0, 1, 1, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの子の研究資料も\nだいぶ増えてきたわね\nちゃんとまとめて\nおかないと♪", 5353, 0, 4, 1, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの子は大事な\n研究対象。だから\nいつまでも健康で\nいてもらわないとね♪", 5354, 0, 8, 1, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "薬に興味があるの？\nなら、今度ゆっくりと\n教えてあげるわね", 5355, 0, 1, 2, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "少し時間があいたから\n一緒に新薬の実験を\nしましょうか♪", 5356, 0, 1, 2, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうしたの？\nまさか急患…！？\nあら、違うのね\nならよかったわ", 5357, 0, 1, 2, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "具合が悪い時はすぐに\n言うのよ。君には\nいつでも健康でいて\nほしいから", 5358, 0, 1, 2, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "少し仮眠したいわね\n肩…いいえ、膝を\n貸してもらえる？", 5359, 0, 4, 2, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "たまには…君の隣なら\n闇医者も悪い研究者も\nお休みにするのも\n悪くないわね♪", 5360, 0, 8, 2, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "たまには朝の陽ざしを\n浴びるのも…\n悪くないわね", 5361, 1, 1, 2, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "天気がいい日は\nいい薬草が採れるの\n君も集めるの、\n手伝ってくれる？", 5362, 2, 1, 2, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いけない、もうこんな\n時間なのね\n診察に没頭すると\n時間感覚がなくなるわ", 5363, 3, 1, 2, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もう少し固い方が\n私好みだけど…\n悪くない寝心地ね", 5365, 0, 1, 3, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "このぬいぐるみ…\n闇医者として\n興味深いわね…", 5366, 0, 1, 3, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "落ち着く香りね\n私も診察室で\n使ってみようかしら", 5367, 0, 1, 3, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "冷えは病につながるわ\nしっかり温めて\n体をいたわりましょ", 5368, 0, 1, 3, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしい♪\n研究のお供に\nもってこいの\n味だわ", 5370, 0, 1, 3, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "医学は日進月歩…\n闇医者とはいえ\n最新の論文には\n目を通しておかないと", 5371, 0, 1, 3, 117501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "白衣の天使かあ\nまさにボクのための\n呼び方だね", 5400, 0, 1, 1, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "美しさとは\n日々の努力が\n作るものなんだよ", 5401, 0, 1, 1, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "大変だ…\nボクは美しく\nなりすぎたかも", 5402, 0, 1, 1, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ボクのかわいさで\n癒やされて\nみんな健康に\nなっちゃうね", 5403, 0, 1, 1, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "どんな服装をしても\nボクの美しさは\n変わらないね", 5404, 0, 1, 1, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "これからはボクも\n美の伝道師として\nがんばらないとね♪", 5405, 0, 4, 1, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ボクのかわいい笑顔を\n近くで見る以上の\n癒やしはないよね♪", 5406, 0, 8, 1, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どう？　看護師姿の\nボクもかわいいでしょ\nもっと近くで見る？", 5407, 0, 1, 2, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ほら！　美しいボクの\n看護師姿を見たら\n元気でちゃうでしょ？", 5408, 0, 1, 2, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "白衣の天使のボクも\n最高に美しいね\n存分に癒されてよ♪", 5409, 0, 1, 2, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "具合が悪いの？\nならボクの美しい顔を\n処方してあげる♪", 5410, 0, 1, 2, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "さあ今日もボクと\n一緒に美の追求に\n付き合ってもらうよ♪", 5411, 0, 4, 2, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "かわいい天使のボクが\nいつもそばにいるんだ\nキミって幸せ者だね♪", 5412, 0, 8, 2, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さすがボク\n目が覚めるような\n美しさでしょ？", 5413, 1, 1, 2, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "美は食で作られる\n美容にいいものを\n食べようよ！", 5414, 2, 1, 2, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふああ…早く寝よ？\n夜更かしは美容の\n大敵だからね", 5415, 3, 1, 2, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふう～…\nリラックスする\nボクも美しい", 5417, 0, 1, 3, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ボクが抱きしめると\n普段よりかわいく\n見えちゃうね♪", 5418, 0, 1, 3, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "美しいボクは\n常にいい香りを\nしていなくちゃね", 5419, 0, 1, 3, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "光がボクを照らしてる\nんじゃなくて、ボクが\n光を輝かせてるのさ", 5420, 0, 1, 3, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "バランスのいい食事が\n美しいボクを\n作るのさ", 5422, 0, 1, 3, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…なるほど\nこうすればより美しく\nなれるかもしれない", 5423, 0, 1, 3, 117601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "仲間のためなら\nきっと…どこまでも\n強くなれるよね", 5425, 0, 12, 1, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "プリンセスフォーム？\n私と同じような力を\n持ってる人がいるの？\n会ってみたいな～！", 5426, 0, 12, 2, 105701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ここの空気は、\nどうもゆるすぎて…\n落ち着きませんわね", 5427, 0, 1, 1, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "陛下のお越しになる\n別宅としては、\n少し警備が\n甘すぎでは？", 5428, 0, 1, 1, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あらあら？\nサッシにホコリが！\nちょっとネコ助！\n掃除は念入りに！", 5429, 0, 1, 1, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いつまで入り浸って\nいるのかと、\n秘書に叱られて\nしまいましたわ…", 5430, 0, 1, 1, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "もういっそ、\nここに間借りして\n仕事しようかしら…？", 5431, 0, 1, 1, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "邪魔している身ですし\n家事くらい\nお手伝いさせなさいな", 5432, 0, 4, 1, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "本当は、意外と\n居心地が良いのかも…\n陛下の気持ち、\n少し分かりましたわ", 5433, 0, 8, 1, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちょっ…わたくしを\n叩いても、ホコリなど\nあまり出ませんわよ！", 5434, 0, 1, 2, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "陛下っ？\nなんだ…貴方でしたの\n用件は手短にお願いね", 5435, 0, 1, 2, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "別に、好き嫌いは\nありませんけれど…\n魔物料理って、意外と\n美味なものですわね", 5436, 0, 1, 2, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "言っておきますけれど\nわたくしは商売人です\n荒事は専門外ですわよ", 5437, 0, 1, 2, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "プリンセスナイトの\n能力…なにか儲け話に\n使えませんかしらね", 5438, 0, 4, 2, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "貴方がたのことも、\n少しくらいは\n信用してないことも\nありませんでしてよ", 5439, 0, 8, 2, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\nさ、今日もバリバリ\n働きますわよ！", 5440, 1, 1, 2, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ですわね\n栄養補給をしつつ\n働きますわよ！", 5441, 2, 1, 2, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "定時ですって？\n関係ありません！\nわたくし、まだまだ\n働きますわよ～っ！", 5442, 3, 1, 2, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うっ…いけませんわ\n日頃の疲れが…\nふわぁ…", 5444, 0, 1, 3, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もふもふ…ふふっ♪\n…なんですのっ、\nなにかおかしくて！？", 5445, 0, 1, 3, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りですわね\nわたくしの執務室にも\n置きたいくらいですわ", 5446, 0, 1, 3, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "いけませんわ…\nこんなに暖かいと\n日頃の疲れが…ふわぁ", 5447, 0, 1, 3, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もう一つ食べたら\n仕事に戻りますわよ？\nあと一つだけ…", 5449, 0, 1, 3, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "商人にとって\n知識は武器ですわ\n陛下のため、貴方も\nもっと勉強なさい？", 5450, 0, 1, 3, 118001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "故郷のお菓子を\nいろいろ作ったんだ～\nみんなに\n配ってくるさ～♪", 5452, 0, 1, 1, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "彼ってどんな仮装が\n似合うかな～？\nシーサーとか？", 5453, 0, 1, 1, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "カボチャチャンプルー\n作ってみよっと！\nきっとおいしいさ～♪", 5454, 0, 1, 1, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "視線を感じるさ～\nもしかして幽霊？\nおしゃべりするさ～♪", 5455, 0, 1, 1, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "さっき作った\nサーターアンダギー、\n早く彼に\n食べてほしいさ～♪", 5456, 0, 1, 1, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "彼のために、\n特別なイタズラを\n考えとくさ～♪", 5457, 0, 4, 1, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつか彼と、\n故郷のハロウィンを\n楽しみたいさ～♪", 5458, 0, 8, 1, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ハロウィンは\n私たちが守るさ～♪\nさ、見回りに行こ！", 5459, 0, 1, 2, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この制服、\nハロウィンらしくて\n大好きさ～♪", 5460, 0, 1, 2, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "イタズラする気ね～？\nどんなことされるのか\n楽しみさ～♪", 5461, 0, 1, 2, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "カボチャのランタン、\n一緒に作ろ！\n絶対楽しいよ～♪", 5462, 0, 1, 2, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お菓子くれるの？\nあは～、ありがとー♪\nもぐもぐ…\n優しい味がするさ～♪", 5463, 0, 4, 2, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミと一緒に過ごす\nハロウィンは、\nドキドキとワクワクが\n止まらないさ～♪", 5464, 0, 8, 2, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ハロウィンは\n朝から大忙しさ～！\nお菓子作り、\n手伝ってほしいさ～", 5465, 1, 1, 2, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お化け屋敷に行こ！\n一緒にいっぱい\nドキドキしようね～♪", 5466, 2, 1, 2, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ここからが\nハロウィン本番さ～！\n幽霊たちと\nいっぱい遊ぶさ～♪", 5467, 3, 1, 2, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっと休んだら、\nお菓子作りを\n再開するさ～♪", 5469, 0, 1, 3, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "でーじかわいいね～♪\nこの子に仮装させたら\nきっと似合うさ～♪", 5470, 0, 1, 3, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お菓子みたいに\n甘い匂い…\nハロウィンらしい\nいい香りさ～♪", 5471, 0, 1, 3, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ランドソルの秋って\n冷えるけど…\nこれがあれば\n体も心もぽかぽかさ～", 5472, 0, 1, 3, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "故郷のご飯も\nおいしいけど、\nこっちのご飯も\nでーじおいしいさ～♪", 5474, 0, 1, 3, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "パンプキンパイの\nレシピは…なるほど～\n勉強になるさ～♪", 5475, 0, 1, 3, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "全部おいしそうで\nどれから食べるか\n迷っちゃうさ～♪", 5477, 0, 1, 3, 117701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ムっ！　幽霊の気配を\n感じるデス！\nさあ姿を現すデス！", 5479, 0, 1, 1, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ムムム…\n妖魔の力を忍法に\n使えないでショウか…", 5480, 0, 1, 1, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "怪しい妖魔を\n成敗するデス！\nハロウィンの平和は\nワタシが守りマスよ！", 5481, 0, 1, 1, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ワタシの祭囃子が\n聞こえマスかー？\nさあ集まるデース！\n陽気に踊りまショウ！", 5482, 0, 1, 1, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お祭りは\n楽しんだ者勝ちデス！\n踊らにゃ\nソンソンデス！", 5483, 0, 1, 1, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "幽霊になる前に\n天下統一を\n果たしたいデスね", 5484, 0, 4, 1, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの世に行っても\nショーグンは\nワタシの大事な\nショーグンデス！", 5485, 0, 8, 1, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ショーグン！\n悪霊退治に\n出かけるデース！", 5486, 0, 1, 2, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "妖魔を家来に\nしてみるのは\nどうデス？", 5487, 0, 1, 2, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "マントを使って\nウツセミの術の精度を\n高めるデス！", 5488, 0, 1, 2, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ハロウィンにちなんだ\n新しい忍法…\nすなわち妖忍法の\n開発を急ぐデス！", 5489, 0, 1, 2, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの世でも\nショーグンに\nお仕えしマスよー！", 5490, 0, 4, 2, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ショーグンもワタシと\nハロウィンパレードを\n踊り明かしまセンか？", 5491, 0, 8, 2, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございマス！\n天下統一に向けて\n急いで準備するデス！", 5492, 1, 1, 2, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹減ってまセンか？\nハロウィンスイーツで\n休憩するデ〜ス", 5493, 2, 1, 2, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜更かしすると幽霊が\nでるかもしれまセン…\nヒュ〜ドロロロ〜…", 5494, 3, 1, 2, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もふもふなところが\nわたあめちゃんに\n似ていマス。わんっ！", 5496, 0, 1, 3, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぬいぐるみや人形には\n魂が宿るという\n言い伝えがありマス…\nマカフシギデ〜ス", 5497, 0, 1, 3, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ウ〜ム…\nなんとも怪しい\n香りがしマスね！", 5498, 0, 1, 3, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "パレードの熱気に\n負けないくらい\n熱いデス！", 5499, 0, 1, 3, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ついつい食べすぎて\nしまうのは\n妖魔のせいデスか！？", 5501, 0, 1, 3, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "トーゴク妖怪の\n図鑑デス！　個性的な\n妖怪ばかりデスね！", 5502, 0, 1, 3, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "ハロウィンの甘味を\n集めまシタよ！\nショーグンへの\n貢ぎ物デス！", 5504, 0, 1, 3, 117801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "彼と二人で\n買い物に…って…\nこれってデートに\nなっちゃうのかな！？", 5531, 0, 12, 1, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "とうっ！　どうどう？\n今の決めポーズ！\nかっこいいよね♪", 5532, 0, 12, 2, 101301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ヒデサイとおそろの\nハロウィンコスとか\nしてみたいな～", 5533, 0, 1, 1, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "カボチャ料理かぁ…\n作ったらヒデサイ\n食べてくれるかな～", 5534, 0, 1, 1, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ハロウィンスイーツ…\nどれもおいしすぎて\n激ヤバなんですけど！", 5535, 0, 1, 1, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "霊界ってどんなとこ\nなんだろ～\nわりと近所だったり？", 5536, 0, 1, 1, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "服をハロウィンっぽく\nアレンジするのも\nたのしーよね♪", 5537, 0, 1, 1, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ヒデサイと一緒に\nハロウィンパーティー\n…えへへ、楽しみ～", 5538, 0, 4, 1, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ヒデサイといると\nドキドキする…\nなんでだろ～？", 5539, 0, 8, 1, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ねねね、うちらも\nハロウィンパレード\n見に行こー？", 5540, 0, 1, 2, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ハロウィンセイバーズ\nしゅつどーう！\nヒデサイも行こ～♪", 5541, 0, 1, 2, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "マントのロゴ\nかっこいいっしょ～？\nカボきちってゆーんだ", 5542, 0, 1, 2, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "トリックオア\nトリート！\nねえねえヒデサイ\nお菓子ちょうだい♪", 5543, 0, 1, 2, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ヒデサイも\nメイクしてみる？\nハロウィンぽいやつ♪", 5544, 0, 4, 2, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ヒデサイのこと\nうちがいつでも\nあっためたげるね！\n…あ！　手、手の話！", 5545, 0, 8, 2, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ハロウィンのイベント\n朝からでも\nやってるかな～？", 5546, 1, 1, 2, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "カボチャでおやつ\n作ってみたんだ～\nヒデサイ食べてみて！", 5547, 2, 1, 2, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ハロウィンの夜って\nやっぱテンション\n上がるよね～♪", 5548, 3, 1, 2, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "超ふかふかしてる～\nちょっと休憩させて\nもらっちゃお", 5550, 0, 1, 3, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "はぁ…\nもにカワすぎて\nつらいんですけど～！", 5551, 0, 1, 3, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ハロウィン限定の\nフレグランスじゃん！\nいい匂いする～♪", 5552, 0, 1, 3, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "やばばば…\nあったかくて\n眠くなっちゃう～", 5553, 0, 1, 3, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これ食べて\nもうひとがんばり\nしよーっと！", 5555, 0, 1, 3, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ハロウィンっぽい\nファッションとか\n載ってないかなぁ？", 5556, 0, 1, 3, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "お菓子いっぱいだ～！\nあとでヒデサイにも\n持ってってあげよ～", 5558, 0, 1, 3, 117901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お掃除が終わったら\n次は書類を片付けて…\nその次は…", 5560, 0, 1, 1, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "皆さんが冒険している\n間の留守は私に\nお任せください♪", 5561, 0, 1, 1, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "美食殿の皆さんが\n持ってきてくれる\nお土産が楽しみです♪", 5562, 0, 1, 1, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ネビアさんとは\nときどき一緒にお茶\nする仲なんです", 5563, 0, 1, 1, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ギルドハウスの乱れは\nギルドの乱れ\n整理整頓が大切です", 5564, 0, 1, 1, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "素敵なギルドハウスの\n管理人ができて\nとっても幸せです♪", 5565, 0, 4, 1, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "皆さんをほんの少し\n特別扱いしちゃう\n私がいます", 5566, 0, 8, 1, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "何かわからないことが\nあるときは私に\n聞いてくださいね", 5567, 0, 1, 2, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "書類を書いていると\n落ち着きます…\n一緒にどうですか？", 5568, 0, 1, 2, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなたのまわりは\nいつも賑やかで\n楽しいですね♪", 5569, 0, 1, 2, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あっ！　お頼みしたい\nことがあって\n探してたんです♪", 5570, 0, 1, 2, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ギブアンドテイクは\n大切です。たまには\nお礼させてください♪", 5571, 0, 4, 2, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "陰に日向にあなたを\n支えていきます♪\n期待していてください", 5572, 0, 8, 2, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日も一日\n管理人として\nがんばります♪", 5573, 1, 1, 2, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹がすきました…\nそろそろお昼に\nしませんか？", 5574, 2, 1, 2, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間…\n皆さんといると一日が\nあっという間です", 5575, 3, 1, 2, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "良質なお仕事は\n良質な休憩から\nです♪", 5577, 0, 1, 3, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいものに\n囲まれてお仕事できる\nのは幸せですね♪", 5578, 0, 1, 3, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お仕事に集中できる\nアロマを設置するのも\nよさそうですね♪", 5579, 0, 1, 3, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ポカポカ温まりながら\n書類仕事をするのも\nいいものですね…", 5580, 0, 1, 3, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "栄養補給しないと\n頭が回りませんからね\nきちんと食べましょう", 5582, 0, 1, 3, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "新条例はこのように\n活用されている、と…\nふむふむ…", 5583, 0, 1, 3, 118501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "会合用の資料と\n連載のネーム…\nどっちを片付けよう？", 5585, 0, 1, 1, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "イノリちゃん、また\nお金くすねてる…\n帰ってきたら\nお尻ペンペンだ♪", 5586, 0, 1, 1, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "カヤちゃんの装備\n傷むの早いなぁ〜\nメンテしてあげないと", 5587, 0, 1, 1, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そうだ、ラーゴのご飯\n買いに行かないと\n今日は何がいいかな？", 5588, 0, 1, 1, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここの人たちは見てて\n飽きない人ばっかり♪\n漫画の参考にしよ〜", 5589, 0, 1, 1, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "また一緒に買い物にも\n行きたいし、冒険も\nしたいな〜…♪", 5590, 0, 4, 1, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…君は見てるだけで\n満足なの？ ちゃんと\n触って欲しいな…♪", 5591, 0, 8, 1, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私の目が見たいの？\nいいけど…魅了されて\n魂が壊れちゃうよ…？\n…冗談で〜す☆", 5592, 0, 1, 2, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ラーゴがね、君に\n遊んで欲しいって☆\n仲良くしてあげてね", 5593, 0, 1, 2, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アシスタントの仕事\n気に入ってくれたなら\nまたお願いしていい？", 5594, 0, 1, 2, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "私が覚醒できるか？\n見せてあげたいけど…\nすごいことになるから\nまた今度で♪", 5595, 0, 1, 2, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "楽しいトラブルが\nあったら、とりあえず\n声はかけて欲しいな♪", 5596, 0, 4, 2, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "マッサージお願い♪\n変なところは…\n少しだけなら☆", 5597, 0, 8, 2, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう〜♪\n今日も一日、一緒に\nがんばっていこうね", 5598, 1, 1, 2, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹空いちゃった…\n一緒にお昼行かない？\nいいお店があるんだ〜", 5599, 2, 1, 2, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "君、眠れないの？\n誰かに見られてる？\n…きっと気のせいだよ", 5600, 3, 1, 2, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっと休憩〜…\nこのまま原稿すれば\n疲れなくなるのかな？", 5602, 0, 1, 3, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい〜♪\nラーゴのお友達に\nなってくれる？", 5603, 0, 1, 3, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り〜♪\nこの目でどう見えるか\n伝えられたらいいのに", 5604, 0, 1, 3, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ほどほどなのが\nちょうどいい時も\nあるよね…♪", 5605, 0, 1, 3, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "この味付け…\nあっちでも再現\nできるかな？", 5607, 0, 1, 3, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふふっ、面白い♪\nイノリちゃんの買う\n漫画にハズレなし☆", 5608, 0, 1, 3, 106701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私…23歳だもん\n魔法少女だなんて\n名乗れないわ…", 5610, 0, 1, 1, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あん、どぅ、とろわ〜\nみんなイイ子に\nな〜る♪", 5611, 0, 1, 1, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あっ！　イケナイ子の\n気配がするわ！\n風紀の乱れは\n先生が許しませんっ！", 5612, 0, 1, 1, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ここで闇の力が\n発動したら大変だわ！\nやだっ…そう思ったら\n緊張して…ダメぇ〜！", 5613, 0, 1, 1, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "オイタした子はみんな\nどうしてうれしそうに\n私の愛のムチを\n欲しがるのかしら…？", 5614, 0, 1, 1, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの子に次は何を\n教えてあげようかしら\n愛？　希望？\nそれとも…♪", 5615, 0, 4, 1, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの子のことを\n考えると、愛と希望で\n胸がいっぱいになるの", 5616, 0, 8, 1, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "先生なのに闇の力を\n持ってるのは秘密よ？\n他の子には\n知られたくないから…", 5617, 0, 1, 2, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "秘密の授業の内容？\nそれは…あんなことや\nこんなことよ♪\nそれから、それから…", 5618, 0, 1, 2, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "しーっ！　私の正体が\nルーセント学院の\n先生だって、ここでは\n秘密にしててね？", 5619, 0, 1, 2, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あら？　補習して\nほしいの？　いいわよ\n君のお願いなら\nなんでも聞いちゃう♪", 5620, 0, 1, 2, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "イイ子にはごほうびを\nあげなくちゃ！\n君はなにが欲しい？\n遠慮しちゃダメよ？", 5621, 0, 4, 2, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "君との秘密が\nまた一つ\n増えちゃったね♪", 5622, 0, 8, 2, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日も一日\n元気に過ごしましょう\n先生が指導してあげる", 5623, 1, 1, 2, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夜まで頑張れるように\nお昼ご飯はしっかり\n食べましょう〜！", 5624, 2, 1, 2, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜更かしはダメよ？\nイケナイ子が\nすることです！", 5625, 3, 1, 2, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "闇の力に振り回されて\nもうヘトヘトよ〜\n心も体も\n癒されたいわ〜", 5627, 0, 1, 3, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "『秘密の学び舎』に\nこっそり連れて\n行っちゃおうかしら♪", 5628, 0, 1, 3, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "イケナイ甘い香り…\nなんだか胸の奥が\n熱くなってきたわ…♪", 5629, 0, 1, 3, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "やんっ♪\n燃え上がる愛みたい♪\n火照ってきちゃった♪", 5630, 0, 1, 3, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "生徒の見本に\nなれるように\n好き嫌いはしないの", 5632, 0, 1, 3, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "『学び舎に咲く禁断の\n愛』？　気になるわ…\nううん、ダメよっ！\nでも…ちょっとだけ…", 5633, 0, 1, 3, 119001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "次に会う時は、\nまたあそこに一緒に…\nえへへ…！", 5635, 0, 12, 1, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "横顔見てるの、\nバレてないよね…？\n…ちらっ", 5636, 0, 12, 2, 106301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "背が少し伸びたか！？\nあ、あいつのところへ\n報告に行かねばっ！", 5637, 0, 12, 1, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "私も貴公の隣に\n立っていられるよう\n日々精進していくぞ！", 5638, 0, 12, 2, 105301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ああ～\nドＭミストが\nあふれてしまいます～", 5639, 0, 1, 1, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "魔法少女として\nクウカ頑張ります～！\n愛と希望の妄想を…！", 5640, 0, 1, 1, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "決めポーズの練習より\nやられポーズの練習を\nしておきます…♪", 5641, 0, 1, 1, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "快感を溜めに溜めて\n放つドＭビームは\n最高ですよ～", 5642, 0, 1, 1, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はっ！\nこれは闇の気配！\n…クウカ自身でした", 5643, 0, 1, 1, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ドＳさん…ぐふふ…\nクウカを縛りあげ…\nじゅるりぃ～♪", 5644, 0, 4, 1, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ドＳさんに攻められる\nことで、クウカは進化\nしてゆくのです～！", 5645, 0, 8, 1, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "はぅっ！\nもっと激しく…！\n情熱的に～～～！", 5646, 0, 1, 2, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "クウカの変身シーンを\nじっくり眺めたい！？\nは、恥ずかしいです～", 5647, 0, 1, 2, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "「本当に魔法少女か\n確かめてやるよ…！」\nドＳさんはそう言って\nクウカを…ぐふふ…♪", 5648, 0, 1, 2, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "愛と希望の力が\nクウカの中に…\nこの胸の高鳴りが…？", 5649, 0, 1, 2, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ひゃあんっ！\nそこです～っ！\nもっと、もっと～♪", 5650, 0, 4, 2, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "クウカをこんなに\n悦ばせるのは\nドＳさんだけです…♪", 5651, 0, 8, 2, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "明るい時間に出歩くと\n目立ちますね\n魔法少女の衣装…", 5652, 1, 1, 2, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼の見回りです～♪\nああ～うっかりドＭを\n増やしてしまいました", 5653, 2, 1, 2, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜！　それはクウカが\n活性化する時間です！\n闇の活動開始です～♪", 5654, 3, 1, 2, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "気の緩んだクウカを\nドＳさんの鋭い牙が\n狙っています～♪", 5656, 0, 1, 3, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "魔法少女のマスコット\nにいいかもしれません\nもっと鎖とか飾りを…", 5657, 0, 1, 3, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "魅惑的な香りです～\nドＭミストの香りに\n似て…いや違いますね", 5658, 0, 1, 3, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "火照る体…紅潮した\nクウカの肢体を熱く\n見つめるドＳさん…", 5659, 0, 1, 3, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食欲を満たした次は\n何を満たせば\nいいですかねぇ～♪", 5661, 0, 1, 3, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "魔法少女がひどい目に\n遭う物語は…\nなさそうですね…", 5662, 0, 1, 3, 119101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ケーキも悪くないけど\nプリンが一番なの\nでもせっかくだから\n両方もらってやるの！", 5664, 0, 1, 1, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "クリスマスって聞くと\nなんだかあったかい\n気分になるの～", 5665, 0, 1, 1, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "煙突がなくても\nミヤコはどこからでも\nおうちに入れるの♪", 5666, 0, 1, 1, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "イブもプリン！\nクリスマスもプリン！\nプレゼントもプリン！", 5667, 0, 1, 1, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "クリスマスツリーの\n高いところの\n飾りつけは、ミヤコに\nまかせろなの～！", 5668, 0, 1, 1, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "アイツのプレゼント\n楽しみなの～\nきっと最っ高に特別な\nプリンなの～♪", 5669, 0, 4, 1, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ミヤコがサンタなら\nアイツはトナカイなの\nつまりお似合いって\nことなの～♪", 5670, 0, 8, 1, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ミヤコ、プレゼントを\n配りにいくの～♪\nオマエも手伝えなの！", 5671, 0, 1, 2, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "オマエにも飾りつけ\nしてやるの！\n頭にプリンを乗せると\nかわいいの♪", 5672, 0, 1, 2, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "幽霊のミヤコが\nいるなら、サンタも\nいて当たり前なの～！", 5673, 0, 1, 2, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "靴下にプリンを\n入れたらつぶれるの\nだからプリンは直接\nミヤコによこすの～！", 5674, 0, 1, 2, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "今日はプリンだけじゃ\n満足してやらないの！\nミヤコをたくさん\n甘やかせなの！", 5675, 0, 4, 2, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ミヤコのプリン\nオマエになら一個…\nうう～、一口だけ\nあげてもいいの！", 5676, 0, 8, 2, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "サンタの朝は早いの～\nミヤコも早起きして\nプレゼント準備したの\nとってもえらいの♪", 5677, 1, 1, 2, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日は一日中\nみんなと遊ぶの～！\nオマエも来いなの！", 5678, 2, 1, 2, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "みんなが寝たら\nチャンスなの～\nこっそりプレゼント\n配りにいくの♪", 5679, 3, 1, 2, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "むふー、気持ちいいの\nこういうプレゼントも\nいいかもしれないの", 5681, 0, 1, 3, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これ気に入ったの～\nプリンとアイツの\n次くらいなの♪", 5682, 0, 1, 3, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いいにおいなの～\nうっかり成仏\nしちゃいそうなの…", 5683, 0, 1, 3, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここに飾っといた\n雪だるま\nなくなっちゃったの\nきっと成仏したの～", 5684, 0, 1, 3, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これはオマエがくれる\nプリンとは\n別腹なの～", 5686, 0, 1, 3, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "プリンケーキ…\nこれならミヤコにも\n作れそうなの！\nさっそく作るの！", 5687, 0, 1, 3, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "びっくりしたの～！\n幽霊のミヤコを\n驚かすなんて…\nなかなかやるの！", 5689, 0, 1, 3, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "コイツの中…\nあったかいの～♪\n昼寝にぴったりなの～", 5690, 0, 1, 3, 119901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "メリークリスマス！\n聖夜に笑顔を\nお届けするべ♪", 5691, 0, 1, 1, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "クリスマス前は\n乳製品がよく売れて\nありがてぇけんど…\n目が回る忙しさだ～", 5692, 0, 1, 1, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "牧場で売る\nクリスマスリースを\n作っておかねぇと…", 5693, 0, 1, 1, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うちの動物たちにも\nクリスマスプレゼント\n用意しなきゃなぁ", 5694, 0, 1, 1, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "クリスマスに向けた\n限定商品とか\n作ってみるべか？", 5695, 0, 1, 1, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんちゃんへの\nプレゼント選び…\nここでボケるか…？\nやめておくべか…？", 5696, 0, 4, 1, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "オラ、あんちゃんから\n本当にたくさんの物を\nもらってんなぁ…", 5697, 0, 8, 1, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "雪遊びがしたいべか？\nへへっ、あんちゃん\nには負けねぇど！", 5698, 0, 1, 2, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ディナーと一緒に\n聖夜のお笑いライブを\nすんのはどうだべか？\nツッコミは任せたべ！", 5699, 0, 1, 2, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "寒くなってくると\n鍋が食べたくなるべや\nあんちゃんはどうだ？", 5700, 0, 1, 2, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あんちゃんは\nサンタさんのこと\n信じてるだか？", 5701, 0, 1, 2, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "どでかいクリスマス\nケーキをこさえるべ\nあんちゃんも作るの\n手伝ってくんろ♪", 5702, 0, 4, 2, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんちゃんが\nオラの旦那だったら…\nって、あんちゃん！\n今の聞いてただか！？", 5703, 0, 8, 2, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "牧場の朝は早いど！\nさぁてと、まずは\n雪かきしに行くべや", 5704, 1, 1, 2, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あんちゃんも一緒に\nお昼食べてくか？\n採れたての冬野菜は\nうんまいど～♪", 5705, 2, 1, 2, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "よい子は早く寝ねぇと\nサンタさんが\n来てくれねぇべよ？", 5706, 3, 1, 2, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こういうのリンリンが\n好きそうだな…\nプレゼント候補に\n入れておくべ！", 5708, 0, 1, 3, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もふもふしてて\nなまらめんこくて…\nあぁ…癒されるべや…", 5709, 0, 1, 3, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この匂い…\n気持ちが和むべや\n夢心地になっちまうな", 5710, 0, 1, 3, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったけぇところは\n落ち着くなぁ…\nつい眠くなっちまう", 5711, 0, 1, 3, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "こ、この味は…！\n…うーん、もっと\nリアクション芸も\n練習しねぇとな", 5713, 0, 1, 3, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "シオシオって\nどんな本読んでんだ？\n…難しい字が\nぎっしりだべや…", 5714, 0, 1, 3, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "この仕掛け…\nオラのコントに\n活かせるかも\nしんねぇな", 5716, 0, 1, 3, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "この着ぐるみで\nリマリマのモノマネを\n練習してみるべか…？", 5717, 0, 1, 3, 119201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "もっとキレイになって\nアイツにぎゃふんと\n言わせてやるんだから", 5718, 0, 12, 1, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "アタシのこと\nどう思う？\nかわいいって…そこは\nキレイって言ってよね", 5719, 0, 12, 2, 105001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ハートマークの刺繍…\nは、やりすぎですかね\nいやちょっとくらい\nアピールしてみても…", 5720, 0, 1, 1, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "雪降らないかな～\nそしたらお兄ちゃんと\n雪だるま作ったり\nできるのに～", 5721, 0, 1, 1, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "プレゼントを入れる\n靴下…いくつ編んでも\n足りません～！", 5722, 0, 1, 1, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お兄ちゃんとの\nクリスマスデートは\n早い者勝ちですからね\n負けませんよ～！", 5723, 0, 1, 1, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "クリスマスだし…\n受験勉強は今日だけ\nお休みです♪", 5724, 0, 1, 1, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんと\nおそろいのコーデで\nクリスマスデート…\nしたいなぁ～！", 5725, 0, 4, 1, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄ちゃんに\nプレゼントする編み物\nこれで３着目～と♪\nあれ、作りすぎ？", 5726, 0, 8, 1, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "えへへ、もっと近くで\n見たくありませんか？\n私のとっておきの\nクリスマスコーデ♪", 5727, 0, 1, 2, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お兄ちゃんが風邪を\n引いたら一大事です！\n私の編み物で暖かく\nしてあげます♪", 5728, 0, 1, 2, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お兄ちゃん、ほっぺに\nケーキのクリームが\nついちゃってますよ♪\n私がとってあげます！", 5729, 0, 1, 2, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お兄ちゃん！\nケーキ、あーんって\nしてあげます！\nほら、あーん♪", 5730, 0, 1, 2, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "クリスマスは大切な\n人と過ごすものっ！\nお兄ちゃん…妹の予定\n空いてますよっ！", 5731, 0, 4, 2, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "クリスマスはずっと、\nお兄ちゃんと一緒に\nいたい…って言ったら\n欲張り…すぎですか？", 5732, 0, 8, 2, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "早起きは３本お得！\n…クリスマスなら\n追加で10本ぐらい\nもらえちゃうかも！？", 5733, 1, 1, 2, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼はケーキ？\nそれとも七面鳥？\nごちそういっぱいで\n迷っちゃいますね～♪", 5734, 2, 1, 2, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お兄ちゃんと\nクリスマスに夜更かし\n…えへへ、ちょっぴり\nドキドキしちゃう♪", 5735, 3, 1, 2, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "編み物をするには\n絶好のくつろぎ空間\nですね～♪", 5737, 0, 1, 3, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なんというかわいさ…\nクリスマス\nプレゼントに\nもってこいですね！", 5738, 0, 1, 3, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これがお兄ちゃんの\nお部屋の香り…？\nんん～！　ずっと\nかいでいたいです～♪", 5739, 0, 1, 3, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふぁ、あったか～い…\n冬場はこういうのが\nありがたいですね～♪", 5740, 0, 1, 3, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ごちそうだぁ～♪\nほら、お兄ちゃんも\n食べて食べてっ！", 5742, 0, 1, 3, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "クリスマスデートの\n必勝法…こ、これは\n読むしかないです！", 5743, 0, 1, 3, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "わっ、すごいです～！\nこれを飾っておけば\nクリスマスが一層\n賑やかになりますね♪", 5745, 0, 1, 3, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "さぷらーいずっ！\nリマちゃんじゃなくて\nリノちゃんでした～！", 5746, 0, 1, 3, 119301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ミミにもミソギにも\nあの人にも頼りに\nしてもらえるように\nしっかりしなきゃ！", 5747, 0, 1, 1, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ミミはにんじんを\n食べられてすごいな…\n私も見習わなきゃ\nがんばろう…！", 5748, 0, 1, 1, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ミソギから怖い話\n聞いちゃった…\nうぅ…誰か一緒に\nいてくれないかな", 5749, 0, 1, 1, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "立派な大人に\nなれるように\nいっぱい勉強\nしておかなくっちゃ！", 5750, 0, 1, 1, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "なんだか…あの人の\nあやしい視線を\n感じるような…？", 5751, 0, 1, 1, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人に勉強を\n教えられるように\nしっかり予習を\nしておこうっと…！", 5752, 0, 4, 1, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今日はあの人と\n一緒に冒険できる…\nなんだかワクワク\nしてきちゃった…！", 5753, 0, 8, 1, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あ、いいとこに来て\nくれましたね！\nあなたに頼みたい\nことがあるんです！", 5754, 0, 1, 2, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "きゃあっ！？\nへ、変なところを\n触らないでください！", 5755, 0, 1, 2, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうですかこの格好？\nかわいい、ですか…？\nそ、そうですか…\nありがとうございます", 5756, 0, 1, 2, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ひゃあっ…！\nすみません、勉強に\n集中してたので\n驚いちゃいました", 5757, 0, 1, 2, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "一緒に勉強して立派な\n大人になりましょうね\n私がそばで見張ってて\nあげます", 5758, 0, 4, 2, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "まだ立派ではないかも\nですけど、私よりも\n大人なあなたのことは\n頼りにしてますからね", 5759, 0, 8, 2, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "立派な大人は\n朝の時間の使い方が\n上手だと聞きました\nあなたはどうですか？", 5760, 1, 1, 2, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ミミとミソギと\nあなたと…大事な人と\n一緒のお昼ごはんは\nやさしい味がしますね", 5761, 2, 1, 2, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うぅ…怖い話を\n思い出しちゃいました\n寝るまで一緒に\nいてくれますか…？", 5762, 3, 1, 2, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "すごい座り心地…！\nとっても勉強が\nはかどりそう…！", 5764, 0, 1, 3, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この子…なんだか\nミミに似てるような\n気がする…ふふっ♪", 5765, 0, 1, 3, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…♪\n勉強で疲れた\n頭がリフレッシュ\nできそうです", 5766, 0, 1, 3, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽかぽかだ…♪\nミミとミソギと\nあの人と一緒に\nいるときみたい", 5767, 0, 1, 3, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いっぱい食べたら\n早く大人になれたり\nしないかな…？", 5769, 0, 1, 3, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "あう…\n知らない単語が…\nちゃんと調べて\n覚えなくっちゃ…！", 5770, 0, 1, 3, 120601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うさぎさんが\nぴょ～んぴょん♪\nみんなえがおで\nるんたった～♪", 5773, 0, 1, 1, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "キョウカちゃんも\nいつかにんじんさんを\n好きになってくれたら\nうれしいな～♪", 5774, 0, 1, 1, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日のミソギちゃんの\nイタズラ、びっくり\nしちゃったけど\nおもしろかったな～♪", 5775, 0, 1, 1, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "このおうち、いつも\nいろんな人がいて\nドキドキぴょんぴょん\nって楽しいな～♪", 5776, 0, 1, 1, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "いいお天気～♪\nお外でみんなと\nいっぱい遊びたいな♪", 5777, 0, 1, 1, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ミソギちゃんも\nキョウカちゃんも\nおにいちゃんがいると\nずっと笑顔だね～♪", 5778, 0, 4, 1, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おにいちゃんにはやく\nあいたいな～♪\nまだかな、まだかな♪", 5779, 0, 8, 1, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "えへへ♪\nおにいちゃんに\nなでなでされると\nぽかぽかするね♪", 5780, 0, 1, 2, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "聞いて、おにいちゃん\nさっきね、かわいい\nちょうちょさんに\n会ったんだよ～♪", 5781, 0, 1, 2, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわっ…！\nおにいちゃんの顔を\nお絵かきしてたから\nびっくりしちゃった♪", 5782, 0, 1, 2, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おにいちゃんも\n遊びたいの？\nそれじゃあ二人も\n呼んで遊ぼう♪", 5783, 0, 1, 2, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おにいちゃんも\nみんなも、優しい人\nばっかりで\nミミ幸せ～♪", 5784, 0, 4, 2, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おにいちゃん♪\n高い高いしてほしいな\nすっごくぴょんぴょん\nできて、好きなんだ♪", 5785, 0, 8, 2, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう～♪\nおにいちゃん、今日は\nおひさまみたいに\nきらきら元気だね～♪", 5786, 1, 1, 2, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おひるごはんだね～♪\nにんじんさんを\nいっぱい食べて\n元気いっぱい♪", 5787, 2, 1, 2, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわあ…\n眠くなってきちゃった\nおにいちゃん、\n一緒に寝よう～？", 5788, 3, 1, 2, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふわぁ、気持ちいい♪\nずっとこうやって\n座ってたくなるね～♪", 5790, 0, 1, 3, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わあ、かわいい～\nぎゅ～っ、ぎゅ～っ♪\nこれで仲よしだね\nえへへ♪", 5791, 0, 1, 3, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "気持ちいいにおい～♪\nぴょんぴょんしたく\nなってきちゃった♪", 5792, 0, 1, 3, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかぽかぽか♪\nおにいちゃんも\nきてくれたら、もっと\nあったかくなりそう♪", 5793, 0, 1, 3, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…ごっくん♪\nおっきくなりたいから\nいっぱい食べるよ～♪", 5795, 0, 1, 3, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "えへへ、おもしろ～い\nこの絵本ね、\nキョウカちゃんから\n教えてもらったんだ♪", 5796, 0, 1, 3, 120401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この部屋…探索の\nしがいがありそう！\nついでにイタズラも\nしかけちゃお♪", 5799, 0, 1, 1, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ミミってああ見えて\n実は大胆で度胸も\nあるよね…ちょっと\nかっこいいな…！", 5800, 0, 1, 1, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "怖い話を聞いた時の\nキョウカって\n面白いんだよね～♪", 5801, 0, 1, 1, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "にいちゃんが\n慣れちゃわないように\nまた新しいイタズラを\n考えなきゃ！", 5802, 0, 1, 1, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "イタズラもいいけど\nミミとキョウカと\nにいちゃんと、普通に\n遊ぶのも楽しいなぁ♪", 5803, 0, 1, 1, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ミミにキョウカ、\nそれににいちゃん！\nみんなそろえば愉快な\n冒険が始まりそう！", 5804, 0, 4, 1, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "次はどんなイタズラを\nしたら、にいちゃんは\n喜んでくれるかな？", 5805, 0, 8, 1, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今ミソギに触ったね？\nヤバいよにいちゃん…\n逃げないとトラップが\n発動しちゃうよ…！", 5806, 0, 1, 2, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わわっ！？　びっくり\nしたあ…！　新しい\nトラップを作ってて\n気づかなかったよ～", 5807, 0, 1, 2, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お？　にいちゃん、\nイタズラする側にも\n興味があるの？", 5808, 0, 1, 2, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "にいちゃんなにか用？\nあ、もしかして…\nミソギと遊びたく\nなっちゃった？", 5809, 0, 1, 2, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ベストタイミングだよ\nにいちゃん！\n今からみんなで探検に\n行くところなんだ！", 5810, 0, 4, 2, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "にいちゃんってさ\nホントに優しいよね\nなにしても怒らないし\n…ありがとね♪", 5811, 0, 8, 2, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "にいちゃんおはよー！\n景気づけに本日\n一発目のイタズラ、\nやっちゃうよ～♪", 5812, 1, 1, 2, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ごはんはロシアン\nサンドイッチだよ！\nさあ、にいちゃん！\n好きなの選んでよ！", 5813, 2, 1, 2, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜ってなんだか\nワクワクしてなかなか\n眠れないんだよね\nにいちゃんはどう？", 5814, 3, 1, 2, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この座り心地のよさ…\nなにかのトラップに\nうまく使えないかな？", 5816, 0, 1, 3, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こういうのに細工して\nミミやキョウカを\n驚かせると、いい反応\nするんだよね♪", 5817, 0, 1, 3, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "においをうまく使った\nイタズラって…\nなにかないかな？", 5818, 0, 1, 3, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったまりながら\n新しいイタズラを\n考えると、いい案が\n出て来たりするんだ♪", 5819, 0, 1, 3, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしくてついつい\n食べ過ぎちゃうなぁ…\nはっ…！？　これって\nまさかトラップ…！？", 5821, 0, 1, 3, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "このキョウカから\n借りた冒険物語\nすっごく\nおもしろいんだよね！", 5822, 0, 1, 3, 120501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "晴れ着を着ると\nなんだか心が躍るね\n足取りも軽く\nなるってもんさ", 5825, 0, 1, 1, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "正月の食べ物ってのは\n美味いもんだね\nいくらでも\n食べれちまうよ", 5826, 0, 1, 1, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "普段は好き勝手してる\nアタシらも\n正月くらいは\n大人しくするさ", 5827, 0, 1, 1, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "年越しそばに雑煮\nこの季節は\n温かいものが\n体に沁みるね", 5828, 0, 1, 1, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "正月だからって\nのんびりしすぎたね\nちょっと釣りにでも\n行こうかね", 5829, 0, 1, 1, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "いい正月だね\nいつかあの子と\n一杯やりたいもんだよ", 5830, 0, 4, 1, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "大事な人と過ごす\n正月ってのがこんなに\n楽しいもんだとはね", 5831, 0, 8, 1, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "部屋があったかくて\n顔が火照っちまったよ\nちょいと外に涼みに\n行かないか？", 5832, 0, 1, 2, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "餅ってのは\n何をつけてもうまいね\nお前さんは\nどの味が好きだい？", 5833, 0, 1, 2, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お祝いの鯛が\n足りないって？\nそれじゃあアタシが\n釣ってきてやるよ", 5834, 0, 1, 2, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おせちが美味いのは\n分かるけど\n食べ過ぎには\n気を付けるんだよ", 5835, 0, 1, 2, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お前さんのおかげで\nいい正月を\n迎えられたよ\nありがとさん！", 5836, 0, 4, 2, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "慣れない晴れ着も\nお前さんに見て\nもらえたなら\n着たかいがあったね", 5837, 0, 8, 2, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようさん\n寒いのは分かるけど\nいい加減布団から\n出て顔洗ってきな", 5838, 1, 1, 2, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日の昼飯は雑煮だ\nアタシの郷土の味\nしっかり味わって\nおくれよ", 5839, 2, 1, 2, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おや、お前さんも\n夜ふかしかい？\n退屈してたところさ\n付き合っておくれよ", 5840, 3, 1, 2, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "晴れ着だと座り方にも\n気を遣うね\nしわになったら大変さ", 5842, 0, 1, 3, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "せっかくだし\nこの子にも晴れ着を\n着せてあげたいね", 5843, 0, 1, 3, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これは冬の花の香り…\n風情があって\nいいじゃないか", 5844, 0, 1, 3, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいねぇ…\nこんな寒い日には\nまさに天国だよ", 5845, 0, 1, 3, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いつも食べてる\nものでも正月に\n食べると\n新鮮な気がするね", 5847, 0, 1, 3, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "せっかくの正月休みだ\nたまにはゆっくりと\n本でも読もうかね", 5848, 0, 1, 3, 120801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "新年のあいさつ…\n私も街のみんなに\nしてみようかしら…", 5850, 0, 1, 1, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "正月はゆっくり過ごす\nのよね…ゆっくりって\n何したらいいのかしら", 5851, 0, 1, 1, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この格好も\n慣れてくれば\n動きやすいわ", 5852, 0, 1, 1, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "う～ん、今年の抱負…\nやりたいことが\nたくさんあるのよね", 5853, 0, 1, 1, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "おせち料理\nネビアの分も\n用意しなくちゃね", 5854, 0, 1, 1, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふふっ\n正月っていいわね\nみんな楽しそうだもの", 5855, 0, 4, 1, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "新年の思い出…\nこれからもっと作るわ\nそれが私の抱負よ", 5856, 0, 8, 1, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日は家で過ごすの？\nあなたと一緒なら\nきっと楽しいわね", 5857, 0, 1, 2, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どう？　この格好？\nコッコロさんは\n褒めてくれたけど…", 5858, 0, 1, 2, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ちょうど良かったわ\nあなたも大掃除\n手伝ってくれる？", 5859, 0, 1, 2, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これから料理するけど\nお雑煮と焼き餅\nどっちが好きかしら？", 5860, 0, 1, 2, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "『今の私』にとって\n初めての正月だもの\nあなたと楽しまないと", 5861, 0, 4, 2, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "去年よりも今年…\nもっと成長するからね\n…お兄ちゃん♪", 5862, 0, 8, 2, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう\nせっかくの正月だもの\n朝から楽しまないとね", 5863, 1, 1, 2, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ねぇ…\n良かったら正月の遊び\n教えてくれるかしら？", 5864, 2, 1, 2, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわぁ～…今日が\n終わっちゃうのが…\nもったいないわね…", 5865, 3, 1, 2, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅ…お参り後だから\n心地よすぎて眠って\nしまいそうだわ…", 5867, 0, 1, 3, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふっ\nかわいいものって\n癒されるわね…", 5868, 0, 1, 3, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…ん\nこれが梅の香り？\n…いい匂いね", 5869, 0, 1, 3, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "キャルじゃないけど…\nこのまま丸く\nなりたいところね…", 5870, 0, 1, 3, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "はむはむっ…♪\nせっかくの正月だもの\n堪能しなくちゃね♪", 5872, 0, 1, 3, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "…ふんふん\n帯の結び方って\nこんなにあるのね…", 5873, 0, 1, 3, 120701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "今の私が作れる\n最高の一曲…\nあの人に届くといいな", 5875, 0, 12, 1, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あの、歌を…\n聞いてくれませんか？\nあなたに贈る\n特別な歌を", 5876, 0, 12, 2, 104201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ひい、ふう…\nむむ、みなに配る\nお年玉のポチ袋が\n残りわずかなのじゃ…", 5877, 0, 1, 1, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "宴の準備はわらわに\n任せておくのじゃ！\n支配者の手腕、\n見せつけてくれる！", 5878, 0, 1, 1, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "新年の願掛けなら\nわらわにすればよい\n支配者に頼むほうが\n確実じゃろう？", 5879, 0, 1, 1, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "みなからもらった\nこの年賀状とやら…\nわらわも\n書いてみようかの♪", 5880, 0, 1, 1, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "正月飾りにもいろいろ\n種類があるんじゃの～\nどれも華々しくて\nわらわ好みじゃ♪", 5881, 0, 1, 1, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あやつへのお年玉は\nちと多めにしておくか\n…日ごろの感謝も\n込めてのう", 5882, 0, 4, 1, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あやつのことを想うと\nそれだけで行く年\n来る年が楽しみになる\nふふ、愉快なやつじゃ", 5883, 0, 8, 1, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "みなに晴れ着を\n褒められて、とても\nよい気分なのじゃ♪\n次はお主の番じゃぞ？", 5884, 0, 1, 2, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お主へのお年玉は\nいちばん最後じゃ！\n残り物には福が宿る\nそうじゃからのう", 5885, 0, 1, 2, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この季節は手が\nかじかむのう…ほれ、\nお主！　わらわの手を\nあたためるのじゃ！", 5886, 0, 1, 2, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お主のために雑煮を\n手作りしてみたのじゃ\n食べていくがよい♪", 5887, 0, 1, 2, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "眷属のお主に\n正月休みはまだ早い！\nずっとわらわのそばに\n控えておくのじゃ♪", 5888, 0, 4, 2, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ふふ、これほど楽しい\n正月は初めてじゃ…\nお主と過ごす時間は\nいつだって特別じゃな", 5889, 0, 8, 2, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "早起きしてわらわを\n待っておったのか？\nさすがはわらわの眷属\n殊勝な心がけじゃな♪", 5890, 1, 1, 2, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "食事どきじゃな\n正月の宴会料理が\nわらわたちを\n待っておるぞ♪", 5891, 2, 1, 2, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜も更けてきたのう\n冬の夜は長い…\n心ゆくまでお主と\n過ごせるわけじゃな♪", 5892, 3, 1, 2, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "実に心地がよい♪\nこのまま寝正月も\n悪くないかも\nしれぬのう", 5894, 0, 1, 3, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "愛いやつじゃのう\nわらわのそばに置いて\nやってもよいぞ♪", 5895, 0, 1, 3, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "品のある香りじゃのう\n寝室に置いておけば\nなにかご利益に\nあずかれそうじゃな", 5896, 0, 1, 3, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "心地よい…\nわらわはしばらく\nここから動かぬぞ\nお主も付き合うがよい", 5897, 0, 1, 3, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "舌鼓が鳴るのう♪\n正月の宴には\n持ってこいの品じゃ！", 5899, 0, 1, 3, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ほう、新春にはそんな\n習わしが…正月を\n制するには、まだまだ\n勉強が必要じゃのう", 5900, 0, 1, 3, 120901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "久しぶりの我が家って\n感じです！　やっぱり\nここが一番ですね〜！", 5902, 0, 1, 1, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さあ食べましょう！\nみんなで囲める食卓を\n心から味わいますよ☆", 5903, 0, 1, 1, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ランドソルに\n帰ってきた途端に\nお腹が空きました〜！", 5904, 0, 1, 1, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ただいま☆\n幸せ特盛りの\nわたしの日常！", 5905, 0, 1, 1, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ようやくランドソルに\n帰ってきたことですし\nやっぱり魔物料理を\nいただきましょう☆", 5906, 0, 1, 1, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人との絆を\n守るために\nもっともっと食べて\n強くならなくちゃ☆", 5907, 0, 4, 1, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつもありがとうって\nあの人を思いっきり\n抱きしめたいです☆", 5908, 0, 8, 1, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あなたの想いは\nこの身をかけて\n全力で受け止めます！", 5909, 0, 1, 2, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おかえりなさい☆\nここにいるみんなも\nあなたの帰りをずっと\n待っていましたよ！", 5910, 0, 1, 2, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "このギルドハウスで\n冒険の疲れを\n癒しましょう〜！", 5911, 0, 1, 2, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あなたの想いが\n全力全開を超える\n力をくれました！", 5912, 0, 1, 2, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "日常が続く幸せを\nあなたと一緒に\nかみしめたいです☆", 5913, 0, 4, 2, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ぎゅ〜っ！\nわたしたちは\nどんなことがあっても\nずっと一緒ですよ？", 5914, 0, 8, 2, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます！\nあなたと過ごせる\n幸せを、今日も\n味わいますよ〜！", 5915, 1, 1, 2, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ご飯の時間ですよー！\nあなたも一緒に\n食べましょうね！", 5916, 2, 1, 2, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日もあなたが隣に\nいてくれることを\n心から願ってますよ\nおやすみなさい☆", 5917, 3, 1, 2, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふい〜…\n安心できる場所で\nくつろげるって\n幸せですね〜…", 5919, 0, 1, 3, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "じゅるり…\n食べたくなっちゃう\nくらい、かわいい☆", 5920, 0, 1, 3, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "くんくん…おおー！\nステーキの香り！\nやばいですね☆", 5921, 0, 1, 3, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "体がぽかぽかしてきて\nわたしの食欲も\n燃えてきましたよー！", 5922, 0, 1, 3, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "わたしの食欲に\nついてこられますか？\nまだまだ食べますよ！", 5924, 0, 1, 3, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "これがキャルちゃんの\n言っていた、キスで\n目覚める王子様の\nおとぎ話ですか〜☆", 5925, 0, 1, 3, 121001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "自分で自分を\n分析するのも、これは\nこれで面白い…♪", 5927, 0, 1, 1, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "強過ぎる力の扱いには\n注意しないと…\n七冠がいい例だね", 5928, 0, 1, 1, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "少年の交友関係は\n計り知れないな…\nアタシも含むのか！", 5929, 0, 1, 1, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "原理を徹底解明して\n再発を防ぐぞー！\n…誰か手伝って～！", 5930, 0, 1, 1, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これは祝福にも\n呪いにもなる…\n忘れずにいよう", 5931, 0, 1, 1, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "少年が\n目を覚ましてくれて\n本当によかった…", 5932, 0, 4, 1, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "彼以外を選んでいたら\n今回の事態は\n乗り切れなかったな…\nさすがだよ、少年", 5933, 0, 8, 1, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "少年！　調子はどう？\nクレープ食べられる？\nっていうか食べて？", 5934, 0, 1, 2, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "元気そうで何よりだ\nまた店を手伝いに\nきてよ。二人もキミに\n会いたがってたしさ", 5935, 0, 1, 2, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "キミの診察もあるし\n今はなるべくそばに\nいるよ。迷惑じゃ\nなければだけど", 5936, 0, 1, 2, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "やっぱり少年は\nあちこちで人を\n助けてる時が\n一番輝いてるよ", 5937, 0, 1, 2, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "アタシは大したこと\nしてないけど\nみんなのことは\n褒めてあげてね", 5938, 0, 4, 2, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "みんなを笑顔に\nできるのは\nやっぱり少年だね", 5939, 0, 8, 2, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "やあ少年\n朝寝坊はしてない？\nそれじゃ、よい１日を", 5940, 1, 1, 2, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おや、少年！\nまかないのクレープ\n作ったけど、食べる？", 5941, 2, 1, 2, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわぁ…もう夜か…\n研究してたら\nあっという間だね…\nおやすみ、少年", 5942, 3, 1, 2, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "体がなまってたのか\n前線に出ると疲れる…\nまさか…年のせい！？", 5944, 0, 1, 3, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "キミたちも今の\nアタシと同じ感じに\nアレンジしてあげよう", 5945, 0, 1, 3, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "誰が置いたんだろう？\nいい香りだねぇ…\nうん、気に入った♪", 5946, 0, 1, 3, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "何も考えてない時間も\n実は思考にとって\n大事なんだよね～…", 5947, 0, 1, 3, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食の大切さは\nいつの食事からも\n感じられるね♪", 5949, 0, 1, 3, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむ…面白い！\n今度全巻\n借りにこようっと", 5950, 0, 1, 3, 121201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "聖学祭か…\n良い記憶はないな\nよし忘れよう", 5952, 0, 1, 1, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "健全なる精神は\n健全なる肉体に宿る…\nはっ、知ったことかよ", 5953, 0, 1, 1, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "暇だし鏡でも見るか…\nえへへ、ユニだよ♪\nよし子供料金いけるな", 5954, 0, 1, 1, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アオイ君は元気に\nしているだろうか…\n彼女は人一倍ぼくに\n懐いていたからな…", 5955, 0, 1, 1, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "そろそろシズル君は\n姉という幻想から\n目覚めただろうか…", 5956, 0, 1, 1, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ぼくは来年も聖学祭に\n行くさ…卒業しても\n君らとは永遠だ", 5957, 0, 4, 1, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "最近同志の登校率が\n減少傾向だな…\nまあ仕方ないのだが…\nないのだが…", 5958, 0, 8, 1, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ほわあああ！\nおい急に話しかけるな\n学びがこぼれる", 5959, 0, 1, 2, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この体操着、周囲から\n大層評判が良いのだよ\nたいそうだけにな\nどやっ！", 5960, 0, 1, 2, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "何を着ていようと\nぼくはぼくさ\n外見など所詮は\n魂の識別符に過ぎん", 5961, 0, 1, 2, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "救護院のアヤネ君が\n最近ぼくの自称年齢に\n疑念を持ち始めてな…\nあの熊…殺るか…", 5962, 0, 1, 2, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "うん？　なんだね？\nなに、用は無い？\n用も無いのに呼ぶとは\nもしや…これが友達！", 5963, 0, 4, 2, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この服が似合ってる？\nな、なんだね突然…\nやめたまえよでゅふふ", 5964, 0, 8, 2, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふぁ～あ…\n朝も更けてきたな…\nそろそろ寝るか…", 5965, 1, 1, 2, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぁ～あ…もう昼だ…\n人間の起きている\n時間ではないな…\n早く寝なくては…", 5966, 2, 1, 2, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うーん、よく寝た！\n気持ちのいい夜だな\n今日も一日がんばるぞ", 5967, 3, 1, 2, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ほわぁ～…\nもしやこれは都で噂の\n人を駄目にするやつ…", 5969, 0, 1, 3, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふむ、愛くるしいな\nだが似合い過ぎる…\nぼくが持つと我ながら\n子供にしか見えん", 5970, 0, 1, 3, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アロマか、興味深いな\nミツキ印ポーションも\n気化させて鼻腔から\n吸入してみるか…", 5971, 0, 1, 3, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "んふ、んふふ…\n火ってイイよね…\nずっと見てられるね…", 5972, 0, 1, 3, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "や、やめろ…\nとめどなく固形食物を\n生産するのはやめろ…", 5974, 0, 1, 3, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この可愛げのない筆致\nやはり作者は理系か！\nぐああ目が理系になる", 5975, 0, 1, 3, 116401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…あいつのためなら\n無理くらいいくらでも\nしてやるわよ", 5977, 0, 1, 1, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この姿、\n魔力の制御ムズ過ぎ…\nま、あたしは優秀だし\nどうとでもなるけど！", 5978, 0, 1, 1, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あいつのこと、\n全部受け入れるって\n決めたから！", 5979, 0, 1, 1, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今なら誰だろうと\n負ける気がしないわ\nドラゴンでもなんでも\nかかってこいっての！", 5980, 0, 1, 1, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "散々助けられた分、\n今度はあたしが\nあいつのこと助けるわ", 5981, 0, 1, 1, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつとの\nこれまでの冒険は\nどれも、あたしの\n大切な思い出…", 5982, 0, 4, 1, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もしまたあいつが\n寝たままになったら\nなんだってするわ\nキ…キスでも…", 5983, 0, 8, 1, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なに、お腹空いたの？\nなら、おいしいご飯を\n食べに行きましょ♪", 5984, 0, 1, 2, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "やっぱ、\nあんたのアホ面見ると\n安心するわ♪", 5985, 0, 1, 2, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "【美食殿】はあんたと\nぺコリーヌがいなきゃ\n始まんないっての", 5986, 0, 1, 2, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ひゃあっ！？\n急に声かけないで！？\n魔力が暴発しても\n知らないわよ！", 5987, 0, 1, 2, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…あんたとこうして\nぼーっと過ごす時間、\nまあ…嫌いじゃないわ", 5988, 0, 4, 2, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんたが信じて\n見守っててくれれば…\nあたし、\nなんだってできるわ", 5989, 0, 8, 2, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよ\n早く顔洗いなさいよ、\nこのねぼすけ♪", 5990, 1, 1, 2, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日のお昼は\nどこで食べる？\nあんたが\n決めていいわよ", 5991, 2, 1, 2, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もしあんたがまた\n夢に囚われても\nあたしが助けるわ\n安心して寝なさいよ", 5992, 3, 1, 2, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "気持ちいい～…♪\nあいつもたまには\nこうして休ませなきゃ", 5994, 0, 1, 3, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "一目惚れしたかも…！\nこの子、\n部屋に飾りたいわー♪", 5995, 0, 1, 3, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "へぇ、あいつって\nこういう匂いが\n好きなのかしら…？", 5996, 0, 1, 3, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖かくて最高…♪\n丸くなっちゃいそう…\nうにゃあ…♪", 5997, 0, 1, 3, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "イケるわね、これ！\nやっぱり食べるって\n大事よねー♪", 5999, 0, 1, 3, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ファーストキスは\nどんな味、ね…\nふ、ふ～ん…？\nなるほど…", 6000, 0, 1, 3, 121101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お友だち…\nできるかしら…？\nこんなわたしでも…", 6002, 0, 1, 1, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あまり、きょろきょろ\nしちゃダメよね…\n変な子だと、\n思われてしまうわ…", 6003, 0, 1, 1, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "広い場所、\n落ち着かない…\nはぅ…どこにいれば…", 6004, 0, 1, 1, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "～♪", 6005, 0, 1, 1, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "【レイジ・レギオン】\n…またいつか、\nみんなと…", 6006, 0, 1, 1, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…一度でいいから、\nわたしもママって…\nあっ、その…\n…な、なんでもないわ", 6007, 0, 4, 1, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ここが、今のわたしに\nとっての帰る場所…\n…そう思っても、\nいいのかしら…？", 6008, 0, 8, 1, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ええと…\nお腹、空いてる？\nおねむじゃない？", 6009, 0, 1, 2, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここにいると\n邪魔かしら…？\nならもっと隅っこに…", 6010, 0, 1, 2, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お喋り…？\nわたしでいいの…？\nうれしい…", 6011, 0, 1, 2, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あなたの好きな歌…\n教えて…？\n練習、するから…", 6012, 0, 1, 2, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ここは賑やかだけど…\nうるさいとは感じない\nむしろ、心地いい…", 6013, 0, 4, 2, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "安心、して…\nわたしの歌で、\nあなたを守るから…", 6014, 0, 8, 2, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちょっとだけ…\n朝は、苦手…\n…ふぁ…", 6015, 1, 1, 2, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼は、食べた？\n良かったら、一緒に…\n少し…焦げてるけど…", 6016, 2, 1, 2, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "眠れないのかしら…\nじゃ、じゃあ…\n子守歌…聴く？", 6017, 3, 1, 2, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こんな特等席…\n恐縮、です…", 6019, 0, 1, 3, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "い、今のうちに、\nこの子でお世話の\n練習を…", 6020, 0, 1, 3, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…\n…つらい気持ちも\n癒してくれる", 6021, 0, 1, 3, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかい…\nいつまでも、\nこうしていられそう…", 6022, 0, 1, 3, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしく出来てる…\nすごいわ…\n見習わなくっちゃ…", 6024, 0, 1, 3, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "『赤ちゃんとママの\nスキンシップ入門』…\n…べ、勉強になるわ…", 6025, 0, 1, 3, 118101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "きれいなお部屋…！\n立派な舞台の\nセットみたい…♪", 6027, 0, 1, 1, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お芝居では私が先輩\nなんだから、しっかり\n私がミサキちゃんを\nエスコートしなきゃ", 6028, 0, 1, 1, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "～～♪\n歌うお芝居も多いから\nもっと上手く\nなりたいな…！", 6029, 0, 1, 1, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ここにいる人たちと\n仲良くなりたいな…\nそしたらきっと演技の\n幅も広げられるよね", 6030, 0, 1, 1, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "機会があったら\nアヤネちゃんとも\nお芝居してみたいな♪", 6031, 0, 1, 1, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんに褒めて\nもらえるように\nお芝居の練習\nいっぱいしなきゃ…♪", 6032, 0, 4, 1, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あう…お兄ちゃんを\n意識したら、台詞が\n飛んじゃったよぅ…！", 6033, 0, 8, 1, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あっ、お兄ちゃん…♪\nお芝居の練習を\n見てくれませんか…？", 6034, 0, 1, 2, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いまの発声練習\nどうでしたか？\nひゃん…！？\n頭は撫でないでぇ～", 6035, 0, 1, 2, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ミサキちゃんも\nお芝居、とっても\n上達してるんですよ\n私も負けられません♪", 6036, 0, 1, 2, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "また物語を聞かせて\nほしい、ですか…？\n私なんかでよければ\nもちろんよろこんで♪", 6037, 0, 1, 2, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "新しいお話を\n考えてみました\n聞いてくれますか…？\nよかった…♪", 6038, 0, 4, 2, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつか…舞台上じゃ\nなくても、照れずに\nお兄ちゃんに気持ちを\n伝えてみせますね…♪", 6039, 0, 8, 2, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます♪\nマヒルさんにもらった\nミルク、一緒に\n飲みませんか？", 6040, 1, 1, 2, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "牧場のみなさんに\nドングリパンを\nいただきました～\nおひとつどうぞ♪", 6041, 2, 1, 2, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "寝る前にまたココアを\n飲みながら、お話を\n聞いてもらえますか？\nえへへ、うれしいな♪", 6042, 3, 1, 2, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お芝居の練習の\nあとは、ここで\nお兄ちゃんと\nゆっくりしたいな♪", 6044, 0, 1, 3, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日も演技の\n練習に付き合ってね♪", 6045, 0, 1, 3, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "素敵な香り…\nこのイメージも\nお芝居に\n活かせないかな…？", 6046, 0, 1, 3, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "私もお芝居で\nみんなの心を\nぽかぽか温められる\nようになりたいな…♪", 6047, 0, 1, 3, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "舞台に立つんだから\n食べ過ぎないように\n気をつけないと。\nでも…おいしいなぁ♪", 6049, 0, 1, 3, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "このお話、面白い…\n脚本を書く\n参考にもなりそう…♪", 6050, 0, 1, 3, 121301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "えへへ…♪\n二人で見た夕日…\nキレイでしたね…", 6052, 0, 12, 1, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "これから泳ぎの\n練習ですか？\n付き合いますよ♪", 6053, 0, 12, 2, 107501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "主さまを導くことで\nわたくしも未知なる\n領域へと辿り着けます", 6054, 0, 12, 1, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "主さまとなら\n海よりも深く\n空よりも高い場所へも\n目指せそうです", 6055, 0, 12, 2, 107601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あいつと二人で\n夏の遠い海に…って\nあたしってば\nなに考えてるのよ！", 6056, 0, 12, 1, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あたしが楽しく\n過ごせるのはあんたが\nいてくれたからよ\nか、感謝してるわ", 6057, 0, 12, 2, 107801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "はぁ…アタシってば\nこんなにかわいくって\nキレイなんて罪よね～", 6058, 0, 1, 1, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "舞台の衣装を\nクリーニング\nしとかなくちゃ…", 6059, 0, 1, 1, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "舞台映えするメイク…\nスズナなら\n知ってるかしら？", 6060, 0, 1, 1, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "物産展の会計係と\n山盛りの算数の宿題…\nどっちが簡単かしら…", 6061, 0, 1, 1, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "牧場と温泉の仕事に\nお芝居の練習に…\nちょ、ちょっと休憩～", 6062, 0, 1, 1, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お客さんの視線も\nうれしいけど…\nあいつも見てて\nくれてるかしら？", 6063, 0, 4, 1, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もっともっと\nセクシーになって\nあいつをビックリ\nさせてやるわ♪", 6064, 0, 8, 1, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "アンタも休憩？\nしっかり働くために\n休むのも大事よね", 6065, 0, 1, 2, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふふん♪　アタシも\n料理ができるように\nなったんだから！\n簡単なのだけだけど…", 6066, 0, 1, 2, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "温泉ってお肌に\nいいのよね？\nもっとキレイに\nなったらどうしよう〜", 6067, 0, 1, 2, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "物産展の荷物は\nこれでよし…っと\nそれじゃアンタも\n運ぶの手伝ってよね♪", 6068, 0, 1, 2, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "いつもと違うアタシに\n見とれちゃった？\n仕方ないわね～♪", 6069, 0, 4, 2, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お花見って風流で\n大人って感じ♪\n…でもお団子も\n忘れないでよね！", 6070, 0, 8, 2, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "みんなに朝ごはんを\n作ってみたら\n喜んでくれるかしら？", 6071, 1, 1, 2, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お客さんがいっぱい\n来る時間帯ね！\n元気出していくわ！", 6072, 2, 1, 2, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ寝ないと…\n睡眠不足はお肌の\n大敵なんだから", 6073, 3, 1, 2, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふかしてて\n気持ちいい～♪\n疲れが癒されるぅ…", 6075, 0, 1, 3, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この子もアタシと\nおそろいの衣装に\nしてあげようかしら♪", 6076, 0, 1, 3, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "素敵な衣装で\nいい香りを\n身にまとう…ふふ、\n大人のたしなみよね♪", 6077, 0, 1, 3, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったか～い♪\nここでお昼寝したら\n気持ちよさそう…", 6078, 0, 1, 3, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お仕事がんばると\nいつもよりお腹\n空いちゃう～！", 6080, 0, 1, 3, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "最新のトレンド\n載ってないかしら？\n物産展の売り物に\n取り入れなくちゃ！", 6081, 0, 1, 3, 121401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "怪盗のこと…\nお父さんお母さんに\nもし知られたら\nなんて説明しよう…", 6083, 0, 1, 1, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "たとえ怪盗でも、人の\n家にお邪魔するときは\n身だしなみをしっかり\nしないと…", 6084, 0, 1, 1, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "鍵開けって難しい…\nうーん、もっと\n練習しておかなくちゃ", 6085, 0, 1, 1, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "姿が見えない\n怪盗の噂…？\nわ、私のことじゃ\nありませんように…！", 6086, 0, 1, 1, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "予告状って…\n切手はどこに貼れば\nいいんだろう…？", 6087, 0, 1, 1, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "怪盗活動にも\n慣れてきたけど…\nやっぱり先輩が\nいないと心細いなぁ…", 6088, 0, 4, 1, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "せ、先輩の心も\nいつか盗めるかな…？\n…わわわ、私ってば\nなに言ってるんだろ…", 6089, 0, 8, 1, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "怪盗が大活躍って\n新聞で読んだ…？\nだっ、誰のこと\nでしょうね…あはは", 6090, 0, 1, 2, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "尾行に潜入…\n存在感がないのって\n意外と役立つことも\nあるんですね", 6091, 0, 1, 2, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "せせせ、先輩っ！\n帽子をぎゅーって\nかぶったら、抜けなく\nなっちゃいました…！", 6092, 0, 1, 2, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ぬ、盗み聞きなんて\nしてませんよ？\nみんなが私に気づかず\n話し始めるだけで…", 6093, 0, 1, 2, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "秘密道具が見たい？\nそ、それは内緒です！\n秘密道具ですから…\nで、でも先輩になら…", 6094, 0, 4, 2, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "えへへ\n見つかっちゃいました\n先輩はいつも私を\n見つけてくれますね…", 6095, 0, 8, 2, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございまふ…\n秘密道具のお手入れで\n夜更かししちゃって…\nちょっと眠たいです～", 6096, 1, 1, 2, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "怪盗が昼に活動する…\n案外そのほうが\n意外性が\nあるのかも…？", 6097, 2, 1, 2, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "外が暗くなりましたね\n…そろそろ怪盗の活動\n始めましょうか？", 6098, 3, 1, 2, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここでくつろぐと\n疲れが取れます～\n…今日も怪盗\nがんばろっと", 6100, 0, 1, 3, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わぁ、かわいい…！\n心を盗まれるって\nこういうことかな…？", 6101, 0, 1, 3, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "素敵な香り…でも\n服に香りがついたら\n隠れてるときに\n見つかっちゃうかな…", 6102, 0, 1, 3, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽかぽかで\nいい気持ち…\n夜道を歩く前に\n温まっておこうっと…", 6103, 0, 1, 3, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "怪盗活動に備えて\n今のうちにしっかり\n食べておかなきゃ…！", 6105, 0, 1, 3, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "女の子は秘密が\n多いほうが魅力的…？\nそ、そうなんだ…", 6106, 0, 1, 3, 121501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ドＳさんはいつも\nクウカの妄想の中に…\nぐふふ、じゅるり～♪", 6108, 0, 12, 1, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "やさしい触り方も\n嫌いじゃありません…\nは…恥ずかしいですが", 6109, 0, 12, 2, 104501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この大怪盗さまに\n盗めないものなんて\nないです！　たぶん！", 6110, 0, 1, 1, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あたしにふさわしい\nビッグなお宝は\nどこにあるですかね～", 6111, 0, 1, 1, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろーりそろーり…\n気配を消せばお菓子も\n食べ放題…にやり", 6112, 0, 1, 1, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "またサボってたのが\nバレたです…\nボスの地獄耳～！", 6113, 0, 1, 1, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ギャングで大怪盗…！\nこの肩書の多さ！\nまさに有能の証です！", 6114, 0, 1, 1, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄さんだったら…\nお宝を山分けして\nあげてもいいですよ", 6115, 0, 4, 1, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄さんはアレですよ\n大怪盗イノリさまの\n相棒みたいなものです", 6116, 0, 8, 1, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "何事も用心深さが\n大切ですよ。ビ…\nビビりじゃないです！", 6117, 0, 1, 2, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぬ、盗み聞き？\nしてないですよっ？\nぴゅーぴゅーぴゅー", 6118, 0, 1, 2, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "情報が欲しければ\nお菓子と交換ですよ\nさぁ、交換交換っ♪", 6119, 0, 1, 2, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "しーっ！\n今、尾行中なんです\n話はあとで…", 6120, 0, 1, 2, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄さんと話してると\n時間が速いような…？\nこの時間泥棒！", 6121, 0, 4, 2, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ちょうどよかった！\nいい話があるんです\n一口乗りませんか？", 6122, 0, 8, 2, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おてんとうさまが\n出てやがるですね…\n悪事がやりにくいです", 6123, 1, 1, 2, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "もうこんな時間ですか\nご飯にお昼寝…\nいやー忙しいです♪", 6124, 2, 1, 2, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふっふっふ！　夜こそ\n大怪盗の時間です！\n……ふぁあ", 6125, 3, 1, 2, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うーん…\n警備の目がないと\n気楽でいいですねぇ", 6127, 0, 1, 3, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "くう…！\nこのかわいさは\n盗めないです…♪", 6128, 0, 1, 3, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "犯行現場に残ったのは\n香水の匂いだけ…\nふふ、おしゃれ大怪盗", 6129, 0, 1, 3, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "意外とこういう場所に\n隠し扉があったり…\nしないです？", 6130, 0, 1, 3, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…\nこの美味しさ…\nとんでもない罠ですね", 6132, 0, 1, 3, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "むむむ…ちっとも\n分からないです…\nほとんど暗号ですよ", 6133, 0, 1, 3, 121601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あら、サレンさんは\nどこに行かれた\nのかしら？", 6135, 0, 1, 1, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふんふんふーん♪\nなんだか華やいだ\n気分ですわ♪", 6136, 0, 1, 1, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さて…次の事業は\nどうしましょう\n何か面白いことは…", 6137, 0, 1, 1, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おーっほっほっほ！\nあら…楽しくて、つい\n笑ってしまいましたわ", 6138, 0, 1, 1, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "センスがあって\nいいお部屋ですわね\n私も見習いたいですわ", 6139, 0, 1, 1, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "サレンさんとあのお方\n仲がいいですわね\nも、もちろん仲がいい\nのはよいことですわ！", 6140, 0, 4, 1, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "どんなときでも\n正々堂々！\nそれが私の\n誇りですわ！", 6141, 0, 8, 1, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふふ、ごきげんよう\n私、絶好調でしてよ", 6142, 0, 1, 2, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どうかされましたか？\n何かお困りごと\nでしたら\n是非力になりますわよ", 6143, 0, 1, 2, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "たまにはこうして\nゆっくりと\nお話しするのも\nいいものですわね", 6144, 0, 1, 2, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "次の事業に関して\n考え事をしてましたの\nよければ相談に乗って\nくださるかしら？", 6145, 0, 1, 2, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "よろしければ\nお話しませんこと？\nサレンさんのお話を\n聞かせてほしいですわ", 6146, 0, 4, 2, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ふふっ…\n先ほどサレンさんと\nあなたさまのお話を\nしていたところですわ", 6147, 0, 8, 2, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さあ！\n今日も一日\n全力で参りますわ！", 6148, 1, 1, 2, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼はどうしましょう\nサレンさんをお誘い\nしてみようかしら", 6149, 2, 1, 2, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もう少しだけ…\n明日の準備をして\nおかないと…", 6150, 3, 1, 2, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ～…いいですわね\nはっ、私としたことが\nはしたないですわね", 6152, 0, 1, 3, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいらしいですわ\nいくつになっても\nぎゅっと\nしたくなりますわね", 6153, 0, 1, 3, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "落ち着きますわね\nサレンさんはどんな\n香りが好きなのかしら", 6154, 0, 1, 3, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふふっ、燃え盛る\n情熱の炎…\nいいですわね", 6155, 0, 1, 3, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "このおいしさで\n元手がゼロ…\nすばらしい\n商品ですわ！", 6157, 0, 1, 3, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "これは…ふむふむ\n新しい事業のヒントに\nなりそうですわ", 6158, 0, 1, 3, 121701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さて、と…\n今日は何をしなくちゃ\nいけないんだっけ？", 6161, 0, 1, 1, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "やることは山積み\nだけど、手を動かす\nのは嫌いじゃないわ♪", 6162, 0, 1, 1, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あら？　アキノさんの\n声が聞こえたような\n気がしたんだけど…", 6163, 0, 1, 1, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アキノさんといると\nついこっちまで笑顔に\nなっちゃうのよね", 6164, 0, 1, 1, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "弱音なんか\nはいてられないわ\nアキノさんに\n笑われちゃうもの", 6165, 0, 1, 1, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "気が付けばアキノさん\nのペースだけど…\n不思議と嫌では\nないのよね", 6166, 0, 4, 1, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あたしを好敵手って\n言ってくれる\nアキノさんのためにも\nしっかりしなくちゃ", 6167, 0, 8, 1, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうしたの？\nアキノさんなら\nさっきそこに\nいなかった？", 6168, 0, 1, 2, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あたしなら大丈夫\n救護院だって\nみんなが助けて\nくれるからね", 6169, 0, 1, 2, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さっきアキノさんが\nあんたを探してたわよ\nなにかしたの？", 6170, 0, 1, 2, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こう見えてヒマじゃ\nないんだけど…\n少しくらいなら\n付き合ってあげるわ", 6171, 0, 1, 2, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ねえ、あんたと\nアキノさんって…\nううん、やっぱり\nなんでもないわ…", 6172, 0, 4, 2, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アキノさんも誘って\nお茶でもしない？\n話したいことが\nたくさんあるの♪", 6173, 0, 8, 2, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "早起きは三文の得よ\nいい一日を迎えるため\n目を覚まさなきゃ", 6174, 1, 1, 2, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日のお昼は…\nアキノさんと同席する\n予定だったわね\nあんたもどう？", 6175, 2, 1, 2, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふぁ…っと、だめね\nたるんだところを\nアキノさんに\n見せるわけには", 6176, 3, 1, 2, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ん～…\n落ち着くわね\nこのまま\n寝ちゃいそう…", 6178, 0, 1, 3, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "救護院の皆も\nぬいぐるみが\n大好きなのよ", 6179, 0, 1, 3, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りね…\nこれはアキノさんの\n趣味かしら？", 6180, 0, 1, 3, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "こんなに激しく\n燃えているのに\nあったかくて落ち着く\nまるでアキノさんね", 6181, 0, 1, 3, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "どんどん出てくる…\nこれ、救護院にも\nほしいわね…", 6183, 0, 1, 3, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…\n前にアキノさんが\n言ってたのは\nこのことかしら？", 6184, 0, 1, 3, 121801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この衣装、私には\nちょっとかわい過ぎて\n恥ずかしいな…", 6187, 0, 1, 1, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一部の人からは\n海賊より海賊らしいと\n評判の父です", 6188, 0, 1, 1, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "潮風で錆びないよう\n武器の手入れを\nしておきましょうか", 6189, 0, 1, 1, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "宝探しのお手伝いなら\n力になれると思います\n父のやる気次第ですが", 6190, 0, 1, 1, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "除霊は気を遣います\n一歩間違えると父まで\n成仏させてしまうので", 6191, 0, 1, 1, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人と見た\n海の景色を…ずっと\n忘れずにいたいな", 6192, 0, 4, 1, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "幽霊になっても\n一目会えるなら…\n私はきっとあの人に…", 6193, 0, 8, 1, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ボートを漕ぐの、少し\n上手になったんですよ\n今度お見せしますね", 6194, 0, 1, 2, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "航海に向けた\n買い出しが必要ですね\n予定は空いていますか", 6195, 0, 1, 2, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "呪われた財宝の\n解呪依頼が多くて…\nふぅ…えっと次は…", 6196, 0, 1, 2, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夜の航海では\n父が明かり代わりに\nなってくれるんです", 6197, 0, 1, 2, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "船の上では食材が\n限られるので料理の\nいい練習になります", 6198, 0, 4, 2, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この先もずっと\nあなたと一緒に\nたくさんの思い出を\n作っていきたいです", 6199, 0, 8, 2, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あの人の寝顔…\nもう少しだけ\n眺めていたいな…", 6200, 1, 1, 2, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "船の上では\n規則正しい生活が\n重要ですから", 6201, 2, 1, 2, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の海は幽霊が\n見分けやすいんです\n青白く光るので", 6202, 3, 1, 2, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海に揺られるような\n心地よさですね\n気が休まります…", 6204, 0, 1, 3, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなたも一緒に\n海を見に行きますか？\n…なんて。ふふっ", 6205, 0, 1, 3, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "爽やかな香りですね…\n一面の青い海が\n目に浮かぶようです", 6206, 0, 1, 3, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "温かい…\n潮風で冷えた体に\n沁みますね", 6207, 0, 1, 3, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あ、おいしい…\n日持ちするなら船旅に\n持っていこうかな…", 6209, 0, 1, 3, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "アンナさんに教えて\nもらった小説は…\nあ、これですね", 6210, 0, 1, 3, 122001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "なにもしないを\nしてるんだよ\nあ～いそがしいそがし", 6212, 0, 12, 1, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "はぁ～あんたといると\nどこまでも気持ちよく\nダラダラできるね～", 6213, 0, 12, 2, 102601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "暗黒騎士にして、\n伝説の海賊でもある\n私に不可能はないっ！", 6214, 0, 1, 1, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海賊団の船員、\n随時募集中です…と\nこれで新たな盟友が\n増えるはずだ…！", 6215, 0, 1, 1, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "肩に乗せるペットが\nほしいな。今のうちに\nペット用品を買いに\n行かなくては…！", 6216, 0, 1, 1, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "財宝の地図はどこで\n売っているのだろう…\n古本屋？　古物商？", 6217, 0, 1, 1, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この海賊衣装に\n身を包んでいると\n前世の新たな記憶が\nよみがえってくるな！", 6218, 0, 1, 1, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "いずれはシグルドと\n海原への冒険に\n繰り出したいな…\nきっと楽しいぞ！", 6219, 0, 4, 1, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "待ちわびたぞ盟友よ！\n私と貴様あっての\n海賊団…だからその…\n今日はそばにいてくれ", 6220, 0, 8, 1, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "シグルド！　港町で\nお魚のおすそ分けを\nもらったんだ！\n一緒に食べよう！", 6221, 0, 1, 2, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "シグルドもこのコート\n羽織ってみないか？\nふふっ、きっとすごく\n似合うと思うぞ！", 6222, 0, 1, 2, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海賊船の新たな\n秘密兵器を作ったぞ！\nシグルド、これから\n見に来ないか！？", 6223, 0, 1, 2, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "私は伝説の海賊だから\n泳ぐのだって得意だ！\nふ、深いところは\n少し怖いが…", 6224, 0, 1, 2, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふふ、いつ無人島に\n漂着してもいいように\n非常食は準備済みだ\nシグルドの分もある！", 6225, 0, 4, 2, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "冥風戦記の新章が\n完成したぞ…！\nシグルド、まずは\n貴様に読んでほしい！", 6226, 0, 8, 2, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふっ、天気明朗\n絶好の航海日和だ！\n早速海に繰り出そう！", 6227, 1, 1, 2, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼食用に魚を\n釣っておいたぞ！\nふふ、いかにも\n海賊っぽいだろう？", 6228, 2, 1, 2, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の海は真っ黒で\n少しだけ怖いな…\nシグルド、私の\nそばを離れるなよ…！", 6229, 3, 1, 2, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "大海賊がくつろぐのに\n相応しい逸品だ…！\nえっと…これ、どこの\nお店で買えますか？", 6231, 0, 1, 3, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わわ、かわいい…！\n船室のベッドに\n置いておきたいな…\n連れてってはダメか？", 6232, 0, 1, 3, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おぉ、この香りは…！\n集中力が上がりそうだ\n海賊船の船長室に\nぜひ置きたいな！", 6233, 0, 1, 3, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これが船乗りの\n伝承に聞く、海原を\nさまよう神秘の火か！\n…暖まるな！", 6234, 0, 1, 3, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "腹が減っては\n海賊はできぬ！\n…小説も書けぬ！", 6236, 0, 1, 3, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "女海賊と騎士はその後\n恋に落ち…？　恋愛\nモノではないかっ！？\nき、興味深くはあるが", 6237, 0, 1, 3, 121901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いつもの山籠もりが\nブームになるなんて…\n人生、なにが起きるか\n分からないなぁ", 6239, 0, 1, 1, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "キャンプ道具…\nいえ、キャンプギア！\nカッコいい響き…♪", 6240, 0, 1, 1, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "レッツ、ＢＢキャン！\nこのフレーズ\n流行るかも…？", 6241, 0, 1, 1, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "キャンプ仲間…\n募集してみようかな？\n友達も兼任で…", 6242, 0, 1, 1, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ユカリさんと\nジュンさん…元気かな\nまた一緒に\nキャンプしたいなぁ…", 6243, 0, 1, 1, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私の取材が載った本…\n【フォレスティエ】に\n送らなくちゃ…♪", 6244, 0, 4, 1, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もし、あの人が\n落ち込むことが\nあったら…その時は\n私が力になりたいな", 6245, 0, 8, 1, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ブッシュクラフトは\nマイフレンドくんの\nカスタムにも\n活かせる技術です！", 6246, 0, 1, 2, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "会話に花が咲く…\nって言いますよね\n私の場合、会話相手が\nお花そのものですけど", 6247, 0, 1, 2, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この服、実は…\n昔ミサト先生に\nこしらえてもらった\n物なんです！", 6248, 0, 1, 2, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "昔はやまびこで会話の\n練習をしてたんです\nほとんどオウム返しで\n気まずかったなぁ～", 6249, 0, 1, 2, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "どうもマイスターです\n…あ、すみません\nみなさんの期待に\n応えようと練習中で…", 6250, 0, 4, 2, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "たとえぼっちを\n卒業しても…\n私は一生ＢＢ団です！", 6251, 0, 8, 2, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "小鳥さんのさえずりで\n目が覚める…\n心地いいものですね", 6252, 1, 1, 2, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "キャンプといえば\nおいしいご飯です！\n腕を振るいますよ！", 6253, 2, 1, 2, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "すっかり夜ですね…\nおやすみの前に\n星でも見ませんか？", 6254, 3, 1, 2, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "都会でくつろぎ…\n自然の中でくつろぐ…\nくつろぎ無限ループ…", 6256, 0, 1, 3, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "しっかり観察すれば\nブッシュクラフトで\n再現できるかも…？", 6257, 0, 1, 3, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はぁ～…やっぱり\n木の香りを嗅ぐと\n肩の力が抜けますねぇ", 6258, 0, 1, 3, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ああ…あったまります\nなんだか心に\nゆとりがでますね…", 6259, 0, 1, 3, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "このおいしさ…！\n今度はキャンプに\n持っていこうかな…", 6261, 0, 1, 3, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…\nいろんな知識があると\nキャンプはもっと\n楽しくなりますよね", 6262, 0, 1, 3, 122101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "部屋がキャンプ用品で\n埋まっていく…\nキャンプ…なんて\n恐ろしい趣味なの…？", 6264, 0, 1, 1, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "仕事でも\nアウトドアでも\n頼れるお姉さんに\nなれたらいいなぁ…", 6265, 0, 1, 1, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この服、かわいい上に\n本当に快適ね～♪\nおしゃれにキャンプを\n楽しめて最高だわ！", 6266, 0, 1, 1, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん〜次はどんな\nキャンプ飯を\n作ろうかしら？\n彼の好物は、っと…", 6267, 0, 1, 1, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "早く週末が\n来ないかしら…\n仕事を忘れてパーっと\nキャンプ飲みを…！", 6268, 0, 1, 1, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "新しいキャンプ飯の\nレシピを覚えたわ！\n彼も喜んで\nくれるはず…よね♪", 6269, 0, 4, 1, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "彼の分の食器も\nこっそり買い揃えちゃ\nおうかな…そ、それは\nさすがにまだ早いか…", 6270, 0, 8, 1, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今度、財団主催で\n大規模なキャンプを\nやってみるのも\nいいかもしれないわね", 6271, 0, 1, 2, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ソロキャンプも\n悪くはないけど\n私はやっぱりキミと…\nな、なんでもない！", 6272, 0, 1, 2, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "キャンプのことなら\n私に聞いて。なんでも\n教えてあげるから！\n…調べた上でね！", 6273, 0, 1, 2, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "キャンプ場で飲む\n最高の一杯は\n他じゃ味わえないわ！\nさあ、乾杯っ！", 6274, 0, 1, 2, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "うん、決めた！　次は\n禁しゅわキャンプ！\nだってキミとゆっくり\n話したいんだもん♪", 6275, 0, 4, 2, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミのおかげで\n本当の最高の一杯が\n味わえたわ…\nありがとう♪", 6276, 0, 8, 2, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "んー、気持ちいい！\nキャンプが趣味に\nなってから、寝覚めが\nよくなったわ♪", 6277, 1, 1, 2, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼は私がごちそう\nするわ。キャンプ飯で\n鍛えた料理の腕前を\n披露しちゃうわよ～！", 6278, 2, 1, 2, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ寝ましょ？\n明日も朝日を眺める\nためにね。もちろん\nコーヒー付きで♪", 6279, 3, 1, 2, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "くつろぐのに\n持ってこいね～\nテントの中に置いても\nよさそうだわ！", 6281, 0, 1, 3, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふ、かわいいわね～\n…今度キャンプ場に\n連れていこうかしら？", 6282, 0, 1, 3, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うん、いい匂い…♪\nキャンプ場を思い出す\n自然の香りだわ〜", 6283, 0, 1, 3, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はぁ、温まるぅ～\n冬のキャンプで\n使ってみたいわね", 6284, 0, 1, 3, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしい～♪\nキャンプ飲みの\nおつまみに\nぴったりね！", 6286, 0, 1, 3, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "へえ…こんなキャンプ\n飯もあるんだ？\n彼、好きだったり\nするかな…", 6287, 0, 1, 3, 122201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "一生ついててやるの\n幽霊の一生は\nなっが～～～いの！", 6289, 0, 12, 1, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "む～…あんまり触ると\nすり抜けてやるの！\nウソなの。むふふ♪", 6290, 0, 12, 2, 100701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "んー…\n今日はベスちゃんと\nなにして遊ぼーかなー", 6291, 0, 1, 1, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ヴァンピィちゃんも\nけんぞくの友だちと\n仲良くなりたいな♪", 6292, 0, 1, 1, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "けんぞくのお部屋は\nヴァンピィちゃんが\n守ってあげなくちゃ！", 6293, 0, 1, 1, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お掃除するなら\nヴァンピィちゃんも\n手伝ってあげよー♪", 6294, 0, 1, 1, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふーん、ふーん♪\nけんぞくってこーゆー\nお部屋が好きなんだー", 6295, 0, 1, 1, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ひまだなー\nけんぞくをさそって\nお散歩いこっかな♪", 6296, 0, 4, 1, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今日のスープに\nけんぞくの大好物を\n入れてあげよっと♪", 6297, 0, 8, 1, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "けんぞくー！\nヴァンピィちゃんと\nお出かけしよ♪", 6298, 0, 1, 2, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "よしよし！\n今日のけんぞくも\nいい子だね♪", 6299, 0, 1, 2, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "んんー…\nやっぱりけんぞくと\nベスちゃんは似てる？", 6300, 0, 1, 2, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いーい？\nヴァンピィちゃんの\nいうこと聞くのよ？", 6301, 0, 1, 2, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ヴァンピィちゃんの\nけんぞくだもん！\n大切にするからね！", 6302, 0, 4, 2, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "えへへっ！\nやっぱりけんぞくって\nやさしー匂いがする♪", 6303, 0, 8, 2, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよー…\nヴァンピィちゃんは\nもうちょっと眠るねー", 6304, 1, 1, 2, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ヴァンピィちゃん\nひなたぼっこ\nだーいすき！", 6305, 2, 1, 2, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "んー！　夜だ♪\nヴァンピィちゃん\n絶好調だよ！", 6306, 3, 1, 2, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わー！\nふかふかだ！\nきもちぃー♪", 6308, 0, 1, 3, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいー♪\nベスちゃんに負けない\n抱き心地！", 6309, 0, 1, 3, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り…なんだろ？\nヴァンピィちゃん\n気に入っちゃった♪", 6310, 0, 1, 3, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいねー…\nヴァンピィちゃん\nずっとここにいるー…", 6311, 0, 1, 3, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "はむはむ…\nんー！\nおいしー♪", 6313, 0, 1, 3, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ヴァンピィちゃん\nこの本\n好きなんだよねー♪", 6314, 0, 1, 3, 122301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夏といえば\nかき氷だよね\n近くにお店は…", 6316, 0, 1, 1, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この格好でいるのも\nなじんできたし\nちょっと鍛錬でも…", 6317, 0, 1, 1, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "動きやすいけれど…\nいつもと違う服装は\n少し落ち着かないな", 6318, 0, 1, 1, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夏の空気に\n当てられると思わず\n気が緩んでしまうね", 6319, 0, 1, 1, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "砂浜で走ると\nいい具合に体幹を\n鍛えられそうだ", 6320, 0, 1, 1, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "終わらない夏は\nないけれど…\nつい願ってしまうな", 6321, 0, 4, 1, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "胸を張って彼と\n並び立てるよう\n私も、もっと強く…！", 6322, 0, 8, 1, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうしたの？\n行きたい場所が\nあるなら付き合おうか", 6323, 0, 1, 2, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "快晴で風は穏やか…\n絶好の釣り日和だね\nさあ、出かけようか", 6324, 0, 1, 2, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日の予定を\n立ててるんだけど…\nキミの希望も\n聞きたいな", 6325, 0, 1, 2, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ビーチスポーツか…\nキミとなら\nいい勝負ができそうだ", 6326, 0, 1, 2, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私たちの夏に\n遠慮は無用だよ\n思いきり楽しもう！", 6327, 0, 4, 2, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつかまた一緒に\n花火を見に行こう\n…約束だよ？", 6328, 0, 8, 2, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "潮騒の音で\n目覚めるのも\nいいものだね", 6329, 1, 1, 2, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今朝釣ってきた魚が\nあるんだ。これで\nお昼ご飯にしようか", 6330, 2, 1, 2, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜にもイベントが\nあるみたいなんだ\n一緒に見に行かない？", 6331, 3, 1, 2, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "気持ちが安らぐね…\nうっかり眠って…\nしまい…そうだ…", 6333, 0, 1, 3, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "肌触りのよさが\nこの格好だと\nよく分かるよ", 6334, 0, 1, 3, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "海をイメージさせる\n香りだね…\n爽やかで落ち着くよ", 6335, 0, 1, 3, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "濡れたままだと\n風邪を引いてしまうよ\nほら、キミもおいで", 6336, 0, 1, 3, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "夏を楽しみきるには\nエネルギーが\n必要だからね", 6338, 0, 1, 3, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "大切な人と過ごせる\n観光スポット紹介…\n…こ、このページは\nもういいかな！", 6339, 0, 1, 3, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "濡らしてもいいなら\n海に持っていって\n乗るのもよさそうだ", 6341, 0, 1, 3, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "こういう名画を\n見た気がするな…\nこんな視点なんだね", 6342, 0, 1, 3, 122501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "水着って\n動きやすくて\nいいよねー♪\nいっちにーさんしー♪", 6343, 0, 1, 1, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ユイちゃんにもらった\n日焼け止め\n塗っておいて\nよかった～", 6344, 0, 1, 1, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なんだか暑いなあ…\nせっかくだし\nプールで泳いで\nこようかな？", 6345, 0, 1, 1, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この格好で\n出かけようとしたら\nレイさんに\n怒られちゃった…", 6346, 0, 1, 1, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "たとえ水着姿でも\n困ってる人を見たら\n助けに行くからね！", 6347, 0, 1, 1, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "バカンス楽しかった～\nまた騎士くんと\n一緒に行きたいな♪", 6348, 0, 4, 1, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この水着、あたしに\n似合ってるかなあ？\n騎士くんはどう\n思ってるんだろ…", 6349, 0, 8, 1, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "騎士くん！\n海に行くなら\n準備運動\n忘れずにね！", 6350, 0, 1, 2, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "泳ぐ練習がしたいの？\nいいよ！　水着だから\nなにかあったらすぐに\n助けてあげるね！", 6351, 0, 1, 2, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "騎士くんの水着姿も\nかっこよかったよ！\nまた遊びに行こ！\n約束ね！", 6352, 0, 1, 2, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "このグローブの向日葵\nかわいいでしょ？\nユイちゃんが\n選んでくれたんだ♪", 6353, 0, 1, 2, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "実はこの水着\nいつも着てる\n服とおなじなんだ…\nって、冗談だよ？", 6354, 0, 4, 2, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "変な日焼けしてないか\n見てもらってもいい？\n…なし！　今のなし！\nやっぱりなしー！", 6355, 0, 8, 2, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夏のお日様に\n負けないよう\n今日も元気いっぱい\nがんばるぞー！", 6356, 1, 1, 2, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹減ってきちゃった\n騎士くんはお腹\n空いてない？\n…聞こえちゃった♪", 6357, 2, 1, 2, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日も一日\n楽しかったー！\n明日もまた\n楽しもうね！", 6358, 3, 1, 2, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふわあ…\nふわふわなのが\nいつもより\nよくわかるよー…", 6360, 0, 1, 3, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そうだ！　水着なら\n濡れてもいいし\n今度洗ってあげるね♪", 6361, 0, 1, 3, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "んー…いい匂い♪\nなんだか\n身体がぽかぽか\nしてきちゃった！", 6362, 0, 1, 3, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "水着だから、えっと…\n暖か涼しい…！\n不思議な感じー", 6363, 0, 1, 3, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "思いっきり身体を\n動かした後だから\nいくらでも\n食べちゃえるよー！", 6365, 0, 1, 3, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…\nなるほどー\n水着の種類って\nそんなにあるんだぁ…", 6366, 0, 1, 3, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "乗り心地バッチリだね\nしゅっぱつしんこー！\nなんちゃって♪", 6368, 0, 1, 3, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "わっ、ぽよんぽよん！\nトランポリンみたいで\nた～のし～！", 6369, 0, 1, 3, 122401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "彼のことを考えてると\n幸せで胸が温かくなる\n…私ったら、もう", 6370, 0, 12, 1, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "うふふふふ\nくすぐったいわ～♪\nもう、イタズラっ子ね\n次は先生の番よ～♪", 6371, 0, 12, 2, 101501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "騎士クンの汗\n拭いてあげたいな…\n余計なお世話かな…？", 6372, 0, 1, 1, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夏バテ気味かも…\nそうだ、今夜は\nかば焼きにしよう♪", 6373, 0, 1, 1, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "青い空、白い雲\n眩しい日差し…！\n夏って好きだな…", 6374, 0, 1, 1, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ヒリヒリする…？\n日に焼けちゃったかな\nふー…ふー…", 6375, 0, 1, 1, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "花火大会があるんだ…\n夜、浜辺…2人きり…\nむ、無理だよ〜！", 6376, 0, 1, 1, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "水着って不思議…\n引っ込み思案が少し\nおさまる…気がする", 6377, 0, 4, 1, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士クンとまた\n海に行きたいな…\nまた、一緒に…", 6378, 0, 8, 1, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ダ、ダイエット！？\nしてないよ！？\n元々これ位だよ…？", 6379, 0, 1, 2, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "スイカ割りのコツ？\nわたしは、騎士クンに\n教わりたいな…", 6380, 0, 1, 2, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "騎士クン。うちわで\n扇いであげるね\nどこに置いたかな…", 6381, 0, 1, 2, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うぅ…暑いね…\n騎士クン、温度計は\n見ない方がいいよ～", 6382, 0, 1, 2, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "じ、じっと見ないで…\nええっと…ちょっと！\nちょっとならいいよ…", 6383, 0, 4, 2, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "え、肝試し？\nう〜ん、うう〜ん…\n…騎士クンとなら！", 6384, 0, 8, 2, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう騎士クン\n見て、あっちの空\nもう入道雲が出てる", 6385, 1, 1, 2, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夕立、来るかなぁ…\nもし雷が鳴ったら\nそばにいてくれる…？", 6386, 2, 1, 2, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "しー。…ほら、虫の声\n…わ、わたしの心臓の\n音は気にしないで…！", 6387, 3, 1, 2, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふふ、水着でゴロゴロ\nするのってなんだか…\nいけないことみたい", 6389, 0, 1, 3, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいい～♪\n日光浴させて\nあげたいな♪", 6390, 0, 1, 3, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ほんのり潮の香りが…\n香ばしくて塩辛くて…\nあ…おなか鳴っちゃう", 6391, 0, 1, 3, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "水着、乾かせるかも…\nそうだ、みんなの分も\n持ってこよう！", 6392, 0, 1, 3, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "夏バテなんてしてたら\nみんなの足を\n引っ張っちゃうよね\nいただきます！", 6394, 0, 1, 3, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "騎士クンの、どうして\n海はしょっぱいの？\nって質問の答えは…\n分かんないよぉ～", 6395, 0, 1, 3, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "顔は怒ってるのに\nなんだかかわいい…\n誰かに似てる…？", 6397, 0, 1, 3, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "これを枕に、ビーチで\n騎士クンと…なんて…\nなんて…なんて…！", 6398, 0, 1, 3, 122601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夏休み、\n毎日たのしいな～♪\nつぎはなにしよう？", 6399, 0, 1, 1, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "自由研究、\nなににしよっかな～？\nプチグリフォンさんの\nかんさつにっきとか？", 6400, 0, 1, 1, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夏休みって、\n給食ないから…\nそれはちょっぴり\nさみしいかも…？", 6401, 0, 1, 1, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "砂浜をはだしで歩くの\nきもちいいよね♪\nくすぐったいけど\nミミ、好きなんだ～♪", 6402, 0, 1, 1, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "きれいな貝がら\n見つけちゃった♪\nミミのたからもの！", 6403, 0, 1, 1, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ミミ、浴衣を\n買ってもらったんだ♪\n今度、おにいちゃんに\n見せてあげたいな！", 6404, 0, 4, 1, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ミミ、おにいちゃんと\nいっぱい夏休みの\n思い出つくりたいな♪", 6405, 0, 8, 1, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ねえ、おにいちゃん…\n夏休みの宿題、\nわかんないとこ\nおしえてくれる…？", 6406, 0, 1, 2, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おかあさんにね、\n麦茶つくるの上手って\nほめられたんだ～♪\n飲んでみて♪", 6407, 0, 1, 2, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夏休みの宿題で\nポスターかくんだ～♪\nおにいちゃんを\nかいてもいい？", 6408, 0, 1, 2, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "線香花火やりたいな♪\nミミ、長持ちさせるの\n上手なんだよ♪", 6409, 0, 1, 2, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おにいちゃんの\n好きな本ってなあに？\nその本で読書感想文\n書こうかな♪", 6410, 0, 4, 2, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "海であそんだ後ね、\nおにいちゃんに\n髪を拭いてもらうの\nすきなんだ～♪", 6411, 0, 8, 2, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夏休みって、\nワクワクして\n早起きしちゃうよね♪", 6412, 1, 1, 2, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わぁ♪　お昼は、\n流しそうめんなんだ？\nミミ、流してみたい♪", 6413, 2, 1, 2, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こわい話聞いて、\nねむれないの…\nねえ、おにいちゃん、\nいっしょに寝ていい？", 6414, 3, 1, 2, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ちょっぴりやすんだら\nまた、いっしょに\n海であそぼうね♪", 6416, 0, 1, 3, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "すっごくかわいいね♪\nこの子のこと、\n絵日記にかこうっと♪", 6417, 0, 1, 3, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "くんくん…\nスイカのにおいだね♪\nこのにおいだいすき！", 6418, 0, 1, 3, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "およいだあとは、\nちゃんと体を\nあっためなくちゃね！", 6419, 0, 1, 3, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "夏休みのご飯って\nなんだかとくべつ\nおいしい気がするね♪", 6421, 0, 1, 3, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "夏の星座って\nすっごくきれいだね♪\nいつかみんなと\nいっしょに見たいな♪", 6422, 0, 1, 3, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "わぁ♪　この子、\nとってもかわいいね！\nおともだちに\nなりたいな♪", 6424, 0, 1, 3, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "ミミ、人魚姫に\nなったみたい！\nおにいちゃん、\nとなりにすわって♪", 6425, 0, 1, 3, 122901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "水着姿になると\nバカンス気分を\n味わえちゃうね！", 6426, 0, 1, 1, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海に行くの待ちきれ\nなくて、もう水着に\n着替えちゃった！", 6427, 0, 1, 1, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海に行ったら\nずぶぬれ系のイタズラ\nたくさんしかけよう！", 6428, 0, 1, 1, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "部屋の中で泳ぎの練習\nしよう！　にいちゃん\nも水着に着替えて！", 6429, 0, 1, 1, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お日さまとお揃いの\n水着なんだ～♪\n似合ってるかなぁ？", 6430, 0, 1, 1, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "海といえば冒険！\n海底に眠る財宝を\n見つけちゃおう！", 6431, 0, 4, 1, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "にいちゃんと一緒だと\n部屋にいても海気分♪\nスイカわりしよっか！", 6432, 0, 8, 1, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "にいちゃん！\n早く海に行く準備\nしなよ～！", 6433, 0, 1, 2, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ねーにいちゃん\n何秒息止められるか\n勝負しよーよ！", 6434, 0, 1, 2, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "にいちゃんはアイスと\nかき氷どっちが好き？\nミソギは…どっちも！", 6435, 0, 1, 2, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "日焼け止めクリーム\nキョウカに\nもらったんだ～", 6436, 0, 1, 2, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "水中メガネがあれば\n水鉄砲くらっても\n平気だね！", 6437, 0, 4, 2, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "水着なら、毎日夏休み\n気分！　にいちゃんも\n着てみなよ～！", 6438, 0, 8, 2, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "にいちゃんおはよー！\n早く顔洗って、\nいっぱい遊んじゃお！", 6439, 1, 1, 2, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "にいちゃんデザートは\nイチゴのかき氷だよ！\n…激辛ってバレた？", 6440, 2, 1, 2, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日は楽しかった～！\n明日もイタズラ日和に\nなるといいな！", 6441, 3, 1, 2, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "落とし穴の下に\nやわらかいの置けば\nケガしないよね！", 6443, 0, 1, 3, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいね～！\nこの子も海に\n連れてっちゃおうよ！", 6444, 0, 1, 3, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "このにおいを利用して\nイタズラするには…\nにいちゃんどう思う？", 6445, 0, 1, 3, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "水着を着て暖炉で\nあったまるのって、\n変でおもしろいね～！", 6446, 0, 1, 3, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "海辺で食べる\nお昼ごはんって最高♪\nってことで海行こう！", 6448, 0, 1, 3, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "いつか海を越えて、\n地図にも載ってない\n場所を見つけたいな！", 6449, 0, 1, 3, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "この口から水が出たら\nみんな驚くよね！\nぷぷ…細工しちゃお！", 6451, 0, 1, 3, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "変な音がするイタズラ\nを仕込んどいて…\n誰か座らないかな～♪", 6452, 0, 1, 3, 122801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あなた様と私の愛を\n周りに見せつけて\n差し上げましょう♪", 6453, 0, 12, 1, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "呼びましたか？\n呼びましたね？\nでは愛を語りましょう\nそうしましょう", 6454, 0, 12, 2, 102701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "水着で歩き回るのは\n恥ずかしいな…\n誰も見てないよね？", 6455, 0, 1, 1, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夏はやっぱり\nかき氷ですよね\n何色がいいかなぁ…♪", 6456, 0, 1, 1, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あの人、泳げないって\n聞きました！\n私が教えてあげないと", 6457, 0, 1, 1, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夏休みの宿題は\n計画的に進めましょう\n当たり前のことです！", 6458, 0, 1, 1, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "防犯魔石、どこに\n着けておこうかなぁ\n…ここにしようかな", 6459, 0, 1, 1, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "海の楽しみ方は\n予習済みです！\nあとは実践ですね♪", 6460, 0, 4, 1, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "水着…きっとあの人に\n見られちゃいますよね\n…褒めてくれるかな…", 6461, 0, 8, 1, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "触りたいんですか？\n…いいですよ\n帽子くらいなら", 6462, 0, 1, 2, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夏は体調管理に\n気をつけましょう\n私が管理してあげます", 6463, 0, 1, 2, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海に行くのが楽しみで\nたまらないんですか？\n私はそこまで…嘘です", 6464, 0, 1, 2, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いつもより薄着だから\nなんだか恥ずかしい…\nみ、見ないでください", 6465, 0, 1, 2, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "へんたいふしんしゃ～\nえっ？　ああ、これは\n海に叫ぶ練習です", 6466, 0, 4, 2, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたと一緒に\n海に行くなんて…\nなんだか大人…えへへ", 6467, 0, 8, 2, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\nさぁ、海に行って\n私と運動しましょう", 6468, 1, 1, 2, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あっつ～い…\nはっ！？　ダメですよ\nシャキッとしないと！", 6469, 2, 1, 2, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日も海で\n遊ぶために、しっかり\nお休みしましょうね", 6470, 3, 1, 2, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夏を楽しむときは\n休憩も大事ですよね\n計画的に、計画的に！", 6472, 0, 1, 3, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいなぁ～\n海のお土産屋さんに\n売ってるかなぁ？", 6473, 0, 1, 3, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "大人な香りがします\n私も違いが分かる\n素敵な女性になります", 6474, 0, 1, 3, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "濡れた体を\n乾かしましょう\nタオル、タオル…", 6475, 0, 1, 3, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "泳いだ後は\n栄養補給…だけど\n…おなか膨らんじゃう", 6477, 0, 1, 3, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "遊ぶだけじゃなくて\nお勉強もしてますよ\nあなたもどうですか？", 6478, 0, 1, 3, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "ミミが喜びそう…♪\nわ、私ははしゃいだり\nしませんけど…っ！", 6480, 0, 1, 3, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "ミソギがいたずらに\n使いそう…しっかりと\n試しておかないと！", 6481, 0, 1, 3, 122701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あたしがまさか\nここにいるなんて…\n自分でも不思議だわ", 6482, 0, 1, 1, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昔みたいにあちこち\n飛び回れないのって\nちょっと不便かも", 6483, 0, 1, 1, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こうして誰かと一緒に\n暮らせるのもあいつや\nみんなのおかげね", 6484, 0, 1, 1, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ここで厄介になるなら\nあたしも家事とか\n手伝わないと…", 6485, 0, 1, 1, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "…だめ！　誰かの\n世話をせずには\nいられないわ！", 6486, 0, 1, 1, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつたちが\n帰ってくるところだし\n綺麗にしないと…", 6487, 0, 4, 1, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "せっかくあたしが\nいるっていうのに\n少しは構いなさいよ…", 6488, 0, 8, 1, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おいしい店とか\n知らないの？\n食べに行きましょ", 6489, 0, 1, 2, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あんた暇でしょ？\nあたしのやること\n手伝いなさい", 6490, 0, 1, 2, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "コッコロたんと\n遊んでくるから\n留守番よろしく♪", 6491, 0, 1, 2, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あらおかえり…って\nボロボロじゃない！\nまた人助けしてたの？", 6492, 0, 1, 2, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "やっぱりあたしは\nあんたのそばが\n一番落ち着くみたい", 6493, 0, 4, 2, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "どこまでだって\nあんたと一緒に\nいてやるんだから", 6494, 0, 8, 2, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふわぁ…おはよう\n…大きくなったせいか\n朝は特に体が重いわ", 6495, 1, 1, 2, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯が食べたい？\nしょうがないわね…\nなんか作って\nあげるから", 6496, 2, 1, 2, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あんたまだ成長期だし\nさっさと寝なさい\n大きくなれないわよ？", 6497, 3, 1, 2, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "たまにはあたしも\nゆっくりしないと\nもたないのよ…", 6499, 0, 1, 3, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいじゃな～い♪\nコッコロたんに\nプレゼントしたいわ", 6500, 0, 1, 3, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りね\n塔にもこういうの\n置いておこうかしら", 6501, 0, 1, 3, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "炎か…前は\n羽が焼けそうで\n怖かったっけ", 6502, 0, 1, 3, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あむ…妖精に\n体重増減の設定って\nあったっけ…？", 6504, 0, 1, 3, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "記憶のデータと違って\n物語はいいわね\n結末が読めなくて", 6505, 0, 1, 3, 123001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "冒険のお土産\nみんなにおすそわけ\nせなあきまへんな", 6507, 0, 1, 1, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おとぎ話よりも\n不思議なことが\nあるもんやねぇ", 6508, 0, 1, 1, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "冒険しに出かけるなら\n動きやすい服装に\nせななぁ", 6509, 0, 1, 1, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "地図に水筒に…\n他に忘れもんは\nあらへんやろか？", 6510, 0, 1, 1, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これまでの冒険のこと\nノートに書いて\nまとめてますんよ", 6511, 0, 1, 1, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "王子はんとの冒険は\nどれもマホマホ王国の\n大事な歴史や♪", 6512, 0, 4, 1, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "どこへ冒険するときも\nうちと王子はんは\n一緒どす♪", 6513, 0, 8, 1, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "魔法で火ぃつける\n練習してますんよ～\nよう爆発しますけど…", 6514, 0, 1, 2, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うちと王子はんで\n冒険道具をお揃いに\nするんもええなぁ♪", 6515, 0, 1, 2, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "テント張りも随分\n上達したんよ\n王子はんのおかげやね", 6516, 0, 1, 2, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ランスロットたちの\n新しい冒険衣装\n思いついたんよ♪", 6517, 0, 1, 2, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "迷子になっても\n王子はんと一緒なら\nきっと大丈夫やね♪", 6518, 0, 4, 2, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "王子はんのこと、\nきっちり守れるように\nなってみせますえ", 6519, 0, 8, 2, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お寝坊さんは\n布団めくって\n起こしにいきますえ～", 6520, 1, 1, 2, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "支度が終わったら\n今日の冒険に\n出かけまひょか", 6521, 2, 1, 2, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうちょっと\nおしゃべりしたいん？\nあと少しだけやで♪", 6522, 3, 1, 2, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "冒険で疲れた体に\nこの癒しぱわーは\nあきまへん…すや…", 6524, 0, 1, 3, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふ、あんさんも\nうちと一緒に\n冒険します？", 6525, 0, 1, 3, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "虫除けのアロマは\n冒険の必需品どす\n忘れんようにせんと", 6526, 0, 1, 3, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うちも魔法使わんでも\n火ぃ起こせるよう\n練習せんとあかんなぁ", 6527, 0, 1, 3, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "この料理…\n冒険するときに\n作ってみまひょか", 6529, 0, 1, 3, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "王子はんとの\n愛と冒険のおとぎ話…\nはぁ…素敵やわぁ♪", 6530, 0, 1, 3, 123101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あの人との\n最良の未来のために\n占いも霊能力ももっと\n精進しなきゃ", 6532, 0, 12, 1, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あなたともっと深く\nつながりたいです\n絆も、そして魂までも", 6533, 0, 12, 2, 103101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "絆の契約…\nあやつが望むのなら\n考えぬでもないがのう", 6534, 0, 12, 1, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "なんじゃ？\nわらわの姿に\n見惚れたかの？", 6535, 0, 12, 2, 104401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "旅の荷物って多いな…\nねぇぷうきち～\nすこしは持ってよぉ～", 6536, 0, 1, 1, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "傘はなくてもいっか\nぷうきちがいるし♪\n『おいなんだと…？』", 6537, 0, 1, 1, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "旅先で人見知りなんか\nしてちゃだめだよね…\nまずはあいさつだ…！", 6538, 0, 1, 1, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おみやげはやっぱり\nご当地ぬいぐるみ\nだよね♪　ワクワク…", 6539, 0, 1, 1, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "知らない場所かぁ…\nうぅ…考えただけで\nすでにホームシック…", 6540, 0, 1, 1, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "野宿するってことは…\nお兄ちゃんのマントで\n寝るチャンスかも…！", 6541, 0, 4, 1, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "どんなに危険な冒険も\nお兄ちゃんと一緒なら\n大丈夫！　…だよね？", 6542, 0, 8, 1, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ぷうきちのアイマスク\nも腹巻も持ってくの！\n旅の必需品なの～！", 6543, 0, 1, 2, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "これ全部背負うのって\nけっこうむずかしいの\n順番まちがえると大変", 6544, 0, 1, 2, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "えへへ～\nなでなでして？　帽子\nの上からでもいいよ♪", 6545, 0, 1, 2, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "『悪いが絆創膏の部分\nはアンタッチャブルだ\n綿が飛び出ちまう』", 6546, 0, 1, 2, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんと一緒に\nもっともっといろんな\n景色が見たいな！", 6547, 0, 4, 2, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "旅って、終わる時は\nきっとさびしいよね…\nお兄ちゃん、帰り道は\n手をつないでもいい？", 6548, 0, 8, 2, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "出発が楽しみすぎて\n寝られなかった…\n『旅行のお約束だな』", 6549, 1, 1, 2, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わぁ　いいお天気！\n旅の間もずーっと\nぴーかんだといいな♪", 6550, 2, 1, 2, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "知らない場所で寝るの\n怖いな…寝る時だけ\n帰ってこようかな…", 6551, 3, 1, 2, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "旅先にはクッションも\nソファもないよね…\n『俺でいいだろ』", 6553, 0, 1, 3, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぬいぐるみのみんな\n旅の無事を\n祈ってて…！", 6554, 0, 1, 3, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "旅先の香りも\n思い出に持って\n帰れたらいいのにな～", 6555, 0, 1, 3, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "旅行用に携帯用暖炉\nがあるといいかも…！\n『まだ荷物増やす？』", 6556, 0, 1, 3, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "『もう出発だぜ？』\nえーまってまって！\n腹ごしらえがまだ…", 6558, 0, 1, 3, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "世界ってこんなに広い\nんだ…！　はやく自分\nの目で見てみたいな～", 6559, 0, 1, 3, 123201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "はちゃめちゃヒマ～\nなーんか楽し～コト\nないかなー", 6561, 0, 1, 1, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここ、いートコだねー\nこんどカリザきゅんも\nつれてこよー", 6562, 0, 1, 1, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわゆいショタが\n見た～い♪\n触りた～～～い♪", 6563, 0, 1, 1, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんか服きっついなー\nちょい太ったかー？\nん～\nま・気のせーっしょ♪", 6564, 0, 1, 1, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あ～やべ\nおねえちゃんに\nメッセすんの忘れたー\nまいっかー", 6565, 0, 1, 1, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "パンケーキ食いてー\n騎士きゅん\n誘ってみよーっと♪", 6566, 0, 4, 1, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "きょーも～\n好きぴに囲まれて～\nシ・ア・ワ・セ♪", 6567, 0, 8, 1, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "アタシと遊ばな～い？\nってなんか\nナンパみスゴー\nウケる～", 6568, 0, 1, 2, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "んー？\n今はだるいからパース\nあとでねー", 6569, 0, 1, 2, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "カリザきゅん\n見なかった～？\nおねえちゃんから\n逃げるとかオシオキー", 6570, 0, 1, 2, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ネイルしたいけど\n無理なんよねー\n爪の間にめっちゃ\nスライム入っからさー", 6571, 0, 1, 2, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おねえちゃんに\nかまってほし～の？\nかわゆ～い♪", 6572, 0, 4, 2, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "な～に騎士きゅん♪\nここでイチャイチャ～\nし・ちゃ・う～？", 6573, 0, 8, 2, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ねんむ～\nけど外から\nショタの声したんで～\nつい起きちった～", 6574, 1, 1, 2, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ランチの後はやっぱ\nデザートっしょー\nベツバラってヤツ～♪", 6575, 2, 1, 2, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こんな時間まで\n起きてるコは～\n食べちゃうぞ～♪", 6576, 3, 1, 2, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あーラクー\nいっしょーここで\nキューケーできるわー", 6578, 0, 1, 3, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なにこれ～\nかわいいじゃ～ん\nショタの次くらいに～", 6579, 0, 1, 3, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いーニオイする～\nなんのニオイとかー\nよくわかんないけどー", 6580, 0, 1, 3, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったか～♪\n溶けてスライム\n戻りそ～", 6581, 0, 1, 3, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ン・ン・ン～♪\nお・い・し～♪\nも～っと食べるぅ～♪", 6583, 0, 1, 3, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "わ～なんかムズー\n読めなー\nウケるー", 6584, 0, 1, 3, 123301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あんパンって\nお菓子に入るのかな？\nハロウィンで\nもらえたりしない？", 6586, 0, 1, 1, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お菓子をくれなきゃ\nぐうたらするぞ～！\nハロウィン以外でも！", 6587, 0, 1, 1, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お化けになったら\n仕事しないで\nゴロゴロし放題\nなのかな？", 6588, 0, 1, 1, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おっと…この仮装\n袖がすごく長いからさ\n引っ掛けないように\n気を付けないとね～", 6589, 0, 1, 1, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "イタズラするのも\n体力がいるよね～\n楽にできそうなの\n何かないかな？", 6590, 0, 1, 1, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつって\n仮装とかするのかな？\n似合いそうなのは\nどんなお化けだろ？", 6591, 0, 4, 1, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ずっとハロウィンなら\nあいつと遊び放題\nなんだけどな～", 6592, 0, 8, 1, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今の街はハロウィン\n一色だからね～\n人混みが大変だよ", 6593, 0, 1, 2, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この仮装、どうかな？\n気に入ったなら\n来年もしてあげるよ～", 6594, 0, 1, 2, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "実はこの長い袖\nドングリとかを\nため込めるんだよね…", 6595, 0, 1, 2, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "カボチャランタンが\nあるんなら\nドングリランタンも\nあっていいよね～♪", 6596, 0, 1, 2, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ハロウィンでも\nやる気があれば\nぐうたらできる…\nうん、いいこと言った", 6597, 0, 4, 2, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "一緒にお菓子食べよ？\n寝転びながら堪能する\nハロウィンスイーツは\n最高だからね～", 6598, 0, 8, 2, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お化けは寝る時間…\n今のあたしはお化け…\nだから、おやすみ～…", 6599, 1, 1, 2, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼か～…\n食後のデザートは\nハロウィンのお菓子で\n決まりだね～♪", 6600, 2, 1, 2, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふぁ～、寝よ…\nお化けは夜に\n出るものだけど\nあたしはリスだからね", 6601, 3, 1, 2, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ハロウィンを楽しむ\nためにも、ぐっすり\n寝とかないとね～", 6603, 0, 1, 3, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…袖から手が\n出せないから\nこのまま撫でよう\nよしよし", 6604, 0, 1, 3, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "リラックスできる\n素敵な香りだね～\n成仏しそうだよ～", 6605, 0, 1, 3, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいね～\nここで寝てもいい？\n…着替えないとダメか", 6606, 0, 1, 3, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…\nお化けもリスも\nお腹は空くんだよ", 6608, 0, 1, 3, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "キョンシーって\nどんなお化けなのか\n本で調べようかな？", 6609, 0, 1, 3, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "より取り見取りだね～\nとりあえず、これと\nこのお菓子はキープで", 6611, 0, 1, 3, 123501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "よし、衣装もばっちり\nハロウィンパレードへ\n出かけよう♪", 6613, 0, 1, 1, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "仮装してても\n剣は手放せないね\nほとんど体の一部だよ", 6614, 0, 1, 1, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "見回りに誘うふりして\n二人でパレードに\n参加しちゃおうかな♪", 6615, 0, 1, 1, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…あれ？　手錠の鍵\n落としちゃった…？\nやば、出かける前に\n見つけないと…！", 6616, 0, 1, 1, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お家でコスプレも\nこれはこれで楽しいな\n決めポーズの練習\nたくさんしておこう！", 6617, 0, 1, 1, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "他にも、お姫様に\nメイドさんに学生服…\nやりたいコスプレが\n多すぎるよ～", 6618, 0, 4, 1, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "漫画もゲームも好き！\n仮装するのも大好き！\n…好きを言葉にすると\nもっと好きになる♪", 6619, 0, 8, 1, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ずっと目が合ってるね\n見つめてくれるのは\nいいんだけど、今日は\n衣装を見てほしいな♪", 6620, 0, 1, 2, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "トリックオアトリート\nお菓子をくれなきゃ\n逮捕しちゃうぞ♪", 6621, 0, 1, 2, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あなたにだけはこの姿\nいつでも見せてあげる\nふふ、なんちゃって♪", 6622, 0, 1, 2, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "どうしたの？\nイタズラするなら\n隙を突かなきゃ\nこんなふうに、ね♪", 6623, 0, 1, 2, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "コスプレしてても\n剣の稽古は休まないよ\nちょっと相手になって\nくれるかな？", 6624, 0, 4, 2, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ひゃっ、びっくりした\n急に触らないでよ～\nハロウィンだからって\nイタズラしないでね？", 6625, 0, 8, 2, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！\n今日も朝から\nパトロールに行こう！", 6626, 1, 1, 2, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "カボチャのケーキを\n用意してるよ！\nデザートを食べて\n午後も頑張ろう！", 6627, 2, 1, 2, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "暗くなってきたね\nカボチャのランタンに\n火を灯そうよ♪", 6628, 3, 1, 2, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふか気持ちいい～\nあっでも衣装がシワに\nなっちゃうかも…？\n…でも気持ちいい～", 6630, 0, 1, 3, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…かわいい\nこの子もパレードに\n連れて行きたいな", 6631, 0, 1, 3, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はぁ～癒される♪\nハロウィンの見回りが\n終わった後は、\nまったりくつろごう", 6632, 0, 1, 3, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここで二人寄り添って\nカボチャスープ飲もう\n…なんて想像したら\nポカポカしてきた…", 6633, 0, 1, 3, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "パレードに参加すると\n体力を使うから、\nいっぱい食べておこう", 6635, 0, 1, 3, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "この絵本のお姫様\nかわいいね\nこの仮装もいいな♪", 6636, 0, 1, 3, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "わあ、おいしそう！\n見回りに行く前に\n少しつまんじゃおう♪", 6638, 0, 1, 3, 123601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "今日こそは、あの人に\n気持ちを打ち明けて…\nそのあとは…うう\nど、どうしよう？", 6640, 0, 12, 1, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "私が剣なら、あなたは\nさしずめ私の鞘…\nふふ、私の帰る\n場所ってことだよ♪", 6641, 0, 12, 2, 103701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "やっぱり\nコスプレしてると\nテンションあがる～♪", 6642, 0, 1, 1, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "キャラコスにも\n興味あるけど…\nマジカル、ラブリー\nどっちにしよっかな～", 6643, 0, 1, 1, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "キャラコスといえば\nミスティーシャイニー\nもいいんだよねえ…\nうはー！　悩むー！", 6644, 0, 1, 1, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ギルドハウスで\n宅コスしてる人\n実は結構\nいるんじゃないかな～", 6645, 0, 1, 1, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "コスプレだけど普段着\nって言いはれそう…\nって、ダメダメ！\nオタクは節度が大事！", 6646, 0, 1, 1, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "フェスで買ってきた\n薄い本～♪\nギルドハウスに持って\nきちゃおっかな～", 6647, 0, 4, 1, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ようこそ\nコスプレ沼へ～\nなんちゃって♪", 6648, 0, 8, 1, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "どうどう？\nナナカちゃんの\nハロウィンコスプレ\n似合ってる？", 6649, 0, 1, 2, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ハロウィン魔法少女\n参上カボ～！\n…やっぱ今の語尾\nナシで！", 6650, 0, 1, 2, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ハロウィンといえば\nトリックオア～…\nコスプレ！\nなんちゃって", 6651, 0, 1, 2, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ランフェスの\n戦利品～♪\nねえねえ\n見たい？　見たい？", 6652, 0, 1, 2, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私にしてほしい\nコスプレがあったら\n教えて♪　君のために\nや～ってやるぜぇ！", 6653, 0, 4, 2, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "一緒にコスプレしたい\nならナナカちゃんは\nいつでも大歓迎だよ♪", 6654, 0, 8, 2, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふぁあ…ねむ\nって、ありゃりゃ　\n昨日コスプレしたまま\n寝ちゃってたかあ…", 6655, 1, 1, 2, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日のお昼は\nなんにしよ？\nカボチャ料理に\nしよっかな～", 6656, 2, 1, 2, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間かあ\nそういえばオタクって\n夜行性の人が多い\n気がするぜぇ…", 6657, 3, 1, 2, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふっふっふ\nこのパニエは\n座るときはちゃんと\nふにゃってなるのさ！", 6659, 0, 1, 3, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いや～\nかわいいものをみると\n癒されますな～", 6660, 0, 1, 3, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "新しい薄い本の匂いの\nアロマとか…ダメ？\n私はあの匂い、なんか\n好きなんだよね～", 6661, 0, 1, 3, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖か～い…\nけど近づきすぎて\n衣装が燃えないように\n気を付けなきゃ", 6662, 0, 1, 3, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "コス衣装のために\n体型維持は必須だけど\nついつい\n食べちゃうんだよね～", 6664, 0, 1, 3, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "おっ、次はこの本に\nのってるキャラのコス\nしてみよっかな？", 6665, 0, 1, 3, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 12, "おおっ！\nお菓子がいっぱい！\nベルルちゃんチョコ\n入ってないかな～？", 6667, 0, 1, 3, 123701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "むっ…\nこの耳の手触り…\n驚嘆に値する…！", 6669, 0, 1, 1, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "獲物を狩りまくる…\nそんなウサギがいても\nいいだろう？", 6670, 0, 1, 1, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ワナなど怖くないぞ？\nむしろ積極的に\n踏んでいく性分だ", 6671, 0, 1, 1, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "一匹狼ならぬ\n一匹ウサギか\nどっちでもかまわん♪", 6672, 0, 1, 1, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "人間とて本を正せば獣\n本能に従えばよいのだ\n遠慮は無用さ☆", 6673, 0, 1, 1, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "脱兎のごとく…\n逃げるものか\n坊やを追い回すのさ♪", 6674, 0, 4, 1, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "獣の道は険しいが…\n坊やめ、音を上げずに\nちゃんとついてきたな\n褒めてやるとしよう♪", 6675, 0, 8, 1, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ニンジンはいらん\n好物は好敵手だ\nさぁどんどんおくれ♪", 6676, 0, 1, 2, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "尻尾に触りたいだと？\nワタシの乱数聖域を\n崩せたらな…☆", 6677, 0, 1, 2, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "頭で考えるな\n体に率直になれ\n己を野放しにするのさ", 6678, 0, 1, 2, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そうさモコフワさ♪\nなで心地は最高だが\n意外にどう猛だぞ…？", 6679, 0, 1, 2, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ワタシにピョンピョン\n跳ねてほしいのか？\nあとでじっくり、な♪", 6680, 0, 4, 2, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ワタシと番になるか？\nオマエさえよければ\nいつでもかまわんぞ☆", 6681, 0, 8, 2, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "太陽と共に目覚め\n活動する\nそれが獣の生き方さ☆", 6682, 1, 1, 2, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼寝をすればいい\nワタシが周囲を\n警戒していてやる", 6683, 2, 1, 2, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "暗くなれば眠るだけさ\nそうすれば余計な\nストレスなどたまらん", 6684, 3, 1, 2, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "むむっ！？\n尻尾がつっかえて\nうまく座れんな…", 6686, 0, 1, 3, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "愛らしさでワタシに\n張り合おうというのか\n５億年後に出直せ☆", 6687, 0, 1, 3, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "野生の芳香か…\n本能が呼び覚まされる\nいいセンスだ♪", 6688, 0, 1, 3, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "寒さも野生のうちだ\n…とはいえ\n温まっていくか♪", 6689, 0, 1, 3, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "悪くはないが物足りん\nこう見えて肉食なのだ\n肉はないのか肉は☆", 6691, 0, 1, 3, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ウサギ族は地獄耳？\nワタシとの共通点だな", 6692, 0, 1, 3, 123801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ここが私の家…\nそれはこれからも\nずっと変わらないわ…", 6694, 0, 12, 1, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ええと、その…今から\nデート…じゃなくって\n散歩でもどうかしら？\n…ふ、二人きりで…", 6695, 0, 12, 2, 106401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ギルドハウスに\nヒーロー参上！\nみんな仲良くッスよ！", 6696, 0, 1, 1, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "料理もできて\n鎧も作れる！\nお母さんはすごいッス", 6697, 0, 1, 1, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ううう…\nまたマントをドアに\n挟んじゃったッス…", 6698, 0, 1, 1, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ずっと鎧を着ていれば\nジュンさんに近づける\nかも？　燃えるッス！", 6699, 0, 1, 1, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "サインの練習…\nもっとしておいた\nほうがいいッスかね～", 6700, 0, 1, 1, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "半人前でも\n胸を張るッス！\nそのうち似合う日が\nくるッスから！", 6701, 0, 4, 1, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "種族の違いも\n強い魂があれば\n超えられるッス！\n信じてるッスよ！", 6702, 0, 8, 1, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "困ったときは\n自分を呼ぶッス！\nあと楽しいときにも\n呼んでほしいッス！", 6703, 0, 1, 2, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "特訓でも行くッスか？\n望むところッス！\n目指せ、一人前！", 6704, 0, 1, 2, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "新しいショーの台本を\n読みこんでるッス！\nところで…この言葉の\n意味、分かるッスか？", 6705, 0, 1, 2, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ヒミツがなくなると\nなんか恥ずかしいッス\nあんたはどうッスか？", 6706, 0, 1, 2, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ヒーローは遅れて\nやってくる…\nあんたもそうッスね♪", 6707, 0, 4, 2, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "誰よりも早く\nあんたに見せたいッス\n一人前になった自分！", 6708, 0, 8, 2, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うーん、今日も\nよく眠れたッス～！\n絶好調、間違いなし！", 6709, 1, 1, 2, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おお、もうお昼ッスか\nどうりでお腹が空くと\n思ったッス～えへへ", 6710, 2, 1, 2, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "パトロールのあとは\n歯みがきに宿題に…\n大忙しッスね、夜！", 6711, 3, 1, 2, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こんなにリラックス\nできるなんて…\n平和な証拠ッスね～", 6713, 0, 1, 3, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "か、かわいい…♪\nさあ、自分と握手…\nううん、抱っこッス♪", 6714, 0, 1, 3, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "優しい匂いッスね…♪\nこれくらいみんなを\n包み込めるように\nなりたいッス～", 6715, 0, 1, 3, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ひっくちゅ！　うー…\nちょっと冷えるッスね\nぬくぬくするッス～♪", 6716, 0, 1, 3, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "特訓した分、\nいっぱい食べるッス！\nでっかくなるッス！", 6718, 0, 1, 3, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "いつか自分の\nヒミツ図鑑が出たり\nして…いやいやいや", 6719, 0, 1, 3, 123901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "牢獄よりは\nマシな環境ね\n我慢してあげるわ", 6721, 0, 1, 1, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "退屈ね…\nキャルでもいじって\n暇をつぶそうかしら", 6722, 0, 1, 1, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ここにいる連中\n私を天気予報士と\n勘違いしてない？", 6723, 0, 1, 1, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "音波情報が多いわね…\nここ、もう少し静かに\nならないの…？", 6724, 0, 1, 1, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "共同生活なんて\n久しぶりだわ\n…懐かしいわね", 6725, 0, 1, 1, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの子たちのギルド\n経営が雑すぎるわ…！\n教育が必要みたいね", 6726, 0, 4, 1, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "とどめを刺される\n準備はできているのに\nまだなのかしら…？", 6727, 0, 8, 1, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "私と戦う気になった？\nあら、まだなのね…\nその時を待ってるわよ", 6728, 0, 1, 2, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私というリソースは\n有効活用しなさい\n子守なんてごめんだわ", 6729, 0, 1, 2, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どうしてそんなに\n頭がいいか？\n生まれつきよ", 6730, 0, 1, 2, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "視力は権能に\n影響しないわよ\n当たり前じゃない", 6731, 0, 1, 2, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたまで天気を\n教えろですって…？\nぶっ殺すわよ？", 6732, 0, 4, 2, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "暇なら付き合いなさい\n好きなゲームでいいわ\nどうせ私が勝つもの", 6733, 0, 8, 2, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "人生朝露…\n悔いのない一日を\n過ごしなさい", 6734, 1, 1, 2, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "午睡はいいわよ…\nふわぁ…眠りは思考に\n必要不可欠なの…", 6735, 2, 1, 2, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夙興夜寝なんて\nやめておきなさい\n休息は大切よ", 6736, 3, 1, 2, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私を満足させるなんて\n大したものね…晶に\n大量生産させるわ", 6738, 0, 1, 3, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "キャルの代わりに\nズタズタにする物が\n欲しかったの…♪", 6739, 0, 1, 3, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りじゃない\n見たことのない調合ね\n誰が用意したの？", 6740, 0, 1, 3, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "パワーが足りないわね\nもっとよ、もっと私を\n寛がせなさい", 6741, 0, 1, 3, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "栄養価はともかく\n味のバランスは\n悪くないわね", 6743, 0, 1, 3, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "つまらない本は\n私が書き直すわ\nこれはどうかしら？", 6744, 0, 1, 3, 106901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今年はアカリと\nお姉ちゃんでサンタが\n二人…つまり幸せも\n二倍ですね♪", 6746, 0, 1, 1, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "クリスマスに向けての\nサックス練習…\nお兄ちゃんと一緒に\n猛特訓です！", 6747, 0, 1, 1, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "クリスマスツリーの\n飾りつけ、完璧です♪\nお兄ちゃんお姉ちゃん\n喜んでくれるかな？", 6748, 0, 1, 1, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "わあ、お外が真っ白！\n生クリームが\nいーっぱいの\nケーキみたいです♪", 6749, 0, 1, 1, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "煙突から入ると\nお洋服が汚れちゃう…\n玄関からじゃ\nダメなのかなぁ？", 6750, 0, 1, 1, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄ちゃんが来たら\nサンタのお洋服\nいっぱい褒めて\nもらおっと♪", 6751, 0, 4, 1, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "聖夜をお兄ちゃんと\n過ごせたら…\nアカリもちょっぴり\n大人になれるかも♪", 6752, 0, 8, 1, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今のアカリは\nサンタさんですから♪\nなんでもお願いして\nくださいね？", 6753, 0, 1, 2, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お外は寒いですから\nアカリとくっついて\nお出かけしましょ♪", 6754, 0, 1, 2, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お兄ちゃんは\nアカリのトナカイさん\nですから、ずーっと\nそばにいてください♪", 6755, 0, 1, 2, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お兄ちゃん、助けて！\nアカリのカラダで\nラッピング練習したら\n絡まっちゃいました…", 6756, 0, 1, 2, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "プレゼント、いっぱい\n準備できました♪\nお兄ちゃんの分は…\nまだヒミツでーす♪", 6757, 0, 4, 2, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "アカリ、プレゼントは\n大人っぽいのがいいな\n早くお兄ちゃんに\n追いつきたいから♪", 6758, 0, 8, 2, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます♪\nふふ、アカリサンタは\nいい子のお手本なので\n早寝早起きなんです♪", 6759, 1, 1, 2, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あれ、もうお昼？\nクリスマスナンバーの\n練習してたら\nもうこんな時間…", 6760, 2, 1, 2, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "冬の夜空は星が\nキレイですね～\nお兄ちゃん、一緒に\n見に行きませんか？", 6761, 3, 1, 2, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ、快適すぎて\nとろけちゃいそう…\nこういうプレゼントも\nいいかもです…", 6763, 0, 1, 3, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "やん、かわいいです♪\nえへへ、お兄ちゃんは\nどんなプレゼントが\n欲しいですか～？", 6764, 0, 1, 3, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "わわ、大人な香り…\nロマンチックな\nクリスマスが\n過ごせそうです♪", 6765, 0, 1, 3, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "これでカラダを温めて\nアカリの温もり…\nお兄ちゃんに\nおすそ分けしよっと♪", 6766, 0, 1, 3, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お腹がパンパンです…\nでもこれで\nちょっとサンタさんに\n近づけたかも…？", 6768, 0, 1, 3, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "クリスマスイブの\n恋人との過ごし方…？\nはわわ、アカリには\nまだ早いかもです…！", 6769, 0, 1, 3, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "わっ、すごいすごい！\n不思議な絵本ですね♪\nこの本でお兄ちゃんに\nイタズラしちゃお♪", 6771, 0, 1, 3, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "アカリ、ホカホカに\nなっちゃいました～♪\n…ぎゅってしても\nいいですよ？", 6772, 0, 1, 3, 124001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "またエンジェルになる\nかもとは思ってたけど\n…サンタさん要素の\n追加は想定外だったわ", 6773, 0, 1, 1, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ラフィたちがいない\nときは私がなんとか\nしないとね\n一応…エンジェルだし", 6774, 0, 1, 1, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "部屋の飾りつけとか\nするのも…あり？\nふふ、浮かれすぎかな", 6775, 0, 1, 1, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "パーティーだったら\nみんなで大人数向けの\nボードゲームもできる\nかも…やったっ", 6776, 0, 1, 1, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この服のモコモコ…\n気づいたら触っちゃう\n…やるわね、ラフィ", 6777, 0, 1, 1, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "アイツと一緒にいると\n人見知りとは違う\n緊張があるのよね…\nって今の聞いてたっ？", 6778, 0, 4, 1, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ぬいぐるみ…\nいじめてないわよね？\n…大事にしてるって？\nそれはそれで…あうぅ", 6779, 0, 8, 1, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いい子と悪い子って\nどう見分けるのかしら\n…まさか素直さとか？\nだったら困る！", 6780, 0, 1, 2, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "プレゼントといえば\nやっぱりゲーム！\n年末商戦サイコー♪", 6781, 0, 1, 2, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "サンタさんはお仕事を\n見られちゃ\nいけないのよね？\n…天職？", 6782, 0, 1, 2, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この服は汚れ対策も\nバッチリなのよね\n煙突に入れるように\n…いや私はNGよ！？", 6783, 0, 1, 2, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "アンタのお願い…\n今なら一つくらい\n聞いてあげるわよ？\nほら、サンタ衣装だし", 6784, 0, 4, 2, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私たちって\nなぜかぬいぐるみと\n縁があるわよね\n…ふふ", 6785, 0, 8, 2, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お、おはよっ\n…ふぅ、寝ぐせを\n直すのが間に合って\nよかったぁ", 6786, 1, 1, 2, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "え…一緒にごはん？\nそ、そう…うん。OK\nまあ、せっかくだし？", 6787, 2, 1, 2, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この時間のゲームって\n妙に楽しいのよね\n…ということで、\nちょっと遊ばない？", 6788, 3, 1, 2, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ああ～ダメになるぅ…\nもうここでずっと\nゲームしてた～い", 6790, 0, 1, 3, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "プレゼントのために\n研究は必要よね、うん\n…はぁ、かわいい～♪", 6791, 0, 1, 3, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "集中力を高める香りも\nあるのよね…\n勝負をするときには\n持ち歩こうかしら", 6792, 0, 1, 3, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "なんだかまったり\nしちゃうわね…\n時間が溶けるわ…", 6793, 0, 1, 3, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お腹いっぱい\n食べられるのも\n幸せなことよね", 6795, 0, 1, 3, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ちっちゃいときは\nアカリと一緒に絵本を\n読んだなぁ…懐かしい", 6796, 0, 1, 3, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "飛び出す絵本…\nこれでゲームブックを\n作ったらおもしろく\nなる気がするわ…", 6798, 0, 1, 3, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "あったまる…\nモフモフ…ふわふわ…\nちょっと休憩しても…\nいいよね…？", 6799, 0, 1, 3, 124101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あら、どうしたの？\nもしかして、私と\n新しい実験を\n始めたくなった？", 6800, 0, 12, 1, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "調子が悪いときは\n診療所に来て\n君は特別に、じっくり\n診察してあげるわ♪", 6801, 0, 12, 2, 105101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "特別じゃなくても\nまったり過ごす\nクリスマスも\nいいものだね", 6802, 0, 1, 1, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ニットの帽子に\nマフラーに耳当て…\n素顔用の防寒対策を\n整えなければ", 6803, 0, 1, 1, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "靴下が\n見当たらなかったから\n枕元にはかわりに\n鎧を置いておこう", 6804, 0, 1, 1, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "聖女なんて言われる程\n素晴らしくはないけど\n心は聖くいたいものだ\n日々精進だね", 6805, 0, 1, 1, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "兜がないから\nイルミネーションが\nいつもよりまぶしく\n感じるよ", 6806, 0, 1, 1, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "皆の幸福を\n祈願して\nクリスマスリースを\n飾ろうか", 6807, 0, 4, 1, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私にはかわいすぎる\n衣装だが…開き直って\nクリスマス気分を\n楽しんでしまおう", 6808, 0, 8, 1, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ツリーの飾りつけ\n手伝ってくれるかい？\nセンスは少年に\nお任せするよ", 6809, 0, 1, 2, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "パーティーは\n用意してる時も楽しい\nねえ少年、この気持ち\n分かってくれるかい？", 6810, 0, 1, 2, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なんでトナカイの鼻は\n赤いのかって？\n無灯ソリ運転は違反で\n取り締まられるからだ", 6811, 0, 1, 2, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "トモちゃんや\nマツリちゃんは\nいい子だから、きっと\nサンタさんに会えるね", 6812, 0, 1, 2, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ヒイラギの髪飾り\n実は気にいってるんだ\n少年にも\n褒めてもらいたいな", 6813, 0, 4, 2, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ねえ少年…そろそろ\n見慣れてほしい\nそんなにまじまじ\n見つめられると照れる", 6814, 0, 8, 2, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝日に照らされて\n街がキラキラ白銀に\n輝いてるよ", 6815, 1, 1, 2, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯を食べて\nちょっと散歩しようか\n祝祭に沸く街は\nとてもきれいだよ", 6816, 2, 1, 2, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "やっぱりクリスマスは\n夜が本番って感じだね\nキャンドルを灯して\n厳かに過ごそうか", 6817, 3, 1, 2, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "鎧姿では無縁だったが\nふかふかしていて\n気持ちいいな…\nふかふか…ふかふか…", 6819, 0, 1, 3, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふ、かわいいね\n抱きしめると\nあの雪の日に産まれた\n赤ちゃんを思い出す", 6820, 0, 1, 3, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "兜を脱いだおかげで\nこの香りに出会えた\n…クリスマスの魔法も\n悪くないかもね", 6821, 0, 1, 3, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "指先から体の芯まで\n暖まるね\nこれなら雪の日でも\n安心だよ", 6822, 0, 1, 3, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐ、もぐ…\nあまり食べるところ\n見ないでほしい", 6824, 0, 1, 3, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "素敵なレストランの\n特集記事が載ってる\n聖夜に予約が取れたら\n最高に幸せだろうね", 6825, 0, 1, 3, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "わっ！\n…………いや\n驚いてなどいない", 6827, 0, 1, 3, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "ふふ…頬に直接\nふかふかを感じられる\n温かくて気持ちいいよ", 6828, 0, 1, 3, 124201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ピアノに読書…\nグレアと一緒に\nなにをしようかな～♪", 6829, 0, 1, 1, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "元の世界へ戻った時\n授業に遅れないよう\nグレアと勉強しとこう", 6830, 0, 1, 1, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "街に魔物料理屋さんが\nあるんだ！　グレアと\n食べに行ってみよう♪", 6831, 0, 1, 1, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "せっかく新しい魔法を\n覚えたし、グレアにも\n見てもらいたいな！", 6832, 0, 1, 1, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "グレアも誘って\nランドソルをもっと\n探索したい！", 6833, 0, 1, 1, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私たちも\nあの人を見習って\nバイトとかしよう！", 6834, 0, 4, 1, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつかあの人を\n私たちの学院に\n招待したいな！", 6835, 0, 8, 1, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あのね！\nこれからグレアと\n魔法愛好会に\n行くんだ！", 6836, 0, 1, 2, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "これからなにするの？\n私たちもついて行って\nいいかな！？", 6837, 0, 1, 2, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "グレアと一緒に\nあなたも魔法の練習\nしてみない？", 6838, 0, 1, 2, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "グレアとよく話すの\nマナリアの制服\nあなたに着せたいって", 6839, 0, 1, 2, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "グレアのそばって\n温かいんだ～！\nぬくぬくだよ～♪", 6840, 0, 4, 2, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたは\nグレアと私の友達！\nこれからもずっと！", 6841, 0, 8, 2, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！\n今朝はグレアと一緒に\n外を散歩してきたよ！", 6842, 1, 1, 2, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹空いたな…\nよし、グレアと一緒に\n魔物料理を作ろう！", 6843, 2, 1, 2, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間だね\n明日のために\nそろそろ寝ようかな！", 6844, 3, 1, 2, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ～この感触…\nグレアの尻尾みたいで\n安らぐ～", 6846, 0, 1, 3, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぬいぐるみって\nいいよね…私もよく\nグレアに抱き付くんだ", 6847, 0, 1, 3, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り～…\nグレアもこういうの\n好きなんだよ！", 6848, 0, 1, 3, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいね～…\nグレアにくっついてる\n時を思い出すよ～…", 6849, 0, 1, 3, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "この世界にしかない\nおいしいものが\nたくさんあるよね！", 6851, 0, 1, 3, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "世界を繋ぐ魔法の\nヒント…本に書いて\nないかなぁ…", 6852, 0, 1, 3, 124301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ピアノに読書…\n今日のアンは\nなにをするのかな…", 6855, 0, 1, 1, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私はアンほど\n勉強はできないから\nちゃんと自習しないと", 6856, 0, 1, 1, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "一度始めたら\nとことん追求するのが\nアンなんだよね…", 6857, 0, 1, 1, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふふ…夢中になってる\nアンを眺めてるだけで\n一日があっという間…", 6858, 0, 1, 1, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ランドソルは広いね…\nアンと一緒にいろんな\n場所へ行ってみたい", 6859, 0, 1, 1, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "アンやあの人の笑顔を\n見てると、すごく\n安心するんだ…", 6860, 0, 4, 1, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もしあの人が私たちの\n学院に編入したら…\nふふ、楽しそうだね", 6861, 0, 8, 1, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "アンもあなたも\nすごいな…\nみんなとすぐに\n仲良くなっちゃうから", 6862, 0, 1, 2, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あなたはこれから\nなにをするの？\nその…アンと一緒に\nついていってもいい？", 6863, 0, 1, 2, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "アンから魔法の練習に\n誘われた？　実は私も\n…一緒にどうかな？", 6864, 0, 1, 2, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あなたがマナリアに\n編入したら\n楽しいのになって\nアンとよく話すんだ…", 6865, 0, 1, 2, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "こっちの世界にも\nアンのように\n私を受け入れてくれる\n人たちがいるんだね…", 6866, 0, 4, 2, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "元の世界へ帰る日が\n来たとしても私たちは\n「さよなら」より\n「またね」がいいよね", 6867, 0, 8, 2, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう。さっき\nランドソルの朝日を\nアンと見てきたんだ", 6868, 1, 1, 2, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私たちは\nこれからなんだけど\nあなたはお昼ごはん\n何を食べたの？", 6869, 2, 1, 2, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ\nアンが眠る時間だ…\nあなたもおやすみ", 6870, 3, 1, 2, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ、疲れが取れる…\nこの尻尾…\nちょっと重いんだよね", 6872, 0, 1, 3, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "これ…\nアンに見せたら\n喜ぶだろうな…", 6873, 0, 1, 3, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り…\nアンの感想も\n聞いてみたいな", 6874, 0, 1, 3, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかい…\nアンがここにいたら\n本を読みながら\n寝ちゃうんだろうな", 6875, 0, 1, 3, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おいしいからたくさん\n食べれちゃうけど\nまた尻尾…\n大きくなっちゃうかな", 6877, 0, 1, 3, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "アンがおススメ\nしてくれた本は\nこれかな…？", 6878, 0, 1, 3, 124401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "凶、凶、凶…大凶？\nなによこのおみくじ\n自宅用だからって\n排出率が適当すぎよ…", 6881, 0, 1, 1, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今年こそ最高の新薬が\nもはや偶然に近い\n最小限の手間で\n作れますように", 6882, 0, 1, 1, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "喉に詰まる前に\n溶けてなくなるお餅…\n最優先の研究課題だわ", 6883, 0, 1, 1, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "よし、完成♪\nミツキ特製…\n「新解釈おせち料理」\n医学的根拠が満載よ", 6884, 0, 1, 1, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お年玉を彼に…\nあげるべき…？\n色んな意味で微妙ね…", 6885, 0, 1, 1, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふふ、今年もまた一年\n彼のバイタルを\n記録できるのね♪", 6886, 0, 4, 1, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今年こそ\n私の薬で彼を魔改造…\nううん、大人の男に！", 6887, 0, 8, 1, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "コマ回しのコマを\n見てたら目が回った？\nそう…手当は不要よ…", 6888, 0, 1, 2, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私の顔で\n福笑いを作った？\nあら…隻眼まで\n再現度が高いわね♪", 6889, 0, 1, 2, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "門松よし、しめ縄よし\nこんなギルドでもね\n一応縁起を担ぐのよ", 6890, 0, 1, 2, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "本気の薬草を煮込んだ\n本気の七草粥よ\n色は気にしちゃダメ", 6891, 0, 1, 2, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "君が今年も健康で\nつつがなく…実験台を\n務められますように", 6892, 0, 4, 2, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いくつ新年を迎えても\n俗世の垢にまみれない\nそんな君こそが…\n私には最高のお薬よ", 6893, 0, 8, 2, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お正月なんだから\nいつまでも寝てないで\nさぁ、実験開始よ♪", 6894, 1, 1, 2, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "カルタも双六もしたし\nあとは実験くらいしか\nやることがないわね", 6895, 2, 1, 2, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "日頃からたいがい\n意味深な夢を見るけど\n初夢はまた別かしら…", 6896, 3, 1, 2, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さすがにこの格好で\n寝正月を敢行するのは\nためらわれるわね", 6898, 0, 1, 3, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "や、闇医者たる者\nこんな愛くるしい物に\n心奪われるわけには…", 6899, 0, 1, 3, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お雑煮のいい香り…\n食欲が増進されるわ\nアロマも立派なお薬ね", 6900, 0, 1, 3, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "胸元は閉じないわよ？\nでも時々ここで\nこっそり暖まるの…", 6901, 0, 1, 3, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "無から有が生まれてる\n新年早々物理の法則を\n無視してくるのね…", 6903, 0, 1, 3, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "どれもこれも読んだわ\n新しい婚活本の\n入荷はまだかしら…", 6904, 0, 1, 3, 124701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "彼が一生懸命\n書いてくれた年賀状\n気持ちがこもっていて\nすごくうれしいわ♪", 6906, 0, 1, 1, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "しっかり丁寧に\n大掃除したから\nとってもいい気持ちで\n新年を迎えられたわ♪", 6907, 0, 1, 1, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "彼の着物姿\nきっと凛々しいわよね\n想像しただけで\n笑顔になるわ～♪", 6908, 0, 1, 1, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お雑煮は地域によって\n違いがあるけれど\n愛情が隠し味なのは\nどこも一緒よね♪", 6909, 0, 1, 1, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "彼と凧揚げして\n遊びたいけど\n森では引っかかって\nできないかしら…？", 6910, 0, 1, 1, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "今年も彼が素直に\n成長できるように\nたくさんいい子いい子\nしてあげましょう…♪", 6911, 0, 4, 1, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "絵馬に彼と\n書いた通り\n今年もみんなが笑って\n過ごせますように", 6912, 0, 8, 1, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "先生と初詣に\n行きましょう〜♪\n迷子にならないように\n手を繋いで、ね？", 6913, 0, 1, 2, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "初売りセールいいわね\nでも気を付けないと\nあれこれ欲しくなって\n買い過ぎちゃうかも…", 6914, 0, 1, 2, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "風邪をひかないように\n温かくするんですよ～\nえ？　先生、温めて？\nふふ、甘えん坊さんね", 6915, 0, 1, 2, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あなたのために\nちょっと豪華なおせち\n用意したのよ\nお口に合うかしら？", 6916, 0, 1, 2, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたも着物着たい？\nふふ、貫禄出ちゃって\n先生ドキドキ\nしちゃうかも…♪", 6917, 0, 4, 2, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたの成長は\nとってもうれしいけど\n今年もまだ、あなたの\n先生でいたいな…♪", 6918, 0, 8, 2, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あら、起きたの？\nお雑煮できてるから\nちゃんとお顔\n洗ってらっしゃいね", 6919, 1, 1, 2, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯を\nしっかり食べて\nみんなでかるた大会\nしましょう〜♪", 6920, 2, 1, 2, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "は～い、良い子は\nもう寝る時間ですよ\n素敵な初夢が\n見られますように♪", 6921, 3, 1, 2, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このフカフカちゃんも\n天日干ししたいけど…\nその前にちょっと\n休憩しちゃおうかしら", 6923, 0, 1, 3, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うふふ、かわいい～\nアオイちゃんや\nハツネちゃんも\nきっと気に入るわね♪", 6924, 0, 1, 3, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お正月は空気も\n透き通ってるから\nいつも以上に\n素敵な香りに感じるわ", 6925, 0, 1, 3, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "火のぬくもりに\n抱かれていると\n不思議と眠気が…\nふああ…", 6926, 0, 1, 3, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "愛情のこもった料理は\nおいしいだけじゃなく\n心も満たされちゃう♪", 6928, 0, 1, 3, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "お正月のお作法も\nたくさんあるのね～\n先生も日々勉強だわ～", 6929, 0, 1, 3, 124601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "少年への感謝をどんな\n形で伝えるべきか…\n言葉よりも物の方が\n良いのだろうか？", 6931, 0, 12, 1, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "話し相手になって\nもらってもいいかな？\n少年と一緒にいると\nとても楽しいんだ", 6932, 0, 12, 2, 104701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お正月だからって\nギャングのボスは\n油断できないよ～？", 6933, 0, 1, 1, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "イノリちゃんがお年玉\n欲しいんだって♪\n悪い子だったし\n10ルピでいいかな☆", 6934, 0, 1, 1, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お正月だからお雑煮を\n作ったんだけど\nカヤちゃんには\n大好評だったよ♪", 6935, 0, 1, 1, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ラーゴがお餅を\n食べたがってるけど…\nこの子にあげるのは\nちょっと心配かな～？", 6936, 0, 1, 1, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お正月は晴れ着の子が\nやっぱり多いよね～\n今度、私の漫画でも\n出してみようかな？", 6937, 0, 1, 1, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "君と二人っきりで\n神殿に初詣…\n行ってみたいな～♪", 6938, 0, 4, 1, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "君とお正月を\n過ごしていると\n面倒なことも\n全部忘れられそう…", 6939, 0, 8, 1, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この着物、どう思う？\n似合ってたら\nうれしいけどな～♪", 6940, 0, 1, 2, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "袖を引っ張ったり\nしないでね？\n着崩れしちゃうから♪", 6941, 0, 1, 2, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お正月ならではの\n漫画ネタってある？\n参考にしたいんだよね", 6942, 0, 1, 2, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "昔は凧あげとか\n駒回しとかしてたけど\n大人になるとそういう\n機会も減るよね…", 6943, 0, 1, 2, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "君にもお年玉を\nあげようか？\n好きな額を言ってね☆", 6944, 0, 4, 2, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "来年も、再来年も…\nこうしてみんなで\n新年がお祝いできると\n素敵だね～♪", 6945, 0, 8, 2, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよ～♪\n朝ごはんは\n焼いたお餅とか\nどうかな？", 6946, 1, 1, 2, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼だね～\nおせちを用意したから\nみんなで食べよっか", 6947, 2, 1, 2, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間だね～\n一日中着物だったから\n肩が凝っちゃったよ", 6948, 3, 1, 2, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "このまま寝たら\nしわになるかな？\n着替えた方がいい？", 6950, 0, 1, 3, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こういうのって\nラーゴのおもちゃに\nちょうどいいかも♪", 6951, 0, 1, 3, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りだけど\n着物に移らないように\n気をつけないとね", 6952, 0, 1, 3, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ちょうどいい\n火加減だね♪\nぽかぽかするよ～♪", 6953, 0, 1, 3, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "着物の時は\nほどほどにしないと…\n欲張ったら、お腹が\n苦しくなるからね～", 6955, 0, 1, 3, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふーん\nイノリちゃんは最近\nこんな漫画を\n読んでるんだ～♪", 6956, 0, 1, 3, 124501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "楽園の気配は…ナシ！\nみんな前を向いてるね\nそうこなくっちゃ！", 6958, 0, 1, 1, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "レッスンの成果も\nこの格好くらい\n目に見えたら\n分かりやすいのになぁ", 6959, 0, 1, 1, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "次の曲はワイルドで\n悪い感じもいいなぁ…\nカヤとムイミちゃん\nみたいなイメージで！", 6960, 0, 1, 1, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "私…服、着てるよね？\nうんうん、着てる！\nあんまり体が軽いと\n急に焦る瞬間あるな～", 6961, 0, 1, 1, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "最近ファンの年齢層が\n幅広くなってきたかも\nこれって私…国民的\nアイドルに近づいた？", 6962, 0, 1, 1, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "パティスリーとコラボ\nしたらどんな感じかな\n…ノゾミンマカロン♪\nとか？　…いけるかも", 6963, 0, 4, 1, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "彼と一緒にいると…\nうれしくって苦しいな\nでも両方諦められない\n…アイドルらしいや", 6964, 0, 8, 1, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この格好、チカと\nツムギも似合うと\n思うんだけどな～\nキミもそう思うよね？", 6965, 0, 1, 2, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "街を歩いてたらね？\nライブとか写真集の\n告知イベントだって\n思われちゃった！", 6966, 0, 1, 2, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私が持ってた剣に\n結んであったリボン…\n何か気づいてくれた？\nヒントは…色だよ♪", 6967, 0, 1, 2, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "キミの気配ってすごく\n分かりやすいんだよ\n近くにいたらすぐに\nピンとくるんだ♪", 6968, 0, 1, 2, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あ、それ…はじめて\nキミにあげた音響盤！\nね、一緒に聴こうよ", 6969, 0, 4, 2, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ぼうっとしてたら\nイタズラしちゃうよ♪\nもっともっと私のこと\n見てないとダーメ！", 6970, 0, 8, 2, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝は今日のはじまり！\n昨日よりももっと\nいい一日にしようね♪", 6971, 1, 1, 2, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "レッスンがんばったし\nまだお昼だし…\nランチ大盛りにしても\nセーフだよね！", 6972, 2, 1, 2, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "寝る前に明日の予定を\n確認しておかないと！\nえっと、集合場所は…", 6973, 3, 1, 2, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "一休みのつもりが\nなが～い休憩になるの\nあるあるだよね～", 6975, 0, 1, 3, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ノゾミンの熱烈ハグ♪\n…ここだけ聞いたら\nスクープになっちゃう\nかも？　なーんて！", 6976, 0, 1, 3, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "香りってなんだか\n記憶に残るよねー\n…こういうの私だけ？\nみんなも同じだよね？", 6977, 0, 1, 3, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "なんだかライブの\n熱気を思い出して\nきちゃった…！\nレッスンしよっと！", 6978, 0, 1, 3, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お腹が減ってたら\nいいパフォーマンスは\nできないもんね！\n…んー、おいし～♪", 6980, 0, 1, 3, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "いい歌詞を書くには\nしっくりくる言葉を\n知っておかないと！", 6981, 0, 1, 3, 124801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "うだうだ悩んでる\nヤツがいたら\nオレのとこ連れてこい\n背中押してやるからさ", 6983, 0, 1, 1, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "最近どことなく\nファミリーの連中が\n浮き足立ってんだよな\n…なんでだ？", 6984, 0, 1, 1, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "イノリのヤツ\nやたらと脇腹\nつついてきやがって…\nくすぐったいっての", 6985, 0, 1, 1, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "身軽になったのは\nいいが…くそっ\nどこもかしこも\nスースーする…", 6986, 0, 1, 1, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "思い出に浸るのも\n悪くはないが\nやっぱ人間\n未来に生きないとな！", 6987, 0, 1, 1, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "またムイミやノゾミと\nツルむのもいいな\nそこにカレもいたら\nなおいいぜ", 6988, 0, 4, 1, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "未来のことを考えると\nなぜかいつもカレが\n頭に浮かんじまう…\nええい、やめだやめ！", 6989, 0, 8, 1, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちょっくらオレと\n腕相撲しねえか？\nこの新しい力\n試させてくれ！", 6990, 0, 1, 2, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "なあ、悪いが上着\n貸してくれないか？\nこのカッコ、割と\n肌寒いんだよ…", 6991, 0, 1, 2, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おっ、生まれ変わった\n喧嘩屋にご用命か？\nいいぜ、キミの\n依頼なら二つ返事だ！", 6992, 0, 1, 2, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんか悩みごとが\nあるなら、なんでも\n話してくれよな\nオレとキミの仲だろ？", 6993, 0, 1, 2, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "このカッコが\nきれいだって？\nや、やめろよ…\n照れくさいだろ…", 6994, 0, 4, 2, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミがいると、なにを\nするにも退屈しないぜ\nだから今日も\n付き合ってくれよな！", 6995, 0, 8, 2, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう！　新しい\n未来がやってきたぜ！\n一秒だって時間は\n無駄にするなよ？", 6996, 1, 1, 2, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そろそろ昼飯に\nしないか？\n穴場のうまい店に\n案内してやるからさ", 6997, 2, 1, 2, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜更かしは\n未来の前借りだ\n体壊さないように\nほどほどにしとけよ？", 6998, 3, 1, 2, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お、いいなこれ\nファミリーの\nアジトにも\n置いときたいぜ", 7000, 0, 1, 3, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "べ、別にかわいいもん\nなんて、そんなに\n好きじゃないし…\n嫌いでもないけどさ", 7001, 0, 1, 3, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "嗅いだことない\n香りだな\nなかなか気に入った！", 7002, 0, 1, 3, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "薄着で暖を取るのって\n最高にぜいたくだよな\nへへっ、堪能させて\nもらうとするか", 7003, 0, 1, 3, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "こいつはいいや\nこのカッコだと\n消耗が激しくて\nやたら腹が減るからな", 7005, 0, 1, 3, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "甘辛コーデ…\nへぇ、そんなのが\nあるのか…\nわ、悪くねえかもな", 7006, 0, 1, 3, 124901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "はぁ…\nもっともっと長い時間\n先輩と過ごせたらなぁ", 7008, 0, 12, 1, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "えへへ…♪\n先輩が、すぐそばに\nいてくれるなんて…\n幸せだなぁ…♪", 7009, 0, 12, 2, 105501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "はーっはっは！\n強くてカッコいい\n大悪党、ここに参上！", 7010, 0, 1, 1, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "みんなおしゃれで\nカッコいいけど\n今のアタシも\n負けてないぞ！", 7011, 0, 1, 1, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ギャングのアジトも\nよかったけど\nここも賑やかで\n悪くないな！", 7012, 0, 1, 1, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "悪党にも休息は必要だ\nここならゆっくり\n休めそうだ！\n邪魔するぞ！", 7013, 0, 1, 1, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "いっぱい人がいるな…\nアタシの悪党っぷりを\n広めるチャンスだ！", 7014, 0, 1, 1, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ここにいれば\nいい思い出がたくさん\n作れそうだな！", 7015, 0, 4, 1, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつかアタシも\nオクトーと一緒に\nこんなアジトを手に\n入れてやるからな！", 7016, 0, 8, 1, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ん？　アタシの格好が\n気になるのか？\nならもっと近くで\n見てもいいぞ！", 7017, 0, 1, 2, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おい、暇だから\nアタシと遊べ！\nカヤとノゾミも呼んで\n大騒ぎするぞ！", 7018, 0, 1, 2, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "オマエ、前より強く\nなってないか！？\nくっそー！　アタシも\n負けてらんないぞー！", 7019, 0, 1, 2, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今日は特別にアタシの\n思い出話を聞かせて\nやる！　さーて、どの\n悪事から話そうか…", 7020, 0, 1, 2, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "オマエとの付き合いも\n結構長くなったよな？\nこれからも\nよろしく頼むぞ！", 7021, 0, 4, 2, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "オマエまでいなく\nなったらアタシが困る\n勝手にどっか\n行くんじゃないぞ！", 7022, 0, 8, 2, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "起きろ、起きろー！\n大悪党の朝は早いんだ\nさっさと\n顔洗ってこい！", 7023, 1, 1, 2, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼飯どうしようか…\nそうだ！　オマエの\nおススメに連れてけ！\nいい店期待してるぞ！", 7024, 2, 1, 2, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日を思い切り\n楽しむためにも\n早く寝とけよ！\nまた明日な！", 7025, 3, 1, 2, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こうやって座ると…\nおお！　すっごく悪党\nっぽいぞ！", 7027, 0, 1, 3, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "オマエ、仲間に\nなりたそうな目を\nしてるな！", 7028, 0, 1, 3, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うん、いい匂いだ！\n何の匂いかは全然\n分かんないけどな！", 7029, 0, 1, 3, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "炎ってなんだか\nカッコいいよな！\n見てるだけで心が\n燃えてくるぞ！", 7030, 0, 1, 3, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いっぱい食べれば\nちょっとは\n背が伸びるかな…？", 7032, 0, 1, 3, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ぐぬぅ…たまには\n本でもと思ったけど\nやっぱりアタシは\nバトル担当だな！", 7033, 0, 1, 3, 125001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お邪魔しまーす★\nなーんてもう\nすっかりくつろいで\nますけどー♪", 7035, 0, 1, 1, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "騎士さんの\nギルドハウス…★\nなんだかドキドキ\nしちゃいます♪", 7036, 0, 1, 1, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぺんぽこりんの\n置き場所はー…\nま、このへんで★", 7037, 0, 1, 1, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うーん、これは\n壊しがいがありそ…\nウソウソ、冗談です★", 7038, 0, 1, 1, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "オトモダチでも\n作ってみますかー\nくすっ★", 7039, 0, 1, 1, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "退屈ですねー\n騎士さん、構って\nくれないかなー", 7040, 0, 4, 1, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もっともっと早く\n騎士さんに逢えてたら\n…なんて、わたし\nらしくないですね", 7041, 0, 8, 1, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "わたし一人にするの\n不安だったりします？\nちゃーんとイイコに\nしてますってー★", 7042, 0, 1, 2, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お出かけします？\nそれともおうちで\nまったりしますー？", 7043, 0, 1, 2, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "女の子をすぐ家に\nあげちゃうなんて…\nふふ、やっぱり隅に\n置けないですねー★", 7044, 0, 1, 2, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "騎士さん騎士さーん★\nウザ絡みしても\nいいですかー？\n騎士さんってばー★", 7045, 0, 1, 2, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "一緒にゴロゴロ\nしませんかー？\nコイビトっぽくて\n楽しそうですし♪", 7046, 0, 4, 2, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "うふふ★\nこーやってあなたに\n優しくされると…\nときめいちゃいます♪", 7047, 0, 8, 2, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます★\nあれれー？\nまだおねむですかー？", 7048, 1, 1, 2, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "騎士さん、お昼は\nもう食べましたー？\nわたし、ラーメンが\n食べたいでーす★", 7049, 2, 1, 2, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あ、夜更かししてちゃ\nダメですよー？\nほらほら、お布団に\nごーごー★", 7050, 3, 1, 2, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふかのふわふわー\nついついまーったり\nしちゃいます★", 7052, 0, 1, 3, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かっわいー★\n名前はー、んー…\nぱんぱかぷんで★", 7053, 0, 1, 3, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "くんくん★\nうーん…\nたぶん素敵な香り♪", 7054, 0, 1, 3, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかーい★\n心も体も\nぽっかぽかですねー★", 7055, 0, 1, 3, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ★\nんー、おいしくって\n止まらないですねー★", 7057, 0, 1, 3, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "へー★\nほほー★\nふんふーん★", 7058, 0, 1, 3, 118201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さ～て時間もあるし\nラテアートの練習でも\nするかにゃ～♪", 7060, 0, 1, 1, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "カフェの猫たちも\n元気に働いてくれて\nお客さんからの評判も\n上々にゃ～♪", 7061, 0, 1, 1, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "カフェのカウンターに\nファントムキャッツの\n目安箱を置こうかにゃ", 7062, 0, 1, 1, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あんこもコーヒーも\n原料は豆にゃ～\nそりゃ相性いいに\n決まってるにゃ♪", 7063, 0, 1, 1, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あいつの為に\nタマキ特製ブレンドを\n開発したいにゃ♪", 7064, 0, 1, 1, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつと働いてると\nなぜかあっという間に\n閉店時間が\n来ちゃうのにゃ～", 7065, 0, 4, 1, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あいつといると\n新しいアイデアが\n溢れるほど\n出てきちゃうのにゃ♪", 7066, 0, 8, 1, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "キミがコーヒーを\n淹れてくれたのにゃ？\nにゃはは、常温で\n猫舌にも優しいにゃ♪", 7067, 0, 1, 2, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "料理が上手くなったら\nカフェご飯メニューも\n充実させたいにゃ～", 7068, 0, 1, 2, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お店の経営は大変\nだけど、キミとなら\n乗り越えられるって\n確信してるにゃ！", 7069, 0, 1, 2, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん？　この制服\n似合ってるにゃ？\nにゃはは！　褒めても\n１ルピも出ないにゃ♪", 7070, 0, 1, 2, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あたしが好きなのは\n猫に好かれる人にゃ♪\n…ん、キミ猫に懐かれ\nまくってるにゃ…", 7071, 0, 4, 2, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミの制服姿\nけっこーイケてるにゃ\nあたしがお客さんなら\n通いつめちゃうにゃ♪", 7072, 0, 8, 2, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝は一杯の\nコーヒーから始まる…\nにゃふふん♪\nシャレた朝だにゃ～♪", 7073, 1, 1, 2, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼はたい焼きと\nコーヒーのセットで\nまったり休憩\nしようにゃ～♪", 7074, 2, 1, 2, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "コーヒー淹れたにゃ\n星空を見ながら\n二人で飲もうにゃ…♪", 7075, 3, 1, 2, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふにゃ～ん…ゴロゴロ\nコーヒーと同じくらい\n癒されるにゃ～…♪", 7077, 0, 1, 3, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こいつかわいいにゃ～\nうちの猫たちとも\nいい勝負なのにゃ！", 7078, 0, 1, 3, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん～いい香りだにゃ～\nコーヒーもそうだけど\n香りの癒し効果は\n抜群にゃ～♪", 7079, 0, 1, 3, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "猫に暖かいものは\nまるまれと言ってる\nようなもんにゃ…♪\nまるまる…", 7080, 0, 1, 3, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "にゃは～うまいにゃ♪\nカフェの新メニューに\n採用しちゃおう\nかにゃ～♪", 7082, 0, 1, 3, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "にゃるほど…\n調べれば調べるほど\nコーヒーは\n奥が深いのにゃ…", 7083, 0, 1, 3, 125101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ワタシの手料理は\n坊やの口に合うらしい\n胃袋は討ち取ったぞ♪", 7085, 0, 12, 1, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "胸に再度触れると\n誓約は無効になるのか\n…だと？　鋭い質問だ\n安心しろ。ならん☆", 7086, 0, 12, 2, 107101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ようやくこの服にも\n慣れてきたかな？\nふふっ、たまには\nこういう服も悪くない", 7087, 0, 1, 1, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日も店は好調だが、\n私は軍人だからな\n当初の目的も\n忘れないようにしよう", 7088, 0, 1, 1, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "猫が近くに来ると\nついつい見てしまうな\n仕事が終わったら\n遊んでやるかな♪", 7089, 0, 1, 1, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "コーヒーの淹れ方が\nうまくなってきたな♪\nどうせならお菓子も\n研究してみるか！", 7090, 0, 1, 1, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "利益を考えると\n価格をあげるべきか？\n…いや、利益よりも\n皆の笑顔の方が大事だ", 7091, 0, 1, 1, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "またあいつを\n呼んでしまったな…\n今度、コーヒーでも\n淹れて労ってやるか♪", 7092, 0, 4, 1, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "次に入荷するお菓子は\nあいつの意見を聞くか\nどんな味が好きか\n気になるしな", 7093, 0, 8, 1, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なに、コーヒーを\n淹れてほしい？\nふふっ♪\n仕方のない奴だな！", 7094, 0, 1, 2, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "…そうだ。\nコーヒーと乾パンは\n合うのではないか？\n今度試してみよう！", 7095, 0, 1, 2, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "コーヒーもいいが、\nココアも悪くないぞ♪\n貴公も一緒にどうだ？", 7096, 0, 1, 2, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "魔法少女に比べれば\n大人しい服だろう？\nだが、カフェには\nこの服でバッチリだ！", 7097, 0, 1, 2, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "貴公はコーヒーを\n飲めるのかっ？それは\nうらやましいな…", 7098, 0, 4, 2, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "貴公の働きぶりには\n目を見張るものがある\nその姿は、その…\n結構かっこいいぞっ！", 7099, 0, 8, 2, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さぁ、今日も一日、\n頑張るぞっ！\n気合いを入れて\n開店準備だっ！", 7100, 1, 1, 2, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼は稼ぎ時だからな！\n荒波を乗り切るため\n貴公も一緒に\n頑張ってくれるか？", 7101, 2, 1, 2, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふあぁ…もう夜か\n今日は頑張ったからな\nはやめに休むとしよう", 7102, 3, 1, 2, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はふぅ～…\nたまにはこうして\nゆったりするのも\n悪くないな…", 7104, 0, 1, 3, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "猫もかわいいが、\nこいつもなかなか…\n見ていると、\n撫でたくなるな♪", 7105, 0, 1, 3, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これは良い香りだな\nふむ、コーヒーも\nより香り高いものが\n作れるよう試すか！", 7106, 0, 1, 3, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふぅ～…\n体を温めなければ、\nすぐに動けないからな", 7107, 0, 1, 3, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これもうまいが、\n私はお菓子も…\nいや、食べすぎは\n体に良くないな", 7109, 0, 1, 3, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "…書物は参考になるな\n次はこのやり方を\n試してみるかな", 7110, 0, 1, 3, 125201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "愛と希望の魔法少女！\n弟くんの平和は\nお姉ちゃんが守るよ♪", 7112, 0, 1, 1, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "魔法少女の戦い方を\n見せてあげる！\nお姉ちゃんチョップ♪", 7113, 0, 1, 1, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "闇の力が高まってる…\n早く弟くんを\nギュ～ってしないと！", 7114, 0, 1, 1, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ミニ弟くんを\n部屋中に呼び出して\n弟くんハウスに～♪", 7115, 0, 1, 1, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "決めポーズの練習でも\nしよっかな…\nはい、ポーズ♪", 7116, 0, 1, 1, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "魔法少女の力で\n弟くんのそばに\n瞬間移動したいなぁ", 7117, 0, 4, 1, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "禁じられた必殺技\nその名も──\n闇のお姉ちゃん頭突き", 7118, 0, 8, 1, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "魔法少女な\nお姉ちゃんに\n興味津々だねっ？\n全部教えてあげるね♪", 7119, 0, 1, 2, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "闇のお姉ちゃんとして\n世界を弟くんのものに\n…な～んて冗談冗談♪", 7120, 0, 1, 2, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "弟くんって魔法少女に\nなりたがってたよね？\n…うん。応援するね！", 7121, 0, 1, 2, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "サインが欲しいの？\nふふっ、任せて！\n愛する弟くんへ、と♪", 7122, 0, 1, 2, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふんふふ～ん♪\n魔法少女お姉ちゃんの\nテーマソング完成っ♪", 7123, 0, 4, 2, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "えへへ、弟くんからの\n愛と希望を感じるよ…\n更に変身しちゃうぞ♪", 7124, 0, 8, 2, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "弟くんの朝を魔法で\n守りに来たよ！\n希望の朝だねっ♪", 7125, 1, 1, 2, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "弟くんのお昼を魔法で\n守りに来たよ！\n愛のお弁当をどうぞ♪", 7126, 2, 1, 2, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "弟くんの夜を魔法で\n守りに来たよ！\nここからは闇の時間♪", 7127, 3, 1, 2, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "魔法少女の一休み♪\n愛と希望と…闇の力が\n回復していくね～♪", 7129, 0, 1, 3, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいかわいい♪\nお姉ちゃんの魔法で\n増やしちゃうぞ…♪", 7130, 0, 1, 3, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り…\n弟くんと同じ…\nくんくん、くんくん…", 7131, 0, 1, 3, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "体を温めておいて…\nこの熱を、ぜ～んぶ\n弟くんに伝えるよ…！", 7132, 0, 1, 3, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ミニ弟くんを呼ぶには\nいっぱい食べないと…\n魔法ってお腹減るから", 7134, 0, 1, 3, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "弟くんの平和を守る…\nそのためには\nチェックチェック…♪", 7135, 0, 1, 3, 120001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この服も、最初は\n慣れなかったのですが\n今ではすっかり\n体に馴染んでおります", 7137, 0, 1, 1, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "自然を守るためにも\nお勉強は欠かせません\n日々精進でございます", 7138, 0, 1, 1, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "採取した薬草を\n調合しておきましょう\nいつ必要になるか\n分かりませんからね", 7139, 0, 1, 1, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "合宿は過酷でしたが\nおかげでちょっと\n力持ちになったような\n気がいたします…♪", 7140, 0, 1, 1, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "わんわんのほうの\n主さまに、ごはんを\nあげる時間ですね…", 7141, 0, 1, 1, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "もっともっと訓練や\nお勉強を重ねて\n主さまのお役に\n立たなくては…", 7142, 0, 4, 1, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おや、そろそろ\nわんわんのほうの\n主さまをお散歩に\n連れていく時間です", 7143, 0, 8, 1, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "主さま、よろしければ\nお散歩に行きませんか\n今日の森は穏やかで\n過ごしやすいかと", 7144, 0, 1, 2, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わんわんのほうの\n主さまも、今では\n【美食殿】の大切な\n仲間でございます", 7145, 0, 1, 2, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "森には危険が\nいっぱいでございます\nケガをなさらないよう\nお気をつけください", 7146, 0, 1, 2, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "もし森や動物のことで\n気になることがあれば\n気軽にお尋ねください", 7147, 0, 1, 2, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "森へ行く前には\n必ず装備の点検を\nお願いいたします\n約束ですよ、主さま？", 7148, 0, 4, 2, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "森の中で主さまたちと\nゆったり過ごす時間は\nわたくしにとって\n大切なひとときです", 7149, 0, 8, 2, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n朝ごはんをしっかり\n食べて、お勤めに\n備えましょう", 7150, 1, 1, 2, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わんわんのほうの\n主さまにおやつを\nあげる時間です\nどうぞ、召し上がれ", 7151, 2, 1, 2, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どれだけ野営に\n慣れたとしても\nベッドで眠れるなら\nそうしたいところです", 7152, 3, 1, 2, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こちらなのですが\nわんわんのほうの\n主さまもお気に入りの\nようです", 7154, 0, 1, 3, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わんわんのほうの\n主さまにも、こうした\n玩具を与えるべき\nでしょうか…？", 7155, 0, 1, 3, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "心地よい香りです\n次は、自然由来の\n香料も試しましょう", 7156, 0, 1, 3, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖をとるのは\n野営の時などに\nとても大事なことで\nございますね", 7157, 0, 1, 3, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食べられる時に食べて\nおくのも、大自然では\n重要でございます", 7159, 0, 1, 3, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "より知識を蓄え\n自然の力を活用できる\nようにいたしましょう", 7160, 0, 1, 3, 125301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "今回の「冥風戦記」も\nなかなかよく書けたぞ\nふふっ、シグルドも\n喜んでくれるかな？", 7162, 0, 12, 1, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "貴様のためならば\n我が真なる魔力\nいつでも\n解き放とうぞ！", 7163, 0, 12, 2, 100901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ニャットちゃんに\nブラッシングを\nしてあげようかな", 7164, 0, 1, 1, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふふ…\nこれがレンジャーの\n制服ですか", 7165, 0, 1, 1, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ\nパトロールの\n時間だ…", 7166, 0, 1, 1, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "魔物について\nもっと知りたいな\n本を探しに行こう", 7167, 0, 1, 1, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "レンジャーになって\n体調を崩す日が\n減った気がします…", 7168, 0, 1, 1, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "本だけじゃわからない\n世界のことを、\nもっと知りたいです…", 7169, 0, 4, 1, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "こんな私にも\nできることはある…\nそう信じています", 7170, 0, 8, 1, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あの…良かったら\n一緒に見回りへ\n行きませんか？", 7171, 0, 1, 2, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "またあなたと一緒に\nレンジャーの仕事が\nできたらうれしいです", 7172, 0, 1, 2, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "けほっこほっ\n…だ、大丈夫です\nたまに出るだけなので", 7173, 0, 1, 2, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ニャットちゃん\nあなたにも\n懐いてきましたね", 7174, 0, 1, 2, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ニャットちゃんと\n散歩に出かけようかな\n…あの人も誘って", 7175, 0, 4, 2, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたと肩を並べて\nレンジャーの仕事が\nできてうれしいです…", 7176, 0, 8, 2, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\nレンジャー・シオリ\n元気に出勤します", 7177, 1, 1, 2, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ニャットちゃんにも\nお昼ごはんを\n用意しなくちゃ", 7178, 2, 1, 2, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "明日は仕事だから\n早起きしなくちゃ\nおやすみなさい", 7179, 3, 1, 2, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふぅ…仕事で\n走り回ったので\n少し休憩します", 7181, 0, 1, 3, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "仕事が終わった後に\nこうして触れていると\n癒されますね…", 7182, 0, 1, 3, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "森の香りがします…\n今日はよく\n眠れそうです…", 7183, 0, 1, 3, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ニャットちゃんと\n同じぐらい\n暖かいです…", 7184, 0, 1, 3, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "レンジャーの仕事を\nしていると\nお腹が空きます", 7186, 0, 1, 3, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "どんなに忙しくても\n読書だけは\nやめられませんね", 7187, 0, 1, 3, 125401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "兄様のお留守の間\nわたくしが、兄様の\n御家を守ります！", 7189, 0, 1, 1, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "に、に、兄様の御家…\n招待いただいた以上は\n失礼のないよう\n振る舞わなくては…！", 7190, 0, 1, 1, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふっ…兄様の素敵な\nお人柄が、家中から\nにじみ出ています…♪", 7191, 0, 1, 1, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "靴を脱がずに\n御家に上がるのに\n慣れていなくて…あ！\n飛べばいいのでは…！", 7192, 0, 1, 1, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここに花を生けたら\n華やぎそうですね\n兄様はお花…\n好きでしょうか…？", 7193, 0, 1, 1, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ずっとここにいたい…\nなどと言ったら\n兄様を困らせて\nしまいますよね…", 7194, 0, 4, 1, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お料理などを作って\n兄様を出迎えられたら\nいいのに…料理の腕も\n磨かなくては…！", 7195, 0, 8, 1, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "このような姿で\n失礼しております…！\nネ、ネズミがいたので\nつい本気を…！", 7196, 0, 1, 2, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おかえりなさいませ\nお忙しい御身をどうぞ\n癒してくださいね", 7197, 0, 1, 2, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "兄様の話し相手…！？\nど、どうしましょう…\nわたくしには面白い\n話なんて…はうぅ…！", 7198, 0, 1, 2, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なぜか、動物などに\n好かれる体質で…\n迷い猫捜しのバイトの\nお役に立てますか？", 7199, 0, 1, 2, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "に、兄様の家に来たら\n『添い寝』をするのが\n礼儀とリアさんが…\n本当…でしょうか？", 7200, 0, 4, 2, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "わたくしはここに\nいて…よいのですね？\n『仲間』として…", 7201, 0, 8, 2, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝は得意なんです\nもし兄様が苦手なら\nわたくしが起こして\n差し上げますよ", 7202, 1, 1, 2, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "兄様…昼餉を作って\nみたのですが、失敗\nしてしまいました…", 7203, 2, 1, 2, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふあぁ…\nはっ！　お…\nお恥ずかしい所を…！", 7204, 3, 1, 2, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こ、これは…！\n人様の御家なのに\nつい…駄目になって…\nしまいますぅ…！", 7206, 0, 1, 3, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "と、飛びかかっては\nこない…ですよね…？", 7207, 0, 1, 3, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "すぅ…はぁ…\nこのかぐわしさ\n心が洗われます…", 7208, 0, 1, 3, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "なんて暖かい…\n兄様の優しくお広い\n御心のようです…♪", 7209, 0, 1, 3, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "こんなに食べていたら\nはしたない…\nでしょうか？", 7211, 0, 1, 3, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "兄様の本棚はまるで\n知識の宝庫ですね\n己の世間知らずぶりを\n実感してしまいます", 7212, 0, 1, 3, 125801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "次の冒険に向けて\n騎空士弁当を作ろっと\nまずはおにぎりから！", 7214, 0, 1, 1, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "魔法の修行しなくちゃ\nもっともっと頼れる\n団長になりたいから！", 7215, 0, 1, 1, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ビカラちゃんを\n遊びに誘いたいけど…\nどういう場所が\n好きなんだろう？", 7216, 0, 1, 1, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "仕事を真面目に\nしっかりこなすことが\n騎空艇への\n一番の近道だよね", 7217, 0, 1, 1, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここにいる人の中で\n騎空団に興味ある人\nいたりしないかな…？", 7218, 0, 1, 1, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "これまでも想い出は\nいっぱいできたけど…\nこれからもたくさん\n想い出を作りたいな！", 7219, 0, 4, 1, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "仲間がいるから\n騎空士は限界だって\n超えられるんだね", 7220, 0, 8, 1, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この衣装\n魔法使いらしいでしょ\n服に着られないよう\n頑張らなくちゃね！", 7221, 0, 1, 2, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あなたとなら\nどんな相手だって\n怖くなんてないよ！", 7222, 0, 1, 2, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "カリンさんから\n新しい依頼が来たよ！\n一緒に頑張ろ！", 7223, 0, 1, 2, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "操舵士になるのは\nずいぶん難しそう…\nいつか頼れる仲間が\n見つかるといいな", 7224, 0, 1, 2, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "手合わせしたいの？\nいいよ、たまには\n団長らしいところ\n見せてあげるね！", 7225, 0, 4, 2, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "まだ二人きりだけど…\nこの騎空団は\n私の宝物だよ！", 7226, 0, 8, 2, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう～…\n昨日は遅くまで\n魔法の研究してて…\nふわぁ…眠いなぁ…", 7227, 1, 1, 2, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "さてと、お昼休み！\n紅茶淹れてくるから\n一緒に飲もうよ！", 7228, 2, 1, 2, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "遅くまでお疲れさま！\n無理しない程度に\nお互い頑張ろう！", 7229, 3, 1, 2, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "魔法の研究は\n一旦、休憩！\n頭を休めなくちゃ", 7231, 0, 1, 3, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "魔法みたいに\nかわいい！\n騎空団に入る？\nなんてね！", 7232, 0, 1, 3, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい匂い…\nそれになんだか\n集中力が増したかも", 7233, 0, 1, 3, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "体だけじゃなくて\n心までポカポカする…\nなんだか魔法みたい", 7234, 0, 1, 3, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いろいろ考え事したら\nお腹が空いちゃった！\nいただきまーす！", 7236, 0, 1, 3, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "『摂理の彼方へ\n至るには…』\n…この魔導書\n勉強になるなあ", 7237, 0, 1, 3, 125501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "こちらの服を着ると\n冒険に出かけたく\nなっちゃいますね", 7239, 0, 1, 1, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "冒険者の心得その一\n準備はできる限り\nしっかりとこなすべし\nなんてどうでしょう？", 7240, 0, 1, 1, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "調合に必要な素材は\nあれとこれとそれと…\n時間があるとついつい\n考えちゃいますね", 7241, 0, 1, 1, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "せっかくですから\nより良い素材を\n自分で集めたいですね", 7242, 0, 1, 1, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "このポーションが\nみなさんの役に立つと\nうれしいですね", 7243, 0, 1, 1, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "冒険者の心得その二\n危なくなった時は\nまず逃げるべし！\n大事なことですね", 7244, 0, 4, 1, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人の冒険は\nいつも楽しそうで\n元気がもらえます", 7245, 0, 8, 1, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ぜひおすすめしたい\n依頼があるんです\nこちらをどうぞ♪", 7246, 0, 1, 2, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ほしいお薬があれば\n錬金術で作って\nさしあげますよ", 7247, 0, 1, 2, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "依頼で気になる\nところがあれば\n何でもご確認ください", 7248, 0, 1, 2, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "このギルドハウスに\n錬金術の実験設備を…\nえ？　だめですか？", 7249, 0, 1, 2, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ポーションをどうぞ\n大丈夫、効果は\n確認済みですので♪", 7250, 0, 4, 2, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "次はどんな冒険に\n行かれるんですか？\nいつでもお供しますよ", 7251, 0, 8, 2, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日もいい一日に\nなりそうですね\n冒険日和といった\nところでしょうか", 7252, 1, 1, 2, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いい時間ですし\nランチにしませんか？\n次の冒険の\n作戦会議も兼ねて♪", 7253, 2, 1, 2, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜も遅いですし\n明日の冒険のため\n今日は早く寝ましょう", 7254, 3, 1, 2, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふう…やはり冒険は\n事務仕事と違いますね\n少し休憩を…", 7256, 0, 1, 3, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "冒険は緊張の連続です\nかわいい物で\n心を癒しましょう", 7257, 0, 1, 3, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふむ、この香りは…\n素晴らしいバランスで\n調合されていますね", 7258, 0, 1, 3, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この火力…\n錬金術の調合に\n使えそうですね", 7259, 0, 1, 3, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "冒険の際は食べられる\n時に食べておく！\n…とペコリーヌさんも\nおっしゃってましたね", 7261, 0, 1, 3, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…なるほど\nこんな調合も\nあるのですね…\n奥が深いです", 7262, 0, 1, 3, 125701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "アイツどこ行った…？\n戦うならアタシも\n連れてけよなー！", 7264, 0, 12, 1, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "今日も悪いヤツ退治…\nの前に腹ごしらえだ！\nなんか食べに行くぞ！", 7265, 0, 12, 2, 106101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "みんなー！\nギルドハウスで\nぼくと握手！", 7266, 0, 1, 1, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "種族も年齢も違うけど\nみんな楽しそうだね！\nやっぱりここはぼくの\nゆ～とぴあさ！", 7267, 0, 1, 1, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ハハッ！　まるで\nパーティー会場だね！\nこれは楽しませがいが\nあるってものだよ！", 7268, 0, 1, 1, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "やぁみんな！\nご利益満点のネズ耳は\nいかがかな？\nひとつ３ルピだよ！", 7269, 0, 1, 1, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここにいれば\n遊び相手に困らないね\nかしこみかしこみ～！", 7270, 0, 1, 1, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "どこか遊びに\n行こうかな♪\nそうだ、あの人にも\n声をかけてみよう！", 7271, 0, 4, 1, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人といると\nぼくまで楽しくなって\nくるんだよね！\n毎日パレード気分さ！", 7272, 0, 8, 1, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ネズ耳の在庫が\n切れたんだ！\n作るのを\n手伝ってくれるかい？", 7273, 0, 1, 2, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ん？　握手かい？\nいいとも！\nいつでも何度でも\nしてあげるよ！", 7274, 0, 1, 2, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この衣装に興味が\nあるのかい？\nきみ、なかなか\n見る目があるね！", 7275, 0, 1, 2, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "しばらくここに厄介に\nなるつもりなんだ\nあとで街を案内\nしてくれるかい？", 7276, 0, 1, 2, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "とっておきのチーズ\nきみと半分こだ！\nみんなには内緒だよ？", 7277, 0, 4, 2, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "きみはいてほしい時に\nいつもそばに\nいてくれるね\n本当にかしこみだよ！", 7278, 0, 8, 2, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "やぁ、おはよう！\n気持ちのいい朝だね\n今日も楽しくネズ耳\n売りにはげもうか！", 7279, 1, 1, 2, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼だね！\nおいしいチーズを\n持ってきたから\nぼくと半分こだ！", 7280, 2, 1, 2, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日も一日\n楽しかったね！\nいい夢が見られること\n間違いなしさ！", 7281, 3, 1, 2, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぼくにも休息は\n必要さ！\nリラックス〜\nリラックス〜♪", 7283, 0, 1, 3, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぼくのぬいぐるみも\n作って売ろうかな…\n修繕費も一気に\n集まるかもね！", 7284, 0, 1, 3, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りだね！\nトーゴクのお香に\nよく似てるよ", 7285, 0, 1, 3, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はぁ…温まるねぇ…\nそうだ、この火で\nチーズでも炙って\nみようかな", 7286, 0, 1, 3, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "うーん、この味…\nトーゴクを思い出すよ\nどれ、もう一つ\nいただこうか！", 7288, 0, 1, 3, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "これはランドソルの\nガイド本だね！\nありがたく参考に\nさせてもらうよ！", 7289, 0, 1, 3, 125601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "まさか、わらわが\nこのような装束を\n纏う日がくるとはな…\n感慨深いものじゃ", 7291, 0, 1, 1, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わらわの美貌で\nこのギルドハウスも\nより華やかに\nなったようじゃな", 7292, 0, 1, 1, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "つまらぬ戦いで\n晴れ着を汚しとうない\n今日は一日\nゆっくりするかの", 7293, 0, 1, 1, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今日はわらわが食事の\n準備をして、あやつの\n帰りを待ってやろう\n献立は何がよいかの…", 7294, 0, 1, 1, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ユキといったか…\n掴みどころのない\nやつじゃが、根性は\n認めてやるかの", 7295, 0, 1, 1, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "こうして、仲間と\nのんびり過ごす時間も\n悪くないのう♪", 7296, 0, 4, 1, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あやつを誘って\n月を見に行こうかの\n夜が楽しみじゃ♪", 7297, 0, 8, 1, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いかなる衣装で\nあろうとも、わらわは\n完璧に着こなして\nしまうのじゃ♪", 7298, 0, 1, 2, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "なんじゃ？\nわらわの姿に\n見惚れておったとな？\nす、素直でよいのじゃ", 7299, 0, 1, 2, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "吸血鬼であるわらわに\n相応しい装束じゃろう\nあとは真っ赤な血を\n添えたいのう…", 7300, 0, 1, 2, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お主、疲れておるな？\nわらわが癒してやろう\nほれ、近う寄るのじゃ", 7301, 0, 1, 2, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お主がおるだけで\nギルドハウスが\n賑やかになるのう\nある種の才能じゃな♪", 7302, 0, 4, 2, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "眷属よ、風呂にするか\nご飯にするか\nそれとも、わらわに…\nいや、忘れるのじゃ", 7303, 0, 8, 2, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝一番、わらわに\n会いたかったとな…\n眷属よ\n褒めてつかわすぞ♪", 7304, 1, 1, 2, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "眷属よ、わらわが\n食事を用意したぞ\n忌々しい太陽に負けず\n頑張るのじゃ", 7305, 2, 1, 2, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "眠るには惜しい夜じゃ\n眷属よ、もうしばらく\nわらわの傍に\nおるがよい", 7306, 3, 1, 2, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふかじゃの♪\n今度あやつにも\n座らせてやろう", 7308, 0, 1, 3, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "愛いやつじゃ\n少しばかり、わらわが\n遊んでやろうかの", 7309, 0, 1, 3, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "気品ある香りじゃのう\nわらわの古城にも\n一つ欲しいところじゃ", 7310, 0, 1, 3, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "よいぬくもりじゃ…\n忌々しい太陽とは\n大違いじゃの", 7311, 0, 1, 3, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "味付けの参考に\nあと、もう一つだけ…\n止まらんのじゃ…", 7313, 0, 1, 3, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "吸血鬼の弱点について\n記されておるのか…\nふむ、眠気が\nさめてしもうたぞ", 7314, 0, 1, 3, 126201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "このままボクが美しく\nなり続けても、彼なら\nきっと隣にいてくれる\nはずだよね！", 7316, 0, 12, 1, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "もっとそばに来なよ\nボクの隣は\nキミのための\n特等席なんだから", 7317, 0, 12, 2, 100801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ドレスの影響かな…\n前より黒や赤が\n好きになったかも", 7318, 0, 1, 1, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ボクがいるだけで\nここがぐんっと\n華やかになったね♪", 7319, 0, 1, 1, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ボクを描いた絵画\n今度持ってきて\n飾ってあげようかな", 7320, 0, 1, 1, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ボクはボクに\n魅了されっぱなしさ♪\nまさに魔性の存在だよ", 7321, 0, 1, 1, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "美のアドバイスを\n聞きたい人いるかい？\nボクがもっともっと\n輝かせてあげるよ♪", 7322, 0, 1, 1, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの人、今度はボクを\nどう褒めるだろう？\nもし語彙が尽きても\n許してあげよっと♪", 7323, 0, 4, 1, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あの人に似合うコーデ\n考えてあげよっと\n案外、なんでも\n着こなしそうだよね♪", 7324, 0, 8, 1, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "吸血鬼になるなんて\nやっぱりゴメンだね！\n永遠の美よりも\n大事なことがあるのさ", 7325, 0, 1, 2, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お肌にいいものは\n大体好きだよ\nトマトジュースとかね", 7326, 0, 1, 2, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "銀のアクセサリーが\nボクは大好きでね\nいつでもプレゼント\n待ってるよ♪", 7327, 0, 1, 2, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "イリヤみたいにお城に\n住んでみたいんだ♪\n美を統べる者に\n相応しいでしょ？", 7328, 0, 1, 2, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "今のボクがカップを\n触ると壊しちゃうんだ\nだからほら、キミが\nボクに紅茶を飲ませて", 7329, 0, 4, 2, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミも美を磨けば\nもっと輝けるはずさ！\nボクがメイクとか\nしてあげようか？", 7330, 0, 8, 2, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "んん、まだ眠い…\n美のためにも、\nもうひと眠りするよ…", 7331, 1, 1, 2, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ボクにぴったりな\n日傘を買ったんだ♪\n散歩にでも行こうよ！", 7332, 2, 1, 2, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜こそボクの時間！\nさぁ、あまねく人々へ\nボクの美を広めよう！", 7333, 3, 1, 2, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "リラックスは大事だよ\n心の余裕こそが\n美の秘訣だからね♪", 7335, 0, 1, 3, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "キミもボクの\n美の虜にしてあげる♪\nうれしいでしょ？", 7336, 0, 1, 3, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "人々を魅了するほどの\n魔性の香り…\nボクにふさわしいね♪", 7337, 0, 1, 3, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "冷えは美の大敵さ\nボクのように\n美しくなりたいなら\n体を温めるべきだよ", 7338, 0, 1, 3, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食事をするボクの\nなまめかしさ…♪\n吸血鬼すらも\nドキッとするだろうね", 7340, 0, 1, 3, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "吸血鬼って\n美しい存在だよね…\nボクほどではないけど", 7341, 0, 1, 3, 126301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ここがナイトさんの\nお家なんですねーっ！\n雰囲気そっくりっ！", 7343, 0, 1, 1, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ドアも壁もお菓子じゃ\nないんですよねっ？\n不思議ですねーっ♪", 7344, 0, 1, 1, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "失礼のないように\n気をつけないとっ！\nライラエルさまとも\n約束してますからっ！", 7345, 0, 1, 1, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "向こうに帰るころには\nお土産話がいっぱい\nできてるといいな～♪", 7346, 0, 1, 1, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "戦闘用のアームの他に\n観光用のアームも\nあったらいいのにな～", 7347, 0, 1, 1, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ナイトさんの充填と\nライラエルさまの充填\nどっちも違って\nどっちも大好きです♪", 7348, 0, 4, 1, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "…ナイトさんが\nマスターになって\nくれたら…えへへっ\nなんでもないですっ！", 7349, 0, 8, 1, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お手伝いだったら\n任せてくださいっ！\nお家の移転とか\nしちゃいますかっ？", 7350, 0, 1, 2, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こっちに来るときは\nポポおじいさんが\nしっかりメンテして\nくれるんですよっ♪", 7351, 0, 1, 2, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お家の中にいるのも\nいいですけど、お外も\n気になります～っ！\nお出かけしましょう♪", 7352, 0, 1, 2, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ヴォルガーノさんに\nそっくりの子猫さんを\n見かけたんですっ！\nご親戚ですかねっ？", 7353, 0, 1, 2, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ここだけの話ですよ？\n…実はケーブルって\n触られると、ちょっと\nくすぐったいんですっ", 7354, 0, 4, 2, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "このお家の持ち主は\nナイトさんですよね？\nそれじゃここでは\nご主人さまですねっ", 7355, 0, 8, 2, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございますっ\n今日もフルパワーで\nがんばりましょうっ♪", 7356, 1, 1, 2, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼の時間ですねっ！\nランチの充填、\nお願いしまーすっ♪", 7357, 2, 1, 2, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ眠らなくて\n大丈夫ですかっ？\n夜ふかしさんなら\nお付き合いしますよ♪", 7358, 3, 1, 2, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "エネルギーの消費を\n抑えるのも大切\nですよね～っ", 7360, 0, 1, 3, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わたしが触っても\n平気なんて…！\nかわいくて頑丈っ！\n好きですっ！", 7361, 0, 1, 3, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "センサーによると…\nこの香りはいい香りに\n該当するみたいですっ\nなるほどーっ！", 7362, 0, 1, 3, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいのって\nいいですよねっ！\nみなさんうれしそう\nですしっ♪", 7363, 0, 1, 3, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "これがこっちの世界の\nごはんなんですねっ\nおいしい気がします！", 7365, 0, 1, 3, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "そーっとそーっと…\n本を破かないように…\n書いてある内容より\n難しいです～っ！", 7366, 0, 1, 3, 126401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ウィスタリア家の\nプライベートビーチも\nご案内しますわね♪", 7368, 0, 1, 1, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "世界を巡る\nリゾートクルーズも\nご用意できますわよ", 7369, 0, 1, 1, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "避暑地に専用の\n別荘がありますの\n今度ご招待しますわね", 7370, 0, 1, 1, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "日焼けは乙女の\n天敵ですわね\n備えはしっかりと…", 7371, 0, 1, 1, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "線香花火だけでは\n物足りませんわね\nもっとドカーンと…", 7372, 0, 1, 1, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ギルド活動も全力で！\nバカンスも全力で！\nそれが私ですわ！", 7373, 0, 4, 1, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "私のセンスで選んだ\n特注の水着ですもの\n似合って当然ですわ♪", 7374, 0, 8, 1, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ご希望ならすぐにでも\n夏の飛空艇遊覧ツアー\nへご招待しますわ♪", 7375, 0, 1, 2, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夏の賑やかな\n雰囲気は好きですが…\n暑さには参りますわね", 7376, 0, 1, 2, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "日の光を浴びるほどに\n輝きを増す夏の私！\n今日も絶好調ですわ♪", 7377, 0, 1, 2, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夏祭りに協力するなら\n資金と人材、どちらも\n用意しないとですわね", 7378, 0, 1, 2, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたさま…その…\nそうも見つめられると\n照れてしまいます…", 7379, 0, 4, 2, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "タマキさんの働く\n海の家も訪れて\nみたいですわね♪", 7380, 0, 8, 2, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "港の市場が\n賑わう頃ですわね！\n私たちも参りますわよ", 7381, 1, 1, 2, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "冷たい飲み物でも\nご一緒にいかが？\nうちのシェフに用意\nさせてありますの", 7382, 2, 1, 2, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "まだもう少し…\nこの夏の夜を\nあなたさまと…", 7383, 3, 1, 2, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あなたさまも\n良ければこちらへ\nいらっしゃいな♪", 7385, 0, 1, 3, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夏に合わせた装いに\n替えてみるのも\n楽しそうですわね♪", 7386, 0, 1, 3, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この夏めいた爽やかな\n香り…期間限定で\n売り出したいですわ", 7387, 0, 1, 3, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "く…我慢です…\nこの暑さに耐えてこそ\n美しさにも磨きが…", 7388, 0, 1, 3, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "暑い季節に働く\nみなさまへ差し入れも\n必要ですわね", 7390, 0, 1, 3, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "夏のトレンドを\n押さえておくのも\n大事ですわね", 7391, 0, 1, 3, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "上手くいけば\nヒット商品になる\nポテンシャルを\n感じますわね…！", 7393, 0, 1, 3, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "この極上の肌触り…\n言い値で買いますわ\n一体おいくらですの？", 7394, 0, 1, 3, 126701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "せっかくのバカンス…\n自由に羽を\n伸ばすとしましょう", 7395, 0, 1, 1, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "たとえどのような\n秘密を持とうとも\n私には筒抜けですよ", 7396, 0, 1, 1, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "子供だましの怪談に\n関心はありませんが…\n霊には興味があります\n観察対象として、ね", 7397, 0, 1, 1, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "彼の絵日記…\nあとでゆっくりと\n読ませてもらいます", 7398, 0, 1, 1, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "セミの鳴き声に入道雲\nそしてクリームソーダ\nこれでこそ夏ですね", 7399, 0, 1, 1, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "夏休みの宿題でも\n作るとしましょうか\n彼の限界を少し超えた\n負荷を与えるには…", 7400, 0, 4, 1, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "彼と過ごす夏を\n特別なものにしたい…\nそれが私の望みです", 7401, 0, 8, 1, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夏だからといって\n浮かれすぎないように\n節度を持って\n楽しみなさい？", 7402, 0, 1, 2, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ああ見えてもマサキは\n私のプリンセスナイト\nあまり侮られては\n困りますよ？", 7403, 0, 1, 2, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "私の秘密ですか？\nまんじゅうが怖い…\nというのはどうです？", 7404, 0, 1, 2, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ここは誰かの秘密を\n盗み聞くのに\n最適な場所ですね\n…ジョークですよ", 7405, 0, 1, 2, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "一緒に風鈴の音を\nのんびり楽しもう…？\n…別に構いませんよ\n貴方とならば", 7406, 0, 4, 2, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "貴方に約束しましょう\n決して忘れられない\n夏にしてあげますよ", 7407, 0, 8, 2, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "早起きとは感心ですね\nでは一緒に\n体操でもしましょうか", 7408, 1, 1, 2, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼食は流しそうめん？\n非効率的ですね\n…食べないとは\n一言も言っていません", 7409, 2, 1, 2, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…貴方が望むならば\nいくらでも怖い話を\nしてあげますが…\nいかがですか？", 7410, 3, 1, 2, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "七冠にも休息は\n必要なのです\nしばらくここで\n休ませてもらいますよ", 7412, 0, 1, 3, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なかなか気に入った…\nというのは\n誰にも秘密です", 7413, 0, 1, 3, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "薫風を思わせる\nこのさわやかな香り…\n悪くないセンスですね", 7414, 0, 1, 3, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "夏だからこそ\n冷え対策は\n重要なのです\n…とはいえ暑いですね", 7415, 0, 1, 3, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "私がどのような味が\n好きなのかは…\n当然秘密です", 7417, 0, 1, 3, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "夏を舞台にした\n小説は数多くあります\n彼が好きそうな本を\n何冊か見繕いましょう", 7418, 0, 1, 3, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "見た目も手触りも\n完璧に覚えました\nいつでも模倣できます", 7420, 0, 1, 3, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "ふむ…夏らしい\nクッションですね\nナイトプールに\n映えそうです", 7421, 0, 1, 3, 126601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "レイ様も格好良いけど\n騎士さんもなかなか…\nって、今の聞こえて\nませんよねっ？", 7422, 0, 12, 1, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "騎士さんはシンプルな\n服が似合いそうです！\n今度、一緒に\n見に行きましょう♪", 7423, 0, 12, 2, 105401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "最初はどうかな～って\n思ったけど…\n水着姿でも案外\n問題ないのよね…", 7424, 0, 1, 1, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "水着で飲みすぎると\nお腹が冷える、って\n言うけど…麦しゅわ\nなら問題ないわね！", 7425, 0, 1, 1, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "暑ければ暑いほど\nその後の麦しゅわは\nおいしくなるのよ…", 7426, 0, 1, 1, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "しっかりと仕事を\nこなしてから、\nしっかりと麦しゅわ！\nやっぱりこれね！", 7427, 0, 1, 1, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふふっ、デザインも\n着心地も最高ね\n奮発して用意して\n正解だったわ♪", 7428, 0, 1, 1, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "伝説の麦しゅわ、\n飲めるものなら\nまた飲みたいわね…", 7429, 0, 4, 1, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "二つ名に恥じない\n聖騎士として\n私…飲むわ！", 7430, 0, 8, 1, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この格好なら水に\n濡れても大丈夫！\nなんだけど、さすがに\n書類は濡らせないわね", 7431, 0, 1, 2, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そうやってじっと\n見られると…ちょっと\n恥ずかしいわ…", 7432, 0, 1, 2, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日もいい天気ね\nふふっ、あとで\nビーチに遊びに\n行きましょ♪", 7433, 0, 1, 2, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "水着姿も慣れると\n案外快適ね\nそうだ、キミも\n水着になっちゃう？", 7434, 0, 1, 2, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "例え水着姿であろうと\n聖騎士としての誇りは\n忘れてないわ！", 7435, 0, 4, 2, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミとだったら\n麦しゅわなしでも\n最高の夏のバカンスに\nなると思うわ♪", 7436, 0, 8, 2, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "仕事終わりの\n麦しゅわのために\n今日も一日\n頑張るわよ♪", 7437, 1, 1, 2, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今日のお昼は\nどうしようかしら…\nさ、さすがに昼からは\n自重してるわよ？", 7438, 2, 1, 2, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さ、一日の疲れを\n洗い流すために…\n軽～く飲むわよ！", 7439, 3, 1, 2, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こうやって\n直に触れると\n肌触りの良さが\nよく分かるわ♪", 7441, 0, 1, 3, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日もかわいいわね～\nどう？　今度\nお姉さんの一人飲みに\n付き合わない？", 7442, 0, 1, 3, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りね～…はっ！\n麦しゅわの匂いの\nアロマポットなんて\nあったらよくない？", 7443, 0, 1, 3, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "こんな格好で火に\n当たってると焙られる\nスルメの気分が\nちょっと分かるわ…", 7444, 0, 1, 3, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…うん、\n結構おつまみにも\nむいてそうね～♪", 7446, 0, 1, 3, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "試験に使った参考書、\nたまには読み返して\nおかないとね", 7447, 0, 1, 3, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "ふふ♪\nいい手触りね～", 7449, 0, 1, 3, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "…はふう～…\nゴロゴロするのって\n最高ね～", 7450, 0, 1, 3, 126801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ん…やっぱり\nこの水着…\n大胆、なんじゃ…？", 7451, 0, 1, 1, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海でもお世話って、\nできるのかしら…？\n浮き輪代わりになる、\nとか…？", 7452, 0, 1, 1, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "～♪\nふふ…海に行く\n準備も、楽しい…かも", 7453, 0, 1, 1, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あうぅ…水着で\n歩いてると…お尻…\nすぐ食い込んじゃう…", 7454, 0, 1, 1, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "海では、はしゃいだ\nほうがいいのよね…\nわ、わー、い…♪\n…こうかしら？", 7455, 0, 1, 1, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたとなら…\n楽しい夏の思い出、\n作れる…気がするの…", 7456, 0, 4, 1, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "また来年も…\n再来年も…\nあなたと海へ\n行けますように…", 7457, 0, 8, 1, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "水着の着方を\n練習してるの…\n後ろ、変じゃない…？", 7458, 0, 1, 2, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海に行く支度…\n進んでるかしら…？\nお手伝い、する…？", 7459, 0, 1, 2, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ひ、日除けの準備は\n万全よ…\nずっと太陽の下に\nいたら…溶けちゃう…", 7460, 0, 1, 2, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "泳ぐ練習…\nこ、ここでするのは\n…さすがに変？", 7461, 0, 1, 2, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "人混みに入るのは\nまだ不安で…\nでも、あなたといれば\nきっと…大丈夫…", 7462, 0, 4, 2, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたのおかげで\n海の楽しいところを\nたくさん知ったわ…\nありがとう…♪", 7463, 0, 8, 2, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お出かけの日の朝は\n早い、のよね…？\nだから、ずっと\n起きていたわ…", 7464, 1, 1, 2, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今頃ビーチの日差しは\n強いんでしょうね…\nそ、想像しただけで…\nめまいが…", 7465, 2, 1, 2, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ビーチの夜といえば\n花火って、聞いたわ…\nバン、って言わない\n花火…ある…？", 7466, 3, 1, 2, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "素肌にふわふわが…\n気持ちいい…♪", 7468, 0, 1, 3, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うふふ…\n一緒に海…行く？", 7469, 0, 1, 3, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふぅ…♪\n気分まで…\n晴れやかになるわ…", 7470, 0, 1, 3, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暑いような…\n寒いような…\n不思議な気持ちに\nなるわ…ね？", 7471, 0, 1, 3, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "泳いだ後には\nいっぱい食べたほうが\n体によさそう、ね…", 7473, 0, 1, 3, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ビーチの日陰で\n読書するのも…\n気持ちよさそう…♪", 7474, 0, 1, 3, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "これで合ってる…？\n遊び方わからなくて…", 7476, 0, 1, 3, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "ふわふわ…♪\n海の底にいるみたい…", 7477, 0, 1, 3, 126901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "恥ずかしい格好で\n室内を歩くこの快感\nクセになりそうです…", 7478, 0, 1, 1, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この水着…\nどうしてかポーズを\n決めたくなりますね…", 7479, 0, 1, 1, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海にはどんな生き物が\nいるのでしょう～\n胸が高鳴ります～♪", 7480, 0, 1, 1, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夏は暑いですね…\nクウカの体が熱いのも\n夏のせい…ぐふふ…♪", 7481, 0, 1, 1, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ドＳさんと無人島に\n取り残されて…という\n妄想はかなりイイです", 7482, 0, 1, 1, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ドＳさんの\n欲望に満ちた眼差し…\nクウカ、受け止めます", 7483, 0, 4, 1, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "海に行くのが\n楽しみです…\nドＳさんと…ぐふふ♪", 7484, 0, 8, 1, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "「もっと過激な水着を\n見せてみろよ」なんて\nいけませんドＳさん…", 7485, 0, 1, 2, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "水着のままで\n踊ればいいのですね…\nドＳさんの望みなら！", 7486, 0, 1, 2, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ドＳさんの熱い視線を\n感じます…じゅるり…\nもっと見てください…", 7487, 0, 1, 2, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こんな格好のクウカを\n放っておくなんて…\nさすがですドＳさん！", 7488, 0, 1, 2, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "海で水着といえば\n何かが起きる予感…！\nドＳさんの新たな攻め\n期待していますね…！", 7489, 0, 4, 2, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "恥ずかしいですけど\n頑張っちゃいました\nドＳさん…こういう\n水着、好きですか？", 7490, 0, 8, 2, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "こんな朝からクウカを\n水着に着替えさせて…\n本当にドＳさんは\n欲望に正直ですね！", 7491, 1, 1, 2, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こんな昼間から\nドＳさんがヌルヌルの\n液体をクウカに～！\nえっ…日焼け止め？", 7492, 2, 1, 2, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ドＳさん…これから\nクウカと夜の海を\n見に行きませんか？\nきっと綺麗ですよ…♪", 7493, 3, 1, 2, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここなら妄想に\n集中できます～♪\nじゅるり～♪", 7495, 0, 1, 3, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こうもかわいいと\n妄想に登場させるのも\n気が引けます…", 7496, 0, 1, 3, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "クウカを昂らせる\nこの香り…！\nは！　ドＳさんの罠！", 7497, 0, 1, 3, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "体を熱くさせて\n水着を脱がそうと！？\nテクニカルです…！", 7498, 0, 1, 3, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "クウカの口の中に\nたくさん…♪\n止まりません…！", 7500, 0, 1, 3, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "読書は心が穏やかに\nなりますね…！\nぐふふ…穏やかに…", 7501, 0, 1, 3, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "いい乗り心地です…♪\nあっ…普通に楽しんで\nしまいました…", 7503, 0, 1, 3, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "これは…\n妄想に役立ちそうな\n感触です…！", 7504, 0, 1, 3, 127001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "成長した自分に\nあわせて、もっと\nかっこいいポーズを\n研究するッス！", 7505, 0, 12, 1, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "これからも一緒に\n最高のヒーローを\n目指していくッスよ♪", 7506, 0, 12, 2, 100501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お父さん、娘の\n水着姿がそんなに\nうれしいの？", 7507, 0, 1, 1, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "怖い話を子どもたちに\n聞かせたら泣かれて\nしまいました…\n加減が難しいです…", 7508, 0, 1, 1, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海に行くと父が\n水着の女性ばかり\n追いかけて困ります…", 7509, 0, 1, 1, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "拾った貝殻で\n新しい占いでも\nはじめてみようかな", 7510, 0, 1, 1, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "貝殻を耳に当てると\n波の音が…あっ\nこれはダメです\nよくない声がします", 7511, 0, 1, 1, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "この飲み物、スーッと\n体に沁み込んでくる…\nあの人にも\n教えてあげたいです", 7512, 0, 4, 1, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "強い日差しも騒がしい\n海も苦手なのに\nあの人となら不思議と\n楽しく思えるんです", 7513, 0, 8, 1, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "夏限定、水と氷を\n使った特別な占いは\nいかがですか？", 7514, 0, 1, 2, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "暑い日々にはやはり\n怪談ですね\n厳選フルコースで\nお聞かせします", 7515, 0, 1, 2, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "寒気がする？　それは\n霊ではなくかき氷の\n食べ過ぎですよ", 7516, 0, 1, 2, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今日の占い、あなたの\nラッキーパーソンは…\n白い水着の女性です", 7517, 0, 1, 2, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あの、よければ\n日焼け止めを塗って\nもらえませんか？\n背中は届かなくて…", 7518, 0, 4, 2, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "海に行きませんか？\n二人きりで静かな\n砂浜を散歩したいです", 7519, 0, 8, 2, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "潮騒だけが響く朝の海\n心が落ち着きます\nこれから一緒に散歩に\n行ってみませんか？", 7520, 1, 1, 2, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "不思議です。どうして\n普通のご飯でも、海で\n食べると特別おいしく\n感じるのでしょう…", 7521, 2, 1, 2, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の海に行きませんか\n今なら夜光虫が\n見られるかも\nしれませんよ", 7522, 3, 1, 2, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夏は知らぬ間に体力を\n消耗しています\n適度に休息して\nいきましょう", 7524, 0, 1, 3, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "このぬいぐるみ…\n大丈夫です\n何も憑いては\nいませんよ", 7525, 0, 1, 3, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ほのかにお線香\nみたいな香り…\nなんだか\n落ち着きます", 7526, 0, 1, 3, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "人魂、鬼火\nセントエルモの火…\n炎を見ていると色々と\n連想してしまいます", 7527, 0, 1, 3, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お腹を壊さぬよう\n食い合わせには\nご注意ください", 7529, 0, 1, 3, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "これはいい\n怪談集ですね…\nつい読みふけって\nしまいます", 7530, 0, 1, 3, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "ふふ、こういうのに\n乗るとなんだか\n子どもに戻った\nみたいですね", 7532, 0, 1, 3, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "こ、これは…\nちょっとメルヘン\n過ぎて恥ずかしい\nですね…", 7533, 0, 1, 3, 127101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "本当に素敵なお家…♪\n騎士たちの人柄を\n感じられるようで…\n不思議と落ち着きます", 7534, 0, 1, 1, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "調度品をつい間食…\nという習慣がこちらの\n世界にはないのですね\n…気をつけないと", 7535, 0, 1, 1, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "手土産のお菓子は\nどちらに置けば\nよいでしょうか？", 7536, 0, 1, 1, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "まるでおとぎ話の中に\n入ってしまったかの\nよう…別世界とは\nよく言ったものです", 7537, 0, 1, 1, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お忍び…ふふっ♪\nときめく響きです\nなんだかお茶目で…\n密やかな印象が", 7538, 0, 1, 1, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ふわ…\nああ、ついあくびが…\n居心地がよすぎるのも\n困り物ですね…ふふ♪", 7539, 0, 4, 1, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士には不思議な力が\nあるだけでなく\n何者かの加護が\nあるようですね…", 7540, 0, 8, 1, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この『王家の装備』は\n少し気難しいのです\nわたし以外が触れると\nその…ビリビリっと", 7541, 0, 1, 2, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "子どもたちに新しい\n遊びを教わりました♪\nにーらめっこしましょ\nあっぷっ…ぷ～っ！", 7542, 0, 1, 2, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "実は憧れていたのです\n友人の家を訪ねると\nいう経験に…ふふっ", 7543, 0, 1, 2, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ぎるどはうす…\nぎるど活動の拠点だと\n管理協会？　の方に\nうかがいました", 7544, 0, 1, 2, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あなたは運命を\n信じますか？\nわたしは…信じます\nよい運命だけですが♪", 7545, 0, 4, 2, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もしわたしが本当に\n天使だったとしたら…\nどうされますか？\n…ふふ、冗談です♪", 7546, 0, 8, 2, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "パンケーキの香りで\n目覚める朝は\nとても良いものですよ\nぜひともお試しを♪", 7547, 1, 1, 2, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ひと休みの時間ですね\n食事にお昼寝…\nすべきことを行って\n英気を養いましょう", 7548, 2, 1, 2, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ休まれては？\n眠れないようであれば\n寝物語か子守歌でも\nふふ、遠慮は無用です", 7549, 3, 1, 2, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "すう………はっ！\n眠ってはいませんよ？\nいくら居心地が良い\nからといって…ふわぁ", 7551, 0, 1, 3, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "まあ、あいらしい…♪\nぜひわたしの寝室に\n招待させてください", 7552, 0, 1, 3, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんて、かぐわしい…\nオーブンからただよう\n焼き菓子の香りとは\nまた異なる魅力が…", 7553, 0, 1, 3, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "みなで暖をとりながら\n互いに語り笑い合う\n…心休まる時間ですね", 7554, 0, 1, 3, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食は心と体に\nゆとりを生みます\n…辛い食べ物の場合？\nそれは、その…", 7556, 0, 1, 3, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "こちらの世界の知識を\n蓄えておかなければ\nテーブルマナーに\nついてのページは…", 7557, 0, 1, 3, 126501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "新しい色の蛍光ペン\n買ったのよね\nこれで勉強が\n楽しくなるわ～♪", 7559, 0, 1, 1, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "学食のランチ、結構\nおいしいのよね～\n今度ペコリーヌに\n教えてやろうかしら？", 7560, 0, 1, 1, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふふ…扉に黒板消し\n仕掛けてるの…あいつ\n引っかかるかしら？", 7561, 0, 1, 1, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "部活するなら運動部も\n悪くないかもね～\n夕日に向かって\n突っ走ってやるわ！", 7562, 0, 1, 1, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "毎日窮屈な制服着て\n学生も大変ね～\n…ま、かわいいけど", 7563, 0, 1, 1, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつに貸したノート\n変な落書きとか\nしてなかったよね…？\n…その、相合傘とか…", 7564, 0, 4, 1, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "昨日の家庭科で\n作ったクッキー…\nあいつにどうやって\n渡そうかな…？", 7565, 0, 8, 1, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "宿題教えてって？\nしょうがないわね～\nじゃあ一緒に\nやりましょ", 7566, 0, 1, 2, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ、明日あたしたち\n日直当番よね？\nめんどい仕事は\nあんたに任せるわ～", 7567, 0, 1, 2, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "寮生活は楽しいけど\n就寝時間が早すぎよね\nいきなり消灯されると\nビックリするわ", 7568, 0, 1, 2, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "校則で禁止だけど、\nにけつでほうき通学\nとか青春っぽくない？", 7569, 0, 1, 2, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "制服って好きな人とも\n自然にお揃いになれて\nいいわよね…って別に\nあんたとって訳じゃ…", 7570, 0, 4, 2, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あんたネクタイ\n曲がってるわよ～？\nほら直したげるから\nこっち向いて？", 7571, 0, 8, 2, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよ～！\n今日も元気に登校よ！\n忘れ物ないようにね！", 7572, 1, 1, 2, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "午前の授業疲れたわ～\nしっかりお昼を食べて\n午後も頑張るわよ！", 7573, 2, 1, 2, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うう…学校の怪談\n思い出しちゃった…\n…別に怖くないけど！", 7574, 3, 1, 2, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふか～\n…気持ち良すぎて\n制服のまま\n寝ちゃいそうね…", 7576, 0, 1, 3, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいくて癒されるわ\n寮に持ち込んでも\n大丈夫かしら…？", 7577, 0, 1, 3, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "集中力の高まる香りで\n勉強の効率爆上がりね\n次のテストで\nいい点取るわよ～！", 7578, 0, 1, 3, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うう、ちょっと冷えて\n来たわね…\nスカートの下に\nジャージ穿こうかしら", 7579, 0, 1, 3, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐっ…もぐっ…\n食べとかないと教室で\nお腹なっちゃうわ～", 7581, 0, 1, 3, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "図書室で借りた本\n明日返却日なのよね…\n今日中に読むわよ！", 7582, 0, 1, 3, 127201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あいつに背中を\n預けるのもいい気分だ\nいつかは、全部…", 7584, 0, 12, 1, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "な、なんだよ？\nじっと見るんじゃねぇ\n尻尾が揺れちまうだろ", 7585, 0, 12, 2, 104301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "魔法の練習！\nむむむ～…\nそれっ…！", 7586, 0, 1, 1, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そだ！　これ着て\nルー学行こっかな？　\n制服自慢しちゃお♪", 7587, 0, 1, 1, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "赤点回避の魔法とか\nあったら最高じゃね？\n誰かうちに教えて～", 7588, 0, 1, 1, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "制服が一番映える\n場所ってどこだろ？\n教室？　遊園地？", 7589, 0, 1, 1, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ベンキョーつらたん…\n今度キャルっちに\n助けてもらお", 7590, 0, 1, 1, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "部活か…\nヒデサイと一緒に\nやったら楽し～かも♪", 7591, 0, 4, 1, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "男子の制服\nもにカワだった…\n今度ヒデサイに\n借りよっかな？", 7592, 0, 8, 1, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちょすー、うちの\nさいきょー魔法で\nテンアゲしてあげる～", 7593, 0, 1, 2, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "九九って呪文ぽくね？\nほら、例えばヒチシ…\nヒチシ、なんだっけ？", 7594, 0, 1, 2, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ヒデサイセンセー\nうちにベンキョー\n教えて！", 7595, 0, 1, 2, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "学割マジ助かるー\nヒデサイ、一緒に\nどんどん使ってこー♪", 7596, 0, 1, 2, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "今度ヒデサイに\nお弁当作ったげる\n屋上で一緒に食べよ♪", 7597, 0, 4, 2, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ヒデサイのバイブス\n上がる言葉教えてよ\nつらたんな時、うちが\nいっぱい言ったげるよ", 7598, 0, 8, 2, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ちょすちょす～\n今日も朝から\nバイブス十分♪", 7599, 1, 1, 2, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼どうしよっかな\nたまにはガッツリ\nいっちゃう系？", 7600, 2, 1, 2, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "やべ、宿題まだ\nできてないし…\nヒデサイ助けて～", 7601, 3, 1, 2, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "充電ちう～\n…ガッコーのイスも\nこれにして～", 7603, 0, 1, 3, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいし、\n癒されるし、キュン死\nしちゃうじゃん…！", 7604, 0, 1, 3, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "リフレッシュの\n魔法発見！\nいい香り～♪", 7605, 0, 1, 3, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ぽかぽかサイコー♪\n今日はもーずーっと\nここにいたいかも～", 7606, 0, 1, 3, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "超おいし～♪\n学食にあったら\n毎日リピする～", 7608, 0, 1, 3, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…\nねむみパない…\n続きはまた今度～", 7609, 0, 1, 3, 127301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今度は子どもたちも\nサラサリアに連れて\n行ってあげたいわ", 7611, 0, 1, 1, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "子どもたちから\nお姫さまみたいって\n言われちゃった♪", 7612, 0, 1, 1, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この剣…火を点けたり\nするのに便利なのよ\nコントロールも効くし", 7613, 0, 1, 1, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あのサラサリアの\nカラっとした暑さが\nちょっと恋しいわ…", 7614, 0, 1, 1, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "買ってきたお土産、\nお世話になってる\nみんなに配りましょ♪", 7615, 0, 1, 1, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんたと一緒なら\nどこの国でだって\n暮らしていけそうね♪", 7616, 0, 4, 1, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今の事業を大きくして\nあんたと世界中の国を\n飛び回ったり…なんて\nすてきじゃない？", 7617, 0, 8, 1, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "サラサリアで食べた\n料理が恋しい…？\nもう…また今度\n作ってあげるわよ", 7618, 0, 1, 2, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "今度旅行するなら\nどこに行こうかしら？\n希望があれば教えてね", 7619, 0, 1, 2, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "サラサリアの香辛料、\nランドソルでも\n人気が出そうよね\nいいビジネスの予感！", 7620, 0, 1, 2, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そんなにじっと\n見られるとさすがに\n恥ずかしいってば…", 7621, 0, 1, 2, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お嫁さんは憧れるけど\nお婿さんになって\nもらうのもありよね…\nあんたはどう思う？", 7622, 0, 4, 2, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "やっぱり、あんたには\nいつもあたしの隣に\n居てほしいな…", 7623, 0, 8, 2, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "陽射しが強くなる前に\n雑多な用事は\n片付けちゃいましょ", 7624, 1, 1, 2, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "サラサリアで食べた\n料理を再現してみたの\n味見してくれる？", 7625, 2, 1, 2, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "暑さに負けないように\n睡眠はちゃんと\n取っておかないと", 7626, 3, 1, 2, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "こっちでもあっちでも\n忙しいのは変わらない\nわね…ちょっと休憩～", 7628, 0, 1, 3, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "サラサリアで見た\nぬいぐるみも\nかわいかったわね", 7629, 0, 1, 3, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お香って地域ごとの\n特色が出るわよね\nこの香りは…\nちょっと神秘的？", 7630, 0, 1, 3, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "砂漠地方も夜は冷える\nのよね。温かいものが\nあると安心するわ…♪", 7631, 0, 1, 3, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食べ慣れた味って\nどうしてほっと\nするのかしら…", 7633, 0, 1, 3, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "今後の取引相手に\nなるかもしれないし\n向こうの文化も\n勉強しておかないと…", 7634, 0, 1, 3, 127501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "犯人はこの中にいる！\n探偵として一度は\n言ってみたいセリフさ", 7636, 0, 12, 1, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "助手くんの情報を\n仕入れておかないと…\n理想の私を、ずっと\n見ていてほしいからね", 7637, 0, 12, 2, 101401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "久々の長旅で\n里心がついちまったね\nしばらくランドソルで\nのんびりしようか", 7638, 0, 1, 1, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "たまには違う服装\n違う得物を使うのも\n悪くないね", 7639, 0, 1, 1, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "サラサリアにいた時は\n砂まみれで大丈夫かと\n思ってたけど、今じゃ\n懐かしく感じるよ", 7640, 0, 1, 1, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "魔法の絨毯、あれは\n楽だし速いし便利\nだったねえ…土産に\n一枚欲しかったな", 7641, 0, 1, 1, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "砂上での戦いは\nなかなかいい鍛錬に\nなったね…今度は\n修行しに行くとしよう", 7642, 0, 1, 1, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "サラサリアの人たちも\n気のいい連中だったが\n元気にやってるかねえ", 7643, 0, 4, 1, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "旅の恥はかき捨てって\nいうけど、悪い旅じゃ\nなかったね。次は\nアイツとどこに行こう", 7644, 0, 8, 1, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この格好を冷やかしに\n来たのかい？\n生憎、もうすっかり\n慣れちまったよ", 7645, 0, 1, 2, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ギルドの連中に\n土産をわたしに\n行くところなんだ\n付き合っておくれよ", 7646, 0, 1, 2, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "久々に水場で\n釣りがしたいねえ…\nもちろんお前さんも\nくるんだろう？", 7647, 0, 1, 2, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おっと\nサラサリアの連中から\n便りが来てるよ\nさ、一緒に読もうか", 7648, 0, 1, 2, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "最近サラサリアの踊り\nを練習してるんだ\nあとで振付けを\n見ておくれよ", 7649, 0, 4, 2, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "なんだいお前さん？\n…なんだか若奥さん\nっぽいって？　まあ、\nそりゃあ、ねえ…", 7650, 0, 8, 2, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いい時間だね\n日が昇りきる前に\nやることをすませ\nとかないと", 7651, 1, 1, 2, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼はどうしようかね\nサラサリア風の\n食事でもつくろうか", 7652, 2, 1, 2, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "さて、早めに寝ようか\n砂漠の夜は冷えるから\n…っと、まだ旅行中の\n気分でいたよ", 7653, 3, 1, 2, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "良い座り心地だ\nサラサリア宮殿の\n応接間を\n思い出すねえ…", 7655, 0, 1, 3, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ランプの魔神に\nあげたら喜ぶかねえ？\n次に会う時までに\n見繕ってみようか", 7656, 0, 1, 3, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香り…\nサラサリア土産の\n香木かい？", 7657, 0, 1, 3, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "旅先での焚火を\n思い出すよ\nなんだかほっとするね", 7658, 0, 1, 3, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ふふ、慣れてる味も\nいいけど、むこうの\n味付けが懐かしく\nなっちまうね", 7660, 0, 1, 3, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…\n千夜一夜物語か\nおもしろいもんだねえ", 7661, 0, 1, 3, 127601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "立派なギルドハウス♪\n帰る場所が素敵だと\n冒険に出るのも\n楽しくなりそうです♪", 7663, 0, 1, 1, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お掃除でも…と\n思いましたけど、\nさすがお兄さんのお家\nきれいにしてますね♪", 7664, 0, 1, 1, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わたしたちもいつか\n立派なギルドハウスが\n持てる冒険者に\nなりたいです…♪", 7665, 0, 1, 1, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "わたし冒険者ですけど\n家を守ってお兄さんの\n帰りを待つのも\n悪くない…かも？", 7666, 0, 1, 1, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お菓子焼こうかな…♪\nちょっと多めに作って\nお兄さんにも\n食べてもらおうっと♪", 7667, 0, 1, 1, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "このお家、とっても\n大好きになりました♪\nだからその…もう少し\nいてもいいですか…？", 7668, 0, 4, 1, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄さんに\n感謝の手紙を書いて\n枕元に隠して\nおこうかな…♪", 7669, 0, 8, 1, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…お兄さん\nお暇なんですか？\nじゃあ一緒に冒険へ\n出かけましょう♪", 7670, 0, 1, 2, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お兄さんは苦手な食材\nとかありますか？\nあの、もしよければ\n今から手料理を…♪", 7671, 0, 1, 2, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "まったり過ごす\nお家時間もいいですね\n冒険者には羽休めも\n大事ですから♪", 7672, 0, 1, 2, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いつでもお兄さんを\n守れるように\nこの姿でいることに\n慣れておきますね…！", 7673, 0, 1, 2, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お兄さん眠そうです…\nちょっとお昼寝\nしちゃいましょうか♪\nはい、膝枕…♪", 7674, 0, 4, 2, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄さん怪我を…！？\nわたしが治療を…\nふー…ふー…", 7675, 0, 8, 2, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます♪\n朝、元気に挨拶すれば\n幸せな一日が過ごせる\nそうですよ♪", 7676, 1, 1, 2, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ごはんの時間です\n…手がふさがってる？\nわかりました、じゃあ\nあ～んしますね♪", 7677, 2, 1, 2, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふわぁ…眠くなって\nきちゃいました…\nお兄さん…お泊りして\nいいですか…？", 7678, 3, 1, 2, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふにゃ～～…♪\nこんな姿、他の人には\n見せられません…♪\nもふもふ～～…♪", 7680, 0, 1, 3, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お兄さんこういうの\n好きなのかな～…\nふふっ、わたしも♪\nぎゅ～～～っ♪", 7681, 0, 1, 3, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アロマの癒し効果…\n上手くアレンジして\nみなさんの治療に\n活かせないかな～？", 7682, 0, 1, 3, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "は～気持ちいい～♪\n身体が暖まると\n心もぽかぽかです♪", 7683, 0, 1, 3, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "うふふ、おいしい♪\nプレシアちゃんなら\n無限にぱくぱく～って\nしちゃいそうです…♪", 7685, 0, 1, 3, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "本はわたしを\n知らない世界に\n連れていってくれる…\nまるでお兄さんです♪", 7686, 0, 1, 3, 126001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "話題の新刊…\nあの人も読んでるかな\n今度会う時、感想\n聞いてみたいな…♪", 7688, 0, 12, 1, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "うにゃっ…あ、熱を\n測ってくれたんですか\nありがとうございます\nバッチリ元気ですよ♪", 7689, 0, 12, 2, 103801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お兄の、けはい…\nん、みつけた\nぎゅ", 7690, 0, 1, 1, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "きょろきょろ\nここも\nぱとろる、するよ", 7691, 0, 1, 1, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おうち\nにぎやか\nさみしく、ない", 7692, 0, 1, 1, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "きょだい、おにぎり\nきょだい、肉まん\nきょだい…お兄？", 7693, 0, 1, 1, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はっぴーちゃん\nどこ？\nお兄、たべた？", 7694, 0, 1, 1, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "くんくん…この、へや\nお兄の、におい\nすんでる\nすめる？", 7695, 0, 4, 1, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おそうじ、にがて\nでも\nれんしゅう\nきゅっきゅ", 7696, 0, 8, 1, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "みみ、さわり、たい？\nんー…だめ…\nむずむず\nなので", 7697, 0, 1, 2, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "くろぷれしあ\nかっこいい？\nん…あざます", 7698, 0, 1, 2, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お兄の、おうち\nきょうみ、ましまし\nたんけん\nするね", 7699, 0, 1, 2, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なでなで、される…と\nねむ…く…\nぶぅ…ぶぅ…ぶぅ…", 7700, 0, 1, 2, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "かみ、りぼん\nおてつだい\nよろ\nです", 7701, 0, 4, 2, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ここ\nすむ\nね？\nまいにち、いっしょ", 7702, 0, 8, 2, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ぐっもにん\nあさごはん\nあさごはん", 7703, 1, 1, 2, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お兄\nおつかれ？\nれっつ、まいぺーす", 7704, 2, 1, 2, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ひとりで、ねれる\nでも\nひとりじゃ、なくても\nねれる、よ…？", 7705, 3, 1, 2, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふかふか\nパパの、おなか\nみたい", 7707, 0, 1, 3, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こんにちは\nぷれしあ、です\nおともだち、なろ？", 7708, 0, 1, 3, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい、におい\nでも、お兄\nもっと、いい、におい", 7709, 0, 1, 3, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "とりま\nお肉、やこ", 7710, 0, 1, 3, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…\nむげん肉まん、も\nきぼう", 7712, 0, 1, 3, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ぜんぶ、よんだ\nもっと、ぶあついほん\nでも、いーよ？", 7713, 0, 1, 3, 126101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "幸せなクリスマスを\n過ごすため\nギルドハウスを\nきれいにしなくちゃ♪", 7715, 0, 1, 1, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "えへへ♪\n彼へのプレゼント…\n枕元にそっと\nおいておきましょう☆", 7716, 0, 1, 1, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "クリスマスといえば\n七面鳥の丸焼き…☆\nよだれを拭いて\nいざ準備です♪", 7717, 0, 1, 1, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "彼に用意した\nプレゼント…\n大きすぎて\nくつ下に入りません…", 7718, 0, 1, 1, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "プレゼントは\n貰う方も、贈る方も\nどちらも幸せを\n感じますね…☆", 7719, 0, 1, 1, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "夜景が見える\nレストランであの人と\nクリスマスデート…\n憧れちゃいますね☆", 7720, 0, 4, 1, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "プレゼントはわたし…\n恥ずかしいですけど\nこの贈り物、彼に\n喜んでほしいです…☆", 7721, 0, 8, 1, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "オーナメントを\nたくさん用意したので\n二人でツリーに\n飾りつけましょう☆", 7722, 0, 1, 2, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あはは、お腹\n空いちゃいました？\nパーティーまで\n我慢してください♪", 7723, 0, 1, 2, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ジングルベ～ル♪\nあなたも一緒に\nクリスマスソング\n歌っちゃいましょう♪", 7724, 0, 1, 2, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "サプライズプレゼント\nの用意をして…って\nあなた！？　い、今の\n聞いてませんよね…？", 7725, 0, 1, 2, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "クリスマスの夜は\nパーティーしましょう\nできれば…その…\n二人っきりで…☆", 7726, 0, 4, 2, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなたと過ごした\n最高のクリスマス…\nずっとずっと心の奥に\nしまっておきますね", 7727, 0, 8, 2, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます！\n皆の願いが叶うような\n素敵な一日に\nしましょうね☆", 7728, 1, 1, 2, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ですね！\nディナーの買い出しが\n済んだら、少しお昼寝\nしちゃいましょうか☆", 7729, 2, 1, 2, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ就寝の\n時間ですね～\n枕元にくつ下の準備を\nお忘れなく～☆", 7730, 3, 1, 2, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふ～気持ちいい…☆\nお家でまったり過ごす\nクリスマスも\nいいですよね…♪", 7732, 0, 1, 3, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいですね～♪\nサンタさんからの\n贈り物でしょうか～？", 7733, 0, 1, 3, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "すう～…はあ～…\nすごく素敵な香り…\n炊き立てのご飯と\nいい勝負です…♪", 7734, 0, 1, 3, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖かいですけど…\nあの日の山小屋を\n思い出して\n恥ずかしいですね…☆", 7735, 0, 1, 3, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "むしゃむしゃもぐもぐ\n止まりませんよ\nクリスマスですから\nむしゃむしゃもぐもぐ", 7737, 0, 1, 3, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "物語に出てくる\nサンタさんみたいに\nわたしも幸せを\n運びたいです…☆", 7738, 0, 1, 3, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "わっ！\nこ…これは素敵な\nサプライズプレゼント\nですね…☆", 7740, 0, 1, 3, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "これを着ればわたしも\n立派なサンタさんに\nなれますかね…？", 7741, 0, 1, 3, 127901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "ここが今のあたしの\n居場所ってやつです\nふふっ、なかなか\n悪くねー気分ですよ", 7742, 0, 12, 1, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "これからはボス代行\nとしてブイブイ\nいわせてやるです\nついてくるですよ！", 7743, 0, 12, 2, 106601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "陛下～♪\n貴女のクレジッタが\nおめかしして\nはせ参じましたわ～♪", 7744, 0, 1, 1, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "パーティーとは景気の\n良さを見せつける場…\n倹約などは\nもっての外でしてよ！", 7745, 0, 1, 1, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この天井の高さなら\n搬入できそうですわね\n陛下用の特注ケーキ♪", 7746, 0, 1, 1, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…ぶぇっくしゅ！\nふう…少し背中を\n開けすぎたかしら…？", 7747, 0, 1, 1, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ここは秘書の目も\n届きませんから\nチクりメモの心配も\nありませんのよね～♪", 7748, 0, 1, 1, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "いくらでも二度見して\nよろしくてよ？\n本当にわたくしだと\n心から納得できるまで", 7749, 0, 4, 1, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "袖の下以外の贈り物も\nなかなかどうして…\n悪くないものですのね", 7750, 0, 8, 1, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "こう見えてダンスの\nたしなみはありますの\nお相手してあげても\nよろしくってよ", 7751, 0, 1, 2, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ドレスはもちろん\n特注品ですわ♪\nもしや貸衣装だと\n思いまして？", 7752, 0, 1, 2, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "バッグの中身？\n仕事に必要なものと…\n心を潤わせるための\n宝石がいくつか♪", 7753, 0, 1, 2, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "やる気というものは\n仕事に必要な条件です\nいわばドレスコードの\nようなものですわね", 7754, 0, 1, 2, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "全ての仕事は自分の\n血となり肉となり\nお金にもなるもの\nなのです。経験談です", 7755, 0, 4, 2, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今年の教訓を活かして\n来年は更に素晴らしい\nクリスマスにして\n差し上げますわ！", 7756, 0, 8, 2, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます\n今日という稼ぎ時の\nはじまりですわよ！", 7757, 1, 1, 2, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "安くて早くておいしい\nそれがランチに必須の\n栄養素ですわ！", 7758, 2, 1, 2, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "宵越しの仕事は\n安眠の敵！\n熟睡したいのであれば\n今が勝負時ですわよ！", 7759, 3, 1, 2, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "たまにはこうして\n休息を取ることも…\n…はっ！？\nドレスにシワが～っ！", 7761, 0, 1, 3, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…わたくしの勘が\n言っていますわ\nこの愛らしさ！\n爆売れ確・定！", 7762, 0, 1, 3, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りですわね…\nお金の匂いには\n敵いませんけれども♪", 7763, 0, 1, 3, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "……ハッ！？\n完全にボーッとして\nしまいましたわ…！\nぬくもり…恐ろしい！", 7764, 0, 1, 3, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "考えませんわ…\n考えませんわよ！\nカロリーのことはっ！", 7766, 0, 1, 3, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ビジネス本以外の本を\n読むのも、たまには\n悪くありませんわね…", 7767, 0, 1, 3, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 14, "よくできていますわね\nこの絵本！\n子ども向けだと甘く\n見ていましたわ…！", 7769, 0, 1, 3, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 15, "この視界の狭さ…\n思い出しますわね\nティッシュ配りの\nアルバイト時代を…", 7770, 0, 1, 3, 128001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふふふ…こっそり\nスイーツを食べる\nリノちゃん見～っけ♪", 7771, 0, 1, 1, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お姉ちゃんの抜き打ち\nお部屋チェック～♪\n…ケーキの食べこぼし\nこれはリノちゃんだね", 7772, 0, 1, 1, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この衣装は目立つから\nどこにいても弟くんに\n気付いてもらえるね！", 7773, 0, 1, 1, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "弟くん、協力して！\nリノちゃんにお勉強\nしなさいって圧を\nかけるんだよっ…♪", 7774, 0, 1, 1, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "絆の力を感じるよ\nこれならもっと万全な\n弟くんのお世話が\nできそうだねっ！", 7775, 0, 1, 1, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お姉ちゃんもたまには\nリノちゃんみたいに\n甘えてみようかな…", 7776, 0, 4, 1, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "弟くんとリノちゃん\nどっちも大切な\n私のきょうだいだよ", 7777, 0, 8, 1, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "分かってるよ♪\nお姉ちゃんの膝枕を\nご所望だねっ？　え？\n違う？　違わないよ？", 7778, 0, 1, 2, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "リノちゃんがね\nお姉ちゃんチョップを\n防ぐ妹白刃取りを\n訓練してるんだよね", 7779, 0, 1, 2, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お姉ちゃん頭突きは\n封印しないとね…\nだって、今使うと\n頭飾りで威力が…ね", 7780, 0, 1, 2, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふふっ♪\n目をつぶってても\n弟くんは見えてるよ\n…そこでしょ？", 7781, 0, 1, 2, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お姉ちゃんも\nリノちゃんみたいに\nかわいさいっぱいに\n振舞っちゃうぞ♪", 7782, 0, 4, 2, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "弟くんっ♪\nいつもお姉ちゃんの\n声が届く範囲にいてね\n…絶対だよ", 7783, 0, 8, 2, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう、弟くん！\nリノちゃんが起こして\nくれたんだね♪\n…先を越されちゃった", 7784, 1, 1, 2, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お姉ちゃんランチの\n時間だぞ♪\nさ、食べさせてあげる\nお口を開けて…♪", 7785, 2, 1, 2, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おやすみの時間だよ\n…弟くんは真ん中ね\n左右には私たち姉妹が\nいるから安心だよ♪", 7786, 3, 1, 2, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お姉ちゃんは全力で\nリラックスしてても\n弟くんの声一つで\nすぐにでも動けるよ♪", 7788, 0, 1, 3, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "リノちゃんこういうの\n好きそうだよね\n今度プレゼントして\nみようかな？", 7789, 0, 1, 3, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい匂いがするね～\nあれ？\nリノちゃんのケーキの\n甘い匂いも混ざってる", 7790, 0, 1, 3, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お姉ちゃんの\n弟くんへの愛も\n熱く燃えあがるね…！", 7791, 0, 1, 3, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "たくさん食べて\n栄養を補給して\nお姉ちゃん力に\n全て変換するよっ！", 7793, 0, 1, 3, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ことわざ辞典…\nリノちゃんにこれを\n読ませようかな", 7794, 0, 1, 3, 128101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "そろ～り、そろり…\nお姉ちゃんが居ぬ間に\nスイーツを～…♪", 7797, 0, 1, 1, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いつか\nお姉ちゃんに似合う服\n作ってみたいですね", 7798, 0, 1, 1, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "あいたっ！？\nひらひらしたとこ\n踏んづけちゃいました", 7799, 0, 1, 1, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お姉ちゃんと\nお兄ちゃんの二人から\n勉強しろって圧力が～", 7800, 0, 1, 1, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "私の中にも秘めた力が\n眠っているはず…\nそう、妹パワーが", 7801, 0, 1, 1, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "私もお兄ちゃんを\n甘やかしてみたいです\n…お姉ちゃんみたいに", 7802, 0, 4, 1, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄ちゃんの部屋を\nこっそり拝見～♪\nはっ！？　これは\nお姉ちゃんの視線…！", 7803, 0, 8, 1, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お姉ちゃん頭突きは\n大地を揺らす威力です\n私とお兄ちゃんは\n挨拶感覚で喰らいます", 7804, 0, 1, 2, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お姉ちゃんチョップは\n雲を裂く切れ味です\n早く妹白刃取りを\n完成させないと…", 7805, 0, 1, 2, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お姉ちゃんみたいに\n大人っぽく着こなす\nには一体どうしたら…", 7806, 0, 1, 2, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "弓のデザインも\nかわいいんですよっ♪\n常に持ち歩きたいです\nけど…危ないですよね", 7807, 0, 1, 2, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "きれいな服を着てると\nお姫さま気分に\nなれますね…あとは\n王子さまがいれば…♪", 7808, 0, 4, 2, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お兄ちゃんっ！\n私は褒められて伸びる\nタイプなのでもっと\nナデナデしてください", 7809, 0, 8, 2, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "妹モーニングコール♪\nお姉ちゃんより先に\n起こしに来れました！", 7810, 1, 1, 2, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ああっ、お姉ちゃん！\nお兄ちゃんにアーン\nするなんてずるいです\n私もしたいですっ！", 7811, 2, 1, 2, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おやすみの時間ですね\nえへへ、きょうだいで\n並んで寝るのって\n楽しいですよね！", 7812, 3, 1, 2, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "スイーツを食べた後は\nお腹を休めましょう～\n平気平気…ちゃぁんと\n運動もしますからぁ…", 7814, 0, 1, 3, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "お姉ちゃんも\nこういうかわいいもの\n好きなんですかね", 7815, 0, 1, 3, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "くんくん…\nなんの匂いでしょうか\n新しいスイーツ？", 7816, 0, 1, 3, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "きょうだい３人\n肩を寄せて暖まるとか\nよくないですかっ？", 7817, 0, 1, 3, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "いつも元気な妹で\nいるためには\nよく食べるのが大事！", 7819, 0, 1, 3, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "なんか姉に関する本が\nちらほらと混ざって…\nこれお姉ちゃんの\n仕業ですね！？", 7820, 0, 1, 3, 128201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふんふんふ～ん\nお正月で世間は\n浮かれてるですねえ\nま、いいですけど♪", 7823, 0, 1, 1, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "は～、お正月は\nだらだらできて\n最高ですね\n…いつも通りですけど", 7824, 0, 1, 1, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ビッグな幹部は\nビッグなお年玉が\nもらえるはずです\n楽しみですね", 7825, 0, 1, 1, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今度ドラちゃんに\nお年玉を持っていって\nやりたいですね", 7826, 0, 1, 1, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "そういえばアユアユと\n約束してたですよ…\nそろそろ出かける\nですかね", 7827, 0, 1, 1, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お年玉がもらえたら\n何に使うか…\n今のうちに\n考えとくです", 7828, 0, 4, 1, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "年神の報酬の駄菓子が\nたまってきたですね…\nガキどもにでも\n配っちまうですよ", 7829, 0, 8, 1, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あたしのレアな\n晴れ着姿、今のうちに\nしっかり目に焼き付け\nとくがいいですよ", 7830, 0, 1, 2, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お兄さんは今日も\nヒマそうですねぇ…\nしょうがないから\nかまってやるですよ", 7831, 0, 1, 2, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そういえばカヤぴぃ\n見なかったですか？\n喧嘩屋初売りセール\nとか言ってたですけど", 7832, 0, 1, 2, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お正月ならではの\n大きなシノギ…\nなにかないですかね？", 7833, 0, 1, 2, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "いいとこに来たですよ\nさっき走ったら帯が\n曲がっちゃったです\n直すの手伝うです！", 7834, 0, 4, 2, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "年神の仕事ですか？\nこれからいくとこです\nお兄さんも一緒に\n来やがるですよ！", 7835, 0, 8, 2, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふぁあ…\nどうしたですか？\nお正月に早起きなんて\n無粋ってヤツですよ…", 7836, 1, 1, 2, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "小腹が減ったですね\n一緒におせちでも\nつつきにいくですよ！", 7837, 2, 1, 2, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜はあたしの時間\nと言いたいとこですが\n初夢のために早く\n寝とくですかね…", 7838, 3, 1, 2, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "正月は食っちゃ寝\nするのが仕事…\nって聞いたこと\nあるですよ", 7840, 0, 1, 3, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふふっ、晴れ着の\nあたしの次くらいには\nかわいいですね", 7841, 0, 1, 3, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "なんかいい匂い…？\nよく知らんですけど\n晴れ着からも同じ\n匂いがしてるですね…", 7842, 0, 1, 3, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふ～あったまるです…\nお正月の唯一の弱点は\n寒いことですからね…", 7843, 0, 1, 3, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…正月太り？\nあたしには関係ない\n言葉ですね", 7845, 0, 1, 3, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "あったあった…\nトーゴクには\nドラゴンの神宮も\nあるんですね", 7846, 0, 1, 3, 128301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お正月のトラブルも\nハツネちゃんが\nめでたく解決\nしてみせるのだ～！", 7848, 0, 1, 1, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そうだ、新年会に\nサプライズ大作戦を\nしかけちゃおう！", 7849, 0, 1, 1, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "イノリちゃんも\nカスミンも振袖姿が\nかわいかったな～", 7850, 0, 1, 1, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "シオリンに\nお年玉あげたいし\n彼にバイトを紹介\nしてもらおうかな？", 7851, 0, 1, 1, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "今度はどんな凧を\n飛ばそうかな？\nみんなが驚くような\n凧がいいよね～", 7852, 0, 1, 1, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ひらめいた！\n彼への年賀状は\nきらーんっ☆って\n感じにしよう！", 7853, 0, 4, 1, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "来年も彼の隣で\n初日の出が\n見られるといいな～", 7854, 0, 8, 1, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今日はキミが\nギルドハウスに来る\n予知夢を見たんだよ～\nふふ、正夢になったね", 7855, 0, 1, 2, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "この振袖どうかな？\nすっごくかわいいよね\nえへへ、ありがとう～", 7856, 0, 1, 2, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ハツネちゃんおみくじ\n開始！　きらーんっ☆\nキミは大吉なのだ～\nどう元気出たかな？", 7857, 0, 1, 2, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今度エルフの森にある\n薬草を使って七草粥を\n作ろうと思うんだ～\nぜひ食べてほしいな♪", 7858, 0, 1, 2, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "お正月っぽい遊びを\n色々と用意したのだ～\nたまにはギルドハウス\nでゆっくり過ごそうよ", 7859, 0, 4, 2, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "もしかして眠たいの？\n…じゃあ、また膝枕\nしてあげてもいいよ？", 7860, 0, 8, 2, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "いっぱい寝たから\n元気いっぱいだよ～\n今日もがんばろう！", 7861, 1, 1, 2, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼だね～\nおせちがあるから\nキミも食べるでしょ？", 7862, 2, 1, 2, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そろそろ寝る時間だね\n今日はどんな夢を\n見られるかな～", 7863, 3, 1, 2, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いい座り心地～\n寝正月で過ごすのも\n最高なのだ～", 7865, 0, 1, 3, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいな～\n癒されてぐっすり\n眠れそうだよ～", 7866, 0, 1, 3, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香り～\nリラックスすると\n眠たくなっちゃうよ…", 7867, 0, 1, 3, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ポカポカいい気持ち～\n初日の出の温もりを\n思い出しちゃうな～♪", 7868, 0, 1, 3, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ、おいし～\nでもいっぱい食べたら\n眠くなっちゃった…", 7870, 0, 1, 3, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ\nお正月料理も\n色々あるんだね～\n今度作ってみようかな", 7871, 0, 1, 3, 128401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "最近カレを見てたら\n何故かおいしそうに\n思えてくるんだよな…", 7873, 0, 12, 1, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "手握っててくれるか？\nじゃないとオレ…\n力が抑えきれない…", 7874, 0, 12, 2, 106501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "つかの間の平和を享受\nしながらぬくぬくと\n読書に耽る…\nふふ、最高だね", 7875, 0, 1, 1, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お正月飾りなんて\n置いたらはしゃいでる\nように見えるかな…？", 7876, 0, 1, 1, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ま、まずい…\n一人遊びしすぎて\nお正月遊びをほぼ\n極めつつある…", 7877, 0, 1, 1, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ミステリーは\n時と場所を選ばない\nつまり…新年でも\n探偵は休まないよ！", 7878, 0, 1, 1, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お世話になった人に\n年賀状でも書こうかな\n助手くん、喜んで\nくれるかな…えへへっ", 7879, 0, 1, 1, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "絵馬に願い事を書こう\n助手くんと一緒に\nいられますように…♪\n…は、恥ずかしいな", 7880, 0, 4, 1, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "助手くんはもっと\n派手な着物のほうが\n好みだったかな…？\nき、気になる…", 7881, 0, 8, 1, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "やあ。助手くんも\nお正月休みを\n持て余してるのかい？\nふふ、似た者同士だね", 7882, 0, 1, 2, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "助手くん助手くん！\n凧あげしにいこう！\n…そ、捜査の一環で", 7883, 0, 1, 2, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "着物は転びそうで\n怖いんだよなあ…\nお、押さないでね？\nフリじゃないよ！？", 7884, 0, 1, 2, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ひ、人目を憚る\n本を読むなら\nみんなが帰省中の今！\nはっ！　助手くん！？", 7885, 0, 1, 2, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ね、ねえ…助手くん…\n一緒に初詣いかない？\nあ、いや！　深い\n意味はないんだけど！", 7886, 0, 4, 2, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あはは…助手くんと\n一緒だと家でごろごろ\nしてるだけでも\n楽しいや…♪", 7887, 0, 8, 2, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふぁ～…\nお正月休みのおかげで\n昼夜逆転中だよ…", 7888, 1, 1, 2, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お正月も依頼が\nひっきりなしだね\nさあ、街へ出よう！\nもちろん君も一緒にね", 7889, 2, 1, 2, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "も、もっと\n近くにきてもいいよ？\n冬の夜は…寒いからね", 7890, 3, 1, 2, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ううぅ～…！\nこのままじゃ\n寝正月だぁ…！", 7892, 0, 1, 3, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "みんなが帰省中でも\nこれがあれば\n寂しくない…かな", 7893, 0, 1, 3, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "うーん…♪\nお正月休みの\nリフレッシュに\nちょうどいいや♪", 7894, 0, 1, 3, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ふぅ…あったまるな\n冬は寒いから\n助かるよ…", 7895, 0, 1, 3, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "うーん、おいしい♪\n読書のお供に\nちょうどいい", 7897, 0, 1, 3, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "時間に余裕があると\n読書が進むよ\nいざ、本棚読破だ♪", 7898, 0, 1, 3, 128501);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "この新しい力…\nさらに使いこなせる\nようになるには…", 7900, 0, 1, 1, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "私に眠る属性の力…\n風の力以外には\nどんな力があるのかな", 7901, 0, 1, 1, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今の私なら\nどこまでいけるのか…\nやれるだけ\nやってみよう", 7902, 0, 1, 1, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "風の力の制御…\n段々とコツが\n掴めてきたな", 7903, 0, 1, 1, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "風の力か…\n応用の幅は広そうだ\n何ができそうか\n色々試してみよう", 7904, 0, 1, 1, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "今度、私とキミで\n料理対決でもする？\n簡単には負けないよ", 7905, 0, 4, 1, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この胸に溢れる\n温かな気持ちは…\nきっと彼への…", 7906, 0, 8, 1, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "一段と剣技が\n冴えてきたような…\nいや…油断禁物だ", 7907, 0, 1, 2, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "かっこいいって？\nありがとう…そんなに\n真っすぐ褒められると\n照れてしまうな…", 7908, 0, 1, 2, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "どれほど厚い壁が\n立ち塞がろうと\n打ち破ってみせる", 7909, 0, 1, 2, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "手が空いてるなら\n剣の稽古に少し\n付き合ってくれるかな", 7910, 0, 1, 2, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "試練を乗り越えて…\n私の中にあるものが\nはっきりと分かったよ", 7911, 0, 4, 2, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "キミから流れてくる\n力の温かさ…これが\n私たちの絆なんだ", 7912, 0, 8, 2, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝だよ、そろそろ\n起きる時間だ\nそれとも私に起こして\nほしいのかな？", 7913, 1, 1, 2, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼食は私が作るよ\nリクエストはある？\nできる範囲で応えるよ", 7914, 2, 1, 2, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おやすみ。また明日も\n一緒に冒険しよう\n約束だよ？", 7915, 3, 1, 2, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休める時は休む…\n戦い続けるには\n必要なことだからね", 7917, 0, 1, 3, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "心の安らぎの大切さ…\nそれを知れたのは\nキミたちのおかげだね", 7918, 0, 1, 3, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "気持ちが落ち着くな…\nこの香り、風の力で\n纏えたりしないかな", 7919, 0, 1, 3, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖まった空気の流れ…\n以前より風の変化に\n気づくようになったな", 7920, 0, 1, 3, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "この味付け…\n今度試してみようか\n味見は任せたからね", 7922, 0, 1, 3, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "心技体、すべてを\n鍛えるには座学も\n必要だからね", 7923, 0, 1, 3, 128801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "瞑想するのに\nいいところはあるかな\n集中できて…お昼寝は\n我慢できるところ", 7925, 0, 1, 1, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここにはあったかい\n空気が流れてるなぁ…\nみんなが受け入れて\nくれるおかげだね", 7926, 0, 1, 1, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "まるで心の中に\n光が満ちてるみたい…\nこの気持ち、みんなに\nおすそ分けしたいな♪", 7927, 0, 1, 1, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この衣装は属性の力を\n反映しやすいんだよね\nキラキラしてるのも\n納得だよ", 7928, 0, 1, 1, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "エルフの里のみなさん\n元気かなぁ…\nまた会いに行きたいな", 7929, 0, 1, 1, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "まだ変身できてる…\nわたしと騎士クンの\n修行の成果\n出てるなぁ…ふふっ♪", 7930, 0, 4, 1, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この服を脱いだら\nどうなるのかな…\nた、試す勇気は\nないけど…", 7931, 0, 8, 1, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふぅ…あ、騎士クン\nちょうど瞑想してたの\n一緒に…する？", 7932, 0, 1, 2, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "不思議だけど\nいつの間にか\n出たり消えたりするの\n…背中の輪っか！", 7933, 0, 1, 2, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この服って肌触りが\nとってもいいんだよ\nさ、触ってみる？\nスベスベだよ？", 7934, 0, 1, 2, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "アストラルの力…\nすごく持続できてるね\n修行の成果が出てるよ", 7935, 0, 1, 2, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "この力があれば\n暗いところで\n落とし物をしても\n見つけやすいかも…？", 7936, 0, 4, 2, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "冒険の準備なら\nできてるよ\nいつでも声をかけてね\n…楽しみにしてる！", 7937, 0, 8, 2, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう騎士クン\n一緒にお散歩とか…\nどうかな？", 7938, 1, 1, 2, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯のあとの\n瞑想って難しいんだよ\n眠くなっちゃって…", 7939, 2, 1, 2, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜ふかしさんは\nほどほどにね？\n一日頑張った自分を\n休ませてあげないと", 7940, 3, 1, 2, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "のんびりしてたら\nケーキが食べたく\nなっちゃうなぁ…\nでも太る…よね…？", 7942, 0, 1, 3, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わあ、かわいい…！\n見てるだけで\nにやけちゃう…♪", 7943, 0, 1, 3, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これは…花の香りかな\n知ってる花かも…？\n当ててみようっ", 7944, 0, 1, 3, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったかいと\nどうしてこんなに\n落ち着くんだろう…", 7945, 0, 1, 3, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食べ過ぎたらお腹が\n目立っちゃうかもって\n分かってるのに…！\n止められないよ～っ！", 7947, 0, 1, 3, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "こ、恋の精霊とか\nいたりするのかな…？\nはっ！　ダメダメっ！\n実力で頑張らないと", 7948, 0, 1, 3, 128901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お部屋の中でも\n修行、修行っ♪\nでも燃やさないように\n注意しなきゃだね", 7950, 0, 1, 1, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うーん…この衣装\n厚着か薄着か\nどっちなんだろう…？", 7951, 0, 1, 1, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いつもの肉球がない分\nお片付けしやすいな♪\n騎士くんのお部屋\nピカピカにしとこー！", 7952, 0, 1, 1, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お休みは騎士くんと\nＢＢＱに行きたいなー\nあたしと一緒なら\n火の心配はいらないよ", 7953, 0, 1, 1, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "この姿ならもっと\n人を助けられる…！\nえへへっ！\n燃えてきたーーっ！", 7954, 0, 1, 1, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "騎士くんが帰ったら\nアイラみたいな笑顔で\nお疲れさまさまって\nお出迎えしよっと…♪", 7955, 0, 4, 1, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この姿の時、いつも\n胸が熱く燃えてるのは\nずっと騎士くんのこと\n考えてるからかな…？", 7956, 0, 8, 1, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "騎士くん騎士くん！\nあたしに触れると\nやけどしちゃうよ…？\nなんちゃってー♪", 7957, 0, 1, 2, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "おっ、騎士くん\n修行に行きたいの？\nえへへっ、いいねー♪\n二人で燃えちゃおー！", 7958, 0, 1, 2, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "そうだ騎士くん\nじゃんけんしよっか？\nグローブ外してるから\nチョキも出せるよっ♪", 7959, 0, 1, 2, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この姿でいられる時間\nすごく増えてきた…！\nえへへ！　あたしたち\n修行の成果出てるね！", 7960, 0, 1, 2, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "じっと見つめないでよ\n顔が真っ赤に…やば！\nほんとに顔から\n火噴いちゃいそう…！", 7961, 0, 4, 2, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "火には強くなれても\n騎士くんに触られた\nほっぺはずーっと\n熱くてたまんないや…", 7962, 0, 8, 2, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよー騎士くん！\n今日も一日\n燃え滾っていくよー！\nファイヤーッ！！", 7963, 1, 1, 2, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "騎士くんお昼だよ！\nちゃんとご飯食べて\n午後からの修行も\n乗り切ろうねー！", 7964, 2, 1, 2, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日もお疲れさま！\nそうだ、寝る前に\nキャンプファイヤー\n囲んじゃおっか♪", 7965, 3, 1, 2, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ぼふーんっ！\nえへへ、気持ちいい…\n修行の前に\nちょっと休憩ー♪", 7967, 0, 1, 3, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいな～♪\nなでなでなでなでなで\nなでなでなでなでっ！\nあははっ、摩擦熱！", 7968, 0, 1, 3, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ん～いい香り♪\n少し熱したほうが\n香りが広がるね…って\n蒸発しちゃった！！！", 7969, 0, 1, 3, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "外でも自分の火で\nあったまれるけど\nお部屋でぬくぬく\nするのが一番だよね♪", 7970, 0, 1, 3, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐっ！\nお腹が減っては\n人助けはできずっ！\nもぐもぐもぐっ！", 7972, 0, 1, 3, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…\nなるほどなるほど…\n…これが上手な\nＢＢＱのやり方か…", 7973, 0, 1, 3, 128701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "…壁も扉も柱も\n全て記録で見たまま\n本当に…来ているのね", 7975, 0, 1, 1, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "…騒がしい場所\n騎士クンが受け入れて\nくれるのをいいことに", 7976, 0, 1, 1, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ここが…騎士クンの\n守りたかった場所\n騎士クンの思い出が\n詰まった場所…ね", 7977, 0, 1, 1, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "視線を感じる…\nこちらの様子を\n探るような…心の動き\n取るに足らないけれど", 7978, 0, 1, 1, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "…そこかしこで…\n言葉にもしたくない\n相手が過ごしていた\n記録を思い出す…", 7979, 0, 1, 1, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "人は多いけれど…\n雪深い山中よりは\n過ごしやすい…か", 7980, 0, 4, 1, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "自覚したことは\nあまりなかったけれど\nひどく…諦めの悪い女\nなのかもしれない", 7981, 0, 8, 1, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お招きありがとう\nそれで…何をして\nいればいい…かな？", 7982, 0, 1, 2, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここは…明るいね\nわたしの城と比べると\nなんだか眩しいくらい", 7983, 0, 1, 2, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "仮面はもう必要ないよ\nだって…わたしの顔を\n騎士クンに見て\nもらえなくなるから", 7984, 0, 1, 2, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "騎士クンさえよければ\nわたしの城に専用の\n部屋を用意するよ\n…いつでも", 7985, 0, 1, 2, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "…騎士クンのマント\nまた貸してほしいな\nきれいに使うから\n…だめ？", 7986, 0, 4, 2, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "いつか二人の願いが\n重なり合えるって…\n信じているね\n…いつまでだって…", 7987, 0, 8, 2, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはよう、騎士クン\n…昨日は夢の中で\nお話ししすぎちゃって\nごめんね。ふふっ", 7988, 1, 1, 2, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お腹は…空いてない？\n食べ物はないけれど\n空腹を忘れる魔法なら\nかけてあげられるよ", 7989, 2, 1, 2, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "騎士クン…\nまだ、眠らないの？\n…そう。それなら…\nわたしも起きているね", 7990, 3, 1, 2, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "肩の力を抜くには…\nまだ時間がかかりそう\nきっと…騎士クンと\n二人きりなら別なのに", 7992, 0, 1, 3, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぺんぽこりん…\nそう、確かあれも\nこんな感じだった…", 7993, 0, 1, 3, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "花の香りは…好き\nつかの間\n心を穏やかに\nしてくれるから", 7994, 0, 1, 3, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あたたかい…けれど\n騎士クンの優しさに\n比べれば、まだまだ", 7995, 0, 1, 3, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "おい、しい…？\nこの感覚が、それ？\nなぜか…納得できる", 7997, 0, 1, 3, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "情報を入手するには\nわざわざ本を開く\n必要があるだなんて…\nプレイヤーは面倒ね", 7998, 0, 1, 3, 129001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "メルクリゾートか…\n良い記憶はないな\nよし忘れよう", 8000, 0, 1, 1, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "知性の戦士ユニ！\nその恐るべき筋力！\nふおお！　うにゃー！", 8001, 0, 1, 1, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぽーん！\n石用の水着ください！\nセクシーロゼッタが、\n渚の視線を独占です！", 8002, 0, 1, 1, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "学院から奨学金を\n勝ち取るより某財団を\nだまくらかした方が\n早い気がしてきたな…", 8003, 0, 1, 1, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "わんつぅ、わんつぅ…\nんぎゃあ足攣ったー！\nおのれカルミナとやら\n絶対に許さん！", 8004, 0, 1, 1, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ところで…なぜぼくは\nプールでもないのに\n水着のままなんだ…\nおのれ世界め！", 8005, 0, 4, 1, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "彼と二人で撮った動画\nうう、凝視に耐えん…\nなんだこのムズ痒さは", 8006, 0, 8, 1, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なに？　水着姿で\n寒くないのかだと？\n普段からもっと薄着の\n娘が沢山いるだろう", 8007, 0, 1, 2, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "シノブ君にメリゾの\n招待状を送ったのだが\n御尊父の暴走を\n心配していたな…", 8008, 0, 1, 2, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ミミ君らにメリゾの\n招待状を送ったのだよ\n迎える準備をせねば…\nおしゃぶり持ってる？", 8009, 0, 1, 2, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "本質の賢者…？\nいや元気にしているが\nなぜ君がぼくの身内を\n知っているんだ…？", 8010, 0, 1, 2, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "水着が似合ってる？\nな、なんだね突然…\nやめたまえよふひひ…", 8011, 0, 4, 2, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "今度は夏にメリゾへ\n行きたいものだ\nむろん君も一緒だぞ", 8012, 0, 8, 2, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ぐああっ、朝陽が…！\n朝陽が昇っている…！\n夜行性ユニ死んじゃう", 8013, 1, 1, 2, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ…もう昼か…\nそろそろ寝ないとな\n規則正しい生活を\nしないと不健康だ…", 8014, 2, 1, 2, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ひゃっはー、夜だー！\nオレたちの時間だぜ！\nふおおブチ上がり～！", 8015, 3, 1, 2, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "これは…ぼくにここで\n寝ろということか？\n一向に構わんが…", 8017, 0, 1, 3, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "きゃっきゃっ！\nこれかわい～！\n…よし、今日も\n子供の擬態完璧だな", 8018, 0, 1, 3, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふむ、良い香りだ\nだがそれだけか…\nとくに精神高揚効果は\nないのか…ちぇー", 8019, 0, 1, 3, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "火を見ていると…\n魔導罐を思いだすな…\nかに座、元気かな…", 8020, 0, 1, 3, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ええい、\n固形食物はいらん！　\nポーションを出せ！", 8022, 0, 1, 3, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "やはり書は文系に限る\nなんと心地よい筆致…\nぐああ突然理系文が！\nひぃ目が理系になる！", 8023, 0, 1, 3, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "ほああ～！\n知性の海上騎士ユニ！\nこれは新たな可能性！", 8025, 0, 1, 3, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "これは…なんだ？\n何が面白いんだ？\n難しいな…", 8026, 0, 1, 3, 129301);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "大切な人と過ごす\n正月の思い出、か…\n昔の私だったら\n考えられなかったな", 8027, 0, 12, 1, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "叶えたい願いなら\nたくさんあるよ\nそれでも一番を選ぶ\nなら、やはりキミと…", 8028, 0, 12, 2, 108901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "神殿にあった\n恋愛おみくじ…\n引いてみようかな…", 8029, 0, 12, 1, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "騎士クン。来年も\nまた一緒におみくじ\n結ぼうね。約束だよ", 8030, 0, 12, 2, 108801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "今度は騎士くんと\n一緒にうつった写真、\nおばあちゃんに\n送ろうっと♪", 8031, 0, 12, 1, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "あ、騎士くん！\n今年も…ううん\nこれからも、よろしく\nおねがいします♪", 8032, 0, 12, 2, 108701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "旧校舎の地下牢…\n真冬のサマー計画…\n等身大のＰＲ…\nうッ、頭が…！", 8033, 0, 1, 1, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "暇だし鏡でも見るか。\nお、いい腹筋育って…\nあ？　何見てんだコラ", 8034, 0, 1, 1, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "オレは金色の疾風！\nんん…なんか違うな。\n我が名は金色の…\nあ？　何見てんだコラ", 8035, 0, 1, 1, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "モニカとユニ先輩って\n口調と身長似てるけど\n子供扱いに対する\n反応は真逆だよね…", 8036, 0, 1, 1, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "シオリン元気かな…\n昔くちゃくちゃに\n撫でくり回して\n嫌がられたっけなァ…", 8037, 0, 1, 1, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "べつにいんだけどさ…\nあんたの知り合いって\n普段から水着みたいな\nカッコの女多くない？", 8038, 0, 4, 1, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "そだ、弟らがあんたに\n会いたがってたンだ。\n暇だったらいつでも\nウチ来てやってよ", 8039, 0, 8, 1, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "特別講座は色々あった\nけど…メリゾ自体は\nまあ悪くなかったよね", 8040, 0, 1, 2, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "水着と合わせる小物に\nセンス出るよね、\nって話をミィコ先輩が\nしててマジわかりみ", 8041, 0, 1, 2, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "水着のミフユねえさん\nやっぱ仕上がってたね\nあれが竜殺しの体か…\nバリかっけーな…", 8042, 0, 1, 2, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "はにょんっ！？\nや、だからさ…\n後ろから声かけんな、\nつってンじゃん…", 8043, 0, 1, 2, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "メリゾの特別講座が\n上手くいったのも\n敏腕カメラマンがいた\nお陰だよ。ありがとね", 8044, 0, 4, 2, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あ？　この水着が？\n似合っ…え、なんて？\nごめ、聞こえんくて。\nもっかい言ってみて", 8045, 0, 8, 2, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "もう朝とかマジないわ\n昨日二人に付き合って\nオールでカラオケだよ", 8046, 1, 1, 2, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はぁ授業行かなきゃ…\n真っ昼間から勉強とか\nマジつらたん過ぎ…", 8047, 2, 1, 2, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日これから夜勤で…\nいやバイトちゃーくて\nボランティアの話よ？\n校則違反よくない", 8048, 3, 1, 2, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "うわ、ふっかふか…\nオニほど安らぐわ…\nやば、ユニってくる…", 8050, 0, 1, 3, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "うちも妹いりゃ\nこーゆーのもなァ…\nま自分用でもいいか", 8051, 0, 1, 3, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ふーん…\nいいじゃんこの香り\n抜群に嗅げるわ", 8052, 0, 1, 3, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "うちン家のルーツの森\n大火災でなくなった\nらしンだよね…\n生まれる前の話だけど", 8053, 0, 1, 3, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "何コレありがてぇー\n食料ほくほく過ぎて草\n米ガチで尊いわァ…", 8055, 0, 1, 3, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "いいけど、なんでうち\n水着で本読んでンだよ\nどーゆープレイだよ", 8056, 0, 1, 3, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "金色の海上騎士クロエ\n推して参る！　覇ァ！\nあ？　何見てんだコラ", 8058, 0, 1, 3, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "何コレ、貝の椅子？\nどーやって遊ぶんだ…\nいや座って終わりか…\nまァそりゃそーか…", 8059, 0, 1, 3, 129401);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さてと…\n明日の訓練メニュー\n考えねえとな", 8060, 0, 1, 1, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "また新入りの女子に\n弁当もらっちまった…\nありがたく食うけどよ", 8061, 0, 1, 1, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "種族なんて関係なく\nみんなが力を合わせて\nランドソルを守る…\nいい時代になったよな", 8062, 0, 1, 1, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "誰にだって長所はある\n新入りのいいところを\n見つけてやるのも\n教官の仕事だ", 8063, 0, 1, 1, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "厳し過ぎても\n甘過ぎてもダメ…\n教官ってのは難しいぜ", 8064, 0, 1, 1, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "戦いが苦手な新入りを\nどうフォローするか…\n後であいつと\n相談してみるか", 8065, 0, 4, 1, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あいつは優し過ぎて\n戦いに向いてねえ\n…そういう甘さ\n嫌いじゃねえけどな", 8066, 0, 8, 1, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "強くなる近道はねえ\n地道な鍛錬あるのみだ\nさ、訓練始めるぞ！", 8067, 0, 1, 2, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "新入りにも\nいつも言ってるが…\n装備の手入れは\n念入りにしろよな？", 8068, 0, 1, 2, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "座学も受けてえのか？\nいい心がけだな！\nなんでも教えてやるよ\n…魔法以外ならな", 8069, 0, 1, 2, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "新入りたちがよく\n恋バナしててな…\nお、おまえは…誰か\n気になるやついるか？", 8070, 0, 1, 2, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "なあ、ストレッチ\n手伝ってくれねえか？\n訓練前にしっかり\n筋肉ほぐさねえと…", 8071, 0, 4, 2, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ずいぶん頑張って\n鍛えたよな、おまえ\nよし！　ご褒美に\nお菓子作ってやるよ♪", 8072, 0, 8, 2, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "訓練日和だな！\nさぁて…まずは\n走り込みといくか！", 8073, 1, 1, 2, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "昼飯はしっかり食えよ\nでなきゃ、\nこの後もたねえぜ？", 8074, 2, 1, 2, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "とっくに消灯時間だ\nさっさと寝な？\n明日も早いんだからよ", 8075, 3, 1, 2, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休むのも訓練のうちだ\n今はのんびり\nさせてもらうぜ", 8077, 0, 1, 3, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "いい面構えだ\n気に入ったぜ！\nあたしの班に入るか？\n…なんてな♪", 8078, 0, 1, 3, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "…いやされる匂いだな\n新入りたちにも\nすすめてみるか…", 8079, 0, 1, 3, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あったけえからって\n寝ないようにしねえと\n教官としての\n威厳に関わるからな…", 8080, 0, 1, 3, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食事も訓練の一環だ\nとはいえ食い過ぎには\n気をつけねえと…", 8082, 0, 1, 3, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "トーゴクの剣術…か\nなにか訓練に\n活かせるかもしれねえ", 8083, 0, 1, 3, 129801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あのおかたに近付く\n不埒な輩には、特別な\n訓練で地獄を見て\nいただきましょう", 8085, 0, 1, 1, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "これだけ広ければ\n多少派手に\n動き回っても\n問題なさそうですね", 8086, 0, 1, 1, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…今誰か私を\n「鬼」教官と\n呼びませんでしたか？", 8087, 0, 1, 1, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "新しく開発したこの薬\n誰か試してくれる人は\nいませんか？", 8088, 0, 1, 1, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "厳しくすれば投げ出し\n優しくすればサボる\n人というのはどこまで\n度し難いのでしょう", 8089, 0, 1, 1, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "はじめましょう\nあのおかたの心を\n射貫くための\nシミュレーションを", 8090, 0, 4, 1, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あらゆる苦難と\n忌々しい女から守る\nためにも、私自身も\n鍛えておかねば", 8091, 0, 8, 1, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あなた様、そんなに\n見つめられると…え？\nエリコはカッコいい？\nええ、当然ですとも", 8092, 0, 1, 2, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "不調があればすぐ\n報告してください\n体のケアも教官の\n大事な役目ですので", 8093, 0, 1, 2, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "新しい訓練器具の\n使い心地はどう…え？\n重すぎる？　これでも\n軽くしたのですが…", 8094, 0, 1, 2, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "運動後には特製の\n栄養ドリンクをどうぞ\nクスクス、何も\n入れたりしてませんわ", 8095, 0, 1, 2, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "よくがんばりました\nあなた様。あぁ…\nお疲れになったお顔も\n素敵ですわ", 8096, 0, 4, 2, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "あなた様、二人だけの\n遠征訓練へ\nまいりましょう。\n既に準備万端ですわ", 8097, 0, 8, 2, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "まだ眠いですか？\nならばストレッチで\n体を痛めつ…ではなく\nほぐしていきましょう", 8098, 1, 1, 2, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼はお弁当をご用意\nいたしました。量も\nスタミナも増し増し\n残さず食べてください", 8099, 2, 1, 2, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "よい睡眠こそ健やかな\n体に不可欠。ですので\n私が寝ずの番をさせて\nいただきますわ", 8100, 3, 1, 2, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休憩用に使おうと思い\nましたが、心地よくて\n立てなくなって\nしまいますわ…", 8102, 0, 1, 3, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "中に重しを詰めれば\n愛でながら運動が\n可能ですわ", 8103, 0, 1, 3, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "香りでリラックスさせ\n同時に暗示を\nかけてみましょうか", 8104, 0, 1, 3, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "…くっ、眠気を誘う\nこの暖かさ…\n油断も隙もありません", 8105, 0, 1, 3, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "主食はこちらで十分\nまかなえますわね\nそれでは私はおかずを\n作りましょう", 8107, 0, 1, 3, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "まあ、実用書の類も\n揃っているのですね\nとても助かりますわ", 8108, 0, 1, 3, 129901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "……（そわそわ）", 8110, 0, 1, 1, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここに寄らずの花陣…\n作ったらダメですよね", 8111, 0, 1, 1, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "部屋の隅が\n落ち着きます\nそれか、陽の当たる所", 8112, 0, 1, 1, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "身を隠せる場所が\nあると…\n助かるんですけど", 8113, 0, 1, 1, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "複雑な造りの家ですね\n触って壊れたり─\nしませんか？", 8114, 0, 1, 1, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "出入りするひと\nみんな、笑顔…\n…変わった家ですね", 8115, 0, 4, 1, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この家なら安全─\nかもしれません\n魔物が出ないので", 8116, 0, 8, 1, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "これも、視察の一環\n遊びに来たわけじゃ\nないです", 8117, 0, 1, 2, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "長話─苦手です\n疲れるので…\nふぅ…", 8118, 0, 1, 2, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ここで友達を作れと\nネアさんが…\nそう、言われても…", 8119, 0, 1, 2, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "世話をするのは\n得意です\n…花の、ですよ？", 8120, 0, 1, 2, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "媛へのお土産を\n探してるんですけど…\n…貴方のおすすめ、\n聞いておきます", 8121, 0, 4, 2, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "平和でのんきで…\n貴方らしい家です\n一応、褒めてます", 8122, 0, 8, 2, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "花に、お水─？\n…いりません", 8123, 1, 1, 2, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "日が高いうちは\nむやみに外へ出ません\n面倒事、多いので…", 8124, 2, 1, 2, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜番。私がします\nあまり眠らない\n性質なので…", 8125, 3, 1, 2, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここなら根を張れる\nかもしれません\n…張りませんけど", 8127, 0, 1, 3, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こんなにやわな体じゃ\n身を守れませんよ─\n…あ。生き物じゃ\nないんですね", 8128, 0, 1, 3, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "花みたいに─\nいい匂い、です", 8129, 0, 1, 3, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "火を見てると、\nジオ・ゲヘナを\n思い出します…ふぅ", 8130, 0, 1, 3, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食事も立派な戦支度\n媛が言ってました", 8132, 0, 1, 3, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "知識も武器の一つだと\n媛が…でも、\nこれでどうやって…？", 8133, 0, 1, 3, 129601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "天気もいいしお花畑に\nピクニックでも\n行こうかな♪", 8135, 0, 1, 1, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ、どこからか\nお花の匂いが…\nいい香りですね", 8136, 0, 1, 1, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "新しいシャベルとか\nじょうろもほしいなぁ\nお小遣いしっかり\nためないとね", 8137, 0, 1, 1, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "お花飾りたいけど\n花瓶はどこかな…\nあとであの人に\n聞いてみよっと", 8138, 0, 1, 1, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "お花の観察日記\n書かなきゃ\n日々勉強は\n欠かせませんよ", 8139, 0, 1, 1, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "衣装にお花を足して\nみたけど、あの人\n気付いてくれるかな？", 8140, 0, 4, 1, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この花冠、上手に\n作れたかも…\n日頃のお礼にあの人に\nあげようかな…", 8141, 0, 8, 1, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あなたは何のお花が\n好きですか？　ほら、\n一応知っておいたら\n役に立つかもですし", 8142, 0, 1, 2, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "そのお花、乱暴に\n扱っちゃダメですよ\n花粉が服について\nとれなくなりますから", 8143, 0, 1, 2, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "土いじりしたから\n服が汚れてますよ\nはたいてあげますから\nじっとしててください", 8144, 0, 1, 2, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そんなにすぐに芽は\n出ませんよ\nまあ、楽しみなのは\n私も同じですけど…", 8145, 0, 1, 2, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "この衣装、そんなに\n気になります？　なら\nこうしてお花を\n着ければおそろいです", 8146, 0, 4, 2, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お花の種を私に？\nありがとうございます\nせっかくなので一緒に\nお世話しませんか？", 8147, 0, 8, 2, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "お花にお水をあげるの\n手伝ってもらえます？\nお水は朝にあげるのが\nいいんですよ", 8148, 1, 1, 2, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "とっておきのお花見\nスポットに\nご案内しますよ\nお弁当も忘れずに！", 8149, 2, 1, 2, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もうこんな時間\n早く寝ましょう\n草木も眠るなんとか\nって言いますからね", 8150, 3, 1, 2, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お花のお手入れって\nけっこう疲れますね…\nここでちょっと一息\nしちゃおっと", 8152, 0, 1, 3, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "耳にお花を着ければ…\nえへへ、すっごく\nかわいくなったね！", 8153, 0, 1, 3, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "これはラベンダー\nこっちはミモザ\nフローラル系の香り\nっていいですねぇ", 8154, 0, 1, 3, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ポカポカしますね～\nまるで春の陽気\nみたいです～", 8155, 0, 1, 3, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お花を一輪さすだけで\nご飯の時間がとても\n華やかになりますね", 8157, 0, 1, 3, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "お花の本が\nいっぱいある！\n今日はこれで\nお勉強です！", 8158, 0, 1, 3, 130701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ふんふ～ん♪\n華やかな服を着ると\n心がウキウキします♪", 8160, 0, 1, 1, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "花祭りで出会った\nみなさん…\nお元気でしょうか？\nまたお会いしたいです", 8161, 0, 1, 1, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "はっ！　そうでした\nこの服の時は\nメイドのお仕事は\nお休みでした…", 8162, 0, 1, 1, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この服は替えが\nありませんから\n大きなドジには\n気を付けないと…", 8163, 0, 1, 1, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "目立ったほつれもなし\n…うん、いい感じに\n補修できました♪", 8164, 0, 1, 1, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "メイド姿でなくても\n心はいつでも\nお嬢さまの\nメイドです♪", 8165, 0, 4, 1, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この服を着ると心が\n浮き立つのはあのかた\nと一緒にいる気持ちに\nなるからでしょうか？", 8166, 0, 8, 1, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "はい、今日は一日\nこの服で過ごそうと\n思います\n変じゃないですよね？", 8167, 0, 1, 2, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "花祭りのおかげで\n少しだけお花に\n詳しくなった…\nような気がします！", 8168, 0, 1, 2, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "花祭り、今度は\nお嬢さまと救護院の\nみんなと一緒に\n行ってみたいですね", 8169, 0, 1, 2, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今度キョウカちゃんと\n花祭りの服でお花を\n見にお出かけ\nするんです", 8170, 0, 1, 2, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "メイド服を全部洗濯\nしちゃうなんて…\nドジっちゃいましたぁ", 8171, 0, 4, 2, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "花祭りの服は私たちの\n思い出の服ですから…\nこれからも\n大切にします♪", 8172, 0, 8, 2, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "はう、そうでした\nお花にお水を\nあげる時間です！", 8173, 1, 1, 2, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼ご飯は\nバスケットを持って\nお花畑に食べ\nに行きませんか？", 8174, 2, 1, 2, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ふぁあ…繕い物を\nしていたらこんな時間\nになってしまいました\n早く寝ないと…", 8175, 3, 1, 2, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふわふわしてて\nきもちいいです～\nどんな生地を\nつかってるんだろ～？", 8177, 0, 1, 3, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "かわいいですね～\nぬいぐるみさんにも\n服をつくって\nあげたいです♪", 8178, 0, 1, 3, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りです～\nあれ？　もしかして\n私の服についてる花と\n同じ香りが…？", 8179, 0, 1, 3, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "暖かいですけど\nあまり近づいちゃうと\n頭の花飾りが乾燥\nしちゃいそうですね…", 8180, 0, 1, 3, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "もぐもぐ…\nいい花を咲かせるには\nしっかりとした栄養が\n必要だそうです！", 8182, 0, 1, 3, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "なるほどなるほど…\nお花のお手入れは\n奥が深いですね…", 8183, 0, 1, 3, 130801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "マホマホ王国にも\nサーカス団設立や\n夢と希望を届けますえ", 8185, 0, 1, 1, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "せっかくの晴れ舞台や\nかっこいいポーズも\nできるようにしたいわ", 8186, 0, 1, 1, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "むむむむ～っ。うーん\nクルルはんみたいに\n胸から宝石を出すんは\n難しいみたいやわ", 8187, 0, 1, 1, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "あむっ…んん～♪\nやっぱり練習のあとは\n甘いものに限るわぁ", 8188, 0, 1, 1, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "アーサーたちの衣装も\n今のうちに考えんと…\n生地、足りるやろか", 8189, 0, 1, 1, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "王子はんとなら\nどんなアイデアも\n見つけられます♪", 8190, 0, 4, 1, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "うちの晴れ姿が\n王子はんの目に一等\n輝いて見えますように", 8191, 0, 8, 1, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "キリっとしたうちも\nかっこいい？\nもう、上手やなぁ", 8192, 0, 1, 2, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "新しい演目考えたんよ\nなぁ王子はん、意見\n聞かせてもらえます？", 8193, 0, 1, 2, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "聞いてや王子はん\n動物さんたちとさらに\n息が合うてきたんよ\nみんな頑張り屋さんや", 8194, 0, 1, 2, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "演技の感想なら\n大歓迎どすえ♪\nたんと聞かせてや～", 8195, 0, 1, 2, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "王子はん、本番当日は\n最前席で見たってな\nそしたらうち、もっと\n頑張れますさかい♪", 8196, 0, 4, 2, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この技をあなたに\n捧げます…なんて♪\n驚いたやろ？\nどっきり作戦成功や♪", 8197, 0, 8, 2, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "素敵なショーのためや\n今日も焦らず一歩ずつ\n成長していきまひょ\nな、王子はん♪", 8198, 1, 1, 2, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お弁当、王子はんも\n一緒にいかがどす？\nみんなで食べて団結や", 8199, 2, 1, 2, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜のサーカスも\n幻想的でとっても\n魅力的なんよ\n一緒にいきまひょか♪", 8200, 3, 1, 2, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "練習が終わったあとは\nの～んびりして\n体力を回復せな…", 8202, 0, 1, 3, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "この子たちとなら\n空中ブランコや\n玉乗りもええなぁ", 8203, 0, 1, 3, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りやなぁ\n本番前の緊張も\n和らげてくれそうやわ", 8204, 0, 1, 3, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "このあったかい感じ…\nスポットライトの熱を\n思い出すわぁ", 8205, 0, 1, 3, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ちゃんと食べへんと\nいい演技はできまへん\n団長はんも言うてたわ", 8207, 0, 1, 3, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "動物さんたちのことも\nもっと勉強せな\n大事な仲間やさかい", 8208, 0, 1, 3, 131001);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "器用じゃないが、\n情には厚いよ\nこういう女を「一途」\nってそう言うんだろ？", 8210, 0, 12, 1, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 103, "斬れないものはないと\n思ってきたさ。だけど\n…この気持ちだけは\n斬れないね、絶対に", 8211, 0, 12, 2, 105601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "んしょ、んしょっ…！\n日頃の感謝を込めて\nヒーローさんのお家を\nきれいにしますです♪", 8212, 0, 1, 1, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふむふむ…\n新アトラクションは\nこのギルドハウスを\nモチーフに…", 8213, 0, 1, 1, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ごそごそ、こそこそ…\nヒーローさんに内緒で\nどこかにお礼の宝石を\n隠しておきましょう…", 8214, 0, 1, 1, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "パークの運営が\n落ち着いたら\nわたしもギルド活動？\nしてみたいですます♪", 8215, 0, 1, 1, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "こんなすてきな\nおうちに住めたら…\nいえ！　うさぎ小屋で\n十分です～っ", 8216, 0, 1, 1, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ヒーローさんのおうち\nだって意識したら\nアトラクションよりも\nドキドキしてきます…", 8217, 0, 4, 1, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ヒーローさんのことを\n考えると顔が赤く…\nこれってもしかして\nひょっとして…？", 8218, 0, 8, 1, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あっ、ヒーローさん！\n話しかけてくれた記念\nということで、宝石\n受け取ってください♪", 8219, 0, 1, 2, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "元気がない時は\n語尾にぴょんですっ！\nさあヒーローさんも\nやってみるぴょん♪", 8220, 0, 1, 2, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ヒーローさんへのご恩\nおばあちゃんうさぎに\nなるまでに、お返し\nできるでしょうか…？", 8221, 0, 1, 2, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ヒーローさん！\n二人で一緒に\nパレードの練習\nしませんか～♪", 8222, 0, 1, 2, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あはは♪\nヒーローさんは\n人を笑顔にする力が\nありますです♪", 8223, 0, 4, 2, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "ヒーローさんに\n一日一恩返しですっ！\n返し終わるまで\nやめませんですます♪", 8224, 0, 8, 2, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "おはようございます♪\nんしょ、んしょっ…！\n気持ちよく起きられた\n記念に宝石どうぞ♪", 8225, 1, 1, 2, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼にフードコートで\nかばばん君バーガー\n買ってきましたよ！\n一緒に食べますです♪", 8226, 2, 1, 2, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日も一日\nお疲れさまですっ♪\nマッサージしますから\n寝そべってください♪", 8227, 3, 1, 2, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "はふぅ～…♪\nお仕事の疲れも\nぴょんぴょ～んって\n飛んでっちゃいます♪", 8229, 0, 1, 3, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "わぁっ、とっても\nかわいいですますっ！\nギルドハウスの\nマスコットですね♪", 8230, 0, 1, 3, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ヒーローさんの好きな\n香り…これを宝石に\nつければ、受け取って\nもらえるでしょうか？", 8231, 0, 1, 3, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "はあ、気持ちいい♪\nヒーローさんの\n好きな温度に\n調整しときますです♪", 8232, 0, 1, 3, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "支配人は体が資本っ！\nたくさん食べ…すぎて\n動けなくなっちゃい\nましたぁ～…！", 8234, 0, 1, 3, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "パークの\nガイドブックとか\nあったらいいですね♪", 8235, 0, 1, 3, 130901);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "外あつすぎ溶けるわ～\nやっぱ部屋ん中で\n水着がラクだねー", 8237, 0, 1, 1, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ン～\nカリザきゅんどこー？\nもしかして逃げた？", 8238, 0, 1, 1, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ミソラちゃんと\nリリちゃん誘って\nそろそろイイコト\nしよっかなー？", 8239, 0, 1, 1, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "おねえちゃんに\n頼まれたシゴトは\nまた今度にすっかー\n夏休みだしー♪", 8240, 0, 1, 1, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "騎士きゅんの\nプリンセスフォームも\n見てみたいんだよなー\nンフ♡", 8241, 0, 1, 1, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "スライムを\nこーしてあーしたら\n騎士きゅんの泳ぐ\n練習に使えるっぽ？", 8242, 0, 4, 1, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "おかえり～♡\nって水着で迎えたら\n騎士きゅん喜んで\nくれるかなー？", 8243, 0, 8, 1, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "騎士きゅん\nこのサングラス\nかけてみる？\nぜってー似合うよー", 8244, 0, 1, 2, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "日焼け痛かったら\nいつでも言ってねー\nスライムでひんやり\nしてあげるよ～♪", 8245, 0, 1, 2, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今から外で\n焼いてこっかなー\n騎士きゅんもどー？", 8246, 0, 1, 2, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "スライムマッサージ\nしてあげよっかー\nほーれ、もみもみ～♡", 8247, 0, 1, 2, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "騎士きゅんが選んだ\n水着も着てみたーい\nネアおねえちゃんに\nどんなの着てほしい？", 8248, 0, 4, 2, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士きゅ～ん\n尻相撲しよっかー♪\nおねえちゃんに\n勝てたらご褒美だぞ～", 8249, 0, 8, 2, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "暑すぎてムダに\n早起きしちった～\n二度寝すっか～\n…ふぁあ…", 8250, 1, 1, 2, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "夏バテしても\nスイカとかかき氷なら\n全然ウェルカム\nなんだよなー", 8251, 2, 1, 2, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今日はこのまま\n水着で寝るかー\n夢ん中で泳ごー", 8252, 3, 1, 2, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "いったんキューケイ…\nンー…よし\n充電カンリョ～♪", 8254, 0, 1, 3, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "仲間になりたそうに\nこっち見てんねー\nきゃわいいしおっけ～", 8255, 0, 1, 3, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ン～いいニオーイ\nお日様あたった\n騎士きゅんの\n次くらいかな～", 8256, 0, 1, 3, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "カラダ冷えてきたから\nたすかるーおかげで\nまだまだ水着イケるわ", 8257, 0, 1, 3, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "うめ～\nとまんねぇ～\n夏バテどこいった～？", 8259, 0, 1, 3, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "ふむふむ…\nこれは意外と\nぬるっと読めるっぽー", 8260, 0, 1, 3, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "ンフフ～\n海の戦士ってカンジ？\nアリよりのアリだね～", 8262, 0, 1, 3, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "あーやべ\n一瞬で寝そー\nヤバだわ～", 8263, 0, 1, 3, 131101);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "服や紙が易々と\n燃えぬとは\nランドソルとはまこと\n住み易き国で候", 8264, 0, 1, 1, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "どの世界にあっても\n民は活力に溢れ\n街は賑わうもの…\n善哉、善哉", 8265, 0, 1, 1, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "食べ歩きに世界征服…\nギルドとはかくも\n自由気儘な徒党に\nありんすなぁ", 8266, 0, 1, 1, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "連絡は…今日もなし\n我が妹子は相変わらず\n放埓なことよ喃", 8267, 0, 1, 1, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "モネは相変わらず\n警戒しきりなれど…\nそのようなところも\n愛らしくあり申す", 8268, 0, 1, 1, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "なんと長閑な世にや\nありけむ…この平和は\n騎士殿たちの努力の\n賜物にありんす喃", 8269, 0, 4, 1, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "『王家の装備』は\n使わぬのかと？\n…フフ。すでに\n用いており申す", 8270, 0, 8, 1, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "今ばかりは媛という\n立場は置いて\nこの地の者らと\n歓談したく候", 8271, 0, 1, 2, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "強さの秘密？　…フフ\n女子の秘密を暴くのは\n野暮にござんす\nご寛恕いただきたく候", 8272, 0, 1, 2, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "此方の家屋、\n見目以上に\n堅牢であり申す\n何ぞ仕掛けがありや？", 8273, 0, 1, 2, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "心地よい時間とは\n疾く過ぎ去りゆくもの\n此処で過ごすと改めて\n実感できる喃", 8274, 0, 1, 2, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "視線が気になる？\nこれはすみませぬ\nなにぶん、お前さまは\n見ていて飽きませぬ故", 8275, 0, 4, 2, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "お前さまの前では\n誰もが心を開く…\nなんとまぁ罪作りな\n色男にありんすな？", 8276, 0, 8, 2, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "よく眠れましたかの？\n寝る子は良く育つ、と\n古くより申します由", 8277, 1, 1, 2, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "美食殿の作法に倣い\n皆で共に昼餉を頂くと\n致しんしょう", 8278, 2, 1, 2, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "逢魔ヶ時は望まぬ客も\n参るもの…お前さまも\n気をつけなんし", 8279, 3, 1, 2, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "わっちの蛇に\n勝るとも劣らぬ\n座り心地で候", 8281, 0, 1, 3, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "魂、万物に宿る\nとの云いあらば\n情愛を注いでやるのが\nよかろうの", 8282, 0, 1, 3, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いと香しき哉…\n騎士殿は香の道にも\n詳しくあられるか", 8283, 0, 1, 3, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ジオ・ゲヘナの\n灼熱と比ぶれば\nそよ風と変わり\nござんせん", 8284, 0, 1, 3, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "美味なる哉…この味\nぺコリーヌ姫が好むも\n道理にありんす", 8286, 0, 1, 3, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "トーゴクに、オーマ…\n書で見るだけでも\n心惹かれる土地よの", 8287, 0, 1, 3, 129701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "暑い日には\n冷たいものですよねー\nかき氷とか食べて\nすっきりしたいです★", 8289, 0, 1, 1, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海への行き来は\nテレポーテーションに\nお任せです★", 8290, 0, 1, 1, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "トロピカルジュースが\n飲みたいでーす♪\n海の家で見たんですよ\nカップル用ジュース★", 8291, 0, 1, 1, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "ご飯どうしようかなー\nあ、海鮮ラーメンとか\n美味しそうかも★", 8292, 0, 1, 1, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "水鉄砲、普通に撃つと\n少し物足りないかも…\nどるるるる～ん★って\n感じが欲しいですよね", 8293, 0, 1, 1, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "コイビトっぽいこと\nアオハルっぽいこと\nいっぱいしたいです★\n修羅場とかも♪", 8294, 0, 4, 1, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "騎士さんが溺れたら\n絶対助けに行きますね\n人工呼吸でもなんでも\nしてあげますから★", 8295, 0, 8, 1, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "騎士さーん\n日焼け止めの塗り直し\nお願いします★\n優しくしてくださいね", 8296, 0, 1, 2, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "海で食べたフルーツ？\nはい、まだありますよ\nこっちでもあーんして\n食べさせましょうか★", 8297, 0, 1, 2, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ぺんぽこりんは\nどうしたのかって？\nどうしたんでしょうね\nどーでもいいです★", 8298, 0, 1, 2, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "今日はどんな\nイイコトしましょうか\n思い出作り？\n人助けもいいですね★", 8299, 0, 1, 2, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "ヒモを引っ張ったら…\n「セ・キ・ニ・ン」\n取ってもらいますよ？\nなーんてウソですけど", 8300, 0, 4, 2, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "みんなでイイコトも\n楽しいですけど～\n…二人でイイコト\nしちゃいますか？", 8301, 0, 8, 2, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "朝ですよー！\n今日も一日、\nイイコト日和ですね♪", 8302, 1, 1, 2, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "日差しにご注意ですね\n日焼け止め…誰かに\n塗ってほしいなー？\n…ちらっ★", 8303, 2, 1, 2, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜の海って\n惹かれちゃいますよね\n…ロマンチックです★", 8304, 3, 1, 2, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "う～ん、まったり～\nこれぞ新ジャンル\nおうちバカンス★", 8306, 0, 1, 3, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "よーしよーし★\nわたしとイイコト\n一緒にしましょうねー", 8307, 0, 1, 3, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "いい香りですねー\nリラックスタイムに\nちょうどよさそう★", 8308, 0, 1, 3, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "水遊びのあとは\nしっかり体を\n温めないとですよね★", 8309, 0, 1, 3, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "栄養補給もバッチリ★\n遊びもイイコトも\nお腹が減ってたら\nできませんからねー？", 8311, 0, 1, 3, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "今だと海関連の本とか\n興味あるんですよねー\n魚とか海難救助とか★", 8312, 0, 1, 3, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "かっこいー★\n名前はー…\nぷんぷくぽんとか？", 8314, 0, 1, 3, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "映えますねー\n写真撮ったら\n素敵な思い出に\nなりそうです★", 8315, 0, 1, 3, 131201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "海でもないのに\nこの姿でいるのは…\nやはり、場違いでは\nありませんか…？", 8316, 0, 1, 1, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "スイカとは割ることと\n見つけたり！\n…ですが目隠しすれば\n見当たらないもの…", 8317, 0, 1, 1, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "まぁ、膝に砂が…\n気がつきませんでした\nまるでわんぱくな\nお子様のよう…ふふっ", 8318, 0, 1, 1, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "家の中でスイカを割る\nわけにはまいりません\nここは潔く包丁で\n切りましょう", 8319, 0, 1, 1, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "ミソラ様やネア様の\n大胆さを見習って…\nき、騎士きゅーん…★\n難しいですね…", 8320, 0, 1, 1, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "きゅ、急に暗く…！？\n…失礼しました\n鉢巻きが下がってきた\nだけでした…ううぅ", 8321, 0, 4, 1, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "わたくしに剣の才は\nあるのでしょうか…\nいえ、何事もまずは\nやってみなくては", 8322, 0, 8, 1, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "なにか羽織った方が\nよろしいですよね…？\nそのままでいい？\nそれはそれで…その…", 8323, 0, 1, 2, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あの、兄様…？\nスイカの種を飛ばす\n遊びもあるというのは\n…本当なのでしょうか", 8324, 0, 1, 2, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "強くなるための修行は\nまだ始まったばかり\nまずは己の目指すべき\n道を見定めなくては", 8325, 0, 1, 2, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "同じ薄着であっても\n黒い天使の姿より…\n気が楽です", 8326, 0, 1, 2, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "はい、ただいまー！\n…あっ！\n海の家でのお手伝いの\nくせが、つい…", 8327, 0, 4, 2, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "兄様さえよろしければ\nまた一緒に海へ…\nあ…申し訳ありません\n浮ついてしまいました", 8328, 0, 8, 2, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "本日もイイコトをして\n清々しい一日を\n過ごしたいものです\nまさに一日一善ですね", 8329, 1, 1, 2, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼時になると\n海の家の料理を\n思い出してしまいます\n焼きそばにかき氷…♪", 8330, 2, 1, 2, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "兄様…よろしければ\n浜辺を歩きませんか？\nきっと、月が\nきれいでしょうから", 8331, 3, 1, 2, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふわふわ心地よすぎて\n眠くなってしまいます\n水着姿では\nいけません…ふぁ…", 8333, 0, 1, 3, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "なんてよい手触り…\n癖になってしまいます\nふふ、よしよし…♪", 8334, 0, 1, 3, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "爽やかな香り…♪\n日焼け止めクリームを\n思い出してしまいます", 8335, 0, 1, 3, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "冷たい水で冷えた体が\n温まります…♪\nまるで兄様のようです", 8336, 0, 1, 3, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "お腹が空いては\n修行ができません…！\n動きに障りない程度に\n栄養の補給を…！", 8338, 0, 1, 3, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "剣術とスイカ割りが\n上達する指南書…\n見つかりませんね…", 8339, 0, 1, 3, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "さあ、ともに大海原を\n参りましょう！\nなんて…ふふっ♪", 8341, 0, 1, 3, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "まるでおとぎ話の\n登場人物になった\nような心持ちです…♪", 8342, 0, 1, 3, 131601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あたしはなんで水着で\n室内をうろついてるの\nかしら…不思議だわ", 8343, 0, 1, 1, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ、天井が汚れてる\n仕方ないわね\nひとっ飛びしますか", 8344, 0, 1, 1, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "はい、お疲れさま♪\n出迎えの言葉は\nやっぱこれよね♪", 8345, 0, 1, 1, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "そういえばあたしって\n羽があるけど\n泳げるのかしら…", 8346, 0, 1, 1, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "あいつのために\n浮き輪も用意したし\n抜かりはないわよ", 8347, 0, 1, 1, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "海までのガイド計画も\nまとまったわね\nふふっ…楽しみだわ", 8348, 0, 4, 1, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "この水着、あいつが\n選んでくれたのよね\n…大事にしないと", 8349, 0, 8, 1, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ネビアは最近どう？\n迷惑かけてない？\n…かけてるのね", 8350, 0, 1, 2, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あんた…部屋の片付け\nくらい自分でしなさい\n散らかってたわよ？\n…片付けておいたけど", 8351, 0, 1, 2, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "もしかして暇なの？\nだったら記憶でも\n見せましょうか？\n凄く恥ずかしいやつ♪", 8352, 0, 1, 2, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夏ってこんなに\n暑いのね…\n海にばかり行く\n気持ちが分かったわ", 8353, 0, 1, 2, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あんたの水着って\n新しいの買わないの？\nなんならあたしが\n選んであげるわよ♪", 8354, 0, 4, 2, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "気軽に触れ合える\n距離にいる…\nあたしにとって\nとても大事なことよ", 8355, 0, 8, 2, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "あらおはよう\n夏の朝は暑いわね\nシャワーでも浴びて\nさっぱりしなさい", 8356, 1, 1, 2, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "お昼は何を食べるの？\nガイド妖精として\n提案しましょうか？", 8357, 2, 1, 2, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "夜更かしは厳禁よ\n無理やり眠らせて\nあげましょうか？", 8358, 3, 1, 2, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "アメスさまだって\nゴロゴロするときは\nあるのよ～", 8360, 0, 1, 3, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "…ふふっ♪\n何よ、あたしが\nかわいいものを\n愛でちゃだめなの？", 8361, 0, 1, 3, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "こういういい香り…\n塔の中じゃなかなか\n楽しめないのよね", 8362, 0, 1, 3, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "水着を着てるのに\n温まるのって\n矛盾してない？\n気にしすぎかしら", 8363, 0, 1, 3, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "あんたと行動するなら\n沢山食べられるように\nならなきゃね…！", 8365, 0, 1, 3, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "文字を読むのと\nデータを読むのは\nまったく違うわ", 8366, 0, 1, 3, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "へぇ、面白いじゃない\nこういう経験、昔じゃ\nできなかったわ", 8368, 0, 1, 3, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "面白いクッションね\nところであんた…\nあたしで遊んでない？\n気のせいならいいけど", 8369, 0, 1, 3, 131701);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "また新しい悪戯\n思いついちゃった♪\n誰に仕掛けようかしら", 8370, 0, 1, 1, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "あ～あ、退屈…\nフィオでもからかって\nこようかしら♪", 8371, 0, 1, 1, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ミソギの悪戯って\nレベル高いのよね…\n負けてらんないわ！", 8372, 0, 1, 1, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "家事ニガテなのよね～\nコッコロたちには\n感謝しないとね", 8373, 0, 1, 1, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "私も魔物料理に\n慣れてきちゃった…\n毒されてるわね…", 8374, 0, 1, 1, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "あいつに仕掛ける\n次の悪戯は～…♪\nこれ…ううん…\nやっぱこっちかしら？", 8375, 0, 4, 1, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "結局ギルドハウスが\n一番落ち着くわね\n…私たちの家だもの", 8376, 0, 8, 1, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "悪戯のコツでも\n教えてあげよっか？\n…え～興味ないの？", 8377, 0, 1, 2, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "これからもずーっと\n退屈しない毎日に\nしてあげる♪\n私の悪戯でね♪", 8378, 0, 1, 2, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ちょうど退屈してたの\nたーっぷりと\n構ってもらうわよ♪", 8379, 0, 1, 2, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "案内が必要なら\n頼ってくれていいわよ\n一応は私だって\nガイド妖精だし！", 8380, 0, 1, 2, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "冒険のガイドなら\n私に任せなさい♪\nある意味忘れられない\n旅にしてあげる♪", 8381, 0, 4, 2, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "妖精がいる家は\n栄えるのよ♪　だから\nずっといてあげる\nあんたのそばにね♪", 8382, 0, 8, 2, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "きゃははっ！\n寝ぐせついてるわよ？\nこのままにしましょ！\nだって面白いし！", 8383, 1, 1, 2, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "自由に外へ行けるって\nすっごく幸せなことよ\nさ、散歩行きましょ♪", 8384, 2, 1, 2, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "安心していいわ\n寝てるあんたに\n悪戯しないから\n…あんたにはね♪", 8385, 3, 1, 2, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "悪戯しすぎて\n疲れたから、ちょっと\n休憩しよっと♪", 8387, 0, 1, 3, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ガイド妖精たる私が、\nこんな造形物に\n惹かれる…わけが……\nかわいい♪", 8388, 0, 1, 3, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この香りを囮にして、\n周りに悪戯を仕込む…\n完璧ね♪", 8389, 0, 1, 3, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "不思議ねぇ…私は\n温度とか関係ないのに\n離れられないわ", 8390, 0, 1, 3, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "食事の必要がない体…\nつまり、食べたければ\n食べていいのよね～♪", 8392, 0, 1, 3, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "へぇ…最近はこんな\n悪戯もあるのねぇ…\nあいつで試さないと♪", 8393, 0, 1, 3, 118601);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "わる～い子は\nトゥンヌス漁船に\n乗ってもらおうかな～", 8395, 0, 1, 1, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "たまにはファミリーの\nみんなにもお休みを\nあげないとね～☆", 8396, 0, 1, 1, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "海辺に素敵な\nバーがあるんだ～\n彼が大人になったら\n一緒に行きたいな♪", 8397, 0, 1, 1, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "夏の風を肌で\n感じるの好きかも～\nラーゴはどう？", 8398, 0, 1, 1, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "海岸線を\nのんびり散歩もいいね\n砂や貝殻に紛れた\nお宝探しの旅だよ～☆", 8399, 0, 1, 1, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "みんなで集まって\nビーチパーティーでも\n開いちゃおっかな～♪", 8400, 0, 4, 1, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "さて、この水着…\n彼は気に入って\nくれてるかな～？", 8401, 0, 8, 1, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "心ゆくまで夏を\n楽しんじゃお～☆\nほら君も♪", 8402, 0, 1, 2, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "水着似合ってるって？\nふふ♪　うれしいこと\n言ってくれるね～☆", 8403, 0, 1, 2, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "熱中症には\n気を付けないと\nだめだよ～？", 8404, 0, 1, 2, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "海の家ならうちの\nファミリーでやってる\nとこにしよっか☆\n豪遊しちゃお～♪", 8405, 0, 1, 2, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "君と一緒なら\nどんな夏になるのか\n楽しみだね～♪", 8406, 0, 4, 2, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "君といると子供心を\nくすぐられちゃうな～\n大人だって思いっきり\n遊んでいいんだよね♪", 8407, 0, 8, 2, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "さ、今日は何をして\n過ごそっかな～…\nねえ、君は何したい？", 8408, 1, 1, 2, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ふふ♪\n波音が心地良い\n時間だね～☆", 8409, 2, 1, 2, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "今夜は星空の下で\n乾杯しよっか～☆\n飲み物取ってくるね♪", 8410, 3, 1, 2, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "ここ涼しい～♪\nちょっと一休み\nしていこっか☆", 8412, 0, 1, 3, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "こういうのも良いけど\nやっぱりラーゴの方が\nかわいいかな～♪", 8413, 0, 1, 3, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "爽やかな香りだね～\nこういう感覚も絵で\n表現してみたいな～", 8414, 0, 1, 3, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "続きを描く前に\n原稿を乾かさないとね\nインクがにじむと\n直すの大変なんだよ～", 8415, 0, 1, 3, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "今日は水着だし…\n食べるのは控えめに\nしておこっかな", 8417, 0, 1, 3, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "話題の作品は\nチェックしないとね～\nあっ、この作家さん\n新刊出すんだ～", 8418, 0, 1, 3, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 10, "うちの出店の客引きに\nこういう乗り物系を\n使うのもアリかな～☆", 8420, 0, 1, 3, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 11, "これ、背景用の\n参考資料に\n一つ欲しいかも♪", 8421, 0, 1, 3, 131801);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "ここに帰るのも\n久しぶり…あれから\n変わったところは\nあるかしら？", 8422, 0, 1, 1, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "バイトも復帰しなきゃ\nうちのギルドにとって\n食費は重要だもの…！", 8423, 0, 1, 1, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "コッコロマ…っ\n…うぅ…\nこの癖は\n直らないのね…", 8424, 0, 1, 1, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この世界はまだまだ\n知らないことだらけね\n『裏世界』とか…", 8425, 0, 1, 1, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "必ずみんなを\n助け出してみせるわ\n…もちろん、兄さんも", 8426, 0, 1, 1, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "またみんなと\n暮らせるなんて…\n夢じゃ、ないのよね", 8427, 0, 4, 1, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "たくさんの人が\n私に優しくしてくれる\n…だからこそ、私も\n頼れる人になりたいわ", 8428, 0, 8, 1, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "次はランドソルの\n街の外にも行きたいわ\nあの…よかったらまた\n一緒に回ってくれる？", 8429, 0, 1, 2, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "独りぼっちで眠るのは\nやっぱり寂しかったわ\n…みんなで雑魚寝？\nそんなの…絶対やるわ", 8430, 0, 1, 2, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "ネビアってば大泣きで\n私を出迎えてくれたの\n…すごく嬉しかったわ", 8431, 0, 1, 2, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "この翼、陽に当たると\n本当に綺麗よね…\n自分のだけれど、つい\nずっと見ちゃうもの", 8432, 0, 1, 2, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 101, "おにーたんっ♪\n…呼びたくなっただけ\n本当にそれだけよっ？", 8433, 0, 4, 2, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 102, "どうしたの？\n…ふふっ、安心して\nこれからもずっと\n私はここにいるわ", 8434, 0, 8, 2, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 1, "みんな起きだす時間ね\n街が活気づいてく感じ\n嫌いじゃないわ", 8435, 1, 1, 2, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "【美食殿】のお昼は\nいつも美味しいから\nまた太っちゃいそうね", 8436, 2, 1, 2, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "おやすみなさい\n明日も、その先も\n一緒に冒険しましょう", 8437, 3, 1, 2, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 2, "休憩も大事…よね\nじゃあ遠慮なく…\nふぅ～…♪", 8439, 0, 1, 3, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 3, "はぁ…ふわふわ…♪\nこのかわいさには\nもう抗えないわ…", 8440, 0, 1, 3, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 4, "落ち着く香り…\nこの匂いを嗅いでると\n帰ってきたなって\n思うわね", 8441, 0, 1, 3, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 5, "みんなで野宿した時も\n焚火の明かりを見て\nすごく安心したのよね", 8442, 0, 1, 3, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 7, "ペコリーヌさんには\n負けるけど…\n美味しくって手が\n止まらないわ…！", 8444, 0, 1, 3, 181201);
INSERT INTO `v1_59c4daaa62c86af571a2f7d37b703dc31ea252dd90862d73c2172708aa481ef9` VALUES (1, 0, 8, "プリンセスフォーム…\n一体どういう仕組みで\n発動するのか、文献に\n書いてないかしら…", 8445, 0, 1, 3, 181201);
